atal infant', '', 'Pusat Pengajian Sains Kesihatan (School of Health Sciences)', '2021', 0),
(4, 'Norliyana Binti Aris', 'Risk factors of vitamin D deficiency and the effects of sunlight exposure and vitamin D supplementation on serum vitamin D level, adiponectin, cardiometabolic risk factors and metabolic syndrome among adults in Kelantan', 'In spite of abundant sunshine for cutaneous vitamin D (VD) synthesis, low levels of VD have been documented among Malaysian population. However, the effects of occupational sunlight exposure and monsoon seasons on VD are not well established. Besides, low VD levels has been associated with several non-bone or calcium-related outcomes including metabolic syndrome (MetS), which may mediated by adiponectin. This study was divided into two phases. Phase 1, a comparative crosssectional study was conducted to characterize the effect of occupational sunlight exposure and monsoon season on serum 25-hydroxyvitamin D (25(OH)D) and identify factors modifying the serum 25(OH)D levels. Besides, the relationship between 25(OH)D levels with high molecular weight (HMW) adiponectin and cardiometabolic risk factors were also observed. Phase 2, a quasi-experimental study was carried out for 12 weeks to evaluate the effects of moderate sunlight exposure (sunlight exposure group; 15 minutes sunlight exposure biweekly on face, arms, hands and feet; n=19), VD supplementation (VD supplement group, 50 000 IU cholecalciferol weekly, n=15] and placebo (placebo group, n=15) on serum 25(OH)D, HMW adiponectin and cardiometabolic risk factors in women with VD deficiency (serum 25(OH)D < 50 nmol/l). Both phases were carried out among Malay working adults in Kelantan from 2012 to 2015. Outcome measures comprises of anthropometric measurements (height, weight and waist circumference), body fat percentage and blood pressure assessment, fasting blood test (25(OH)D, HMW adiponectin, lipid profile, glucose, insulin and hs- CRP) and questionnaire (socio-demographic, medical history, sunlight exposure and sun protection use, physical activity assessment and VD intake). In phase 1, two-point data were collected in 138 outdoor and 143 indoor workers, first in non-monsoon (May-June 2012) and second in monsoon season (Jan-Feb 2013). Results of phase 1 study revealed that serum 25(OH)D levels were significantly higher in outdoor workers compared to indoor workers irrespective of season and sex (p<0.001). Furthermore, significant association between VD status and occupation was observed (p<0.001). Monsoonal differences of 25(OH)D was observed only in male outdoor workers (mean difference, MD = 10.39 nmol/l, p<0.001). However, in overall, no significant association was found between VD status and monsoon season (2(1)=0.076, p=0.783). Serum 25(OH)D level was directly predicted by hours of sunlight exposure (=0.38, p=0.010) and inversely by sun protection score (=-4.64, p=0.001), body mass index (=-1.02, p=0.002), indoor occupation (=-42.72, p<0.001) and female sex (=-19.46, p<0.001). No significant relationship between VD with HMW adiponectin and cardiometabolic risk factors were found in this study (p>0.05). Considering the results of determinants of VD in Phase 1, female indoor workers with VD deficiency in both monsoon and non-monsoon seasons were recruited for phase 2 study. In phase 2, after 12 week of intervention, serum 25(OH)D increased significantly in sunlight exposure (MD = 14.27 nmol/l, p<0.001) and VD supplement group (MD = 14.30 nmol/l, p<0.001) but not in placebo group (MD = 1.63 nmol/l, p=0.067). Significant increase in HMW adiponectin was observed only in VD supplement group (MD=0.43 ng/ml, p=0.024). Among the MetS components, only glucose decreased significantly after 12 weeks of sunlight exposure (MD=-0.27 mmol/l, p<0.001) but no changes seen in the other groups. No significant changes were found in waist circumference, blood pressure, triglycerides and other cardiometabolic risk factors in all groups after 12 weeks. However, HDL-C was found increased significantly in all groups after the intervention (p<0.05). In conclusion, both moderate sunlight exposure and VD supplement interventions improved the VD levels, but the effects of VD on HMW adiponectin and cardiometabolic risk factors are still inconclusive.', 'vitamin d sunlight supplementation', '', 'Pusat Pengajian Sains Kesihatan (School of Health Sciences) ', '2020', 0),
(5, 'Nurul Syarida Binti Mohd Sakeri', 'The profiles of malay muslims with vestibular disorders and the outcome of vestibular rehabilitation', 'Those who are diagnosed with chronic vestibular disorders are anticipated to experience disturbing vestibular symptoms when pursuing their daily life activities. In the present study, it was of interest to know the specific difficulties faced by Muslims when performing their daily tasks (including solat) and whether the conventional vestibular rehabilitation would be effective in reducing the symptoms. This is a mixed-design study with three consecutive phases. In the first phase, triggering and/or worsening factors to vestibular symptoms were determined. In the subsequent phases, a mixed-convergent study design was employed, i.e., quantitative (VHIT, cVEMP and MyVRBQ) and qualitative (in-depth interview) methods. Of 91 respondents, 68% reported that their symptoms were triggered by body and head movements. Nearly half of them reported at least one prayer movement triggered and/or worsened their symptoms. In the second phase of the study, despite normal findings from VHIT and cVEMP (except for P13 and N23 latencies), MyVRBQ showed that the participants were affected by the symptoms. Content analysis unveiled five content areas: 1) Common symptoms, 2) Effects on general activities, 3) Effects on performing solat, 4) Conditions that may exacerbate and/or provoke vestibular symptoms, 5) Compensatory strategies to overcome and/or hinder from having the symptoms. Following rehabilitation, significant reductions in MyVRBQ scores were seen in all categories (as early as two weeks). Two content areas were discovered: 1) Improvements in general activities, and 2) Improvements in solat. While the objective assessments (VHIT and cVEMP) were insensitive, the occurrence of the symptoms and the benefit of the rehabilitation were clearly shown by MyVRBQ. The content analysis was able to discover other important aspects missed to be covered by the quantitative assessments (including the ability to perform solat before and after the rehabilitation). The study findings would be useful to clinicians in providing optimum services to Muslim patients with chronic vestibular disorders.', 'vestibular disorders rehabilitation', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2020', 0),
(6, 'Farrah Noor Binti Ahmad', 'Mechanical Properties And Bioactivity Of Ti-Nb-Ha Composite Fabricated By Mechanical Alloying', 'Titanium is the most popular metallic biomaterial for orthopaedic implant owing to their excellent mechanical properties and good corrosion resistance. However, the mismatch of elastic modulus and poor bonding with bones due to its bioinert behaviour has been identified as the major reason that lead to the implant loosening and eventual failure of the implantation. The present work investigates the mechanical performances and bioactivity of titanium-niobium-hydroxyapatite (Ti-Nb-HA) composite prepared by mechanical alloying and powder metallurgy. To study effect of HA and Nb , HA and Nb were varied from 0 to 15 wt.% and 0 to 40 wt.%, respectively. The powders of Ti, Nb and HA were mixed in a high energy ball mill for 2 hours at 200 rpm and followed by compaction under 500 MPa and sintering at 1200C. Due to the brittleness of HA, the incorporation of HA decreased the compressive strength (1001.24 MPa to 160.94 MPa) and microhardness (300.53 HV to 85.47 HV). Adding HA contribute to the poor bonding with matrix which is more pronounced to reduce the elastic modulus from 65.10 GPa to 29.91 GPa. With the increasing in HA content, the composite displayed good bioactivity characteristics evaluation in HBSS for 30 days. The highest bioactivity was exhibited by composite with 15 wt.% HA due to the highest apatite (3.40%). Factor affecting the bioactivity are believed to be caused by HA decomposition during sintering process that produces CaO and CaTiO3. As a result, the presence of these Ca2+ ions increased the calcium concentration and accelerated the apatite growth. Higher Nb content improved the compressive strength (199.95 MPa to 300.11 MPa) and microhardness (120.97 HV to 269.90 HV) due to solid solution strengthening. However, the presence of TiO2 and Ti2P decrease compressive strength with 40 wt.% Nb. Apart from that, the elastic modulus was slightly decreased with the rise of Nb content. The highest amount of  phase is obtained by 30 wt.% Nb (76%). Increasing in Nb content to 40 wt.% decreases elastic modulus owing to decrement in  phase as a consequence of HA decomposition that lead to the formation of TiO2 and Ti2P. The presence of  phase, high solubility of Ti2P and functional groups of OH- act as favourable site for apatite growth in composite consisting different amount of Nb. Upon immersion test in HBSS for 30 days, the highest bioactivity was attained by 30 wt.% Nb and followed by 40 wt.% Nb, 20 wt.% Nb, 10 wt.%. The enhanced of apatite growth in 40 wt.% Nb was found to be caused by the presence of biocompatibility phases of TiO2 and Ti2P. Composite with addition of 10 wt.% HA and 30 wt.% Nb displayed the best properties and holds great potential in providing mechanical support and bioactivity enhancement in getting similar cortical bone characteristics.', 'properties bioactivity ti-nb-ha', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2020', 0),
(7, 'Suhawati Binti Ibrahim', 'Preparation Of Low Molecular Weight Natural Rubber Via Photooxidation In Latex State', 'Ultraviolet (UV) light has been used to degrade organic matters, including natural rubber (NR) which was commonly carried out in an organic solvent. The aim of this work is to prepare liquid natural rubber (LNR) using a photodegradation method in latex state, hence to characterize its physical and chemical properties. The efficiency of photodegradation was determined by the molecular weight reduction and gel content of the LNR obtained. The molecular structure of LNR was determined by Fourier Transform Infrared (FTIR) and Nuclear Magnetic Resonance (NMR). While, Scanning Electron Microscopy (SEM) and Transmission Electron Microscopy (TEM) were used to determine the change in morphology of latex particles. Reaction parameters such as UV radiation, temperature, hydrogen peroxide, reaction time, dry rubber content (DRC) and stabilizers showed synergistic effect and influenced the reactions efficiency. Anionic surfactant (SDS) provided better stability to NR latex compared to non-ionic surfactant (Teric). The zeta potential of NR latex was increased during the photodegradation, provided by the negatively charge of fatty acid. Phosphate that represent fatty acid amount was increased in latex serum due to the decomposition of phospholipid upon exposure to the UV and oxidizing agent. Titanium dioxide (TiO2) anatase nanocrystals was prepared via the sol-gel method. The dispersed TiO2 in NR latex showed catalytic effect on the photodegradation reaction. The presence of methylene blue as photosensitizer during photodegradation lowered molecular weight of LNR. The cleavage of NR chains during photodegradation occurred at C=CH and CH2-CH2 bonds. The molecular structure of LNRs were similar to that the NR, but hydroxyl and carbonyl groups on its chain increased. These functional groups were formed as a result of chain cleavage of NR. Photodegradation of epoxidized natural rubber (ENR50) latex showed similar reaction to the NR latex without affecting the mole percentage of epoxy group. However, the presence of TiO2 during the reaction induced for the ring opening of epoxy group to hydroxyls.', 'molecular rubber photooxidation', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0),
(8, 'Nurul Aizan Mohd Zaini', 'Preparation And Properties Of Sepiolite-Filled Ethylene Propylene Diene Terpolymer Composites', 'The role of clays as fillers in rubber composites is unquestionably important due to their abundance, low cost, light colour, and ability to enhance the strength and stiffness of rubber. However, differences between the compatibility of the hydrophilic clay and the hydrophobic rubber, which would result in a poor dispersion, remains as a challenging problem in industrial applications. This study was conducted to determine the potential of incorporating sepiolite (Sep) as a filler in ethylene propylene diene terpolymer (EPDM). EPDM/Sep composites were prepared with Sep loadings of 070 parts per hundred of rubber (phr) using a two-roll mill. The results indicated improvements in the tensile and dynamic mechanical properties, swelling resistance and crosslink density, thermal stability, and flammability resistance of the sepiolite-filled composite compared with the unfilled composite. The homogenous dispersion of sepiolite particles in the EPDM matrix and the formation of zigzag structures, especially at 60 phr, were the main reasons for the improved mechanical properties of the composite, which were confirmed by the morphological studies. The formation of a protective layer, which acted as a barrier against heat transfer into the deeper layers, had enhanced the flammability resistance of the composites. In the study of sepiolite hybridised with carbon black (CB), silica, or calcium carbonate (CaCO3), five different compositions were prepared, with EPDM/Sep at 30 phr as a control composite. EPDM/Sep/CB displayed the highest tensile strength, thermal stability, and improved flammability resistance. These results were influenced by the ability of CB to disperse well and form protective layers that could act as a mass transport barrier in the matrix. Significant findings in this work indicated that silica and CB were able to be hybridised with sepiolite, while sepiolite could be a potential substitute for CaCO3 in the EPDM composites. Meanwhile, the utilisation of glut palmitate (GP) salt and (3-aminopropyl) trimethoxysilane (APTMS) as coupling agents in the EPDM/Sep composites have successfully enhanced the tensile strength and elongation at break, the rubber-filler interaction, and dynamic mechanical properties. The enhanced rubber-filler interaction indicated that the presence of GP and APTMS have improved the compatibility and interaction between Sep and EPDM matrix, as supported by the FTIR results. Studies on different vulcanisation systems revealed that the highest tensile and dynamic mechanical properties were exhibited by the sulphur system, followed by the mixed curative and peroxide system, whereas the highest thermal stability and flammability resistance were demonstrated by the peroxide system.', 'preparation properties sepiolite', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2020', 0),
(9, 'Wee Chee Lee', 'Effects of vitamin D on vascular function and oxidative stress in the microcirculation of diabetics', 'Diabetes mellitus contributes to macro- and microvascular complications, leading to adverse cardiovascular events. Vitamin D deficiency is associated with the development of diabetes-related cardiovascular complications. This study was divided into two parts: (i) animal study and (ii) human study. This animal study aims to determine the effects of vitamin D deficiency on (a) microvascular endothelial and smooth muscle functions in normal and diabetic rats; (b) the changes to endothelial nitric oxide synthase (eNOS) protein expression and oxidative stress parameters in mesenteric arterial tissue of normal and diabetic rats; (c) to study whether oral calcitriol supplementation is able to ameliorate microvascular dysfunction in vitamin D-deficient rats. This human study aims to evaluate the effects of vitamin D deficiency on oxidative stress status in subcutaneous arteries of diabetic patients. Animal study: (a) Male Sprague-Dawley (SD) rats were subdivided into three equal groups of 10 rats each: (i) rats receiving 10-weeks of normal diet (Group NC), (ii) rats receiving 10- weeks of vitamin D-deficient diet (Group ND) and (iii) rats receiving 10-weeks of vitamin D-deficient diet with four weeks of oral calcitriol supplementation, starting from week 7 (Groups NDS). (b) Streptozotocin-induced diabetic male SD rats were subdivided into three equal groups of 10 rats each: (i) diabetic rats receiving 10-weeks of normal diet (Group DC), (ii) diabetic rats receiving 10-weeks of vitamin D-deficient diet (Group DD) and (iii) diabetic rats receiving 10-weeks of vitamin D-deficient diet with four weeks of oral calcitriol supplementation, starting from week 7 of diabetes induction (Groups DDS). At the end of 10 weeks, all rats were sacrificed. Rats mesenteric arteries were isolated and dissected to undergo vascular function studies using wire myograph. Protein expression of eNOS in mesenteric arterial tissue was determined using Western blot. Immunohistochemistry was used to detect the presence and localization of eNOS in mesenteric arteries. Superoxide dismutase (SOD) and malondialdehyde (MDA) levels in mesenteric arterial tissue; fasting blood glucose (FBG), serum 25(OH)D and calcium levels in blood were also measured. Human study: Diabetic patients were categorised into two groups based on serum 25(OH)D levels: (i) vitamin D non-deficient diabetic patients (Group DNP, n = 10) and (ii) vitamin D-deficient diabetic patients (Group DDP, n = 13). The levels of SOD and MDA in subcutaneous arterial tissue were measured. Results of animal study: (a) Normal rats. Endothelium-dependent relaxation to acetylcholine (ACh) was significantly attenuated in mesenteric arteries of vitamin D-deficient rats. Reduced SOD levels and protein expression of eNOS were observed in vitamin D-deficient rats. However, calcitriol supplementation showed no significant improvement in these parameters. Endothelium-dependent contraction to calcium ionophore (CaI) was augmented in vitamin D-deficient rats receiving calcitriol supplementation. Increased calcium levels were also found in calcitriol-supplemented vitamin D-deficient rats. (b) Diabetic rats. ACh-induced endothelium-dependent relaxation was significantly impaired in mesenteric arteries of vitamin D-deficient diabetic rats. Reduced SOD levels and protein expression of eNOS and enhanced MDA levels were found in vitamin D-deficient diabetic rats. These impairments were successfully ameliorated by calcitriol supplementation. Augmented CaI-induced endothelium-dependent contraction and impaired sodium nitroprusside (SNP)-induced endotheliumindependent relaxation occurred in vitamin D-deficient diabetic rats. However, calcitriol supplementation failed to show improvement in these vascular responses There were no significant differences in endothelium-independent relaxation to salbutamol (SB) and contraction to phenylephrine (PE) as well as in general parameters such as body weight changes and FBG levels between study groups in both normal and diabetic rats. Results of human study: Markedly augmented MDA levels were found in subcutaneous arterial tissues of vitamin D-deficient diabetic patients. However, SOD levels in vitamin D-deficient diabetic patients showed the reduced trend (p = 0.072) compared to vitamin D non-deficient diabetic patients. In conclusion, this study demonstrated that vitamin D deficiency attenuates microvascular endothelial function in both normal and diabetic rats. The impairment for endothelial function was likely due to the diminished nitric oxide contribution, associated with reduced eNOS protein expression and augmented oxidative stress. Vitamin D deficiency in diabetic rats also impairs vascular smooth muscle function. The study also showed that calcitriol supplementation to diabetic rats with vitamin D deficiency improves endothelium-mediated vasodilation, by upregulating eNOS expression and improving oxidative stress status. However, calcitriol supplementation to normal rats with vitamin D deficiency induces hypercalcaemia, leading to augmented endothelium-dependent contraction. Besides that, vitamin D deficiency in diabetic patients as well showed augmented oxidative stress.', 'vitamin d oxidative diabetics', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2020', 0),
(10, 'Arbaz Sajjad', 'Evaluation of physico-mechanical, chemical properties and cytotoxicity of fabricated glass ionomer nano zirconia-silica- hydroxyapatite hybrid material', 'The aim of this study was to synthesize and characterize a nano zirconia-silicahydroxyapatite (nanoZrO2-SiO2-HA) composite and to investigate the effects of adding nanoZrO2-SiO2-HA to a conventional glass ionomer cement (cGIC). NanoZrO2-SiO2-HA composite was synthesized using a one-pot sol-gel technique, which was then characterized using scanning electron microscope (SEM), transmission electron microscope (TEM), fourier transform infrared spectroscopy (FTIR) and x-ray diffraction (XRD). Following the characterization studies, further investigations were carried out after addition of nanoZrO2-SiO2-HA to cGIC (GIC nanoZrO2-SiO2-HA) at varying weight percentage (~3% to 9%) to compare their mechanical properties (compressive strength, flexural strength, and fracture toughness), physical properties (surface roughness, colour stability and sorptionsolubility), chemical property (fluoride ion release) and cytotoxicity in relation to cGIC (Fuji IX). SEM and TEM images were successful in demonstrating that the particle morphology in terms of size to shape distribution was small and narrow with low agglomeration. The nano powder consisted of rod-shaped HA crystallites (~114 nm) interspersed with spherical silica (~18 nm) and zirconia (~39 nm) particles. The FTIR spectra indicated some molecular interaction presented between the nanoZrO2- SiO2-HA and GIC. The XRD diffractogram indicated the presence of peaks for ZrO2, SiO2 and HA. Compressive strength, flexural strength and fracture toughness of GIC 5%nanoZrO2-SiO2-HA was statistically higher than that of other percentages of GIC nanoZrO2-SiO2-HA and cGIC. The highest values recorded were- compressive strength (144.12  13.88 MPa), flexural strength (18.12  2.33 MPa) and fracture toughness (1.35  0.15 MPa.m1/2), leading to an increase of ~30 %, ~26 % and ~57 % respectively, as compared to cGIC. Additionally, GIC 5%nanoZrO2-SiO2-HA had a roughness profile (0.158m  0.29) similar to cGIC (0.151m  0.29). Overall, the color change (E) values for GIC 5% nanoZrO2-SiO2-HA group were lower than those of cGIC over a 28 day period and were between slight to perceptible. The GIC 5%nanoZrO2-SiO2-HA showed highly significant difference in the mean fluoride release for all the time intervals as compared to cGIC (p  0.05). In addition, GIC 5%nanoZrO2-SiO2-HA recorded lower sorption values (23.64  2.3 gmm-3) as compared to cGIC (36.28  2.6 gmm-3) and higher solubility (66.46  2.4 gmm-3) as compared to cGIC (56.76  1.6 gmm-3). The results of cytotoxicity testing showed that GIC 5%nanoZrO2-SiO2-HA demonstrated cytotoxicity at 24 h incubation for 200 mg/ml conc. However, at 72 h incubation it exhibited lower cytotoxic response as compared to cGIC which was statistically significant (p<0.05) at 200 mg/ml concentration of the material extract. The addition of nanoZrO2-SiO2-HA to cGIC significantly enhanced its physico-mechanical, chemical properties and demonstrated a favourable cytotoxic response. Based on the results of our recently concluded study, GIC nanoZrO2-SiO2-HA has the potential to be suggested as a restorative dental material with diverse applications ranging from cavity restoration, core build-up and as a luting material.', 'physico-mechanical chemical cytotoxicity ', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences) ', '2020', 0),
(11, 'Nazirah Binti Ab Rashid', 'Properties Of Biocompatible Mg-Zn Alloy Based Hybrid Composite Fabricated By Powder Metallurgy', 'In this study, biodegradable and biactive metallic material of magnesium-zinc/hydroxyapatite/alumina (Mg-Zn/HAP/Al2O3) hybrid composite fabricated by powder metallurgy was developed. The main objective of this work was to investigate the effects of HAP and Al2O3 amount of content and weight ratio on mechanical, corrosion and wear behaviour of Mg-Zn based alloy. The powders of Mg, Zn, HAP and Al2O3 were mixed in a high energy ball mill, compacted under 400 MPa and sintered at 300C. The increasing Al2O3 content from 0 to 15 wt. % in the hybrid composite resulted in improvement in hardness (57.60 Hv to 83.87 Hv) and compression strength (126.48 MPa to 244.20 MPa). Based on polarization test, 0 wt. % Al2O3 composite (i.e. consist of 15 wt. % HAP) is the most noble with corrosion potential (-1.604 V) and the lowest current density and corrosion rate (0.252 A/cm2, 1.25 mm/year, respectively) due to apatite formation in Hanks Balanced Salt Solution (HBSS). While 5 wt. % Al2O3 (i.e. with 10 wt. % HAP) shows the highest wear resistance due to high hardness of Al2O3. Composite with 20 wt. % ceramic (HAP and Al2O3 with 2:1weight ratio) exhibited low hardness (67.03 Hv), low compressive strength (138.67 MPa), high corrosion rate (2.34 mm/year) and the low volume loss due to wear (4.9 to 14.6 x 10-4 mm3). Overall, hybrid composite with addition of 5 wt.% Al2O3 and 10 wt. % HAP at weight ratio 2:1 displayed the best properties, for biomedical implant application.', 'mg-zn-alloy composite metallurgy', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0),
(12, 'Nor Hafizah Che Ismail', 'Preparation, Characterisation And Properties Of Uscovite/Acrylonitrile Utadiene Styrene Nanocomposites', 'The development of acrylonitrile butadiene styrene (ABS) nanocomposite based on non-expandable clay minerals presents a promising approach that has been relatively unexplored. Muscovite was chosen over the most commonly used clay minerals, due to its higher aspect ratio when compared to montmorillonite (MMT). As such, this study investigated the possibilities of muscovite to expand and to function as reinforcement filler in ABS matrix via two-stage ion exchange process for fillermatrix compatibilisation and melt compounding for polymer fabrication. The modification process involved treatment with LiNO3 (first-stage) and modification with cetyltrimethylammonium bromide (CTAB) at various concentrations as a secondstage cation exchange reaction. Characterisation of treated muscovite was assessed by using X-ray fluorescence (XRF), X-ray diffraction (XRD), Fourier transform infrared (FTIR), BrunauerEmmettTeller (BET), Field emission scanning electron microscopy (FESEM) coupled with Energy dispersive x-ray spectroscopy (EDX), and Transmission Electron Microscopy (TEM). The experimental outcomes showed that not only basal spacing, but also specific surface area increased while the number of stacked individual silicate layers of organoclay kept decreasing at high CTAB concentrations, which signified separation within the muscovite layers. The changes in basal spacing further evidenced that muscovite displayed a possibility for expansion. A further goal of this research is to extend the application of organomuscovite (OM) filled ABS matrix. In this case, OM and unmodified muscovite were embedded in ABS matrix at various filler loading of 1, 3, and 5 wt.%. The aspects addressed included the effect of ion-exchange process, the degree of dispersion that was achieved, and the effect of various filler loading on the mechanical properties of ABS nanocomposites. Along this line, this study reveals that the ABS/OM nanocomposites possessed a tendency to exemplify enhanced mechanical properties, in comparison to those of ABS/muscovite. Nevertheless, incorporation of muscovite at all filler loadings led to a slight reduction in tensile strength, a significant decrease in elongation at break, a slight improvement in modulus and hardness, and increment in thermal stability over those of the neat ABS. Flexural strength and modulus were improved by 10% and 28%, respectively, when compared to those retrieved from neat ABS. Both wide angle x-ray diffraction (WAXD) and TEM analyses indicated the formation of mixed intercalated and exfoliated structures with incorporation of OM. Therefore, the development of non-expandable muscovite incorporated with polymer matrices provide the opportunities to explore new functionalities beyond those found in conventional materials.', 'uscovite/acrylonitrile utadiene styrene', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0),
(13, 'Aroyehun Abdulqudus Bola', 'Investigation on physicochemical and nutritional properties of caulerpa racemosa, gracilaria manilaensis and padina tetrastromatica', 'Seaweeds are recognised as an important ingredient of functional foods recommended for daily food due to their unique compositions and nutritional value. This study was the first time conducted whereby three tropical edible seaweeds (Caulerpa species, Gracilaria species, and Padina species) were selected from Western Peninsular Malaysia to investigate their proximate, physicochemical and nutritional properties according to change in season and geographical habitat. Remarkable geographical variability was recorded in the proximate composition of C. racemosa harvested from the pond and wild. Analysis revealed the farm-C. racemosa contain higher concentration of lipids (4.20  0.32 % DW), protein (20.27  0.14 % DW), dietary fiber (27.57  0.14 % DW) and energy values (25.45  0.07 kcal kg1) than the wild-C. racemosa with higher ash level (44.98  1.60 % DW). G. manilaensis harvested in November during the Northeast monsoon (NEM) showed a relatively higher level of proteins (19.39  0.12 % DW), carbohydrates (39.58  0.20 % DW), dietary fibers (31.07  1.08 % DW) and energy value (27.22  0.11 kcal kg1) than the G. manilaensis collected in August during Southwest monsoon (SWM) with a significant higher ash content (38.48  0.23 % DW). Amongst the seaweeds P. tetrastromatica revealed ash levels of (64.819  0.26 % DW) comparatively higher than both C. racemosa and G. manilaensis. Investigation of the fatty acids (FAs) profiles showed palmitic acid (C16:0) was the most abundant ranging from (83.87  89.29 %) in G. manilaensis, followed by (51.70  63.27 %) C. racemosa and (0.83 %) P. tetrastromatica. Furthermore, oleic acid (C18:1) constituted the dominant monounsaturated fatty acids (MUFA) occurring at (5.80  6.33 %) in C. racemosa, followed by (1.47- 6.33 %) G. manilaensis and (0.40 %) in P. tetrastromatica. Total amino acid content occurred between (64.63  159.69 mg/g) in C. racemosa, (122.43  163.58 mg/g) in G. manilaensis and (61.02 mg/g) in P. tetrastromatica. With respect to physical properties, water holding capacity (WHC) and oil-holding capacity (OHC) showed significant difference according to habitat and seasonal fluctuations. Total phenol content were (96.91 - 178.78  5.93 mg GAE/g), (74.05  220. 36 mg GAE/g) and (61.20 mg GAE/g) for C. racemosa, G. manilaensis and P. tetrastromatica respectively. GC-MS analysis revealed the presence of phytochemical compounds including ether, aldehyde, ester, fatty acids, terpenes, sterols, and organic acids responsible for their antioxidant activities. Overall, this thesis revealed that physicochemical and nutritional value of seaweeds have geographical and seasonal variations and that its regular consumption may add benefits to human.', 'caulerpa-racemosa gracilaria-manilaensis padina-tetrastromatica', '', 'unspecified', '2020', 0),
(14, 'Nik Zuraina Binti Nik Mohd Noor', 'Thermostabilized multiplex pcr assay for detection of selected bacteria associated with respiratory tract infections among malaysian hajj pilgrims', 'Respiratory tract infections (RTIs) are the commonest health problem during the annual Hajj pilrimage. Common bacteria associated with RTIs include Klebsiella pneumoniae, Haemophilus influenzae, Staphylococcus aureus, Streptococcus pneumoniae, Mycobacterium tuberculosis and Pseudomonas aeruginosa. Rapid detection of these pathogens could facilitate towards effective therapies. Therefore, this study aimed to develop and evaluate a thermostabilized polymerase chain reaction (PCR) assay for simultaneous detection of these six bacteria. The first step involved designing specific primers for the target bacteria and an internal amplification control (IAC). Each set of primers was evaluated to analyze for their specificity and sensitivity. A multiplex PCR was then developed by optimizing the concentration of primers and other components. Initial accuracy of the multiplex PCR was determined on clinical isolates. Subsequently, this assay had undergone lyophilization process in the presence of trehalose as the sugar-stabilizer. The assay stability was tested at different sets of temperature for different time-intervals. In the last stage, this assay was evaluated on the sputum specimens from Hospital USM and further evaluated at the field level using the specimens from Malaysian Hajj pilgrims. Results indicated that all the designed primers were specific to the respective target bacteria. The optimized concentrations of primers for bacteria (0.4 M) and IAC (0.2 mM), MgCl2 (2.5 mM), dNTPs (0.2 mM) and Taq DNA polymerase enzyme (0.75 unit) were used in the development of multiplex PCR assay. Initial evaluation on bacterial isolates showed that the assay was 100% accurate on both target and non-target bacteria (n =145) (analytical specificity) with the lowest limit of detection was 10 pg DNA (200 bacterial cell) (analytical sensitivity). Lyophilization of this assay was successfully carried out in the presence of 6% trehalose in the PCR reagent. The assay was stable at the ambient temperature (25C) for at least six months. The sensitivity, specificity and accuracy of this assay were 100%, 92% and 95%, respectively on cinical sputum specimens (n = 200). Field evaluation on specimens from Malaysian Hajj pilgrims ensued the sensitivity and specificity of 100% and 92%, respectively, with the accuracy of 97%. From this study, two main bacteria detected from the clinical and Hajj sputum specimens were K. pneumoniae and H. influenzae, respectively. In conclusion, the rapidity, convenience, thermal-stable and reliable, could enable the application of this thermostabilized multiplex PCR assay to be used as a molecular diagnostic tool for the detection of six respiratory bacteria.', 'bacteria respiratory infections', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2020', 0),
(15, 'Norain Isa', 'Synthesis Of Silver Nanoparticles Using Kyllinga Brevifolia Extract And Immobilisation On Tio2 Nanotubes For Methyl Blue Dye Removal', 'The textile industry is an intesive producer of wastewater which unless treated may result in the discharged of toxic and harmful dyes to the environment. One method that can be used to remove dyes is by reduction on a surface of catalyst. The catalyst chosen in this work was silver nanoparticles (AgNPs) synthesised by salt reduction technique. The first part of this thesis focused on the synthesis process of AgNPs. However instead of using typical reductant, AgNPs were synthesised by green chemical route utilising Kyllinga brevifolia extract (KBE) as reducing agent. The KBE was also found to be a good capping as well as stabilizing agent. By controlling the temperature, concentration of AgNO3 as the silver precursor, concentration of KBE and reaction time, the AgNPs were sucsessfully synthesised. The phytochemical constituents in KBE responsible for Ag+ reduction were identified. Carbohydrate, protein, plant sterol (stigmasterol and campesterol) were found to have the highest concentration thus proposed as the main constituents that can reduce Ag+ ions to Ago. KBE derived AgNPs are highly dispersed with ~ 17.64 nm diameter and have quasi-spherical shape. The catalytic removal of MB was then done to demonstrate the properties of AgNPs in removing MB. Four (4) systems were used to investigate the performance of AgNPs; System 1 (AgNPs alone), System 2 (AgNPs + NaBH4), System 3 (AgNPs + KBE) and System 4 (AgNPs on TNTs). From the catalytic study on MB removal, no reduction was observed in System 1. Reduction was the highest in System 2. The pseudo first and second order approaches were used for the kinetic study of System 2. 100% removal efficiency (%RE) was found to be possible in 30 ppm MB solution with pH 8-10 which followed first order kinetic with reaction rate of 2.5715 min-1. For 100 pm solution, the first order kinetic was 1.4614 min-1. It took less than 5 mins for the 100% removal which is considered to be extremely fast. On the other hand, for System 3, 93 %RE of MB was achieved with a rate of reaction of 0.2663 min1 at pH 2. The efficient removal is proposed to be due to the process of reduction occuring via electron relay effect whereas in System 3, sedimentation occurred along with the reduction process. However, at the end of the process it was observed that seperation of AgNPs from the treated MB solution was difficult which may pose a secondary pollution. In order to circumvent this, in the second part of this thesis, System 4 was introduced where AgNPs were immobilised on TiO2 before being subjected to be used as catalyst for MB removal. The TiO2 was fabricated on a surface of titanium wire by anodic process. The anodic film was made to be in a form of TiO2 nanotube (TNT) arrays and AgNPs were then dispersed on the TNTs as catalyst support by wet impregnation technique. The TNTs/AgNPs were characterized and their catalytic activity was tested for removal of MB. However, it was found that the removal efficiency was much slower as compared to when AgNPS were used. The reduction of MB by TNTs/AgNPs followed pseudo-first order kinetic with the kinetic rate of 7.5 x 10-3 min-1.', 'silver-nanoparticles kyllinga-brevifolia methyl-blue-dye', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0);
