(16, 'Nur Soleha Binti Abdul Rahim', 'Development Of Building Information Modeling (Bim) Implementation Framework In Malaysian Construction Industry', 'Building Information Modeling (BIM) is anticipated to be mandated starting 2019 onwards for public projects in Malaysia. However, the BIM implementation is still at a nascent stage. Therefore, there is urgency for the Government to monitor the trend of BIM development in the construction industry. This study aims to determine and evaluate the current phase of BIM development in the construction industry with the consideration of sustainability aspects and demand-supply based on two perspectives, namely contractors (demand) and academic institutions, focusing on final year students (supply). The findings from the questionnaire survey show that 72% of the contractors are still at the awareness phase of BIM development; whereas 22% at the adaptation phase, 3% at the adoption phase and 3% at the application phase. In addition, the results also indicate that 73% of the contractors perceive that there is no urgent demand on BIM skilled graduates. From the supply perspective, only 19% of the future graduates have 1 to 5 years of experience on BIM highlighting the needs for academic institutions to provide more BIM related-training (skills), facilities and networking in the future. Additionally, 68% of the contractors are only aware of BIM contribution towards environmental sustainability compared to economic (43%) and social (11%) sustainability. It is expected that this study can assist the government in monitoring the development of BIM in the construction industry as well as contributes to the literature and knowledge particularly in the civil engineering and construction management area.', 'building information modeling', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2020', 0),
(17, 'Roziana Bt Mamat@Muhamad', 'Development Of Environmental Factors In Classroom Design Recommendation For Children With Autism Spectrum Disorder', 'Typical learning environment at a centre for children with autism spectrum disorder (ASD) are designed based on healthy normal children. Ideally, the learning environment for these children should complement their unique functional, emotional and behavioural requirements as inappropriateness will cause distraction, uncomfortable condition and occurrence of undesirable behaviour. Hence ergonomic intervention needs to be introduced. This research study the impact of five different factors of the physical classroom environment on children understanding instructions and their attention span in the classroom. Observation on behaviour, emotion and cognitive of those children carried out for each physical classroom environment factor. They were subjected to two types of experiments for each physical environment factors. Qualitative and quantitative methods were carried out. Two experiments were conducted to measure individuals response time to instruction (speed of understanding) and time to complete a task (a measurement of attention span). The experiment deployed eleven children with ASD aged between five to nine years old. Their mental age is between four to five years. A control group with normal children age four to five years was also used for comparison. The physical environment factors being studied are sound decibel, sound frequency, the intensity of the light intensity, type of colour and temperature within the classroom. For the children with ASD, five different levels of each factor were set up for each experiment. Pre-tests (current condition) and post-tests (intervention condition) approach are only applied for sound. The other physical factors were done using typical experimental techniques. Observation method was deployed in all physical factors to study the children with ASD behavioural, emotional and cognitive reaction. Statistical analysis tools are used to quantitatively evaluate the effect of environmental factors on the response time and attention span. Qualitative analysis tools were executed to assess the behavioural, emotional and cognitive reaction. The finding showed that ergonomic intervention caused significant improvement in the speed of understanding and attention span during task performing for the children with ASD compared to their current learning environment. Restlessness and uncomfortable behaviour had also decreased significantly within an optimum range of each physical factor. However, their performance is still slower than normal children. Those optimal values of the environmental factor are recommended in the design of the learning environment specifically for children with ASD in Malaysia.', 'classroom children autism', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2020', 0),
(18, 'Ali Yaraghi', 'Investigation Of Potential Weathered Ree-Bearing Granitoid Crust From Dinding District Of Western Tin Belt, Peninsular Malaysia', 'This research interpreted a green and sustainable exploration strategy of ion-adsorption type REE clay potential deposits with minimum or free radioactive issues in some prone districts of western Peninsula Malaysia. An intensive characterizationstudy was conducted on two sets of samples from Dinding district located within the western part of Malaysian tin granite belt. Understanding REEs characterization andgeochemical behaviour among weathered crusts of granitoids as well as their leachability were the main objectives of this study. The study was conducted based on the field and microscopic investigations, XRD, FTIR Spectroscopy, SEM-EDX, XRF, ICP-MS, CEC determination and batch leaching of clay hosted REEs. Petrographical study and geochemical analysis showed granitoids in Lumut (LU) and Telok Murok (TM) sites were ilmenite-series, mainly peraluminous, S-type which were classified into syeno-granite and monzo-granite, respectively with k-feldspar, quartz, plagioclase and mica group as major minerals. Apatite, monazite, zircon, allanite, titanite and ilmenite were accessory minerals in LU site whilst, TM site was indicated by zircon, apatite and allanite. XRD analysis showed the presence of kaolin and smectite rich clay groups, whilst phlogopite was common mica in parent granites. In both sites, depletion of REE+Y (REY) content in horizon A was considerably apparent, whilst REY enriched in horizon B and/or C. The maximum content of REY could be as high as 3500 ppm in horizon B2 and /or C analyzed by ICP-MS. Total REE content (TRE) of the weathered crust is relatively elevated compared to the parent rocks (3 to 7 times), in horizon B and C of both sites. The chondrite normalized diagrams showed a downward tendency of positive to negative Ce anomaly with LREE enrichment in both sites. However, the mass balance of REE mineral components between each horizon in both sites are different. In batch leaching experiments, TRE extraction levels of ~70% ~ 90% for both sites were achieved with relatively lower extraction of 50-80% for HREEs.', 'ree-bearing granitoid crust ', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0),
(19, 'Muhammad Razlan Bin Zakaria', 'Woven Carbon Fiber Epoxy Composite Laminates Reinforced With Carbon Nanotube Interlayer Using Electrospray Deposition Method', 'The hybridization of woven carbon fiber-carbon nanotube (CF-CNT) received enormous attention from research communities in the field of epoxy laminates composites. In this study, electrospray deposition (ESD) method was used to deposit carbon nanotube (CNT) on the woven carbon fiber (CF) surface. The deposition of the CNT on the woven CF surface is intended to improve the surface roughness of the woven CF as well as to provide a mechanical interlocking between the woven CF and the epoxy matrix. For ESD method, the stability of the CNT in the solvent is very crucial during the ESD process and N-Methyl-2-Pyrrolidone is proven suitable for dispersing CNT due to high stability. The effect of voltage and spray time of ESD on the morphologies of the woven hybrid CF-CNT has been studied. The optimum voltage and spray time to achieve homogeneous and even CNT coating on the woven CF surface is 15 kV and 15 min, respectively. From single fiber test, the ESD method is found to be safe without any significant degradation on the tensile strength of the woven CF-CNT. The epoxy composite laminates with optimized woven hybrid CF-CNT and woven CF without deposited CNT were then prepared and compared in terms of mechanical, thermal and dielectric properties. The evaluation showed that woven hybrid CF-CNT epoxy composite laminates have greater mechanical, thermal and dielectric properties than woven CF epoxy composite laminates. The results demonstrate that the woven hybrid CF-CNT epoxy composite laminates are capable of improving tensile strength, tensile modulus, flexural strength, flexural modulus,interlaminar shear strength, thermal conductivity and dielectric constant about 21 %, 37 %, 19 %, 27 %, 25%, 35 % and 22 %, respectively, compared to the woven CF epoxy composite laminates.', 'fiber carbon nanotube', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2020', 0),
(20, 'Rafidah Binti Ahmad', 'Parallel-Pipelined-Memory (P2m) Of Blowfish Fpga-Based Radio System With Improved Power-Throughput For Secure Zigbee Transmission', 'Currently, the advanced encryption standard (AES) scheme is employed by most of the Institute of Electrical and Electronic Engineers (IEEE) standards to secure the data transmission of mobile devices specifically in internet of things (IoT) network. However, this scheme requires high compute platform and memory to support the encryption or decryption process which may not exist in all IoT-attached devices. In order to overcome this issue, this research work proposed an alternative cryptography scheme with improved power-throughput and reduced hardware utilization to be considered as a replacement to the existing AES. Based on the performance analysis among the symmetric cryptography schemes, the AES-128 and Blowfish schemes have been chosen to be enhanced and developed based on Zynq- 7000 field programmable gate array (FPGA) technology by using three design techniques comprised of parallel, pipelined and memory (P2M) techniques. At software level, the findings showed that the proposed Blowfish design had better performance with slices occupied and power consumption decreased by 45.3% and 94% respectively, and double throughput value was generated if compared to the proposed AES-128 design. Despite of these, the proposed AES-128 design increased the throughput by 22% and reduced the power consumed to 56% with 46.8% slices usage compared to the AES designs from previous studies. At hardware level, the proposed Blowfish design continued to be implemented and validated on ZedBoard and Zynq7000 AP SoC ZC702 FPGA platforms operated at 2.4 GHz ZigBee standard via XBee-PRO ZigBee through-hole XBP24CZ7PIT-004 for real-time data transmission. Two FPGA-based radio platforms were used as transmitter and receiver to form a two-way communication and measured in non-line-of-sight (NLOS) indoor environment based on point-to-point (P2P) topology within wireless personal area network (WPAN). The performance results indicated that the proposed P2M Blowfish radio system possessed a good quality in wireless data transmission with the bit-error-rate (BER) of 6.25x10-3, maximum signal strength of -34.58 dBm and maximum communication range of 61 m at 10 dBm transmitter radio frequency (RF) power level. The improvement in performance analysis either in the software or hardware level shown by the proposed P2M Blowfish has confirmed that this design has the ability to replace the existing AES scheme in mobile devices for the IoT application.', 'parallel-pipelined-memory ', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2020', 0),
(21, 'Mohammed Ibrahim', 'Development Of Natural-Pozzolan Based Alkali Activated Concrete Incorporating Nano-Silica', 'The primary aim of this research was to develop a natural pozzolan (NP)-based alkali activated concrete (AAC). NP was acquired from the Red Sea coast of Saudi Arabia. The influence of mix design variables on the properties of NP-based AAC were not been investigated earlier including durability of such a concrete when exposed to aggressive environmental conditions. In order to enable its curing at room temperature conditions and attain desirable properties, nanosilica (nSiO2) was incorporated. The morphology, mineralogy and polymerization mechanism of the developed binder were studied in detail. The fresh and hardened characteristics of nSiO2 modified AAC were investigated including its pore structure. The durability of the AAC when exposed to chloride laden environment, acid and sulfates was also evaluated. The results reveal that the superior properties of NP-based alkali activated binder (AAB) were obtained when 400 kg/m3 of precursor material was activated with a combination of sodium silicate (SS) and sodium hydroxide (SH) at a SS/SH ratio of 2.5 having 14M SH solution cured for 7 days at 60 C. The addition of nSiO2 in the mixture enhanced the strength, morphology and mineralogy of the NP-based AAB when cured at 60 C as well as room temperature conditions. The nature of the binder was composed of C-A-S-H with Na in the structure with greater absorption of Ca and Al in the case of mixes containing 5% and 7.5% nSiO2. The total pore volume of nSiO2 modified concrete after 28 days of room temperature curing was in the range of 18.35% to 11.23%, the highest in the control mix and the lowest in xxviii the AAC mixture prepared with 5% and 7.5% nSiO2 due to enhanced polycondensation of hydration products. As a result of the improved morphology and mineralogy of the AAB modified with nSiO2, durability was remarkably enhanced. The chloride migration coefficient was 12.82, 12.63, 10.52, 7.83 and 6.22 m2/s (x10-12) and the gravimetric weight loss of the reinforcement embedded in the concrete was 1.608, 0.992, 0.793, 0.670 and 0.681% in the AAC modified with 0, 1, 2.5, 5 and 7.5% nSiO2, respectively. The resistance of AAC prepared with 5% and 7.5% nSiO2 exposed to 5% H2SO4 and sulfate solutions was significantly improved than the other replacement levels. Based on the outcomes, it can be concluded that the NP can be utilized to produce structurally viable AAC for practical applications. The inclusion of nSiO2 in the mixture enabled it to be cured at room temperature conditions. Moreover, the performance of the AAC was either comparable to or better than the OPC-based concrete in all aspects studied in this research. Therefore, the use of the developed AAC particularly that cured at room temperature will lead to the benefits including environmental, economic and technical.\r\n\r\n', 'natural-pozzolan alkali nano-silica', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2020', 0),
(22, 'Suhana Binti Ahmad', 'Effect of etanercept and gold nanoparticles on the expression of tnfr2+ regulatory t cells and cd103+ dendritic cells in peripheral blood mononuclear cells of asthma patients', 'Immune tolerance by regulatory T cells (Tregs) is one of the various mechanisms, which is employ to maintain homeostasis and protect the host against various environmental stimuli. Recently, a subset of Tregs expressing tumor necrosis factor receptor 2 (TNFR2+ Tregs) is identified as a more suppressive and proliferative cell population and its regulation is reported to be impaired in respiratory dysfunction condition such as asthma. Gold nanoparticles (AuNPs), a highly potential tool in immunotherapies, are shown to be protective against key features of asthma. Hence, the current study would like to elucidate the effects of AuNPs on the expression of TNFR2+ Tregs, as well as on CD103+ dendritic cells (DCs), which have been shown to induce Tregs in asthmatic individuals and whether a TNFR2 agonist, etanercept, can modulate the effects of AuNPs. A five-color flow cytometry assay was used to determine the expression of cell population of interest in asthmatic and non-asthmatic controls (n=6) and traditional ELISA assay to determine the level of TNF- and IL-10. Stimulation of peripheral blood mononuclear cells (PBMCs) of asthmatic individuals with AuNPs for 24 hours does not induce significant effects on the cell population of interest. Meanwhile, etanercept as anti-TNF is shown to significantly decrease TNFR2+ Tregs (p = 0.0210) and T effector cells TNFR2+ (Teff) (p = < 0.0001) with an increased pattern of Foxp3+ Tregs only. Surprisingly, etanercept is shown to significantly increased the level of TNF-, question the principal mechanism of etanercept as TNF antagonist. Correlation analysis in the current study demonstrated inverse association of CD103+ DCs with Tregs including TNFR2+ Tregs (r = - 0.6853, p = 0.0170), indicates to the independency of this subset of DCs in the regulation of immune homeostasis, particularly in asthma. Results indicated to the potential of AuNPs as potential formulation carrier for immunotherapies due to its capability to be effectively uptake by antigen-presenting cells such as DCs without inducing immune response.', 'etanercept gold-nanoparticles asthma', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences) ', '2020', 0),
(23, 'Tarek Mokhtar Abubaker Aldhire', 'Effect Of Additives On Zinc Silicon Carbide Composite Coating On Mild Steel By Electrodeposition', 'Zn-SiC composite coating is an effective protection measures for steel structures. Incorporation of SiC particles within zinc matrix as well as dispersion of these particles through the coating thickness are found a practical problem. In order to obtain uniform and dense Zn-SiC composite coating using electrodeposition process, operating parameters should be well controlled. Various operating parameters were used in this study. This includes current density (20, 30, 40 and 50 mA/cm2), stirring speed (300, 400, 500, 600 and 700 rpm) and SiC concentration (5, 10, 15, 20 and 25 g/L). The deposition of zinc with SiC particles was performed by electrodeposition process using zinc sulfate bath containing 2 micron sized of SiC particles. The best operating parameters obtained from preliminary study were current density of 40 mA/cm2, stirring speed of 600 rpm and SiC concentration of 20 g/L. To enhance the formation and properties of Zn-SiC composite coating, electrodeposition of Zn-SiC composite coating in presence of niobium chloride and phosphoric acid additives at various concentrations were introduced in this study. The best mechanical and corrosion properties were obtained with 10 g/L of niobium chloride and 7 g/L of phosphoric acid. The higher incorporation rate of SiC particles into zinc matrix was confirmed by SEM and EDS studies. A significant reduction in corrosion parameters of Zn-SiC composite coating was observed in which corrosion potential of -946 mv and -1008 mv were achieved with niobium chloride and phosphoric acid respectively compared with -1100 mv obtained for Zn-SiC composite coating without additives. The microhardness of the composite coating was successfully improved by using the additives during electrodeposition process. Microhardness value of 312 Hv and 252 Hv were obtained at 10 g/L of niobium chloride and 7 g/L of phosphoric acid respectively whereas it was reached to 166 Hv without additives. The change in the microstructure of Zn-SiC composite coating to fine grains was also noted. The morphology of the coating, mechanical properties and corrosion behavior of the Zn-SiC composite coating were further improved in the presence of niobium chloride and phosphoric acid additives. The presence of additives in the bath solution led to an increase in zeta potential and change the surface charge of SiC particles to more positive which results in more particles acquired to the cathode surface. Hence, the particles were more stable in the solution due to electrostatic repulsion which preventing agglomeration of these particles and consequently increase the incorporation rate of SiC in the coating.', 'additives zinc-silicon electrodeposotion', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(24, 'Neoh Soon Sien', 'Improved Residual Distributionschemes For The Maxwells', 'Electrodynamics have innumerable applications, one of which is to locate embedded object, for example in a human body using electromagnetic scattering. The wireless telecommunication is all about the radiation of electromagnetic waves, and the optical waveguide transmits signals at the speed of light. The aspiration of this work is to introduce the vertex-based residual distribution(RD) schemes for Maxwells equations, which is time-explicit and still secondorder-accurate. The computational electromagnetics (CEM) works do not havea standard mesh topology for unstructured grid, which might inhibit their computationaldevelopment. The most eminent residual distribution scheme which vouches for the second-order-accuracy is the Lax-Wendroff residual distribution (RD-LW) scheme. The RD schemes are transcendent for upwind schemes that stay compact, such as the RD-LDA (low diffusion A) scheme, but appears to be time-implicit for time-dependent fluid problems. The first innovation in this work is to procure a time-explicit updating scheme for RD-LDA scheme while still retaining the order-of-accuracy. Besides, the RD-Galerkin method is propounded in this work, which is rare in RD framework. Secondly, the weak Galerkin FEM is adapted for time-dependent second-order Maxwells equation, and also devising a gradient flux residual approach which is tantamount to the RD-scheme for secondorder Maxwells equation. These two effective solvers reduce first-order Maxwells equations to second-order Maxwells equation in scalar form. The weak Galerkin finite-element method (FEM) is indisputably more accurate in replicating nuxxiv merical results, but it is somehow deficient upon handling certain boundaries,unlike the gradient flux residual approach. The novelty of this work comes from introducing the RD schemes to first-order Maxwells equations, while devising a new RD scheme for the second-order Maxwells equation. The test cases in this work comprised of three main electrodynamics phenomena, they are waveguide propagation, radiation mechanism and scattering problem. Three-dimensional problems are also studied to ascertain the extension of these schemes for realtime applications. The numerical results manifest no instability issues for all the constructed numerical schemes. The lumped RD-LDA scheme trims off the computational cost by approximately 50 times, as compared to its time-implicit consistent mass-matrix approach, although this is still 4 to 6 times higher than the RD-LW schemes. In general, the space-centered schemes of RD-LW, RDGalerkin, weak Galerkin FEM and gradient flux residual in this work promise an order-of-accuracy between 1:4212 and 2:43871. In contradistinction to the spacecentered schemes, the upwind RD-LDA schemes only have an order-of-accuracy ranging from 0:7825 to 0:9335.', 'residual distributionschemes the-maxwell\'s', '', 'Pusat Pengajian Kejuruteraan Aeroangkasa (School of Aerospace Engineering)', '2019', 0),
(25, 'Hasan Alasmari', 'The Effect Of Crumb Rubber Fine Aggregate Replacements On The Flexural Performance Of Fibre Reinforced Concrete Beams', 'It is well known that crumb rubber when incorporated in concrete has shown an improvement in elastic properties which actually enhance the energy absorption. However, the static responses of fibre at different aspect ratios incorporated with crumb rubber aggregate in a double layer are yet to be investigated. This study investigates the effect of crumb rubber aggregates with and without steel fibres on the flexural behaviour of layered and non-layered reinforcement concrete beams on a full scale. Rubberized concrete of layered and non-layered specimens were prepared by partial replacement of 10%, 12.5%, and 15% of sand aggregate volumes. Fibrous concrete were prepared from different types of aspect ratios of steel fibres (80 and 60) with different lengths for hooked-end and micro copper coated steel fibres at a 0.5% of the volume fractions. The layered specimens were constructed by placing rubberized concrete at the top and both layers, whilst the bottoms were dedicated to fibrous concrete. The non-layered specimens were prepared using a combination of rubberized and fibrous concrete subjected to their aspect ratios. The static responses were evaluated in terms of their fresh properties and beam characteristics behaviour. The findings revealed that the layering enhanced the mechanical properties performances compared to the non-layered samples. Increasing the aspect ratios of the steel fibres with inclusion of the crumb rubber aggregate led to increase in flexural strength and stiffness of the beams, whilst the lower aspect increases the toughness, ultimate deflection, ductility index and strain. Furthermore, the newly developed layered beams helped for further cracking control and enhanced the failure patterns. Overall, the results have shown promising performance in the layered form whether in beams or standard specimens.', 'crumb-rubber replacements fibre-reinforced', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering) ', '2019', 0),
(26, 'Hossien Mohammadi', 'Synthesis And Characterization Of Strontium And Cobalt Doped Akermanite Bioceramics', 'The akermanite ceramic with the chemical formula (Ca2MgSi2O7) is a calcium (Ca2+), magnesium (Mg2+) containing silicate bioceramics have drawn attentions of biomaterials researchers because they showed more controllable degradation rate and improved mechanical properties compared to phosphate-based bioceramics such as beta-tricalcium phosphate (TCP) and hydroxyapatite (HA). In addition, their ionic dissolution products such as Ca2+, Mg2+, silicate (Si4+) have been reported to positively affect the bone cell proliferation and differentiation in vitro and in vivo. However, the low fracture toughness and fracture strength of akermanite limit its biomedical applications, particularly under load-bearing sites. The purpose of this study is to dope strontium (Sr2+) and cobalt (Co2+) into akermanite ceramic to improve their mechanical properties (particularly fracture toughness). This is performed by high energy planetary ball milling of oxide powders of Ca, Mg and Si with Sr and Co (as dopant) for 3 h with speed of 500 rpm. This is followed by sintering in the furnace at 1200C for 4 h temperature. Sr is bone seeker trace elements which possess positive effects on bone formation (osteogenesis). The Sr concentration of 5, 10 and 15 mol% was chosen in this study. On the other hand, low concentration of Co has effects on vascularization (angiogenesis) and the concentration of 2 mol% and 5 mol% was chosen for Co doping accordingly. In ion doping, the dopant could either partially or fully doped in the host ceramic. Since, partial substitution occurs in in real experimental conditions, the ratio of Sr/Sr+Ca and Co/Co+Mg was chosen. Accordingly, the compositions were categorized as 0.05Sr, 0.10Sr and 0.15Sr based on the Sr/Sr+Ca and 0.02Co and 0.05Co based on Co/Co+Mg ratio. The results obtained confirmed that Sr2+ and Co2+ substitution did not change the silicate structure and akermanite phase. In addition, the Sr2+ and Co2+ substitution enhanced physical and mechanical properties of akermanite. However, the toughness and strength of akermanite were dependent on the Sr2+ (5 mol% optimum) and Co2+ (2 mol% optimum) content. The optimum fracture strength and toughness of Sr-substituted sample was found to be 16.44 and 1.42 MPa.m1/2, respectively. On the other hand, the optimum strength and toughness of Co-substituted sample was 21.35 MPa and 1.68 MPa.m1/2, respectively indicating that Co improves the mechanical properties of akermanite. In vitro bioactivity and biodegradability revealed different apatite morphology depending on the Sr2+ content after 21 days of soaking in SBF solution and controlled the biodegradability of akermanite. Compared to Sr-doped akermanite sample, the Co-doped sample did not show obvious apatite formation and biodegradability after 21 days of soaking in SBF solution compared to pure akermanite. However, the pH value of SBF media showed a higher pH value compared to akermanite possibly due to faster release of Ca2+ into the media. Finally, both akermanite and Sr-substituted akermanite samples showed cytocompatibility while Sr-containing sample showed higher human fetal osteoblast (hFOB) cell viability which demonstrated the positive effect of Sr2+ ions on the hFOB cell proliferation. However, the Co-containing sample showed cytotoxicity on the hFOB cell viability which may indicate the negative effect of Co2+ ions on cell viability.', 'strontium cobalt akermanite', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(27, 'Farah Alwani Binti Wan Chik', 'Conceptual Framework Of Wind Disaster Risk Mitigation For Rural Houses In Nothern Peninsular Malaysia', 'Windstorm event hit several parts of Malaysia particularly in the Northern region has severely affected humans and causing damage to the properties as well as fatality. Disaster risk mitigation efforts should be exerted to reduce the disastrous consequences of windstorm to the housing sector in rural area. The main objectives of the study are to develop conceptual framework of wind risk mitigation for rural houses in Northern Peninsular Malaysia. Questionnaire survey using five points Likert-scale was distributed to two groups of respondents, namely the expert and community group in the study. A non-probabilistic sampling technique was chosen as a purposive or judgmental sampling and analysed using IBM SPSS statistics version 21. The secondary data on post windstorm survey shows windstorm event predominantly occurs during the month of April, May and October during the inter-monsoon period in the Northern Peninsular Malaysia tremendously damage the rural houses roof cladding, hence, replacement is needed. The relative importance index was introduced to analyse significant influence on pre-identified risk factors. Meanwhile, Spearmans rho correlation was performed to ascertain the risk and threat among the variables in the wind hazard mitigation. Thus, framework on the wind disaster risk mitigation for rural houses in Northern Peninsular Malaysia derived risk identification rank, and also risk hierarchy and threats took place in mitigation phase. The risk identification rank showed implementation of design in rural roofing system as the most significant preidentified risk factor. The framework indicated that roles of codes on wind loading, wind disaster event and design implementation are significantly important in risk hierarchical and threat. A process cycle involved during the reconstruction phase to produce a good quality of rural houses. Challenges and preventive measures encountered throughout the process shall be taken into account required continuous improvement over time. Finally, this study shall benefit the policy maker and governance body in decision making and develop a guideline on the wind disaster risk mitigation.', 'wind risk-mitigation houses', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2019', 0),
(28, 'Yuh Nien Chow', 'Phytotoxic Effects Of Heavy Metals-Enriched Water Irrigation On Food Crops Using A Closed Hydroponic System', 'The issues of food and water security have conventionally been addressed independently, and to date, their nexus has emerged to be the most intricate global agenda. Today, wastewater irrigation has emerged to be a widespread strategy to fulfil the pressing need of non-conventional water resources. These discharges carry toxic elements, exceeding the maximum allowable limits, suggesting the possible risks to food crops and food chain. Heavy metals are the most carcinogenic, teratogenic and mutagenic constituents, accumulating in the irrigation water. Trivalent chromium [Cr (III)], lead [Pb (II)] and nickel [Ni (II)] are the most insidious pollutants, ascribed to their complex electronic chemistry, non-biodegradability, solubility and mobility. This study aimed to investigate the complex interconnection of metals-enriched water irrigation on Vigna radiata, Ipomoea aquatica and Brassica chinensis in relation to the physical growth; physiological characteristics: photosynthetic pigments, proline, antioxidative response [guaiacol peroxidase (POD), catalase (CAT) and ascorbate peroxidase (APX)], antioxidant capacities and morphological characteristics. The toxicity implications were evaluated using in vitro bioassays. Metals-enriched water irrigation adversely induced significant concentration- and duration-dependent reductions in the elongation of roots and shoots; with Cr (III) exerted the highest inhibition in Vigna radiata and Brassica chinensis, denoted the reduction of 68.04% and 75.69% for root and shoot. Ipomoea aquatica was specifically sensitive to Ni (II), with the highest root and shoot inhibition of 83.78% and 87.33%. Chlorophyll-a, chlorophyll-b, and carotenoid contents were significantly reduced, up to 83.92%, 75.86%, and 63%. Profound lipid peroxidation (170.30%) and rising proline content (201.08%) were complementary with the pronounced alterations for POD, APX and CAT activities. The marked suppressions of antioxidant activities above the threshold levels of 0.50 mM Pb (II), 0.20 mM Cr (III) and 0.05 mM Ni (II) in the plant models indicated that the antioxidant defense machinery could no longer protect the plant systems against the oxidative damages. These disturbances corroborated with the xylem and phloem distortion, and stomata disruption. Significant cytotoxic effect with 50% reduction in HepG2 cell viability was noted at 0.20 mM Pb (II), 0.40 mM Ni (II) and 1.20 mM Cr (III). Genotoxic effects on DNA tail moment and tail damage were observed at the lowest concentration of 0.04 g/mL. Conclusively, the oxidative stress-related health threats associated with the deteriorating effects on the food crops could be exacerbated by a wide scale unregulated metals-polluted wastewater irrigation practice, and place alarming threats to the sustainability of water-food nexus.', 'phytotoxic water-irrigation hydroponic', '', 'Pusat Penyelidikan Kejuruteraan Sungai dan Saliran Bandar (REDAC)', '2019', 0),
(29, 'Nelvi Sutanto', 'Photodegradation Performances Of Low-Density Polyethylene Composites Loaded With Photocatalysts', 'Growing production and consumption plastic worldwide is currently resulting in a significant solid waste and is causing serious pollution problems. Various approach has been attempted and photodegradation seems to be the environmental benign approach. However, the degradation rate that has been achieved is only in the range of 0.03 to 0.21 %/h. Therefore, in this work, an appropriate photocatalyst that could expedite the photodegradation rate of the polymer was developed based on zinc oxide (ZnO), titanium dioxide (TiO2) and graphitic carbon nitride (g-C3N4) by sol gel method. The effect of ZnO/TiO2 ratio and wt% of g-C3N4 was investigated. The best photocatalytic activity performed by photocatalyst ZnO/TiO2 with ratio of 3:1 that was incorporated with 10 wt% g-C3N4 denoted as 10C-3ZT was selected to fabricate LDPE composite films. The optimized photocatalyst is 10C-3ZT with following features: dominated by zincite phase and minor traces of c-Zn2Ti3O8 together g-C3N4, formation of heterojunctions within ZnO/g-C3N4 and c-Zn2Ti3O8/g-C3N4, mixture of spherical and rod shape particles, low band gap energy of 2.5 eV have remarkable reduced recombination of e-h in 10C-3ZT photocatalyst thus resulted in 99% degradation within 45 minutes with kinetic rate constant of 0.093 min-1. LDPE composite films with 3 different thickness (1 mm, 0.1 mm and 0.035 mm) was prepared with 10C-3ZT. Compression moulding was used to produce 1 mm composite films and wet casting method for films with 0.1 and 0.035 mm thickness. The weight % of 10C-3ZT was varied from 1 to 10 wt% and the properties of LDPE/10C-3ZT composite films were compared with pure LDPE by analysing the changes in weight loss, carbonyl index, tensile strength, percentage elongation, morphology, chemical structure, degree of crystallinity. The weight loss was further enhanced with 10 wt% PVA functionalized photocatalyst (10C-3ZT-10 wt%-PVA) in LDPE polymer matrix. The total weight loss of 96% was attained in 350 h. Carbonyl index up to 2 was achieved. Enhanced OH released due to heterostructure formation, increase in amorphous region and PVA functionalization for water absorption resulted in substantially improvement in degradation of LDPE, which was 47 times faster than pure LDPE.', 'photodegradation low-density photocatalysts', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(30, 'Noram Irwan Bin Ramli', 'Development of site specific wind hazard map for peninsular Malaysia using geo-spatial modelling', 'Hazard assessment is one of the coping capacity activity in minimise the effect of risk. In wind engineering the wind hazard assessment are evaluated based on the value of wind speed. Currently the value of wind speed is referred to basic wind speed (Vs). Basic wind speed is defined as the probability of the maximum wind speed within the return period. However, wind speed at specific location which is known as site wind speed (Vsite) should consider the effect of land use land cover and topography effect. Apart from that, wind hazard assessment on a spatial area is not feasible because of the Vsite value determined based on the point location. Therefore, the main objective of this study to develop the site specific wind hazard map by using geo-spatial technique. In MS 1553:2002 Vsite is calculated by multiplying the Vs with the Land Use Land Cover (LULC) factor denoted as Mz,cat, and topographic factor as Mh. In order to apply these formulae in a spatial area, Geographical Information System is used. This study also examined the wind hazard assessment by compare the performance of Vs map and Vsite map produced. For that reason, the past windstorm damage in Peninsular Malaysia is used to validate the performance of the wind hazard map produced. From the result, wind hazard map based on the site specific wind speed (Vsite) is highly recommended compared to the basic wind speed (Vs) map. The result showed that the damage occurred at lower Vs value compared to Vsite. Based on 50 years return period for windstorm damage cases, Vs is identified at 31.66 m/s which is 9.02% lesser when compared to value identified using Vsite which is equal to 34.80 m/s. It can be concluded that the risk assessment by referring only to Vs are misleading. Thus, the current risk assessment approach may underestimate the real potential of wind hazard for site specific location.', 'wind-hazard geo-spatial modelling', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2019', 0),
(31, 'Faiezah Binti Hashim', 'Preparation And Characterisation Of Ethylene Vinyl Acetate/Natural Rubber/Mengkuang Leaf Fibre Thermoplastic Elastomer Composites', 'Thermoplastic elastomers composites are a ternary blend, which consist of thermoplastics and elastomers as matrix phase and natural fibre as dispersed phase. The end performance of the composites is explained on the basis of combined behaviour of the natural fibre, polymer matrix and fiber/matrix interface. Thus, in this study, thermoplastic elastomer composites based on ethylene vinyl acetate (EVA), natural rubber (NR) and mengkuang leaf fibre (MLF) were developed. Firstly, the best blending sequences was studied to produce composites with the best end properties. The EVA:NR ratio was fixed at 50:50 while the MLF loadings were varied from 0 to 10 phr. It was found that better enhancement in the end properties were achieved when EVA was blended with NR first before the addition of MLF. This system produces the composites with the best fiber dispersion in the matrix, resulting in low stabilization torque, good tensile properties, and better thermal stability, compared with the other systems. Secondly, fiber modification through alkaline peroxide bleaching treatments were examined. The treatment was found to be effective in removing surface impurities, lignin and hemicellulose, thereby producing a rougher fibre surfaces which promote a good fibre/matrix adhesion, as depicted by Scanning Electron Microscopy (SEM), thus resulting better tensile properties and thermal properties. Furthermore, the treatment were resulted in the reduction of water absorption from 31% to 26%. Next, comparison between EVA/NR/MLF and EVA/(epoxidized natural rubber) ENRxxvi 50/MLF composites were evaluated. It was found that, the EVA/ENR-50/MLF composites showed lower stabilization toque, higher tensile and thermal properties than EVA/NR/MLF composites. These results indicated that the EVA/ENR-50/MLF composites had better compatibility than the EVA/NR/MLF composites. This result was probably due the interaction between the carbonyl group of the EVA and the epoxy group of the ENR-50 and the formation of hydrogen bonds between the MLF and the EVA/ENR-50 matrix. However, the presence of ENR-50 had further increased the water absorption of the blend and composites due to oxirane group present in the ENR-50. Lastly, the influenced of different types of vulanisation system namely sulfur and peroxide curing systems were evaluated. The stabilization torque of vulcanized composites exhibited higher value compared to its unvulcanized counterparts as the effect of the crosslinking. Dicumyl peroxide (DCP) cure system showed higher improvement in tensile strength and modulus compared to sulfur vulcanizates. However, sulfur cure system showed better resistance towards thermal degradation compared to peroxide system. This was attributed to the DCP that was caused degradation in polymer chain or chain scission in the composites at high temperature.', 'ethylene-vinyl leaf fibre ', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(32, 'Ashraf BinAzmi', 'Dynamic Optimization Of Low Density Polyethylene Production In Tubular Reactor Under Thermal Safety And Fouling Resistance Constraints', 'The highly exothermic nature of the low density polyethylene (LDPE) polymerization process and the heating-cooling prerequisite in tubular reactor can lead to thermal runaway and can also create fouling problems. Both problems need to be considered when optimizing the LDPE production to ensure the highest profit and a safe operation can be achieved. However, this is not an easy task since the conversion of the monomer (XM), which is normally proportional to high profits, could be achieved at high reaction temperatures and could lead to a high fouling formation. Consequently, in this work, the dynamic optimization study to obtain the optimum production of the LDPE under thermal safety and fouling resistance constraints is carried out. Prior to the dynamic optimization study, the kinetic rate parameters estimation is carried out. A mathematical model is developed and validated using industrial data. For thermal safety considerations, a suitable form of energy balance is developed and the reactor critical temperature ( ) is determined. For the fouling study, fouling resistance (Rf) is used as the fouling measurement. This study uses the changes in the heat transfer coefficient (U) determined from industrial data in order to obtain the maximum reactor fouling resistance. Based on the sensitivity studies, monomer flow rate (FM), initiator flow rate (FI), solvent flow rate (FS) and reactor inlet pressure (Pin) are selected as the optimized parameter variables while reactor jacket temperature (TJ) is selected as the optimized control variable in the dynamic optimization. In the dynamic optimization study, the optimization problems are solved using dynopt coded programming which is based on orthogonal collocation (OC) and sequential quadratic programming (SQP) methods. In different constraints case studies, the results show that the optimization case without thermal safety and fouling resistance constraints gives a higher XM than the optimization case with and constraints. Five different objective functions (OF) are considered to identify the most optimum reactor performance. The thermal safety and fouling resistance constraints are considered and are successfully satisfied in all the cases. The highest of 365.99  and of 49.48 cm2. s.K /cal are obtained by maximum XM and maximum profit OFs, respectively. These values are below the and allowed which are 366  and 50 cm2. s.K /cal, respectively. The most optimum reactor output is obtained from the maximum profit OF with the profit earned of RM328.18 million/year while the and ,sucessfully satisfied at 365.87  and 49.48 cm2.s.K/cal respectively. Overall, the complex relation of the LDPE tubular reactor process parameters and the trade-off balance between the input-output parameters are handled very well by the dynamic optimization.', 'low density polythylene', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2019', 0),
(33, 'G.Sivarajah Ganesan', 'Performance Enhancement Of Anaerobic Ammonium Oxidation Reactor Start-Up And Operation With The External Hydrazine Addition', 'Anaerobic ammonium oxidation (Anammox) is one of the widely used biological treatments to remove nitrogenous compounds from wastewater. Despite this, Anammox system has long start-up period and the Anammox bacteria can easily undergo inhibition or starvation due to fluctuation of feed in wastewater treatment plants. In the first part of the study, Anammox bacteria were enriched in a sequencing batch reactor (SBR) with a working volume of 8L. In 75 weeks the substrates were increased step wise from 100  900 mg-N/L. The substrates provided (ammonium + nitrite) were in equimolar balance of 1:1. The parent SBR achieved more than 90% of nitrogen removal efficiency (NRE) in 14 weeks. The second part of the study was to investigate the effect of external hydrazine addition on aiding the start-up of Anammox reactor. Effects of 5 different externally added hydrazine concentration on reactor start-up were studied (0, 5, 10, 15, 20 mg/L). According to the results obtained, SBR with 10 mg/L hydrazine addition only took 7 weeks with an NRE of 86%. However, the SBR with no hydrazine addition took 11 weeks to stabilize with a NRE of 83.5%. The third part of the study was done to evaluate the effect of substrate inhibition on Anammox bacteria and ability of external hydrazine addition to aid the recovery of Anammox bacteria. 3 substrate concentrations were studied which were 900, 1100 and 1300 mg-N/L. The outcomes show that the inhibition percentage (IP%) obtained for reactors with substrate concentration of 900, 1100 and 1300 mg-N/L after 28 days of inhibition were 27, 38 and 75%, respectively. It was found that the substrate inhibition model (Edwards model) is the best model to represent the inhibition towards Anammox bacteria. Half saturation constant (Ks) and inhibition constant (KIE) obtained were 361.62 mg/L and 731.3 mg/L, respectively. During the recovery studies, reactors that had hydrazine addition showed better recovering capabilities compared to the one without hydrazine addition. The best result in terms of NRE was obtained from the reactor inhibited with 900 mg-N/L and recovered in the presence of hydrazine (R9H) which was 94%. Evidently, the best growth rate was also obtained from reactor R9H at 0.22/day and the lowest growth rate was obtained for R13 which was 0.07/day. The final part of this study was to evaluate the effect of different starvation condition on Anammox bacteria and its recovery. Three different starvation were studied which were starvation with the presence of ammonium (Ra), nitrite (Rn), and hydrazine (Rh). The decay rates calculated after 15 days for Ra, Rn, and Rh were 0.032/day, 0.042/day and 0.019/day, respectively. Finally, the best and the worst recovering capabilities after starvation were shown by reactor Rh and Rn where the growth rate value tabulated were 0.092/day and 0.011/day, respectively.', 'anaerobic ammonium oxidation', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2019', 0);
