(34, 'Ahmad Fikri Bin Abdul Karim', 'Preparation And Characterization Of Kenaf Filled Natural Rubber Latex Foam', 'Kenaf fiber have attracted great interest as filler material in polymer matrix composites (PMC) due to its low cost, and the ability to enhance properties such as tensile strength and modulus, chemical resistance and thermal stability of PMC. However, poor dispersion and incompatibility of kenaf in NRLF still remain as challenging issue for their practical application in various environment. In this research kenaf filled NRLF composite containing 0 to 7 part per hundred rubbers (phr) of kenaf loading was prepared through a well-known Dunlop processing method. Kenaf filled NRLF shows reduction of tensile properties, swelling resistance and thermal stability properties of kenaf filled NRLF composites as compared to the unfilled NRLF. The less physical interaction via penetration and/or interlocking of NRLF chains at kenaf surface contributed to weak interfacial adhesion between kenaf and NRLF which leads to the decreased in properties of kenaf filled NRLF composites. However, with some modification to the kenaf and NRLF, the properties of kenaf filled NRLF were improved. Studies on the partial replacement of kenaf by starch were carried out to determine the potential of starch as replacement for kenaf in NRLF composites. Series of five composites of kenaf/starch filled NRLF composites with different kenaf/starch fraction loading (i.e. 7/0, 5/2, 3.5/3.5, 2/5 and 0/7 phr) were prepared. Partial replacement of kenaf by starch produced hybrid filler composites showed great potential as co-filler with kenaf NRLF composites, at which the tensile properties, swelling resistance, compression and hardness was improved with increased in starch fraction. The thermal stability was higher at 3.5/3.5 kenaf/starch fraction. Based on this series of studies, the corn starch was then used as a co-filler in the formulation of kenaf filled NRLF with fix amount of starch (3 phr). The results show that the tensile strength, elongation at break, swelling resistance, hardness, thermal stability and density were higher compared with samples without corn starch. The morphological study by SEM shows that samples with co-filler have smaller pores size and better distribution. The effect of treated kenaf by alkaline treatment on the properties of kenaf filled NRLF composites were then studied separately. The dispersion of kenaf in NRLF and interfacial adhesion between kenaf and NRLF was further enhanced with the addition of treated kenaf, which enhanced tensile properties, hardness, compression, thermal stability and swelling resistance of the kenaf filled NRLF composites. The used of prevulcanized NRL shows the improvement of several properties of kenaf filled NRLF. The results show that 24 hours was the optimum time for prevulcanization of NRL. By comparing with samples without prevulcanized, samples with prevulcanized NRLF shows higher tensile properties, swelling resistance, density, hardness and thermal stability due to the crosslink density effects. Morphological study by using SEM shows the good interfacial adhesion and uniform pores size of kenaf filled prevulcanized NRLF.', 'kenaf rubber latex', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(35, 'Mohamed Ahmed Elsayed Sleem Abdalla', 'Investor Trading Patterns And Performance Before, During And After Two Consecutive Crises: Evidence From Egyptian Stock Market', 'Egypt was shocked by the 2007/2008 global financial crisis, and was hit strongly by the 2011 domestic political crisis. Despite the fact that EGX is a promising active emerging stock market, the background of EGX illustrated by Niemczak & Smith (2013) shows that EGX is not only inefficient but also fragile and exposed to crisis. Therefore, it is expected that some investors are more informed and it is worth to investigate such case in light of the two recent crises particularly the political turmoil. Using behavioral finance aspects, this research aims to identify the trading patterns (e.g. momentum, contrarian) and performance of buy and sell trades conducted by different types of investors (i.e., domestic individuals, domestic institutions, foreign individuals, and foreign institutions) during crisis and non-crisis periods. The dataset of investors daily inflows and outflows is extended from January 2006 to December 2016. The Vector Autoregressive (VAR) is employed to detect feedback trading, and volatility (e.g. via Wald test), while the method of Kamesaka et al. (2003) is employed to measure the performance of each investor category. The results indicate that the trading strategies utilized by the four investor categories during crisis periods differ from those employed during non-crisis periods. Second, momentum and contrarian patterns are heavily employed but in different intense. Further, Institutional foreigners were winners during the five sub-periods while Individual investors were nearly always losers. This suggests that foreign institutions are information-driven while individuals are behavioral-driven as in Kamesaka et al. (2003).\r\n\r\n\r\n\r\n\r\n', 'investor trading crises', '', 'Pusat Pengajian Pengurusan (School of Management)', '2019', 0),
(36, 'Asem Mustafa Moh\'ad Al-Nemrat', 'Modified Sumudu Transform Analytical Approximate Methods For Solving Boundary Value Problems', 'In this study, emphasis is placed on analytical approximate methods. These methods include the combination of the Sumudu transform (ST) with the homotopy perturbation method (HPM), namely the Sumudu transform homotopy perturbation method (STHPM), the combination of the ST with the variational iteration method (VIM), namely the Sumudu transform variational iteration method (STVIM) and finally, the combination of the ST with the homotopy analysis method (HAM), namely the Sumudu transform homotopy analysis method (STHAM). Although these standard methods have been successfully used in solving various types of differential equations, they still suffer from the weakness in choosing the initial guess. In addition, they require an infinite number of iterations which negatively affect the accuracy and convergence of the solutions. The main objective of this thesis is to modify, apply and analyze these methods to handle the difficulties and drawbacks and find the analytical approximate solutions for some cases of linear and nonlinear ordinary differential equations (ODEs). These cases include second-order two-point boundary value problems (BVPs), singular and systems of second-order two-point BVPs. For the proposed methods, the trial function was employed as an initial approximation to provide more accurate approximate solutions for the considered problems. In addition, for the STVIM method, a new algorithm has been proposed to solve various kinds of linear and nonlinear second-order two-point BVPs. In this algorithm, the convolution theorem has been used to find an optimal Lagrange multiplier.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'analytical methods problems', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia) ', '2019', 0),
(37, 'Chang Shu Fun', 'Contributions Of Visual Arts Sector Towards Urban Regeneration In Penang Island', 'The transition of the global economy towards the post-industrialization phase has\r\nled to a new trend of urban regeneration. Cities are now exploring strategies to promote\r\nplace regeneration towards sustainability. Parallel to this, a creativity-centred and\r\ncultural-centred economy is increasingly a global focus, especially after the\r\npopularisation of the Creative City concept. Recognising creative arts as one of the\r\nkeystones of creative or cultural industries, cities began to adopt or adapt art strategy. According to the literature, vibrant art market and active art initiatives for creative place- making could help to revitalise societal vibrancy and regenerate economic\r\ncompetitiveness of a city. Nevertheless, critiques also highlighted undesirable\r\nconsequences such as gentrification, displacement and loss of local authenticity due to\r\nthe active implementation of creative or art strategy in a city. In Penang, since George\r\nTowns listing as a UNESCO World Heritage City in 2008, the local arts and cultural\r\nassets increasingly gained a legitimate stake in local policy-making towards developing\r\nPenang Island into a creative city. Creative or art strategy could help to sustain Penangs\r\ncompetitiveness by retaining and attracting creative talents towards supporting its future\r\ndevelopment. This is achievable with careful planning and implementation. This\r\nresearch examined visual arts as a sectoral case study subsumed under the art or creative\r\nindustries. This study investigated the contribution of the visual arts sector towards\r\nurban regeneration in Penang Island by analysing the stakeholders perceptions (i.e. the\r\nproducers, the marketers, the consumers, and the supporters). Using mixed research\r\nmethods by triangulating the findings from both quantitative and qualitative analysis on\r\nprimary as well as secondary data collected from multiple sources, the study revealed\r\nthat visual arts sector in Penang Island contributed more significantly in generating\r\neconomic spin-off through its vibrant art activities instead of generating direct income to\r\nits producers and marketers. More efforts are required to promote local art appreciation\r\ntowards increasing demand for artworks in the market. This research concluded that\r\nthere is a need for effective stakeholders collaboration in order to achieve shared\r\nmissions to develop visual arts sector in Penang Island as a potential creative industry. This will eventually help to inspire local creativity and innovation towards making\r\nPenang Island a creative city for urban regeneration.', 'visual arts regeneration ', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2019', 0),
(38, 'Saima Sohni', 'Lignocellulosic Biomass From Agricultural Residue For The Production Of Bioenergy And Bio-Based Materials', 'The objectives of this study are to investigate physicochemical properties of wide range of agricultural residues available in Malaysia to ascertain their suitability for downstream processing along with prospective usage as promising feedstock in the production of bioenergy and bio-based materials. In the first phase, physicochemical characterization was carried out for oil palm frond (OPF), oil palm trunk (OPT), oil palm empty fruit bunch (EFB), oil palm kernel shell (PKS), rice husk (RH), rice straw (RS) and kenaf stalk (KF). These studies were based on proximate composition, CHNS/O content, calorific value and lignocellulosic content determination. In addition, various analytical techniques such as Fourier transform infrared (FTIR), X-ray diffraction (XRD), X-ray fluorescence (XRF) spectroscopy and thermogravimetry (TGA) were used to study microscopic properties such as functional groups, crystallographic structure, mineralogical composition and thermal degradation, respectively of these residues. Results of the first phase provided baseline for subsequent phases wherein two new eco-friendly processing methods using supercritical carbondioxide (SC-CO2) and tetrahydrofuran (THF) were demonstrated for OPT and PKS, respectively. Results of the first phase showed that in terms of volatile matter, the order followed was; EFB (83.42 %)  KF (82.70 %)  OPT (81.46 %)  OPF (76.98 %)  RS (76.42 %)  PKS (69.66 %)  RH (66.65 %), showing yield in thermochemical conversion. Proximate analysis revealed that RH has the highest ash content (18.82 %), predominantly composed of silica. The minimum ash material was generated by KF (5.73 %), EFB (6.56 %) and OPT (7.71 %), containing high fractions of catalytic species which are likely to participate in pyrolytic reactions.', 'lignocellulosic agricultural bioenergy', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2019', 0),
(39, 'Nur Atiah Binti Azmi', 'Development Of A Portable Membrane-Color-Sensor For Detection Of Heavy Metal', 'A basic requirement of colorimetric membrane-based sensors is to allow the target analyte to access to the chromophore while retaining a strong chromophore immobilization on the membrane surface. This study elucidates the fundamental perceptive of membrane morphologies and their influences on the binding of chromophores to detect aqueous heavy metals ions. Flat sheet membranes consist of mixed polymer cellulose acetate (CA) and chitosan (CS) was acts as the sensing platform for chromophore binding. Membrane with 17 wt.% CA and 1 wt.% CS showed to have the high binding capacity and high binding stability up to 90 days of measurement. The addition of deionized water (DI) as the non-solvent additive has also shown to improve the membrane porousness, which improved the sensors sensitivity. Visible color changes of the colorimetric membrane from blue-greenish to peachy-pink was observed when it was in contact with the Pb2+ ions in 1 ppm Pb(NO3)2. Selection of sensitive chromophore (Dithizone, 1-(2-pyridylazo) 2-naphthol and 4-(2-pyridylazo)-resorcinol) and its immobilization strategy on the membrane sensor has also been carried out. Dithizone (DTz) at unadjusted pH was capable to produce an obvious color transition observed through UV-visible absorption spectrum and naked eyes recognition. The optimum immobilization of DTz required the concentration of 100 ppm and 10 minutes immobilization time. To determine the sensitivity and selectivity of the developed colorimetric sensor in the single and mixed aqueous heavy metals ions solution, the sensing conditions such as pH, type of heavy metals (Pb2+, Hg2+, Zn2+ and Cu2+), concentration and response time were evaluated. The developed DTz-membrane sensor in this work has exhibited quick (within 1 minute) color change and was able to display distinctive color changes from blue-greenish to peachy-pink, yellowish-orange, red-violet and reddish-brown in the response to the presence of Pb2+, Hg2+, Zn2+ and Cu2+ in aqueous solutions. The quantitative analysis using RGB (R:Red; G:Green; B:Blue) data showed that each tested metal ions have demonstrated their own RGBs recognition pattern phase without significant interfering effects among the heavy metal ions. This showed the potential for practical applications of on-site quick detection on either single or mixed heavy metal ions. The DTz-CA/CS membrane showed a distinctive color changed in the detection of synthetic heavy metals ions in the water that obtain from Kerian River. The synthetic heavy metals ions was prepared the at maximum permissible limit of 0.1 ppm Pb2+, 2.0 ppm Zn2+ and 0.2 ppm Cu2+ for industrial effluent (Standard A) by Malaysian Department of Environment. This membrane sensor was successfully applied for the determination of heavy metals ions not only limited to river water quality assessment but also included the cosmetic product analysis (lipstick samples) at the low trace level of heavy metals ions.', 'membrane-color-sensor detection', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2019', 0),
(40, 'Chen Jien Jie', 'Synthesis Of Thermo-Magneto-Responsive Poly(N-Isopropylacrylamide)-Based Composite Hydrogels For Adsorption-Desorption Of Chromium (Iii) Ions', 'Stimuli-responsive composite hydrogels have been in the vanguard of researches for their application in metal ion adsorption and its release via conformational change. The preparation of composite hydrogels with both thermo- and magneto-responsiveness requires careful layer-by-layer coatings of functional shells onto the core of iron oxide magnetic nanoparticles (MNPs). However, multiple stages of shell encapsulation of MNPs remains a major setback on the production of composite hydrogels with adequate colloidal stability and well-functioned dual-responsiveness. In this study, homo-polymeric poly(N-isopropylacrylamide)-encapsulated magnetite nanoparticles (PNIPAM-MNPs) cross-linked composite hydrogels were facilely synthesized via layer-by-layer coatings with and without employing silanization precursor, 3-(trimethoxysilyl)propyl methacrylate (MPS). It was found that PNIPAM could be gelated directly onto the silica-coated, poly(vinylpyrrolidone) (PVP) functionalized MNPs (silica-PVP-MNPs) via free radical polymerization without MPS to improve its colloidal stability and both thermo-magneto-responsive. Besides, co-polymeric poly(N-isopropylacrylamide-co-acrylic acid)-encapsulated MNPs ((PNIPAM-co-AA)-silica-PVP-MNPs) composite hydrogels were prepared for elucidating the difference in adsorption mechanisms between chelating groups of carboyxlates (-COO-) contained by AA moiety and amides (-CONH) of NIPAM moiety. In the temperature manipulated adsorption-desorption tests, desorption of Cr3+ gradually predominated as temperature increased from 298 K to 323 K for PNIPAMsilica-PVP-MNPs. Re-adsorption of Cr3+ by the composite hydrogel took place as being quenched to 298 K for lower initial Cr3+ concentration (20  80 mg L-1) which showed that desorption can be realised for surface adsorption. Before heating, the equilibrium adsorption data of Cr3+ fitted well into Flory-Huggins and Frumkin models, that elucidated the chelation of Cr3+ ions occurred via replacement of water molecules on the binding sites. Moreover, PNIPAM-silica-PVP-MNPs had higher maximum adsorption capacity, qm (434.78 mg g-1) compared to (PNIPAM-co-AA)-silica-PVP-MNPs (qm = 243.90 mg g-1) as extrapolated by Langmuir isotherm model in which the data of both composite hydrogels also showed good fit to the model. The adsorption kinetic analysis indicated that Cr3+ adsorption on PNIPAM-silica-PVP-MNPs was governed by intra-particle diffusion and reversible surface physisorption as its data followed pseudo-first, pseudo-second- and intra-particle diffusion models. On the other hand, surface chemisorption predominated over (PNIPAM-co-AA)-silica-PVP-MNPs as it followed only pseudo-second model.', 'thermo-magneto-responsive adsorption-desorption', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2019', 0),
(41, 'Muhammad Izhar Bin Kairi', 'Synthesis Of Graphene From Alternative Precursors And The Use Of Quartz Plate For Carbon Source Manipulation', 'Graphene is a single layer of carbon atoms arranged in an sp2-hybridized structure with properties far superior compared to other materials. Research and development in graphene synthesis have been rapidly growing the past few years especially using chemical vapor deposition (CVD). However, in order to move graphene from laboratory scale to commercial domain; graphene synthesis cost need to be continually reduced. In this thesis, this problem was approached from a few angles. One of the study in this thesis demonstrate that rice straw and synthetic biogas, typical wastes from the rice and palm oil production industries can be used as inexpensive carbon source for the production of graphene. In the case of rice straw, the lignocellulosic biomass was first put through thermal pyrolysis in order to obtain the bio-oil and bio-char. Only 0.50 mL of bio-oil was then used as carbon source to sufficiently synthesized 1 cm x 1 cm of large area graphene with good quality (ID/IG = ~0.55) via a two-heating source setup ambient pressure CVD (APCVD) . By doing this, the amount of carbon source going out as effluent is reduced as it has been recovered as side-products prior to graphene growth. The bio-char was also used as carbon source for graphene growth but with a novel and facile carbon trapping assisted APCVD involving customized quartz plate. Here, 2.5 mg of bio-char was encapsulated with quartz plate and Cu foil in a specific arrangement which acted as carbon shields and trapped the carbon active species at high temperature within the confined space of the setup. By implementing carbon trapping, lesser amount of carbon source was needed for graphene growth of the same size; graphene growth efficiency increased around 400 %. Lastly, the effluent of the graphene growth process was converted into syngas when synthetic biogas was used as the carbon precursor with Ni as the catalyst at 900 oC in a one-step process; turning waste into wealth.', 'graphene quartz manipulation', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2019', 0),
(42, 'Sahrish Ahmad', 'Innovation performance of small and medium private hospitals in India : roles of open and closed innovation', 'Innovation is increasingly becoming a common practice within the hospitals to improve the performance. In India, innovation among hospitals is prevalent and the healthcare services serve to more than two third of its population. Although innovation is significant among the large private hospitals, the practice of this concept is still lacking among the small and medium private hospitals. Previous research on innovation performance of healthcare organizations mostly focused on the large private hospitals, and the factors affecting innovation performance among small and medium private hospitals were neglected. Therefore, this study aims at examining the factors that affect the innovation performance of small and medium private hospitals namely open innovation and closed innovation practices. Subsequently, it is also pertinent to investigate the impact of service innovation orientation, organisational learning, and innovation culture on open innovation and closed innovation that lead to innovation performance. Further, this study also examined mediating effect of open innovation and closed innovation between service innovation orientation, organisational learning, innovation culture, and innovation performance. This study was designed as a quantitative study and data were collected at one point of time. The study used nonprobability purposive sampling technique and the data were collected from small and medium private hospitals from three states of India (Delhi, Uttar Pradesh, and Uttarakhand). Questionnaires were sent to the doctors of small and medium private hospitals through electronic mail. In total, 186 questionnaires were returned and only 173 completed questionnaire were found useful data analysis.', 'innovation private hospitals', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2019', 0),
(43, 'Nor Aini Ahmad', 'Co2 Removal Using Polyvinylidene Fluoride Mixed Matrix Membrane In Membrane Gas Absorption', 'Carbon dioxide (CO2) removal technology is important in the purification of energy source such as biogas. Among the CO2 removal techniques, membrane gas absorption (MGA) can be used to separate CO2 at low pressure. MGA integrates the advantages of membrane and chemical absorption process in a single unit. However, membrane wetting in the long operation can induce the increment of mass transfer resistance even using hydrophobic membranes. Polyvinylidene fluoride (PVDF) is the commonly used membrane in MGA, but PVDF defluorination in amine solutions was postulated to cause membrane wetting. In this research, poly[2,2-(m-phenylene)-5,5-dibenzimidazole (PBI) with the great chemical resistance and thermal stability was blended into PVDF membrane to enhance the physical and chemical properties membrane. Besides that, SAPO-34 zeolite with CO2 absorption affinity was incorporated into PVDF membrane to improve CO2 absorption. PVDF membrane incorporated with SAPO-34 zeolite was hydrophobically modified using silane. Hydrogen bonding in the polymer blend due to donor (-NH-) and proton acceptor (-N=) of PBI encouraged the formation of miscibility blend. PVDF/PBI membrane with 20 wt% of PBI showed the highest CO2 flux of 3.07 x 10-4 mol/m2s. The CO2 flux of PVDF membrane increased 60 % to 4.53 x 10-4 mol/m2s when it was blended with 10 wt% of SAPO-34 zeolite. The pre-modified SAPO-34 zeolite using fluorocarbon silane retarded the formation of porous structure, resulting in a great membrane resistance for CO2 transfer. The post-modification of PVDF/SAPO-34 membrane using silane caused improvement in CO2 absorption. The significant improvement of water contact angle and liquid entry pressure resulted in the increment of overall mass transfer coefficient (Ko) to 12.46 x 10-6 m/s. Introducing humid CO2 gas into MGA system incorporated with the post-modified PVDF/SAPO-34, the CO2 permeation was significantly reduced to 10.65 x 10-6 m/s. The Ko of post-modified membrane remained similar to the overall mass transfer coefficient of non-silanated PVDF/SAPO-34 membrane. The wetting study conducting in diethanolamine (DEA) solution (2 M) showed that incorporation of zeolite reduced swelling of that PVDF/SAPO-34 membrane. However, the unfavorable interaction between fluoroalkyl and amine groups induced severe wetting of post-modified PVDF/SAPO-34 membrane by amine. Hence, PVDF/SAPO-34 hollow fiber with different SAPO-34 loadings (1, 3 and 5 wt%) were synthesized. The highest CO2 flux of 8.73 x 10-4 mol/m2s was achieved when 3 wt% of SAPO-34 zeolite was incorporated into PVDF/SAPO-34 hollow fiber. PVDF/SAPO-34 hollow fiber exhibited lower mass transfer resistance in comparison to PVDF/SAPO-34 flat sheet. The CO2 absorption flux of PVDF/SAPO-34 membrane was greatly improved of about 140 % higher than the CO2 absorption flux of the neat membrane when 2 M DEA was used as the liquid absorbent. Neat hollow fiber membrane swelled nearly 71.0 % after being wetted by amine. However the incorporation of SAPO-34 zeolite into PVDF hollow fiber membrane reduced swelling by amine, down to 47.7 %.', 'co2 polyvinlidene-fluoride gas-absorption', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2019', 0),
(44, 'Siti Jasmida Binti Jamil', 'Shape Preserving Interpolation Using Rational Cubic Ball Triangular Patches', 'Shape preserving interpolation is an important area for graphical presentation of scattered data where it is most desired in computer graphics, computer aided manufacturing, computer aided geometric design, geometric modeling, geology, meteorology, as well as in physical and chemical process. In many interpolation problems, shape characteristics of the surface data commonly considered are positivity, monotonicity and convexity. Thus, the focus of this thesis is on the graphical displays of triangular surfaces of scattered data which possess positive, monotone and convex shape features, respectively. Shape preserving schemes will be displayed for triangular patches using rational cubic Ball function with free shape parameters (weights function). It will be shown that the proposed scheme is visually pleasing when appropriate parameters are chosen. Firstly, for each data set in two dimensional (2D) region (x,y) is divided into triangular elements using Delaunay triangulation method. The interpolating surface of scattered data is a convex combination of three rational cubic Ball triangular patches with the same set of boundary Ball ordinates. Conditions to obtain positivity, monotonicity and convexity preserving surfaces, respectively, are derived on the Ball ordinates with free parameters in order to preserve the inherited shape characteristics of the underlying data. Finally, a relationship between rational Bzier and rational Ball bases will be shown using conversion formulae.', 'preserving rational triangular', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2019', 0),
(45, 'Shanthi Nadarajah', 'Cultural Factors As Predictor Of Adjustment Process And The Role Of Self-Efficacy As A Moderator Among Expatriate Academics In Malaysia', 'In 2011, the former Prime Minister of Malaysia, Dato Sri Mohd Najib Tun Haji Abdul Razak claimed that the Ministry of Education (MOE) needs to increase the number of international students studying in Malaysia by 2025. The enrolling number of international student is coordinated with Key Performance Index (KPI) of internationalisation of Malaysian Higher Education. This situation would increase job opportunities for those who are with PhD qualifications and attract more expatriate academics into Malaysia higher education institutions as to fulfil the needs of the international students and to put Malaysia in the world map as higher education hub. In the effort of increasing the number of international students, higher education institutions in Malaysia has drawn their attention to identify on how to better accommodate and retain expatriate academics. These efforts are resulted depending on how well the expatriate academics adjusted themselves into Malaysian academia. Adjustment difficulties among expatriate academics could affect their job performance and these may affect their decision to remain at or leave the institution.', 'cultural self-efficacy expatriate', '', 'Pusat Pengajian Pengurusan (School of Management)', '2019', 0),
(46, 'Nor Atikah Binti Shafai', 'Board Diversity As Antecedent And Corporate Social Responsibility As Consequence Of Earnings Management: Malaysian Evidence', 'Earnings management practices have escalated in recent years. The consequence of this practice is detrimental, and has received immense attention from academician and practitioners. The issue of earnings management has become a serious concern, especially in corporate governance ability as a monitoring mechanism and the consequence of earnings management manifestation. Using Agency Theory and Human Capital Theory, this research endeavours to investigate the relationship between board diversity (diversity-of-boards and diversity-in-boards) and earnings management. This research also determines to examine corporate social responsibility (CSR) as the consequence of earnings management based on Stakeholder-agency Theory and Signalling Theory. Particularly, this study investigates whether earnings management affects the quality of CSR disclosure. Additionally, this research examines the moderating effect of corporate reputation between earnings management and CSR. A total of 265 public listed companies on the Main Market of Bursa Malaysia for the year 2016 have been analysed. This study reveals that board leadership, multiple directorships, gender diversity and age diversity are significantly negative in relation to earnings management. Non-executive directors commitment and nationality diversity, on the other hand, are found to be significant and positively associated with earnings management. The remaining variables which are board size, ethnic diversity and competency diversity were found to have no effect in mitigating earnings management.', 'corporate social responsibility', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2019', 0),
(47, 'Nilavathi Balasundram', 'Using Popplet Application To Encourage The Use Of Multiple Modes Of Representations In Learning Transition Metals', 'This study introduced writing-to-learn (WTL) activities integrated with graphic organizers using the Popplet application to encourage the embedding and translating Multiple Modes of Representations (MMR). Simultaneously, this study measured the effectiveness of the embedding and translating MMR on students misconceptions on transition metals and attitude towards learning chemistry. Concurrent embedded mixed method design was employed for eight weeks with 81 Form Six students. The effectiveness of WTL activities integrated with graphic organizers using the Popplet application to encourage the embedding and translating MMR measured using open-ended tests. Then, the open-ended tests were evaluated using Multimodal Writing Task Embeddedness Inventory (MWTEI) and Multimodal Writing Task Translation Inventory (MWTTI) respectively. The Transition Metal Diagnostic Tests (TMDT) measured students misconceptions on transition metals while Attitude Towards Learning Chemistry Lessons (ATCL) measured students attitude towards learning chemistry.', 'popplet representations learning', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2019', 0),
(48, 'Sylvia Annabel Dass', 'Selection Of T Cell Receptor-Like Antibody Reactive To Mycobacterium Tuberculosis 16 Kda Heat Shock Protein From A Human Antibody Phage Display Library', 'T cell receptor (TCR)-like antibody has drawn the attention of many researchers recently due to its dual functionality of sandwiching the best of the humoral (antibody) and cell-mediated immunity (T cell) in a single platform. This is possible through the advancement in technology, specifically genetic engineering and phage display. The primary focus of this study was to generate TCR-like antibody for the development of latent tuberculosis diagnostics and therapeutics since the global burden contributed by latent tuberculosis is constantly increasing. As targets, Mycobacterium Tuberculosis (Mtb) heat shock protein (HSP) 16kDa antigen peptide presented by the major histocompatible complex (MHC) HLA-A*2, HLA-A*11 and HLA-A*24 were used in this study. The 16 kDa antigen heat shock protein is responsible for the survival of the TB bacilli during dormancy, making the protein a suitable candidate for latent tuberculosis investigation. Target peptide-MHC complexes were generated via a UV-mediated peptide exchange process. Prior to peptide exchange, UV-sensitive photolabile peptide-MHC complex of all three HLAs were formed by refolding each of the HLA heavy and 2M light chains along with a UV-sensitive peptide. Upon UV exposure, the photolabile peptide was cleaved at the UV-sensitive amino acid site allowing the exchange of 16 kDa antigen target peptide to form the 16 kDa target peptide-MHC complex.', 't-cell-receptor tuberculosis human', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2019', 0),
(49, 'Anis Suriani Ibrahim', 'Carbon Dioxide, Energy Fluxes And Evapotranspiration Of The Oil Palm Canopy On Mineral Soil', 'The research work focuses on the measurements of carbon dioxide flux, en-ergy fluxes and evapotranspiration of the oil palm canopy for oil palm trees planted on mineral soil. The first aim of this research is to assess the responses of the oil palm canopy (in terms of carbon dioxide flux) to changes in meteorology and season while the second aim is to assess the performance of the evapotranspiration models (Penman-Monteith and Bowen Ratio Energy Balance) for the oil palm canopy. The sampling was conducted over a 25-month period using 30-min averaging time of eddy covariance method in Keratong, Pahang. Results show that the oil palm is very productive tropical C3 plant in which it assimilates 4.3 mol m2 s1 (60 t ha1 yr1) of carbon dioxide from the atmosphere. The monsoonal (the Northeast and South-west monsoons) and the diurnal variations of carbon dioxide flux, energy flux and evapotranspiration exhibit notable patterns. On the monsoonal timescale, the varia-tions in the net radiation and the vapour pressure deficit leads to the increase in car-bon dioxide assimilations. The vapour pressure deficit threshold for the stomata was also observed to be >2000 Pa and >1000 Pa for the Southwest and Northeast mon-soons, respectively. The evapotranspiration models performance analyses show that the Penman-Monteith model tend to underestimate the actual evapotranspiration by 2% while the Bowen Ratio Energy Balance model overestimate actual evapotranspi-ration by 17%.', 'carbon-dioxide evapotranspiration oil-palm', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2019', 0),
(50, 'Rozaidy Mahadi', 'The Role And The Process Of Institutional Entrepreneurship In The Implementation Of Accrual Accounting By The Malaysian Federal Government', 'Recognising that accounting change is a complex process involving different types of forces and agents, there is an urgency to explain how accrual accounting as a product of change is able to become a catalyser for institutional reform through the process of institutional entrepreneurship. Hence, this study integrates multiple strings of institutional theory, namely, logics, institutional entrepreneurship, and rhetoric to explain how the Accountants General Department (AGD) initiated accrual accounting change in Malaysias federal government and institutionalised it. The study adopted an interpretive case study as the researchs methodological paradigm. From the case findings, it can be seen that there are two exogenous forces that pushed the federal government to adopt accrual accounting in the Malaysian federal government, and both forces concomitantly worked at the same. The inducement of both exogenous forces in the field has redefined the institutional logics at both federal and departmental levels. Subsequently, isomorphism pressures pushed the federal governments logic from bureaucracy to managerialism, and the transformation of the federal government logic subsequently influenced the assimilation of public sector accountants logic from scorekeeper to professionalism-bureaucracy logic. Hence, due to the AGDs location in a highly embedded field, the adoption of professionalism-bureaucracy logic did not significantly enhance the AGDs roles and functions in the government.', 'entrepreneurship accounting government', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business) ', '2019', 0),
(51, 'Zubair Mahmood', 'The Uses And Gratifications Of Facebook.Com: An Exploratory Study Of University Students In Pakistan', 'Facebook has a high penetration rate among university students in the Pakistan, yet few academic studies seek to theoretically understand its popularity and uses. This study explored university students\' uses and gratifications of Facebook.com. The Uses and Gratifications Theory (U&G) approach is applied in this research because it has been tested by previous researchers, that with the U&G principle, users can gratify their needs through the very process of using a medium (Cutler & Danowski, 1980). The concept of an active audience, as active receivers with purposive media uses, is the core tenet of the adaptation of theory U&G perspective, and augments its application to the study of Facebook. The focus of study was to explore: (1) the patterns of using Facebook among university students in Pakistan (2) the needs of university students as gratified by using Facebook in Pakistan (3) the benefits of using Facebook among university students in Pakistan and (4) the motivations which induce students to use Facebook. This study utilized the U&G approach as introduced by Katz, Blumler, & Gurevitch, (1974) to understand the appeal of mass media to the audience, as well as the assumptions that are particularly applicable to interactive media. The Qualitative approach was used for this study and for the focus group discussion technique for data collection. A constant comparative technique method was applied for the analysis of data collected from 8 focus group discussions from the top three research based universities in Pakistan: University of Punjab, Lahore, Quaid-i-Azam University, Islamabad, and Agricultural University of Faisalabad.', 'uses gratifications facebook', '', 'Pusat Pengajian Komunikasi (School of Communication)', '2019', 0),
(52, 'Shanmugapriya', 'Molecular Characterization And Bioinformatics Analysis Of Microrna-221-5p Regulated By Standardized Polyalthia Longifolia (Sonn.) Thwaites Leaf Extract In Hela Cell Lines', 'Polyalthia longifolia (Sonn.) Thwaites is an exquisite plant species with rich ethnomedicinal values. Recent scientific investigations on P. longifolia leaf extract have also revealed its anti-cancer property against HeLa cells through the induction of caspase-dependent apoptosis by regulating microRNA (miRNA) expressions. However, there were no further investigations performed to report the functional analysis of the regulated miRNA, with absolutely no means of scientific evidence of validation of miRNA dysregulation in HeLa cells treated with the methanolic P. longifolia leaf extract. Hence, this study was conducted to validate the miRNA expression in methanolic P. longifolia leaf extract treated HeLa cells in comparison with untreated HeLa cells with an intricate elucidation of functional and proteomic analysis of miRNA expression. In this study, methanolic P. longifolia leaf extract was freshly prepared and MTT assay was performed to identify the IC50 value against HeLa cells. The expression of miR-221-5p was validated by performing Taqman real time RTqPCR which confirmed the down-regulation of miR-221-5p in HeLa cells treated with methanolic P. longifolia leaf extract compared to the untreated HeLa cells. The functional analysis of miR-221-5p was conducted through gain-of-function and loss-of-function approach by MTT assay, flow cytometric analysis of Annexin V/ Propidium Iodide assay and caspase-3 assay.', 'microrna-221-5p polyalthia-longifolia leaf-extract', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2019', 0),
(53, ' Ahmed Housni Ahmed Al Sswey', 'Development And Evaluation Of Culture-Based Mhealth User Interface Guidelines For Elderly Arab Users', 'Despite the extensive availability of mobile applications in the Arab world, the relationship amongst its culture, mobile user interface (UI) elements and elderly Arab people has not been thoroughly explored. Moreover, the Arab world lacks usability guideline to support usable and effective mobile app UI design, which has resulted in low acceptance and satisfaction. This study involved the development and evaluation of culture-based UI guidelines and mobile applications for elderly Arab users. A preliminary study involving 40 elderly Arab users was carried out to (i) identify the usable elements of mobile UI and the current problems they encountered when using mobile apps, and to (ii) investigate their suggestions regarding the cultural values of these UI elements. From the preliminary work, ten UI elements and six problems encountered by them were identified. Then, these UI elements and problems were mapped, and all the possible combinations of UI components, cultural aspects and usability components were analysed in drafting a guideline. The final guideline was grouped into five distinct categories involving 40 UI design guidelines and 26 guidelines for the problems encountered by elderly Arab users when using mobile apps. Rapid Development Model together with the Unified Modelling Language was then applied to design and develop a mobile health (mHealth) app based on the guidelines.', 'development culture interface', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia) ', '2019', 0),
(54, 'Syatirah Binti Mat Zin', 'Malay Language Consonants Contact Pattern Based On Electropalatography Epg3 And Flex Epg System', 'Electropalatography (EPG) is a medical instrument used in detecting contact pattern between the tongue and hard palate during a continuous speech. EPG contact pattern was built as a guideline for speech study and can be used to guide speech therapist during a treatment. In this study, the EPG3 system is used as an instrument for developing the Malay language consonants contact pattern. Thirty (30) Malay subjects without speech or hearing difficulties were selected in this study. All subjects were required to wear Reading palate and produce 15 Malay consonants in this study. The results indicate in the production of bilabial, velar and glottal cosonants, more contacts were located at the posterior of the hard palate. Meanwhile, in the production of alveolar and postalveolar consonants, the contact pattern were more on the anterior part of the hard palate. Besides, the design and development of new EPG system, namely Flex EPG system was also included in this study. The new EPG system features a Bluetooth technology, which overcomes the major lack of the EPG3 system. The development architecture of the Flex EPG system can be classified into two parts which are the Flex EPG hardware components and the Flex EPG software configuration. Additionally, the Flex EPG hardware consists of the Flex EPG palate and the electronic circuit. For the data collection, the Flex EPG palate was used to detect the tongue and hard palate contact by identifying the electrodes signal. The patterns of the contact are transmitted to a computer for display, storage, and analysis via a Bluetooth module.\r\n\r\n', 'malay-language electropalatography system', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2019', 0),
(55, 'Hidayani Binti Jaafar', 'Modified Dye-Sensitized Solar Cell (Dssc) For Enhancement Of Photovoltaic Properties', 'Dye-sensitized solar cells (DSSC) are promising low-cost photovoltaic devices that have a good chance to become a competitor to p-n junction solar cells based technology. DSSCs are fabricated from abundant and cheap materials via inexpensive processes and are likely to be a significant contributor to the future commercial photovoltaic technology. Therefore, by using natural dyes as sensitizers is one of the alternative ways to reduce the fabrication cost of DSSC. However, the efficiency () of these natural dyes is still low (<2 %) compared to the existing solar cell technology. Therefore, the aim of this work is to optimize DSSC capability by identifying the most suitable natural dyes to be used as sensitizers and coupled with further improvement through the modification of both photoanode and counter electrode in order to enhance the photovoltaic properties using natural dye. There are four phases in this study. For first phase, E. conferta and G. atroviridis were selected as natural dyes to be used as sensitizers. Efforts are tried to enhance the device performance but at the same time used of low cost sensitizers. E. conferta has been selected due to better photovoltaic properties and produced better  (1.18%) compared to G. atroviridis (0.85%). In second phase, modification of photoanode for enhancement of photovoltaic properties using E. conferta with different amount Nb-doped TiO2 (05 wt% of Nb) were synthesized via solid state technique. By doping with 1.0 wt% Nb-doped TiO2, the  increased to 1.40%. In third phase, further modification in counter electrode using carbon black-TiO2 composite was investigated. In this phase, three parameters were varies which are different amount of carbon black, different sintering temperature and different sintering time for carbon black-TiO2 composite counter electrode. DSSC-based on 15 wt% of carbon black-TiO2 composite counter electrode reached the highest  (2.5%) by using E. conferta as sensitizer. Upon modification of sintering parameter at 525 C for an hour,  increased to 2.77%. Therefore, by using E. conferta as natural sensitizer,  has increased to almost 3% when integrated with modified photoanode (1.0 wt% Nb-doped TiO2) and counter electrode (15 wt% carbon black-TiO2 composite that sintered at 525 C for an hour).', 'dye-sensitized photovoltaic properties', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2019', 0),
(56, 'Azduwin Binti Khasri', 'Activated Carbon Derived From Pentace Triptera, Intsia Bijuga And Hevea Brasiliensis Sawdust Via Microwave-Induced Potassium Hydroxide Activation For Dyes Adsorption', 'Synthetic dyes are widely applied in various industries which has resulted in the water pollution. Therefore, this study aims to synthesis activated carbon (AC) from Pentace triptera (PS), Intsia bijuga (IS) and Hevea brasiliensis (HS) for blue (MB) and remazol brilliant violet 5R (RBV) dye adsorption via microwave-induced potassium hydroxide (KOH) activation adopted together with carbon dioxide (CO2) gasification. Optimum preparation conditions for all ACs prepared were determined using response surface methodology (RSM). ISAC showed high Bruneaur-Emmet-Teller (BET) surface area and total pore volume of 952.23 m2/g and 0.584 cm3/g, respectively compared to PSAC and HSAC. All adsorbents best fitted to the Langmuir isotherm model with ISAC showed higher maximum monolayer adsorption capacity (Qm) of 434.78 and 212.77 mg/g, respectively for MB and RBV dye at 30C. Kinetic studies showed that all system followed a pseudo-second order model with film diffusion was the rate-limiting step controlling adsorption. Thermodynamic studies confirmed that all systems were endothermic in nature. For the column studies, the better correlation of breakthrough data shown by Thomas and Yoon-Nelson model. The ACs had good reusability performance for MB and RBV adsorption especially up to three cycle using ethanol as solvent.', 'activated-carbon microwave adsorption', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2019', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(57, 'Mairo Hamid Ipadeola', 'The Impact Of The Social Inclusion Awareness Module On The Attitude And Knowledge Of Students In Nigeria', 'People with disabilities (PWD) throughout history have been subjected to a multiplicity of oppressive social attitude which include neglect, rejection, hostility, bullying, distrust, pity and over-protection among others (WHO, 2011) while lack of knowledge informed these attitudes. The study set out to study the impact of the Social Inclusion Awareness Module (SIAM) on the attitude and knowledge of students in Nigeria. The SIAM was developed using ADDIE instructional design. A sequential mixed method design was applied in this study. The qualitative approach used phenomenological research design, with a face to face interview involving fourteen (14) students with disabilities and eleven (11) regular students purposefully selected from one institution in Nigeria. The qualitative data were analysed by thematic analysis and the findings revealed that Student with disabilities (SWD) expressed reduced social inclusion in terms of social participation, economic access, physical/environmental access and supportive /valued social relationships, this was due to lack of public enlightenment and inavailability of facilities to reduce the impact of disability. SWDs proposed education for the public (society) and provision of equipment / facilities as solution to social inclusion. The quantitative approach used a single group method of quasi experimental design involving pre-test, intervention and post-test. Questionnaire was used for the pre-test and post-test, eight (8) weeks intervention of SIAM module was taught through lecture method to 491 students The data was analysed using descriptive statistics and paired t-test.', 'social inclusion attitude ', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2019', 0),
(58, 'Fatimatuzzahra Abd. Aziz, ', 'Predicting Gentamicin Induced Nephrotoxicity Using Pharmacometabonomic Approach', 'Gentamicin has been one of the most widely used antibiotics. However, its nephrotoxicity is a major concern as it is filtered through the kidneys for excretion in the form of urine. However, early diagnosis is difficult and no reliable metabolites as biomarkers are currently available. Thus, in this study, a pharmacometabonomic approach using nuclear magnetic resonance (NMR) spectroscopy to investigate the altered metabolic pattern in serum and urine samples prior to administration of gentamicin has been employed to develop a model to predict nephrotoxicity induced by gentamicin and to identify the metabolic biomarkers associated. The aim of this study is therefore to determine the potential of urine and serum metabolites in predicting gentamicin induced nephrotoxicity.', 'gentamicin nephrotoxicity pharmacometabonomic', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2019', 0),
(59, 'Mahsa Yousefi Borbori', 'Extraction Of Collagen From Quail (Coturnix Japonica) Feet: Characterization And Development Of Electrospun Nanofibers', 'Poultry processing plants produce a huge amount of wastes. The discharge of these amounts of wastes has raised serious concerns regarding their environmental impacts, diseases, and loss of valuable biological resources like proteins and lipids. Utilization of these by-products for producing value-added products may offer a feasible and economically viable solution. This line of thought led to the research on the by-products as sources of collagen. In this study, quails feet from poultry processing by-products was utilized as a new source of collagen along with other applications such as electrospun nanofibers. In this way, acid and pepsin soluble collagens and also lactic acid and lactic acid pepsin soluble collagens were extracted from quails feet and characterized. The physicochemical, thermal and morphological properties of the extracted collagens are investigated. The electrophoretic patterns indicated that all samples were type-I collagen with three different chains. Amino acid analysis demonstrated that the imino acid contents of the samples are higher than those of calf-skin, pig-skin, and chicken feet collagens. The FTIR spectra suggested that the extracted collagens were in triple-helical structure. The zeta-potential analysis is shown the isoelectric points of the collagens are in the pH range of 5.24-5.61. Differential scanning calorimetry and thermogravimetric analyses indicated that the extracted collagens had higher thermal stability in comparison to calf-skin and pig-skin collagens. The result showed that the correlation between the thermal stability of collagen and the imino acid content.', 'collagen electrospun nanofibers', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2019', 0),
(60, 'Chu Shi Wei ', 'Assessment Of Quality Standards Of Supported Employment By In-House Job Coaches And Employees With Disabilities', 'Quality standards of supported employment are established for individuals with disabilities in many developed countries. In Malaysia, however, there is still no assessment of quality standards since the beginning of supported employment 10 years ago. The purpose of this study is to assess the quality standards of supported employment by in-house job coaches and employees with disabilities based on a developed model of quality supported employment in Malaysia. The objectives are to assess quality standards from three key dimensions which are organization, job coach service and outcomes. Furthermore, the predictors of outcomes are identified. The correlations in the assessment between job coach and employee with disabilities are identified. A mixed method research design which includes primarily quantitative research methods as well as qualitative research methods was utilized to collect data from 16 companies which provides in-house job coaching services and employment to employees with disabilities. The sample of the study includes 173 in-house job coaches and 173 employees with disabilities. A Quality Standards Framework for Supported Employment in Malaysia (QSFM) was operationalized into the Quality Supported Employment (QSE) Instrument for the purpose of the assessment. The results of the study indicated that the organizations surveyed were of the view that the quality standards of supported employment were good. Findings also included predictors of quality outcomes of supported employment which were the management and leadership of the organization, the intensive support at the workplace and follow-up services.', 'employment in-house disabilities', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2019', 0),
(61, 'Chuah Hui Wen', 'Antecedents And Outcomes Of Customer Engagement Behavior In The Airline Brand Fan Pages', 'The dynamic, ubiquitous, and real-time interaction enabled by social media has revolutionized marketing practices and consumer behavior; offering new ways to gather and share information and most importantly, opening new engagement and collaboration possibilities. Although the possibilities provided by social media seem to be endless, companies often find it challenging to leverage these opportunities to engage with customers and influence their behaviors. To fully exploit the capabilities of social media and the associated benefits, understanding what stimulates customer engagement behavior is imperative. To this end, this study develops a theoretical framework to elucidate the antecedents and outcomes of customer engagement behavior in the airline brand fan pages (BFPs), grounded in various theoretical premises and literatures. The model was assessed using partial least squares-structural equation modeling (PLS-SEM) with a sample of 368 fans of the Malaysian airline Facebook pages. Four key findings are derived. First, customers prior gratifications of BFP uses and brand perceptions complement and interact with each other in shaping customers prior engagement with the BFPs. In other words, prior brand perceptions moderate this relationship. Second, customers engagement with the BFPs prior to the exposure to corporate social responsibility (CSR) activities carries over to influence their (future) engagement behavior. Third, perceived CSR-brand fit acts as a stimulus for customer engagement behavior and self-brand integration is the underlying psychological mechanism (mediator) that facilitates this process.', 'customer engagement airline-brand', '', 'Pusat Pengajian Pengurusan (School of Management)', '2019', 0),
(62, 'Wan Maisara Binti Wan Mohamad', 'The Influence Of Organizational Innovative Climate, Knowledge Sharing And Work Engagement On Innovative Behavior Among Engineers In Electrical And Electronic Mncs In Malaysia.', 'The importance of innovative behavior among engineers currently is vital and competition based on innovation can serve as a basis for sustainable development, especially for multinational companies in Electrical and Electronic sector in Malaysia. Grounded by the social cognitive theory, this study utilized a research model examining organization innovative climate factors (support for innovation, competitiveness, and performance orientation), individual factors (altruism, knowledge self-efficacy, reciprocity, reputation, and trust), and ICT use as predictors of innovative behavior with knowledge sharing (knowledge giving and knowledge receiving) as mediating variables. In addition, work engagement (vigor, dedication, and absorption) as moderator to strengthen relationship between knowledge sharing (knowledge giving and knowledge receiving) and innovative behavior.', 'innovative climate engagement', '', 'Pusat Pengajian Pengurusan (School of Management)', '2019', 0),
(63, 'Aminu Nafiu', 'Development And Evaluation Of Nanogel System Loaded With Triclosan And Flurbiprofen For Treatment Of Periodontitis', 'Periodontitis is a highly prevalent major dental disease that affects millions of people around the globe. Anaerobic gram-negative bacteria and its toxins have been strongly implicated as a prime cause of the disease. A great number of local drug delivery systems have been proposed, but they were mainly made to focus on killing the causative microbes rather than also targeting the inflammation which also plays a significant role in the aetiology of the disease. Moreover, there is difficulty in accessing the periodontal pocket and attaining adequate residence time by these systems, hence being only partially successful. Therefore, the aim of this study was to formulate and evaluate a novel biocompatible nanogel (NG) co-loaded with triclosan (TCS) and flurbiprofen (FLB) for effective intra-pocket treatment of periodontitis. TCS and FLB are highly crystalline compounds and practically insoluble in water. These properties restrict delivery of their pure forms into the periodontal pocket, hence warranted their formulation into a nanoparticulate system. HPLC method development, compatibility study, nanoparticles (NPs) and NG development were performed. The formulations were extensively characterised by scanning electron microscopy (SEM), transmission electron microscopy (TEM), particle size, polydispersity index (PDI), zeta potential, differential scanning calorimetry (DSC), X-ray powder diffraction (XRPD), fourier transform infrared spectroscopy (FTIR), rheology, swelling, erosion, bioadhesion, in vitro release, antimicrobial, stability and in vivo studies. The developed HPLC method was able to successfully separate and quantify TCS and FLB at retention times (tR) of 12.5 and 10.1 min, respectively.', 'nanogel treatment periodontitis', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2019', 0),
(64, 'Mustaqqim Bin Abdul Rahim', 'Performance Of Reinforced Concrete Beam With Embedded Galvanized Steel As Lightning Down Conductor Cable', 'Due to current problem with existing lightning protection systems such corrosion and stolen cable, a new system that can be installed within concrete structures has been introduced by the International of Electrotechnical Commission (IEC). However, detailed installation guidelines were not provided and previous study indicated that improper installation techniques and unsuitable materials embedded inside the concrete structure could cause physical damage to the concrete. Therefore, a newly proposed arrangement of galvanized steel cable was studied in this research. The impact of lightning simulation towards the concrete beams was determined. Concrete beams of 200 x 300 x 1200 mm sizes were used and several tests were conducted in order to investigate the performance of concrete beams. It was found that; very minimum temperature increases inside the concrete beams that were charged with high electric current. From the frequency test, reduction of natural frequency before and after the lightning simulation can be assume as negligible.', 'concrete-beam galvanized conducter-cable', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2019', 0),
(65, 'Zainatul Asyiqin Binti Samsu ', 'Enhanced Rhamnolipid Production From Waste Cooking Oil By Pseudomonas Aeruginosa Usm-Ar2', 'Rhamnolipid, a glycolipid type of biosurfactant is the most investigated glycolipid biosurfactant. The problem of this study was the waste cooking oil used as a major carbon source is immiscible in aqueous phase and inhibited the growth of the microorganisms studied which is Pseudomonas aeruginosa USM-AR2. The ultimate aim is to enhance microbial production of rhamnolipid on a lab-scale. Thus, the appropriate feeding strategy for fed-batch culture needs to be determined to increase the availability and subsequent intake of the carbon source by the microorganisms. Several objectives have to be met to ensure this strategy is achievable, which include: 1) to evaluate and select different medium formulation from literature.; 2) to determine the effect of operational conditions on rhamnolipid production and the behaviour of oxygen transfer in batch culture; 3) to analyse the kinetics of rhamnolipid production in batch culture; and 4) to identify the best feeding strategy to improve rhamnolipid production in fed-batch culture. Results showed that the modified medium composition to support rhamnolipid production contained the following: NO3-, Mg+, K+, PO43-, trace elements and waste cooking oil with C/N equivalent to 18. The addition of Tween 80, a commercial surfactant, into the medium showed no significant impact on rhamnolipid production. In a bench-top bioreactor, the agitator tip speed affected rhamnolipid production. Rhamnolipid production at a lower tip speed (1.131 m/s) was 1.5-fold higher than production at a higher tip speed (1.414 m/s). Rhamnolipid production achieved the maximum concentration of 4.86 g/L (0.041 g/L.h of the overall productivity) when the production medium was controlled at pH 6.85.', 'rhamnolipid waste cooking-oil', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2019', 0),
(66, 'Rashida Sharmin', ' Effect Of Sentiment On Stock Returns: Evidence From The Gulf Cooperation Council Stock Markets', 'Researchers have reported a significant influence of sentiment in many developing and developed markets. Due to the limited access for foreign investors, the US$900-billion-dollar GCC (Gulf Cooperation Council) regional market has failed to attract foreign investors in the past. These cannot develop unless foreign investors are interested. To attract foreign investors, the influence of sentiment on these markets need to be investigated in details. The objectives of the study are (i) to identify the influence of local sentiment in the GCC stock market, (ii) to determine the effect of firm characteristics on the relationship between the stock returns and sentiment, (iii) to detect any asymmetric effect on stock returns with respect to a shock to sentiment, and finally (iv) to investigate the influence of regional and global sentiment on the GCC markets.', 'effect stock returns', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2019', 0),
(67, 'Elkhanssa Abdelhameed Ahmed Elhag', 'Identification Of Barriers To Effective Treatment And Prevention Of Malaria In Khartoum, Sudan', ' Malaria is one of the main causes of death in Sudan. The highest prevalence is among children and pregnant women. The estimated deaths were 3500 cases per year. Near thirteen percent of the hospital admissions were due to malaria. Despite the achievements of the National Malaria Control Programme in Sudan, still the targets on eradication and elimination were not reached. The current research was carried to identify the barriers to effective prevention and treatment of malaria in Sudan. The research was conducted in Khartoum state. A prospective cross-sectional survey was carried to assess the community pharmacists practices of malaria prevention and treatment. The public in Khartoum were also assessed for their malaria knowledge in addition to their prevention and treatment practices. Malaria treatment in a public hospital was also investigated retrospectively and prospectively. The results showed that community pharmacists had inadequate malaria knowledge and malaria treatment practices. About 66.2% of the surveyed community pharmacists had less than 50% knowledge score. There was significant relationship between pharmacist knowledge score and receiving training on malaria prevention and treatment (P-value 0.008). The research revealed under reporting of antimalarial adverse drug reactions (ADRs) by the community pharmacists. The community pharmacists reported lack of knowledge, lack of training and time as main barriers to their effective contribution in malaria prevention and treatment and ADRs reporting activities. The publics in Khartoum showed good knowledge regarding malaria symptoms, complications and drugs. About 86.9% mentioned mosquitos bites as the main cause of malaria.', 'treatment prevention malaria', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2019', 0),
(68, 'June Chiang Kai Sing', ' A Stylistic Analysis Of Selected Graded Readers And Chinese Second Language Learners Aesthetic Response Towards Selected Stylistic Devices', 'Mostly used in extensive reading programmes, graded readers (GRs), which come under the umbrella of language learner literature (LLL), are weighted with the obligation to engage second language (L2) learners. Many publishers of GRs focus on strong plots using reduced language code to achieve this objective; however, there are stakeholders who recognise the importance of retaining good natural literary discourse. Rosenblatt\'s transactional reader response theory and Miall and Kuiken\'s foregrounding theory support the notion that stylistic devices have the capacity to create evocation in the reader which could heighten the aesthetic or pleasurable reading experience. Taking this into consideration, the study examined the effect of literariness in GRs for them to be considered good by investigating the extent of employment of selected stylistic devices in GRs that are considered good (awardwinning GRs) and that are considered less good (non-award winning GRs) to determine the importance of literariness in making successful GRs. The study also compared Chinese L2 learners aesthetic response towards texts without and with selected stylistic devices . As such, the study was a two-phased investigation. To examine the GRs (phase one), a stylistic analysis was carried out to compare the occurrence of figures of speech, the selected style markers, in three award and six corresponding non-award winning texts.', 'graded-readers second-language devices', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2019', 0),
(69, 'Siti Salina Binti Saidin', 'Antecedents And Consequences Of Cyberloafing Among Knowledge Workers In Malaysian Msc Status Companies: The Moderating Effect Of Duration On Cyberloafing Breaks', ' This study examines and validate a reseach model in order to understand the actual cyberloafing behavior among knowledge workers in Malaysian MSC-status companies by adopting the Theory of Interpersonal Behavior (TIB) for the antecedents of cyberloafing (intention to cyberloaf, habit, facilitating condition and ability to hide cyberloafing) and the Consequences of Deviant Usage of Internet Technology (DUIT) in order to investigate the consequences of cyberloafing in terms of work productivity, work stress and online security threats to the organizations. Precisely, this study also investigates whether duration of cyberloafing break moderates the relationship between actual cyberloafing behavior and knowledge workers\'work productivity as well as the relationship between actual cyberloafing behavior and knowledge workers\' work stress. 264 usable data was obtained through online survey and paper-based survey from knowledge workers in Malaysian MSC-status companies, and twelve hypotheses were tested. Partial Least Squares Structural Equation Modeling (PLS-SEM) was utilised to verify the research model in this study. The results show that affect, social factor and perceived consequences were significant belief dimensions of intention to cyberloaf. The intention to cyberloaf, habit and ability to hide cyberloafing were found to be significant antecedent of cyberloafing. However, facilitating conditions was found insignificant as the predictor of cyberloafing. Additionally, work productivity and work stress were found to be significant consequences of cyberloafing. However, online security threat to the organizations was not significant as the consequence of cyberloafing.', 'antecedents consequences cyberloafing', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2019', 0),
(70, 'Molood Seifi', 'Natural And Mechanical Security Attributes For House Break-In Prevention In Penang Hotspots', 'An extensive body of knowledge supports the effectiveness of crime prevention through environmental design (CPTED) on house break-in prevention. CPTED consists of natural attributes which are provided by designing the elements of the house in such a way to prevent break-ins and mechanical attributes which include after built security installations such as alarms and CCTV. However, most studies have focused on the overall effect of CPTED on house break-ins. They have overlooked the individual effects of the natural & mechanical indicators & dimensions of CPTED. Therefore, more comprehensive research is required to explore the effect of natural CPTED versus mechanical CPTED. Hence, this study examined the impact of the natural and mechanical indicators and dimensions of CPTED on house break-in prevention. According to the literature, the ideal data for such a study could be obtained from the detached houses located on the hotspots which attract a higher number of break-in incidences. Hence, the house break-in data from the Penang Islands police headquarter was mapped and analysed using the geographic information system and hotspot analysis technique. Consequently, neighbourhood A was selected as the study area possessing a high demographic number of detached houses. A questionnaire survey was administered to 194 randomly selected residents of the neighbourhood out of which 57% responded. 111 questionnaires were returned out of which 106 were complete and usable.', 'security house break-in', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2019', 0),
(71, 'Ali Safaei', 'Adaptive Model-Free Control And Localization For Single-Agent And Multi-Agent Nonlinear Dynamic Systems', 'In this thesis, a unified solution comprising model-free control and localization algorithms is presented to address the tracking problem in single-agent completely unknown nonlinear dynamic systems, the formation-tracking problem in multi-agent completely unknown nonlinear dynamic system, and the cooperative localization problem for a team of mobile agents. The formulated model-free control algorithms, neither rely on the universal approximation characteristic of the artificial neural networks nor regressor-based approximation.', 'model-free localization nonlinear', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2019', 0),
(72, 'Mohammad Ghazi Bin Ismail', 'Efisiensi Pengurusan Air Tidak Berhasil (Nrw) Di Negeri Kelantan; Kajian Kes Bechah Tendong', 'Negeri Kelantan mencatatkan kadar NRW tinggi setiap tahun ke belakangan ini. Antara kawasan yang mencatat paras NRW tertinggi ialah Bechah Tendong dengan nilai 62%. Kajian ini bertujuan mengenalpasti permasalahan NRW, implikasi kewangan, menilai tahap kesedaran awam dan membangunkan SOP komprehensif. Analisis data kualitatif telah dilakukan menggunakan Perisian QSR Nvivo. Nisbah faedah-kos (BCR), Tempoh bayar balik (PBP), Pulangan atas pelaburan (ROI), Nilai kini bersih (NPV) digunakan bagi penilaian ekonomi. Hasil analisis Nvivo mendapati isu yang paling dominan dan memberi kesan besar dalam pelaksanaan NRW adalah berkaitan dengan pelaksanaan kerja, kekangan dalam melaksanakan kerja dan kontrak serta kurang kefahaman konsep pengurusan NRW yang menjadi isu besar kepada kegagalan pelaksanaan NRW dengan berkesan. Nilai indikator ekonomi yang diperoleh adalah BCR= 1.03, PBP = 9.32, ROI (%) = 6.40 dan NPV= RM 405,576.82. Berdasarkan analisis kolerasi, hubungan paling signifikan diperolehi di antara masalah sikap dan undang-undang dengan nilai pekali korelasi pearson, r=0.364. Hasil kajian menunjukkan paras NRW semasa berjaya dikurangkan sebanyak 17.35% iaitu daripada 62% menjadi 44.65% bagi tempoh 5 tahun (2014-2018). Kesimpulan, kajian ini mempunyai potensi untuk menjana pendapatan melalui penjimatan kepada pihak berkaitan. Seterusnya, merealisasikan hasrat keefisienan pengurusan NRW dicapai.\r\n\r\n', 'efisiensi pengurusan air', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2018', 0),
(73, 'Mustaffa Ali Azhar Bin Taib', 'Formation Of Tio2nanotubular Structure In Fluorinated Ethylene Glycol Electrolytes Containing Additives By Anodisation', 'TiO2 nanotube arrays (TNTs) have attracted significant interest as the most promising candidate for photo-induced reaction applications. The electrolyte composition is the one of critical factor for oxide formation by anodisation. The TNTs were fabricated in ethylene glycol (EG)/ ammonium fluoride (NH4F) electrolyte containing various additives (H2O, H2O2, KOH, LiOH and Na2CO3) as O2- and/or OH- providers. The properties including morphology, structural of formed oxide and crystallinity were investigated. The TNTs formed in EG/NH4F/H2O2 resulted in grassy structure (wall thickness ~ 10 nm) owing to high chemical etching at the tip of nanotubes. The TNTs formed in EG/NH4F/KOH electrolyte was partially crystalline with average tubes length 6.1 m. The OH- ions suppress the excessive surface etching at the tips of nanotubes. Meanwhile, the addition of Na2CO3 in EG/NH4F electrolyte was successfully formed as-anodised free standing TNTs (FSTNTs) due to gas evolution which aids in weakening the adherence of anodic film on Ti. The as-anodised FSTNTs contain nanocrystallite anatase. The grassy TNTs demonstrated the highest c decolouration efficiency of MO (91.7%) after 2 h owing to the capability of anatase phase to retain at 600 oC at the tip of grassy structure.', 'tio2nanotubular additives anodisation', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2018', 0),
(74, 'Koh Chin Kok', 'Modified Statistical Process Control For Short Runs Test And Measurement Process To Reduce False Alarm', ' The key characteristics of test and measurement (T&M) manufacturing are short production runs, multi-product families and testing at multi-stations. Classical Shewhart control charts, namely x chart and R chart have been widely used in statistical process control (SPC). Short production runs in T&M render these charts inefficacious as inherent meager data do not warrant meaningful control limits. Measurement errors increase the risks of false acceptance and rejection, thereby leading to consequences such as unnecessary process adjustment and loss of confidence in SPC. Industry practice allows the installation of Guard band, e.g., through Guide to the Expression of Uncertainty in Measurement (GUM) to reduce the width of acceptance limit, as an indirect way to compensate the measurement errors. Past related works which presented standardized observations technique is highly recommended due to its simplicity and practicality. However, the concern is that this technique requires sufficient data to calculate the control limits and it does not deal with the effect of measurement errors. Based on this premise, the research objective is to develop a modified SPC model by considering measurement uncertainty in modified control charts (Z chart and W chart) for short runs T&M process in multi-stations. The implementation of this model involves two phases. Phase I retrospective analysis computes the input parameters, such as the standard deviation of the measurement uncertainty, measurement target and estimate of the population standard deviation. Thereafter, Five-band setting and Sfactor are proposed to estimate process standard deviation to maximize the the opportunity to detect assignable causes with low false-reject rate. Lastly, the modified Z chart and W chart are generated in Phase II using standardized observations technique that considers the measurement target and the estimated process standard deviations. Run tests based on Nelsons rules to interpret the control charts. In terms of validation, three case studies, labeled as Case I, Case II and Case III were conducted with different ratios of standard deviations in measurement uncertainty and population to demonstrate the effectiveness of the proposed model. A complete years data samples were collected from products tested at multi-stations in a T&M manufacturing facility at Bayan Lepas, Penang. For Case I with the measurement error is negligible and does not affect the process standard deviation; the results indicate that there were no false alarm points found in all methods. In Case II with the measurement error may noticeably affect the process standard deviation, and the results show that the model with Five-band setting and S-factor reduced the false alarm rate by 100% in comparison to the classical Shewhart method, except for the Five-band setting which has a smaller sustained shift (25% false alarm) was falsely detected in station WH05. In Case III with the measurement error is relatively larger and appeared to be more significantly affecting the process standard deviation; the results reveal that both proposed methods performed well in modified Z and W charts, which reduced false alarm rate by 50% for station WH05, 0% for station WH06 and 37.5% for station WH07. As a conclusion, the research has proposed and demonstrated the modified SPC model can address the understudied issues caused by short production runs and measurement errors. The model is practical for T&M manufacturing to reduce false alarms and to prevent unnecessary process adjustment.', 'control measurement false-alarm', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2018', 0),
(75, 'Mohammed Abdel Lateif Al-Shalabi', 'Enhanced Technique For Maximizing Wireless Sensor Networks Lifetime Based On Utilizing The Phenomena Of Overlapping Nodes And Data Transmission', ' Wireless Sensor Networks (WSNs) have attracted the attention of the researchers in the last few decades due to their involvement in many applications such as monitoring environment, fire tracking, and health care monitoring. In WSN, sensor nodes are deployed on the target area to sense the required events. The deployment of nodes can be formal (in specific locations) or random (in random locations). In the WSN that uses the random deployment of nodes, one of the common problems, when the sensors are close to each other, is the overlapping between them. This overlapping causes sensing approximately the same data by different nodes and also the transmission of duplicate data to the Cluster Head (CH), which leads to more energy consumption. Another problem in WSNs is the direct transmission of data from a CH to the Base Station (BS), which also negatively influences the overall network lifetime. Moreover, the random selection of the CHs leads to select nodes with low energy to be CHs which reduces the network lifetime. This thesis intends to solve the overlapping between nodes and the direct data transmission using different mechanisms. In this thesis, a mechanism is proposed to prolong the network lifetime by reducing the negative effect of the overlapping problem and utilizing the overlapping nodes to maximize the efficiency of the network in terms of network lifetime and energy consumption. This mechanism considers the distance between nodes in an efficient way in order to identify the overlapping between them based on the nature of the application with considering the blind area of the overlapping nodes.\r\n\r\n', 'wireless overlapping transmission', '', 'Institut Penyelidikan Pendidikan Tinggi Negara IPPTN (National Higher Education Research Institute NaHERI)', '2018', 0),
(76, 'Nurbaizura Binti Borhan', 'The Effect Of Economic And Social Factors On Tourism Demand For Malaysia And Selected Neighbouring Countries', 'Tourism industry has become one of the important sectors in the ASEAN region. However, the growth in the number of tourist arrivals has reduced in recent years. Due to the economic importance of the tourism industry, this study investigates the long-run relationship and short-run dynamic between tourism demand with that of selected economic variables and social indices. Utilizing data from 23 countries, the variables employed in this study consist of four economic variables as well as five social indices and five one-off events. To achieve the objectives, the study has employed a few econometric techniques that include Engle-Granger (EG) 2-step procedure, autoregressive distributed lag (ARDL) modelling approach, static and heterogeneous panel data techniques and also Kalman filter (KF) estimation technique. The result of cointegration analysis revealed that there exist long-run relationship among the selected variables. The results from panel data techniques yield higher percentage of correct sign for the model coefficients with exchange rate and income level generally have positive impact on tourism demand. The relative price and substitute relative price are found to have a mixture of positive and negative impact. This study also revealed that the SARS outbreak, FLU pandemic and euro debt crisis have negative impact on the tourism demand for Malaysia while the H1N1 pandemic and global financial crisis do not have a negative impact on the number of tourist arrivals.', 'economic social tourism', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2018', 0),
(77, 'Nur Shuhaidatul Sarmiza Binti Abdul Halim', 'Cell-Based Therapy Of Human Adipose- Derived Mesenchymal Stem Cell Expressing Angiopoietin-1 In An Experimental Model Of Airway Inflammation', 'Cell-based therapy of mesenchymal stem cells (MSCs) has been shown to enhance the endogenous repair process by increasing the limited regenerative capacity of the lung in chronic lung disorders as well as following injury. However, the underlying cellular and molecular mechanisms of MSCs to enhance airway regeneration and repair are remain unclear. This study was aimed to investigate the effect of delivering human adipose-derived MSCs (hAD-MSCs) alone and in combination with vasculoprotective factor, the ANGPT1, by aerosol technique in a rabbit model of asthma related-airway inflammation. Given the anti-inflammatory, anti-permeability, and endothelial-protective characteristics of ANGPT1, we hypothesise that, combining MSCs with ANGPT1 offers promise in the treatment of airway inflammation. Transfection of hAD-MSCs with ANGPT1 was performed using microporation technique. For in vivo study, the rabbit were sensitised with combination of ovalbumin (Ova) and alum injection and further challenged with Ova inhalation to induce asthma-related airway inflammation. The MSCs and MSC-pANGPT1 were aerosolised directly into the airway using the MicroSprayer Aerosolizer 48 h after injury. Histopathological assessments of the airway inflammation along with local inflammatory responses were quantitatively measured at three days after cell delivery. To investigate the functional effect of MSCs on airway regeneration and repair, an indirect in vitro co-culture model of injured airway epithelium explant with MSCs was developed. Liquid chromatography-tandem mass spectrometry (LC-MS/MS) analysis was performed to determine the factors secreted by MSCs and their involvement in epithelium regeneration and repair was evaluated by histopathological assessment.', 'therapy derived expressing', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2018', 0),
(78, 'Marshina Juliza Bt Mohd Hasim', 'Attachment Dimensions, Patterns Of Interaction During Conflict And Marital Satisfaction Among Married Individuals', 'This study aims to create a comprehensive model integrating adult romantic attachment dimensions, patterns of interaction during conflict and marital satisfaction. The application of Attachment Theory in this study was established via two dimensions of anxiety and avoidance. This study comprises two parts. Part One of the study examined the relationship between individual respondents childhood attachment dimensions with mother, father, peers and adult romantic attachment dimensions. Part Two of the study sought to determine if adult romantic attachment dimensions acted as a predictor to marital satisfaction through the mediating role of communication patterns during conflict. By means of survey method, data was collected using self-reporting questionnaire involving 400 married individuals in the state of Penang. Partial Least Squares (PLS) analysis was employed and result from the analysis yielded all the constructs have composite reliability value of more than 0.6 and convergent and discriminant validity with an average variance extracted (AVE) value greater than 0.50. The final model in Part One and Part Two recorded high Goodness of Fit (GoF) values at 0.681 and 0.401 respectively. The first model in Part One predicting on adult romantic attachment dimensions showed a strong explanatory power with R2 values of 73% in anxiety with spouse and 63.9% in avoidance with spouse. Additionally, the second model in Part Two indicated slightly lower explanatory power with R2 value of 39.5% on marital satisfaction. The results of Q2 tests proposed for both parts are well predicted by the model.\r\n\r\n', 'attachment interaction marital', '', 'Pusat Pengajian Komunikasi (School of Communication)', '2018', 0),
(79, 'Noor Saifurina Binti Nana Khurizan', 'Integrated Multi-Criteria Decision Making  Data Envelopment Analysis Models In Efficiency Analysis Of Sponsored Research', 'In the context of higher education administration, specifically for sponsored research, efficiency analysis has become an essential process for both sponsors and researchers. The evaluation process will provide the information on research productivity in fully utilising the resource to produce the desirable outcome. It is easier to evaluate the sponsored research performance when its efficiency is represented by a single score. Over the years, many methodologies have contributed into assessing the performance of sponsored research. Among the most popular ones are Multi-Criteria Decision Making (MCDM) Method and Data Envelopment Analysis (DEA). MCDM and DEA method both deal with problems concerning multiple inputs and outputs. This factor is crucial in efficiency analysis as most case studies are presented with more than one resource and outcome. The main objective of this study is to evaluate the efficiency of sponsored research in a university subject to its data availability and number of Decision Making Units (DMUs). The integrated MCDM-DEA methods are presented in order to fulfill the requirement of the main objective. The first case study presents a novel way of integrating three different MCDM and DEA model to evaluate the performance of a sponsored research from a much simpler form of data in a small size under the same grant. The integrated model has managed to handle the subjective data and objective data in producing the single score for each sponsored research.\r\n\r\n', 'decision making envelopment', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2018', 0),
(80, 'Lee Ching Hoe', 'Leadership Styles And Job Performance: The Roles Of Psychological Empowerment And Person-Supervisor Fit', ' This research examined the relationship between leadership styles and job performance. In addition, the research proposed psychological empowerment mediates the above relationship. The research also proposed person-supervisor fit moderates the relationship between leadership styles and psychological empowerment where the positive relationship is stronger when the person-supervisor fit is higher. The research setting in which hypotheses were tested is MNCs operating in Malaysia, specifically the top three industrial states in Malaysia, namely Selangor, Penang and Johor. Examining leadership styles (transformational, transactional and laissez-faire) in MNCs is particularly useful for extending research on job performance because of the complexity of such setting highlights the importance of leaders (supervisors) and followers (employees) relationship on job performance. Additionally, many MNCs rely on teams to carry out much of their work, making the person-supervisor fit and psychological empowerment important issues for multinational management research. Using multisource data, the research found that transformational leadership has a significant positive effect on psychological empowerment. However, there is no evidence of significant effect for transactional leadership and laissez-faire on psychological empowerment. Psychological empowerment mediated the relationship between leadership style (transformational and transactional) and job performance. The results also indicated that person-supervisor fit moderates the relationship between transformational leadership and psychological empowerment, such that it strengthens the positive relationship.', 'leadership psychological supervisor', '', 'Pusat Pengajian Pengurusan (School of Management)', '2018', 0),
(81, 'Jocelyne Lee Jia Lin', 'The Influence Of Strategic Human Capital On Organisational Performance Of Manufacturing Organisations In Malaysia.', 'Research on strategic human capital among Malaysian manufacturing companies is very important for the growth of the economy. This is because in manufacturing sector, the absorption and learning ability of technology is very limited as it is hindered by semi-skilled foreign workforce. As such, strategic human capital is a very useful element to ensure that the crucial and relevant technology is absorbed and utilized. Specifically, this study attempts to examine the impact of learning orientation, human resource configuration and social capital towards strategic human capital in enhancing the organisational performance. Aside from understanding the factors that trigger strategic human capital, knowledge strategy as the moderator is examined as the element that strengthens the relationship between strategic human capital and organisational performance. Data was collected from 164 large manufacturers via survey questionnaire developed from related literature and pre-tested by HR managers and academic experts. The data was analysed using partial least square-structural equation modelling via Smart PLS. Findings indicated that learning orientation, human resource configuration and social capital plays a role in strategic human capital. Knowledge strategy moderates the relationship between organisational performance and strategic human capital and it is found that more attention is paid to the financial aspect of organisational performance. This study makes both theoretical and practical contribution by identifying the elements that create strategic human capital and what construct strengthens its relationship with organisational performance. Limitations of the study were explained and suggestions for future study were also presented.', 'influence human-capital organisational', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2018', 0),
(82, 'Rohayu Haron Narashid ', 'Assessing The Local Spatial Variation In The Relationships Between Rainfall, Vegetation And Elevation', 'Rainfall varies spatially ranging from large to local scales. Spatial elements such as vegetation and topography are the contributing factors to local variations of rainfall. However, local spatial variation process in rainfall due to vegetation and topography is unidentified when using a global model. This study aims to assess the local spatial variation of rainfall in the relationships between rainfall, vegetation and elevation using a local modelling approach. The main data used consist of rainfall depths, vegetation index of Normalized Difference Vegetation Index (NDVI) from Landsat 7 ETM+ satellite images and the elevation data from 174 and 103 locations of rainfall stations within the Northern and East Coast Region of Peninsular Malaysia respectively. Based on the availability of NDVI datasets from the years 2000, 2009 and 2011, the local spatial variations of rainfall were determined. The small clustering patterns in rainfall, vegetation and elevation that were computed in Moran\'s Index with the value of 0.1 to 0.5 showed low values of the variables being clustered in the study areas. Thus, the spatial process in rainfall, vegetation and elevation demonstrated a potential for local variations. The spatial pattern of these variables led to the exploration of non-stationary relationships. In order to explore the local spatial variation of rainfall, the regression techniques of Ordinary Least Square (OLS) and Geographically Weighted Regression (GWR) were applied to determine three types of models i.e. : (1) the relationship between rainfall and vegetation; (2) the relationship between rainfall and elevation; and (3) the relationship between rainfall, vegetation and elevation. The statistical findings for all relationships had shown significant local variations when Akaike\'s Information Criterion (AICc) obtained from GWR were lower. The GWR R-squared (0.146 to 0.770) improved the OLS r-squared (0 to 0.176). The best GWR model with the highest AICc difference values ( AICc) for years 2000, 2011 and 2009 were found in Model 1(164.571), Model 3 (163.946) and Model 2 (147.605), respectively. Land use and vegetation changes are the possible reasons when the relationship between rainfall-elevation for year 2011 was found to be more significant. The significant location of local spatial variations of rainfall due to vegetation and elevation can also be demonstrated based on the findings. With the detailed capabilities provided in remotely sensed data, the local variations of the relationships are possible to be carried out. Therefore, the spatial relationship that exists between rainfall, vegetation and elevation at the local level are significantly contributing to the local variations in rainfall.', 'variation rainfall vegetation-elevation', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2018', 0);
