(83, 'Hamid Reza Sadeghpour', 'The Transfer Of Humour In Comedy Animations From English Into Persian Dubbed And Subtitle Versions', 'The study examines the degree of the adequate transference of humorous linguistic and cultural expressions and humorous expressions that are based on Extralinguistic and Cultural References (ECRs) in the dubbed and subtitled versions of seventeen comedy animations from English into Persian. The study also analyses the employed translation procedures in the transfer of those humorous expressions, and consequently identifies the most effective translation procedures utilized to transfer the source message. The study aims to identify which technique (dubbing or subtitling) transfers the humorous expressions in the comedy animations more adequately. The study was carried out by identifying the humorous linguistic, cultural and ECRs-based expression in the source texts. Next, they are classified into eight groups based on the selected classification of humour by Nedergaard Larsen (1993). Finally, a comparison was made to identify the equivalence of the humorous linguistic, cultural and ECRs expressions in the Persian dubbed and subtitled versions, in order to examine whether they were transferred adequately or not. The employed translation procedures were analysed using selected translation procedures chosen for the current study and Pedersen`s (2011) translation strategies for subtitling ECRs. The most effective translation procedures were then identified through functional theory by Reiss and Vermeer (1984), and a better technique that transferred the humorous expressions more adequately into the target texts was identified. The findings show that translators employed a target-oriented approach in the dubbed versions and a source-oriented approach in the subtitled versions. However both techniques could not retain the humorous criteria of the source text. At the same time, the findings reveal that the quantity of the humorous expressions in the dubbed versions is more than the subtitled versions. Finally, the study finds that substitution is a practical strategy in the transfer of the humorous linguistic, cultural and humorous ECRs expressions in the comedy animations from English into the Persian dubbed and subtitled versions.', 'humour animations dubbed-subtitle', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) ', '2018', 0),
(84, 'Nazilah Binti Abdul Satar ', 'The Chemo-Sensitisation Effect Of Curcumin Against Low Dose Cisplatin On Non-Small Cell Lung Cancer (Nsclc) Stem Cells.', 'Cancer stem cells (CSCs) represent a small subpopulation within a tumour that possesses the stem-like properties but are also initiating resistance towards cytotoxic agent which contribute to cancer relapse. A natural compound such as curcumin that contains high polyphenol has been found to possess chemo-sensitivity effect with an ability to sensitise the CSCs to the cytotoxic agents such as cisplatin. Therefore, the present study was designed to investigate the efficiency of curcumin as a chemo-sensitiser in lung CSCs and to analyse its inhibitory effect on CSCs activity using A549 and H2170 cell lines that belong to non-small cell lung cancer (NSCLC). The NSCLC cell lines cultures were treated with various concentrations of cisplatin and curcumin to obtain the inhibitory concentration (IC50) using 3-(4, 5-dimethylthiazol-2-yl)-2H-tetrazolium, inner salt (MTS) assay. The lung CSCs with phenotype CD166+EpCAM+ was isolated using fluorescence-activated cell sorting (FACS). The efficiency of curcumin to sensitise lung CSCs was observed on apoptosis and stemness characteristics including migration ability, colonies and spheroid formation. The mRNA level was analysed for genes involved in apoptosis and stemness using quantitative real time-polymerase chain reaction (RT-qPCR). Liquid chromatography mass spectrometry (LCMS) was used to evaluate the effect of curcumin on CSC niche. The results discovered that exposure of NSCLC cell lines to curcumin (10 M  40 M) reduced the percentage of cells viability to an average of ~51% and ~54% in both A549 and H2170.', 'chemo-sensitisation lung cancer', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2018', 0),
(85, 'Nasser Deeb Husni Tamimi', 'Computer Use In Esl Classrooms In Area Of Conflict: Teachers Selfefficacy And Barriers Towards Computer Use In The Palestinian Public Schools', 'This study was designed to investigate factors related to computer use for instructional purposes. The aim was to examine level of computer use in Palestinian public schools, English teachers computer self-efficacy with respect to computer use in teaching, the barriers such teachers face when using computers in their teaching and the relationships between teachers\' computer self-efficacy and their usage of computers in teaching. The study derived its theoretical framework from Technology of acceptance model 3 (TAM 3) which is proposed by (Venkatesh & Bala, 2008). The sample of this study consisted of 186 English teachers from Palestinian public schools. In addition, to six English teachers were selected for a semi structured interview. Validity and reliability were established for the survey instrument. Descriptive analysis and inferential statistical techniques were used as well. Findings in this study revealed that level of computer use for instructional purposes is relatively low. Findings indicated that level of computer use is high in preparation areas such preparing quizzes and preparing tests while it is relatively low in other levels such as in areas for delivery of teaching, evaluation of teaching and communication purposes. Findings of the study also showed that English teachers have got positive self-efficacy towards computer use. They possess positive attitudes towards the effectiveness of computer use for instructional purposes but findings indicated that these teachers may be not prepared yet to use computers in their teaching due to many barriers.', 'computer area conflict', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(86, 'Rawdah Adawiyah Binti Tarmizi', 'Maximal Irredundant Coverings Of Some Finite Groups', 'The aim of this research is to contribute further results on the coverings of some finite groups. Only non-cyclic groups are considered in the study of group coverings. Since no group can be covered by only two of its proper subgroups, a covering should consist of at least 3 of its proper subgroups. If a covering contains n (proper) subgroups, then the set of these subgroups is called an n-covering. The covering of a group G is called minimal if it consists of the least number of proper subgroups among all coverings for the group; i.e. if the minimal covering consists of m proper subgroups then the notation used is s(G) = m. A covering of a group is called irredundant if no proper subset of the covering also covers the group. Obviously, every minimal covering is irredundant but the converse is not true in general. If the members of the covering are all maximal normal subgroups of a group G, then the covering is called a maximal covering. Let D be the intersection of all members in the covering. Then the covering is said to have core-free intersection if the core of D is the trivial subgroup. A maximal irredundant n-covering with core-free intersection is known as a Cn-covering and a group with this type of covering is known as a Cn-group. This study focuses only on the minimal covering of the symmetric group S9 and the dihedral group Dn for odd n  3; on the characterization of p-groups having a Cn-covering for n 2 f10;11;12g; and the characterization of nilpotent groups having a Cn-covering for n 2 f9;10;11;12g. In this thesis, a lower bound and an upper bound for s(S9) is established.', 'irredundant finite groups', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences) ', '2018', 0),
(87, ' Asniza Hamimi Binti Abdul Tharim', 'Indoor Environmental Quality, Occupants Satisfaction And Perceived Productivity In Green Building Index Rated Office Buildings', 'The aim of this research is to examine the objective and subjective measurements of overall indoor environmental quality (IEQ) in Green Building Index (GBI) Non-Residential New Construction (NRNC) office buildings located in Kuala Lumpur and Putrajaya, Malaysia. This is also to identify the influence of various faade designs that are implemented in the selected GBI NRNC office buildings. This research not only focuses on the aspects of the IEQ levels in the selected case study buildings, but it also tests the relationship between IEQ and Occupants Perceived Productivity with Occupants Satisfaction as mediator. The research methodology adopted for this research is divided into two types which are the objective (fieldwork) and subjective (questionnaire survey in the form of post occupancy evaluation) measurements. Subsequently, in order to investigate the current performance of IEQ in the selected GBI NRNC office buildings, a series of fieldwork measurement were conducted in the buildings i.e., ST Building, PJH Building, MITI Building and KKR2 Building. Indoor and outdoor environments were monitored in this research to evaluate the IEQ performance of these building with various faade design. Concurrently, the POE survey on IEQ assessment were distributed and collected amongs occupants in the buildings. Using the purposive sampling techniques, 302 responses were analyzed using the partial least squares structural equation modeling.', 'indoor office building ', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(88, 'Thong Chean Wah', '  Teacher Competency In Chinese Independent High Schools In Penang', 'This study aimed to explore the competencies of mathematics teachers in Chinese Independent High Schools (CIHSs) of Penang state. The COACTIV model that including content knowledge (CK), pedagogical content knowledge (PCK), pedagogical/psychological knowledge (PPK), organizational knowledge, and counseling knowledge was used as conceptual framework. A total of 55 participants were selected to involve in in-depth and focus group interviews using multi-stage sampling technique. There were five groups of participants, namely five principals, five senior assistants, five mathematics department heads, 13 mathematics teachers, and 27 students of the five CIHSs. Principals, senior assistant, and mathematics department heads were involved in in-depth interviews while mathematics teachers and students were involved in focus group interviews. Results revealed that CK, PCK, and PPK are generally recognized as important to be possessed by mathematics teachers in CIHSs. However, the organizational knowledge and counseling knowledge seemed to be neglected. Findings revealed that all the five competencies, namely CK, PCK, PPK, organizational knowledge, and counseling knowledge not only fits conceptually into COACTIV model but also reinforced the theories used in this study. Finally, this study has successfully contributed to human resource management and development particularly in CIHSs and also in the field of education generally.', 'teacher chinese high-schools', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(89, 'Kanakambal Velusamy', 'Reading Attitudes And Habits Of Primary School English Language Teachers.', ' The main purpose of this study is to investigate the reading attitudes and habits of primary school English language teachers in Kinta District, Perak. The study is also aimed to find the selection of reading materials, the purpose of reading and the factors that hinder primary school English Language teachers from reading. The study also focused to suggest measures that are needed to improve the reading habits among these teachers. An explanatory mixed method design using questionnaires and interviews were applied to obtain information from 204 and 13 respondents respectively from English language primary school teachers in the Kinta District, Perak. The findings from the quantitative analysis revealed that teachers had an overall positive attitude towards reading (M=4.24, SD=.723) but only moderate level of reading habit (M=2.97, SD=1.844). Analysis of Variance (ANOVA) revealed no significant differences in reading attitude based on demographic variables: on gender and teachers qualifications. However, the results indicated significant differences between ethnicities, age groups and years of teaching experience. Results showed that the main purpose for teachers to read was for knowledge, examination or research purposes. The major factors hindering them from reading were cost factor and lack of self- motivation. However, in the qualitative findings, teachers revealed that they are aware of positive reading attitude and good reading habits are important to improve their proficiency level, build their confidence in the language and enhance their teaching practices. It also revealed that teachers were burdened with workload, thus hindering them from reading extensively.', 'reading attitudes habits', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(90, 'Wah Tze Huey', 'Development And Evaluation Of Resilience Training Module: Its Effect On Resilience Among Caregivers', 'Caregiving can be overwhelming if the role has demanded more than it is expected. As resilience has a positive relationship with surviving life crises, enhancing resilience will provide them with skills to cope and decrease depression. Caregivers can learn resilience skills to take proactive steps to prevent crisis or to reduce risk factors. The objectives of this study are to develop module to enhance resilient skill and evaluate the effectiveness of the module in enhancing resilience of caregivers. Structural Equation Modeling has supported the conceptual framework of this study, where the construct resilience has five subconstructs (problem solving, spirituality, leadership, self-efficacy and networking). Resilience scale RS-14 (questionnaire with Likert Scale) and reflective journaling have been used to collect data to address the effectiveness of the training module. This is a quasi experiment, applying mixed method design with both quantitative and qualitative data analysis. A purposive sampling of one hundred caregivers have participated in this resilience training. A paired sample t test of resilience score for pre and post resilience training is significantly different with p < .05. The post training score is significantly higher than the pre training score which is supported by testimonials of participants. The participants have improved their level of resilience after the training with no lag behind in anyone particular subconstructs. Although a one-way between-groups analysis of variance has shown a significance difference in gained score of subconstructs, the post-hoc comparison using the Tukey HSD test has indicated that the differences of gained scores among the five subconstructs were quite small and not significance.', 'resilience effect caregivers', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2018', 0),
(91, 'Abdullah Amer Mohammed Salih', 'Adaptive Local Fuzzy Based Region Determination Image Enhancement Techniques For Non-Uniform Illumination And Low Contrast Images', 'Local contrast enhancement is an approach to improve the local visibility detail of an image by increasing the contrast in local regions. Recently, researchers have shown an interest in solving the issue of non-uniform illumination. However, most of these techniques divide the image into two parts only namely over-exposed and under-exposed regions and try to enhance the poor contrast in both regions using same approach. However, these methods are not robust and they are specifically designed to solve a specific problem at one time. This limitation has motivated this study to propose a new technique to solve the abovementioned problems. In the beginning, Adaptive Local Exposure Based Region Determination (ALEBRD) method is proposed to determine and divide the image into three regions namely under-exposed, over-exposed, and well-exposed regions. The results show that the proposed ALEBRD method produced better region determination performance than the other state-of-the-art methods. Based on the qualitative analysis, it could determine those three regions with high accuracy. After that, contrast of each region will be enhanced using a new local contrast enhancement technique called Adaptive Fuzzy Exposure Local Contrast Enhancement (AFELCE). The proposed AFELCE method is specifically designed to enhance the contrast of each region using different approaches. The proposed AFELCE technique successfully improves the contrast of 300 low-contrast and non-uniform illumination images, taken from three different databases namely standard, underwater, and microscopic human sperm images. The proposed AFELCE method qualitatively and quantitatively outperforms the state-of-the-art methods,. Qualitatively, the proposed AFELCE method has successfully enhanced the contrast of those images by producing more uniform illumination images with high contrast. Quantitatively, the proposed AFELCE method produces the highest average of Entropy (E), Measure of Enhancement (EME) and Universal Image Quality Index (UIQI) for the standard image database with values of 7.582, 42.75 and 0.94 respectively. The similar results obtained for the underwater database images, where it produces the highest average of E, EME and UIQI values with 7.124, 41.13 and 0.89 respectivley. While for the microscopic human sperm image database, it produces the highest values for E and EME with values of 7.602 and 42.51 respectively, and . This study is suitable to be applied to a real time applications. Based on the good results obtained for standard, underwater, and microscopic human sperm images, the developed system has high potential and suitable to be applied to a real time applications.', 'image enhancement non-uniform', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2018', 0),
(92, ' Eltefat Ahmadi', 'Synthesis Of Titanium Tetrachloride Through Arbothermal Reduction And Chlorination Of Ilmenite Oncentrate', 'The synthesis of titanium oxycarbonitride (TiOxCyNz) from ilmenite and its chlorination at low temperatures for production of titanium tetrachloride (TiCl4) was investigated in this research. The effects of reduction/nitridation temperature, time, atmosphere and addition of waste polyethylene terephthalate (PET) plastic into coal on the formation of TiOxCyNz and iron (Fe) from ilmenite were investigated in carbothermal reduction and nitridation (CTRN) process at 1100-1250 C for 60-180 minutes with four different PET-to-coal ratios (C/Ored) ranging from 25 to 100 wt%. Field-emission scanning electron microscopy (FESEM) equipped with energy dispersive X-ray spectrometer (EDX) analyses showed that the product synthesized by 75 wt% PET had a unique microstructure in which spherical Fe particles were distinctly separated from TiO0.02C0.13N0.85 phase. The highest extents of reduction and nitridation of the sample synthesized by 75 wt% PET were 99.15% and 85.47%, respectively. Iron was also removed by an aeration leaching process at 70 C in the presence of ammonium chloride (NH4Cl) and 0.1 wt% AQ-2 (Anthraquinone-2- sulfonic acid sodium salt monohydrate) as the effective catalysts. The efficiency of Fe removal was 98.5%, and final TiO0.02C0.13N0.85 contained 0.48 wt% Fe as determined by inductively coupled plasma-optical emission spectroscopy (ICP-OES) analysis. The chlorination mechanism of titanium nitride (TiN) and TiOxCyNz were extensively investigated at 250 C - 400 C. The extent of chlorination moderately increased with increasing the temperature and decreasing particle size of TiN at constant flow rate of N2-Cl2 gas mixture. The highest extents of chlorination of TiN at 250 C and 400 C were about 85.6% and 97.7% in 60 minutes, respectively. The results also indicated that a shrinking core model with mixed-control mechanism governed the chlorination rate. The surface chemical reaction of chlorine gas on the surface of TiN particles was rate controlling in the initial stage and, during later stage, internal (pore) diffusion through the intermediate product layer was rate controlling step. The apparent activation energy (Ea) of about 10.97 kJ/mole was obtained for the chlorination of TiN. The extent of chlorination of TiO0.02C0.13N0.85 was 93.5% at 400 C in 60 minutes. The TiCl4 with the purity of about 99% was eventually produced from ilmenite and the residue of the chlorination contained high amounts of rear earth elements (REEs) as well as refractory metals. This research demonstrated that a three-step process could be a feasible and sustainable method for production of relatively pure TiCl4 from ilmenite.', 'titanium arbothermal chlorination', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2018', 0),
(93, 'Abdulwahab Yusuf Ebrahim A. Aziz Al Jawder', 'Political Marketing And Women Candidates In The 2014 Parliamentary Election In The Kingdom Of Bahrain', 'The 2002 Constitution of Bahrain guarantees electoral rights for men and women. Thus, this political science thesis focuses on the political marketing strategies and tactics used by female candidates to win the 2014 parliamentary election in the Kingdom of Bahrain. The main aims of this study are to investigate political marketing awareness and the behavior of the candidates in the light of Arab- Muslim culture, reflecting on the frameworks adopted, and the electoral orientations characterized by the performance of the female candidates. This qualitative study uses Grounded Theory to develop a theory based on collected data. Data was collected from two sources: in-depth semi-structured interviews and documents. Ten out of 22 female candidates (i.e. 45.45% of the total nominees) were selected as informants with diversity of qualification and experience from each of the four Governorates based on purposive sampling method  three informants won parliamentary seats, three qualified to the second round and four lost the 2014 Parliamentary Elections. This also reflected the informants diverse demography and cultures considering the cultural diversity across the Governorates. To maintain validity, the findings were triangulated. To evaluate the informants strategies, the study utilizes Strength, Weaknesses, Opportunity and Threats strategy (SWOT). The research findings show that the candidates behavior was controlled and influenced by Arab-Muslim culture, notably masculinity, tribalism, stereotype and uncertain avoidance.', 'political marketing women', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2018', 0),
(94, ' Ola Ahmed Mohammed Al-Wasabi ', 'Flash Cache Hybrid Storage System For Video-On-Demand Server.', 'A video-on-demand (VOD) system allows users to access any video at any time. This system enables users to view videos in the real-time streaming mode for extended durations. One of the important components of the VOD systems is the hybrid storage server. This component consists of HDD, SSD, and RAM, collectively fulfilling the requirement of simultaneous fast data access and large data distribution to numerous users. However, current hybrid storage systems still pose numerous challenges. (1) The integration and roles of the HDD, SSD, and RAM are relatively weak in terms of optimizing fast access prior to streaming to a large number of simultaneous users. (2) The HDD and SSD exhibit poor data layout and streaming controller in supporting the production of a high number of simultaneous streams. This thesis proposes (1) an enhanced hybrid storage system (EHSS) for the VOD servers. The HDD, SSD, and RAM are managed and integrated using an effective mechanism, in which the top 10% most popular videos are utilized to achieve fast data access and service to a large number of simultaneous users. (2) The flash cache hybrid storage system (FCHSS) is also proposed. Unlike the EHSS architecture, the FCHSS architecture has no RAM, which is removed and replaced by a flash-based SSD. The flash-based SSD is used instead of the RAM as a cache for the HDD to achieve fast data access and service to a large number of simultaneous users. (3) The new data layout stores thousands of video segments in the HDD and SSD.', 'hybrid storage server', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2018', 0),
(95, 'Lina Abdurrahman Musallam Bashayreh', 'The Effectiveness Of Reading Strategies On Developing Reading Comprehension Among Students In Saudi Arabia', 'The purpose of this study was to investigate the effectiveness of a training program based on metacognitive reading strategies on EFL students reading comprehension. To that end and for research data collection purposes, the researcher applied mixed methodology approach. The quantitative research instrumentation consisted of an adapted version of the Metacognitive Awareness of Reading Strategies Inventory (MARSI) that was developed by Mokhtari and Reichard, (2002) and a reading comprehension exam as pre and posttests. The qualitative tool, on the other hand comprised semi- structured interviews that were conducted at the end of the study between the researcher and 10 samples from the experimental group who volunteered to be interviewed. The study sample consisted of 70 EFL students in the Preparatory Year Program (PYP) who were equally distributed over two study groups; (experimental and control) and were purposefully chosen to participate in an intervention that lasted for 8 teaching weeks. Based on the participating students pretest results in both quantitative tools, the researcher adapted the current reading curriculum in the ELC and customized it to fit students needs for more reading practice and strategy- based instruction towards promoting their reading comprehension. The training program consisted of six selected reading strategies, female- oriented reading passages, and various enriching and engaging activities. After the training has completed and research data were collected and analyzed, the resultant findings showed that there was a significant effect of metacognitive reading strategies on students strategy employment and consequently on their reading comprehension. Further, thematic analysis of the interview data revealed an overall satisfaction and positive attitude on the part of the participating students towards the training program, metacognitive reading strategies, and the reading material of training program. The study was concluded by some recommendations for further study and exploration on reading strategies and their relation to reading comprehension, especially in the EFL context.', 'effectiveness reading comprehension ', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(96, 'Ekarat Sitisan ', 'Guidelines Of Islamic Corporate Social Responsibility Of Islamic Bank In Thailand', ' Researchers have infrequently researched the concept of Islamic corporate social responsibility. Their researches on corporate social responsibility (CSR) in Islam are mostly on the theoretical part which is concerned about Islamic CSR principles and Islamic CSR framework. However, Islamic CSR framework and Islamic CSR principles could not apply in Islamic financial institutions without guidelines for practice. Thus, Islamic CSR guidelines of Islamic financial institutions were needed to identify. The general objective of this study was to propose Islamic CSR guidelines of an Islamic bank in Thailand. The second objective was to measure the practice of an Islamic bank in Thailand on CSR and to analyse the possibility of applying the proposed Islamic CSR guidelines into an Islamic bank in Thailand. In this research, a purposive sampling technique was used to select the six informants who are involved with CSR of an Islamic bank in Thailand such as a CSR representative of an Islamic bank, a director of an Islamic bank, a shariah advisory board of an Islamic bank for an interview on CSR in the Islamic bank. Also, the questionnaire was distributed and answered by four respondents, who are a shariah advisory, an expert person in Islamic finance and CSR representative of an Islamic bank, to find their opinions on the proposed Islamic CSR guidelines. This research was conducted qualitatively. The content analysis was chosen to analyse these data\r\n\r\n', 'corporate social responsibility', '', 'Pusat Kajian Pengurusan Pembangunan Islam (Centre for Islamic Development Management Studies ISDEV) ', '2018', 0),
(97, 'Goh Su Lun', 'Economic Evaluation And Factors Affecting Smoking Cessation Using Istop Program In A Local Manufacturing Company.', 'Tobacco products are a double-edged sword. While tobacco products contribute to a countrys economic significantly, it is also a notable risk factor for human health and a silent thief of the wealth of its users, society and nation. Apart from the healthcare cost, the work performance of smokers is also being affected leading to lower productivity. Many studies have also shown that workplace smoking cessation programs are effective and have generated positive savings for the employers. Therefore, workplace smoking cessation has been viewed as a potential strategy to combat the usage of tobacco products. Abundant studies have been carried out abroad, but local studies are scares; especially in the private manufacturing sector. This study was a cross-sectional single prospective cohort workplace smoking cessation study conducted in a local manufacturing company. This study reviewed a 12-week innovative multi-component smoking cessation intervention program to support smoking employees to quit smoking, called iSTOP program. The objectives of this study were to evaluate the effectiveness of this innovative program and the smokers behaviours as well as to identify factors affecting smoking cessation and relapse. On top of these, the quality of this program was also evaluated using qualitative analysis method, making it more effective in assisting smokers to quit smoking. As this was the Company fully sponsored program, the last section was to calculate the economic return this program to the employer using the common commercial indicators (ROI and IRR), which are familiar by the Management team.', 'economic smoking istop-program', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(98, 'Seffetullah Kuldas', 'An Academic Resilience Scale And Model For Malaysian Adolescents.', 'Despite their socioeconomically-disadvantaged backgrounds, which impede academic achievements of the majority, some adolescents can academically succeed. This exceptional achievement, defined as academic resilience, raises the question: what and how individual, familial, and school factors enable some adolescent students to perform the same task better than their peers from the same socioeconomic status (low SES). To enhance understanding of this question and to explore factors underlying academic resilience from the local sociocultural frame of reference, this quantitative research integrated various theoretical and empirical literature into a Socio-Eco-Cultural-Transactional Framework of Academic Resilience. Using this framework, an academic resilience scale and model for Malaysian adolescents was developed. Reliability and validity of the scale and model were tested and established through pilot and main studies on academic resilience of adolescents with low SES in a rural area of Kedah, Malaysia. The participants were randomly selected through a venue-day-time sampling technique. Using FACTOR 10.7 version, a Minimum Rank Factor Analysis of data collected from pilot study 2 (N = 308) and 4 (N = 127) identified two interpersonal resources and two intrapersonal assets of academic resilience. The resources appeared to be perceived parental care and perceived teacher care, while the assets appeared academic performance goal and educational optimism.', 'academic resilience adolescents', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(99, 'Ooi Shir May', 'Internationalisation Of Service-Sector Small And Medium Sized Business Training And Consultancy Firms In Malaysia', ' Globalisation forces and information communication technology advancements have enabled small and medium-sized (SMEs) service firms to internationalise their business activities at an ever-increasing speed and scale. This thesis explores the internationalisation of such firms from an emerging market. In particular, it studies business training and consultancy (BTC) firms internationalisation decision making as well as their challenges and capabilities. The multiple-case study approach is adopted, and thirty-one in-depth interviews are conducted with members of the top management and executives from eight business training and consultation firms in Malaysia. The Uppsala model and the framework for service internationalisation are used as theoretical guidance to analyse the internationalisation of the firms. The entry modes, psychic distance, business network, internationalisation challenges, and business capabilities are analysed in this study. The result suggests that psychic distance, business network, and business capabilities, which are listed in internationalisation theories, explain the internationalisation of BTC firms from Malaysia. However, the discussion of entry modes in the framework of service internationalisation does not accurately explain the internationalisation of BTC firms from Malaysia. Language and country-of-origin perception are the major challenges for the BTC firms in this study. Business capabilities are important for BTCs to form a competitive advantage during their internationalisation. The study provides new insights into service internationalisation in SMEs from an emerging market. The application of internationalisation theories to the BTC industry in an emerging market is analysed and internationalisation challenges and capabilities are discovered. The internationalisation theories do not accurately explain the current internationalisation of the BTC firms in this study. ', 'internationalisation business training-consultancy', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2018', 0),
(100, ' Khairul Bariyah Binti Othman', ' Konsep Niat Berteraskan Islam Dalam Tingkah Laku Kepatuhan Zakat Pendapatan', 'Zakat pendapatan merupakan satu ibadah yang mempunyai keistimewaan dan keunikan dalam pelaksanaannya. Ia bukan sahaja ibadah yang mempunyai nilai hubungan ketuhanan, malah merangkumi nilai kemanusiaan melalui aspek muamalatnya. Oleh sebab ibadah zakat pendapatan ini merangkumi bidang ibadah dan muamalah, fatwa mewajibkan ibadah ini diakui telah mewujudkan peningkatan dalam jumlah kutipan dana zakat negara. Namun di sebalik peningkatan ini, setidaktidaknya wujud tiga permasalahan utama yang sering dibincangkan dalam kalangan sarjana-sarjana terdahulu hingga ke hari ini. Pertama ialah tentang aras kepatuhan yang masih rendah dalam kalangan muzzaki di Malaysia. Kedua ialah kefahaman terhadap kewajipan zakat pendapatan yang masih rendah. Ketiga iaitu kedudukan niat dalam urusan ibadah zakat pendapatan yang memberi kelangsungan kepada tingkah laku kepatuhan. Berdasarkan realiti ini, pelbagai kajian telah dijalankan bagi merungkaikan permasalahan yang timbul. Namun kajian-kajian terdahulu banyak didominasi oleh konsep-konsep niat dalam kepatuhan tingkah laku yang dibina berteraskan falsafah lazim yang dibangunkan oleh sarjana Barat. Timbul persoalan, setakat manakah komprehensifnya konsep niat yang diperkenalkan oleh teori-teori lazim ini sesuai untuk diguna pakai dalam kajian kepatuhan ibadah seperti zakat pendapatan dalam kalangan umat Islam? Adakah ia selari dengan tasawur Islam? Sekiranya tidak, bagaimana konsep niat yang sesuai untuk digunakan dalam merungkaikan isu niat ini. Justeru, kajian ini dilakukan adalah untuk mencapai tiga objektif yang telah ditetapkan.', 'niat islam zakat', '', 'Pusat Kajian Pengurusan Pembangunan Islam (Centre for Islamic Development Management Studies ISDEV) ', '2018', 0),
(101, 'Marcela Binti Pimid', 'Stakeholder Collaboration On Conservation Of Natural Resources In Lower Kinabatangan Sabah', 'A failure to achieve a sustainable development of ecotourism and conservation is often related to the failure in addressing varying needs and interests of various stakeholders. Moreover, the strategies use to solve the issues of conservation and ecotourism often excludes the opinions of local communities in rural areas. The present study investigated the stakeholder collaboration in both sectors, factors and issues which influenced stakeholder collaboration on conservation and ecotourism, as well as the impacts of climate change on stakeholders, ecotourism and conservation in the Lower Kinabatangan Sabah. The aims were achieved by conducting a concurrent mixed method research using quantitative and qualitative approaches. The quantitative method gathered 328 questionnaires from each household of local communities in Sukau and Batu Puteh villages in the Lower Kinabatangan, whereas the qualitative method was conducted using a participant observation and in-depth semi-structured interviews to community leaders, local authorities, non-governmental organisations, private sectors, local and private sector ecotourism. The study highlighted five important findings. First, the number of local communities participated in conservation activities were higher compared to the ecotourism venture. Second, the surveys revealed that the local communities did not know how to participate in both activities of conservation and ecotourism, but the interview analysis showed that profit was the main factor that determined the community involvement in both sector.', 'conservation natural resources', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(102, 'Mageswari A/P Ranjanthran', 'The Effects Of Environmental Quality On Revisit Intention Among European Tourists To Malaysia.', 'Tourism is a sunrise industry in Malaysia. The extraordinary approach to a tourist destination, the tourist experience itself convertible as the selling point. This applies to the entire remarkable destination around the globe because of its image. Every highbrow tourism provider has the essential objective to bring back tourist to the destination with the less promotional activity which incurs budget. The environmental quality factors are the key attributes in attracting tourists to revisit or to recommend the destination to others. The purpose of this study was to examine the relationship between environmental quality factors toward intended to revisit intention. A self-administered survey was carried out at the selected airport and in the selected prominent tourist location in the east and west Malaysia. A sample of 482 European tourists was obtained using the purposive sampling approach. The data were analyzed using Statistical Package for Social Science (SPSS) software. The whole model was confirmed using SPPS PROCESS, a versatile computational tool for observing the mediating variable in the study. Major findings of this study complement the S-O-R theory. European tourists gathered information about Malaysia from internet sources predominantly. The key reasons for European tourists to visit Malaysia are reservation of heritage and historic monuments, less language barrier, the beauty of natural scenery and landscape and numerous activities for tourists. The finding shows, environmental factor nature and man-made does not support the relationship on revisit intention but social factor does. Interestingly, with the help of the mediator (tourist experience) the relationship turns out to be positive.', 'environmental revisit tourists', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(103, 'Nurul Ruhayu Mohd Rosli ', ' Physico-Chemical Characteristics Of Pinang River Estuary, Balik Pulau, Penang.', 'The Pinang River is located at the north-western of Penang Island. Its length is approximately 6.5 km, with narrow and shallow upstream, but wider and deeper downstream. This river supplies freshwater to nearly one-third of Balik Pulau population. Unfortunately, anthropogenic effluent from agriculture, domestic and aquaculture are being directly discharge into the river thus, deteriorating the water quality. Therefore, this study was undertaken to determine the Pinang River estuarine processes which involve the mixing of freshwater and seawater that may influence the river hydrodynamic, biological, physical and chemical aspects. These characteristics would possibly affect the estuarine water circulation, river transport time scales (i.e. residence time and flushing time) and pollutants (i.e. nutrient and sediment concentrations; and its loadings). Net ecosystem metabolism (NEM) status in Pinang River was also evaluated in terms of ratio between photosynthesis and respiration. Diurnal studies were carried out for 24 hours at two stations during two tidal cycles at spring and neap tides and wet and dry season. A secondary data (from October 2007 until October 2008) on river discharge, salinity and volume along Pinang River were utilised to determine the residence time and flushing time. Pinang River estuarine system was considered as micro-tidal and partially stratified estuary. The flushing time did not influence the residence time (R2=0.028) in Pinang River.', 'physico chemical characteristics', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2018', 0),
(104, 'Aini Khairiah Binti Samani', 'Pengetahuan Kemiskinan Dalam Kalangan Masyarakat Melayu Di Mukim Sri Medan, Batu Pahat, Johor', 'Poverty Knowledge is an approach that is used to understand the root causes of poverty, much precisely from the perspective of the poor, which stands for those with lack of education, lack of income and lack of property ownership. Unknowingly, the poor have created a culture of poverty in response to their poverty. Culture of poverty is a state of a lifestyle correlated with negative attitudes such as laziness, lack of motivation, lack of confidence, easy to give up and surrender to fate, which causes a person or community to keep on living in poverty. The Malay community is associated with those who have negative attitudes, which lead to poverty. In Malaysia, the Malay had the highest percentage of poverty than other races. From 1970 to date, the percentage of poverty among the Malay had stated 0.8 percent compared to the Chinese and Indian, respectively 0.1 percent and 0.6 percent. Shiftless or laziness is the attitude that considered as the cause of the Malay living in poverty. The objectives of this study are i) to explore the causes of poverty in the Malay community in Mukim Sri Medan, ii) to determine the opportunities available around Mukim Sri Medan which could be benefited by the poor and iii) to analyze the main factor that creates poverty from their perspectives. A questionnaire survey was conducted on 313 poor Malay head of households, which were obtained through Mukim Sri Medans e-Kasih system. From this, 30 respondents were selected for the in-depth interview session. ', 'pengetahuan kemiskinan melayu', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) ', '2018', 0),
(105, 'Tay Kai Xin  ', 'The Determinants Of Long And Medium Haul International Tourists Length Of Stay In Malaysia.', 'Tourism is becoming an increasingly important contributor to the Malaysia economy. However, it has been acknowledged as a problem that the growth of tourism industry in Malaysia is due to tourist arrivals but not the receipt per arrival. This is because lower average length of stay. Tourists who stay at one destination longer means visit more attractions and generate more businesses for the destination. The theory of planned behaviour was used to understand the determinant factors of tourists length of stay in Malaysia. To be exact, this thesis aims to study marketing mix, attitude, subjective norm, and perceived behavioural control toward the formation of tourists length of stay in Malaysia. It also aims to identify the impact of marketing mix on the formation of attitude and investigate the moderate effects of different age groups and travel distance on these determinants toward the length of stay in Malaysia. Three main hypotheses were outlined. A pilot study with 55 respondents was performed using Stata14.2 software to ensure the validity and reliability of the proposed test model. After the pilot study, the revised questionnaire was used in the final data collection with 384 respondents at five Malaysia International Airports. Descriptive analysis and survival analysis were applied and the thesis findings revealed that the theory of planned behaviour was better in predicting international tourists length of stay in Malaysia. The results showed that mediated relationship of marketing mix and attitude was generally much more important than as independent variables toward length of stay. On the other hand, moderated relationship of age and travel distance was also proven and this finding was crucial to destination marketers in term of market segmentation and in designing marketing mix. The theoretical and practical implications of the study were discussed followed by research limitation and future direction.', 'determinants international-tourists stay', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(106, 'Athirah Azhar', 'Corporate Social Responsibility Initiatives For Childrens Education In The Rural Areas: A Case Study Of Adopt-A-School (ASC) Program From Pintar Foundation', 'Corporate Social Responsibility (CSR) initiatives has been actively conducting educational programmes under PINTAR Foundation since 2007 specifically in the rural and underserved areas in Malaysia. The primary objectives of this study are to examine the children perception about educational programmes under the CSR initiatives; to analyse the impact of educational programmes for the rural school academic performance and corporate companys goal; and to recommend the interventions plans for the corporate companies CSR and school to further improve childrens educational programmes specifically in the rural schools. This qualitative study has chosen the ASC Program in PINTAR Foundation as a case study.', 'corporate social responsibility', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2018', 0),
(107, ' Nurhanim Binti Abdul Aziz', 'Removal Of Sulphate In Waste Recycle Aggregate Using Bacillus Subtilis', 'Waste concrete aggregate (WCA) is highly potential to be re-utilised as a recycled material as it is applicable to numerous functions. Attached cement paste on WCA surface has limited the potential WCA to be recycled as a part of raw construction materials. Low density, high in water absorption and sulphate content are identified as the major contributing factors for this limitation. The sulphate content in delayed ettringite formation (DEF) from high water absorption of attached cement paste leads to DEF expansion and forms a micro-crack, causing a mass loss and affects the mechanical strength (compressive strength) of the concrete. The main objective of the present study was to treat WCA by incorporating the use of Bacillus subtilis before it was reused in recycled cement mortar (RCM) production. The characteristics of WCA were previously identified prior to the B. subtilis adhesion test. The efficiency of B. subtilis to treat WCA was evaluated based on four variable factors i.e. B. subtilis concentration, B. subtilis: WCA ratio, zeta potential, and retention time. Treated WCA (TWCA) from the WCA treatment by B. subtilis was reused as a part of RCM production. The compressive strength of RCM was subsequently evaluated to determine its quality. Results revealed that WCA had a low density, high water absorption, carbonated by attached cement paste and rich in ettringite. WCA contained 0.53 0.06 % of soluble sulphate and 47.76 8.43 % of attached cement paste. Leaching behaviour of inorganic element demonstrated Ca and SO42- as major elements, ranging from 10.06 mg L-1 to 149.15 mg L-1 and 30.78 mg L-1 to 38.90 mg L-1, respectively.', 'removal waste aggregate', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2018', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(108, 'Shamala A/P Balan ', 'Pharmacoepidemiologic And Cost Evaluation Of Off-Label Drug Prescribing Among Paediatric Patients At Hospital Sungai Buloh, Selangor, Malaysia', 'Off-label drug prescribing is common among paediatric patients. Prevalence and cost data on off-label drug prescribing among paediatric patients in Malaysia as well as the reasons behind the quantitative findings of previous studies remains unexplored. This research aimed to explore, evaluate and characterise the practice of off-label prescribing among paediatric patients in Hospital Sungai Buloh. Four studies were conducted using mixed-methodology approach to address the research objectives. The qualitative method provided a baseline and ground information on the awareness, knowledge, attitudes and views on offlabel drug prescribing among paediatric patients.', 'pharmacoepidemiologic off-label-drug paediatric-patients', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(109, 'Boo Mei Chin', 'Income And Subjective Well-Being In Malaysia', 'Can money buy happiness? The income-happiness puzzle (Easterlin Paradox) points out that individuals with higher incomes are happier than people with lower incomes yet raising everyones income does not compensate with overall higher levels of happiness. This thesis aims to examine income and subjective well-being in Malaysia. The research focuses on two measures of subjective well-being  happiness and life satisfaction. Based on the wave 5 (2005-2009) and wave 6 (2010-2014) data obtained from the World Values Survey, this study addresses the issue of subjective well-being inequalities from different income groups. The survey was carried out in year 2006 for wave 5 and year 2011 for wave 6. People were happier and more satisfied in year 2011 compared to year 2006. However, over the same period, happiness and life satisfaction inequalities were found to be higher among the low-income group compared with the higher income groups. This study also examines the influence of absolute income, relative income and expected income on happiness and life satisfaction based on wave 6. Using the ordered logit regression analysis, it is found that higher absolute income contributes to greater happiness and satisfaction levels among Malaysians. In terms of the role of relative income on happiness, tunnel effect is observed in particular among those in the low-income group. When compared with others who earn relatively higher income, Malaysians are less satisfied with life but the effect is found to be reversed in their happiness levels. Higher expected income seems to generate greater satisfaction among Malaysians. Other factors such as health, employment, religiosity, trust and democracy do influence Malaysian happiness and life satisfaction.', 'income subjective well-being', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2018', 0),
(110, 'Surita Hartini Binti Mat Hassan ', 'Kelestarian Pembangunan Harta Wakaf: Analisis Terhadap Perumahan Wakaf Di Pulau Pinang', 'Kelestarian merupakan elemen yang cukup penting dalam pembangunan termasuklah pembangunan terhadap harta wakaf. Walau bagaimanapun, kelestarian dalam harta wakaf melibatkan usaha-usaha untuk mengekalkan serta memperbanyakkan harta wakaf dan menghasilkan manfaat wakaf yang berterusan. Namun, sehingga kini masih terdapat banyak harta wakaf di Malaysia terutamanya tanah tidak dibangunkan secara produktif. Keadaan ini mengakibatkan berlakunya ketidaklestarian dalam pembangunan harta wakaf. Perumahan wakaf merupakan antara pembangunan ke atas tanah yang semakin mendapat perhatian mutawalli untuk memproduktifkan tanah wakaf terutamanya Majlis Agama Islam Pulau Pinang (MAINPP) yang aktif membangunkan perumahan wakaf di atas tanah wakaf di Pulau Pinang.', 'kelestarian harta wakaf', '', 'Pusat Kajian Pengurusan Pembangunan Islam (Centre for Islamic Development Management Studies ISDEV)', '2018', 0),
(111, ' Mohamad Isa Bin Abd Jalil', ' Information Disclosure And Waqif Commitment: The Role Of Trust As Mediator And Communication As Moderator', 'The role of cash Waqf as a solution to the problem of idle Waqf land is no longer questionable. However, after 34 years of the implementation of cash Waqf in Malaysia, the struggle of the lack of capital and limited financial resources to promote idle Waqf assets remains a vital issue. One way to maintain and increase cash Waqf collection is by multiplying the committed Waqif. Therefore, this study attempts to unravel the issue by exploring the relationship between the attitude of Waqif commitment to donate more, the degree of trust among Waqif, information disclosure from Waqf institution and communication. Apart from regression test, this study also examines the role of trust as mediator and communication as moderator.', 'information waqif mediator', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2018', 0),
(112, 'Pravina Jayapal A/P Jayapal ', 'The Role Of Materialism On Consumer Perceived Values And Online Impulse Buying Behaviour Among Generation Y In Malaysia', 'This study aimed to examine the role of emotional value, social bridging, social bonding and epistemic value on online impulse buying behaviour through materialism. The study incorporates three theories which are the Stimulus-Organism Response Model (SOR), Theory of Consumption Values (TCV) and Social Capital Theory (SCT). A total of three hundred and twelve respondents participated in this study via online survey method. The results revealed that emotional value and epistemic value affect all the dimensions of materialism (success, centrality, happiness).', 'materialism consumer values-buying', '', 'Pusat Pengajian Pengurusan (School of Management)', '2018', 0),
(113, 'Salina Binti Mokhtar', 'Model Kesejahteraan Psikologi Berasaskan Ihsan Kendiri, Sokongan Sosial Dan Kesejahteraan Spiritual Dalam Konteks Guru Pendidikan Khas Masalah Pembelajaran.', 'Guru Pendidikan Khas yang mengajar murid berkeperluan khas bagi kategori masalah pembelajaran (GPKMP) menghadapi pelbagai isu yang menjejaskan kesejahteraan psikologi seperti tekanan, compassion fatigue dan burnout dalam pekerjaan. Penekanan yang kurang diberikan kepada aspek kesejahteraan psikologi telah menyebabkan kesan negatif kepada GPKMP. Justeru kajian ini bertujuan membina model kesejahteraan psikologi berasaskan ihsan kendiri, sokongan sosial dan kesejahteraan spiritual dalam konteks GPKMP dalam Program Pendidikan Khas Integrasi (PPKI) di Zon Utara Malaysia. Kajian dijalankan terhadap 322 GPKMP di Pulau Pinang, Kedah dan Perlis. Teknik pensampelan pelbagai peringkat digunakan dan dijalankan melalui teknik pensampelan rawak strata mengikut kadar dan teknik pensampelan rawak mudah berkelompok. Kajian ini menggunakan pendekatan kuantitatif menerusi kaedah tinjauan berdasarkan reka bentuk keratan rentas dan melibatkan empat instrumen iaitu soal selidik Ihsan Kendiri, Rangkaian Sokongan Sosial, Kesejahteraan Spiritual dan Kesejahteraan Psikologi. Kaedah analisis yang sistematik digunakan dalam menentukan kesahan dan kebolehpercayaan soal selidik. Penganalisisan data kajian adalah menggunakan analisis deskriptif berbantukan perisian SPSS dan analisis inferensi pula menggunakan Partial Least Squares Structural Equation Modeling (PLS-SEM) berbantukan perisian Smart PLS 3.0.\r\n\r\n', 'psikologi kesejahteraan guru', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(114, ' Fatemeh Habibian Naeini ', 'Analysis Of The Quality Of Delivery And Students Engagement In Universiti Sains Malaysia-Developed Video Lectures', 'In an effort to transform teaching and learning in the university, Universiti Sains Malaysia (USM) has embarked on providing recorded video lectures on its own official Learning Management System. The measure of the Quality of Delivery of video lectures is captured by the Direct Instruction model of teaching, where the instructor acts as a content expert who directly engages the learners and at the same time manages their learning. The lecturers are evaluated by their students at the end of the semester, but there is no evaluation as to whether their lectures have followed the Direct Instruction format.', 'quality developed video-lectures', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2018', 0),
(115, 'Noor Afeefah Binti Nordin ', 'Characterisation Of Cellulose Nanocrystals From Oil Palm Fronds For Carboxymethyl Cellulose Bio-Nanocomposites', 'Cellulose nanocrystals (CNC) were produced from oil palm fronds (OPF) to produce carboxymethyl cellulose (CMC)-cellulose nanocrystals bio-nanocomposite. A fundamental study on top, middle and bottom parts of raw oil palm fronds was conducted and based on the scanning electron microscope (SEM) images, it showed that the bottom part of OPF had greater percentage of vascular bundles compared to middle and top parts. It was further supported by chemical analysis that showed bottom part of OPF had the highest -cellulose content. The top, middle and bottom parts of OPF were further utilised to produce CNC by applying chemo-mechanical treatment.', 'cellulose oil-palm bio-nanocomposites', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology', '2018', 0),
(116, 'Diana Laila Ramatillah', 'Therapeutic Outcomes And Mortality Related To Hemodialysis  Among Hospitalized Hypertensive And Diabetic Patients In Jakarta, Indonesia And Penang, Malaysia. ', 'Therapeutic outcomes of hemodialysed patients usually depend on proper pharmacotherapy given and follow up of the patients. Based on the high mortality incidence of this category, a study was conducted in both countries, Indonesia and Malaysia. A total of 455 patients from HD center Jakarta and Penang were included in this study based on inclusion and exclusion criteria. A retrospective evaluation of 199 patients in both countries were also included. All patients that fulfilled the criteria were included in HD center Penang and Jakarta as convenience sampling. In 256 hemodialysed patients who were evaluated by prospective, 14.8 % had diabetes mellitus, 55.1% had hypertension and 30.1 % had diabetes mellitus and hypertension. ', 'therapeutic hemodialysis hypertensive', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(117, 'Tan Bee Ying', 'Evaluation Of The Perception And Effectiveness Of Calendar Blister Pack Intervention On Medication Adherence And Clinical Outcome Among Hypertensive Patients At Kulim Hospital, Malaysia. A Mixed Methodology Approach', 'This study aimed to explore patients perception on medication packaging and calendar blister pack (CBP), to assess the effectiveness of CBP intervention towards medication adherence, clinical outcome (blood pressure) as well as the cost associated with the said intervention among hypertension patients in Kulim Hospital, Malaysia. A mixed methodology approach which involved both qualitative and quantitative methodology were implemented in this study. In phase I study, two focus group discussions were conducted among 16 hypertensive patients to collect data on patients perception towards medication packaging and CBP medications in managing hypertension. Collected data were transcribed verbatim and analysed by thematic analysis to identify the emerging themes. Phase II in this study was designed as a randomized controlled trial with the study outcomes were medication adherence, blood pressure level and treatment costs which included costs for prescribed medications, clinic visit, hospitalization, medical procedure and diagnostic test.', 'calender-blister medication hypertensive', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(118, ' Farhan Alanazi', 'Employee Performance Management System (EPMS) And Lecturers Organisational Commitment In Higher Education Institutions In Saudi Arabia: The Moderating Role Of Change Agents And The Mediating Role Of Lecturers Satisfaction', 'The overarching aim of the study is to assess the Employee Performance Management System (EPMS) and Lecturers Organisational Commitment in Higher Education Institutions in Saudi Arabia: the Moderating Role of Change Agents and the Mediating Role of Lecturers Satisfaction. The study utilized quantitative and qualitative methods. Apparently, the highest importance of predictor affected the employment performance was observed with change agent (59%), followed by staff organization commitment (28%), level of satisfaction (10%) and field of study (3%). While the highest importance of predictor affected the staff organization commitment was observed with level of satisfaction (40%), followed by employment performance management system (30%) and change agent (30%).', 'employee lecturers education', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2018', 0),
(119, ' Nor Aiza Bt Zamzam Amin ', 'The Influence Of Instructional Leadership Of Middle Managers On Teacher Commitment Through Professional Learning Community And The Role Of Trust In Leader As A Moderator.', 'This study investigates the influence of instructional leadership of middle managers on teacher commitment, professional learning community (PLC) as the mediator and trust in leader as the moderator on the relationship between instructional leadership and teacher commitment. This study is designed using the survey method. The questionnaire was adapted from Principal Instructional Management Rating Scale (PIMRS) by Hallinger and Murphy (1985), Professional Learning Community Assessment (PLCA) by Huffman and Hipp (2003), Omnibus T-Scale by Hoy and Tschannen-Moran (2003) and teacher commitment by Nordin (2007). The questionnaire was administered to 400 secondary school teachers based on their geographical locations which have been clustered into zones using a multi-stage sampling.', 'leadership teacher moderator', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(120, 'Ang Kai Cheen', ' Genetic Predisposition Of M2 Annexin A5 Haplotype In Recurrent Pregnancy Loss Among The Malays In Malaysia.', 'Repeated Pregnancy Loss (RPL) is a prevalent condition where conventional hereditary thrombophilia factors have been ruled out in Malaysia population. M2/ANXA5 haplotype, a variation at the core promoter region of Annexin A5 (ANXA5) gene, was suggested to be a predisposition factor for RPL. ANXA5 is a placenta anticoagulant protein which binds on the surface of syncitiotrophoblasts to prevent thrombotic events that would lead to RPL. In this study, the prevalence of M2/ANXA5 haplotype was 42.2% in Malay population and 34.9% for parous controls. When compared M2/ANXA5 clinically defined primary and secondary RPL carriers to M2/ANXA5 carriers in random populations, odds ratio of 1.52 (95% CI:1.1 to 2.1) was determined.', 'genetic pregnancy loss', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2018', 0),
(121, 'Muhammad Sabiu Bala ', ' Multiple Linear Regression Models For Estimating True Subsurface Resistivity From Apparent Resistivity Measurements. ', 'Multiple linear regression (MLR) models for rapid estimation of true subsurface resistivity from apparent resistivity measurements are developed and assessed in this study. The objective is to minimize the processing time required to carry out inversion with conventional algorithms. The arrays considered are Wenner, Wenner-Schlumberger and Dipole-dipole. The parameters investigated are apparent resistivity ( a  ), horizontal location (x) and depth (z) as independent variable; while true resistivity ( t  ) is dependent variable.', 'linear subsurface resistivity', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(122, 'Norakmarwati Ishak', 'Malaysian Construction Self-Initiated Expatriate (SIE): Characteristics, Motivations And Repatriation Factors', 'Self-initiated expatriates (SIE) are a sub-group of immigrant workforce in the study of international migration. They comprise of professionals, who on their own, initiated the migration process without depending on any organization. Their numbers are increasing and resulting in a brain drain of skilled workforce from the nation. Previous studies have indicated difficulties in identifying specific features of this subgroup and separating the SIE as an entity outside of the international migration theory. Previous studies on SIE have focused on career management and personal orientation of individuals and the studies were fragmented.\r\n\r\n', 'construction expatriate repatriation', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(123, ' Aizat Bin Khairi', 'Penanganan Masalah Pelarian Rohingya Di Malaysia Dalam Konteks Hybrid Peace Dan Pendekatan Multi-Track', 'Kajian ini menganalisis penanganan masalah pelarian Rohingya di Malaysia menggunakan kerangka yang dibina berdasarkan idea hybrid peace dan pendekatan multi-track. Persoalan utama dalam kajian ini adalah bagaimanakah masalah pelarian Rohingya ditangani di negara ini? Siapakah aktor-aktor yang terlibat? Apakah peranan dan inisiatif yang mereka lakukan untuk menangani masalah pelarian Rohingya? Bagaimanakah kerjasama antara aktor-aktor yang terlibat boleh membantu menangani isu pelarian Rohingya di Malaysia dengan lebih baik dan komprehensif? Bagi menjawab persoalan kajian ini, kaedah penyelidikan berteraskan kualitatif digunakan untuk mendapatkan data sekunder dan primer.', 'pelarian-rohingya hybrid-peace multi-track', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2018', 0),
(124, 'Mazlin Binti Mohideen', 'Design, Synthesis, Cytotoxic Activity And DNA Intercalation Of New -Carboline Derivatives. ', 'The focus of this study has been to investigate the in vitro cytotoxic effects of new -carboline derivatives on the K562 human cancer cell line. Analysis using 3D-QSAR models has revealed the importance of derivatisation at position-2 and -9 of the -carbolines. Two new series of N2-benzylated--carboline (M23-M46) and N2-N9-benzylated-1-substituted--carboline derivatives (M47-M113) were synthesised and characterised using four-step reaction and were produced in good yields (>70%). Compounds M23-M113 exhibited the most potent anticancer activity with IC50 values between 0.01-4 M, except for compounds M88-M90 which produced IC50 values of more than 100 M.', 'cytotoxic intercalation carboline', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research) ', '2018', 0),
(125, 'Dharmela Sellvam', 'The Genome And Recombinant Capsid Protein Of A Newly Isolated Escherichia Phage Yd-2008.S', 'The numbers of discovered phages are just a minute fraction of its population in the biosphere. However, the advancement of genome sequencing technology as NGS (next generation sequencing) provides opportunity to identify more complete phage genomes data that feasible to register them in ICTV (International Committee on Taxonomy of Viruses). A tailed phage species designated as Escherichia phage YD-2008.s was discovered and the complete genome was sequenced and deposited in NCBI (National Centre for Biotechnology Information) database with GenBank accession No. KM896878.1.', 'genome capsid escherichia', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2018', 0),
(126, 'Mohd Talha Anees', 'Application Of Geographic Information System And Hydrological Modelling Of Sungai Galas, Kelantan, Malaysia', ' Flooding is one of the natural hazard in the world as well as in Malaysia. Kelantan is also effected by flooding which need to be analysed. Flood analysis can be done through hydrological modelling by using high resolution data to find exact causes and effects of flooding. But in the absence high resolution or in situ data, what are the alternatives to conduct hydrological modelling? The objectives of this study were (i) to develop alternative methodologies and models for the generation of accurate flooding parameters values by using remote sensing and Geographic Information System (GIS) in a data sparse environment in Kelantan,', 'geographic information hydrological', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(127, 'Cheah Sau Seng', 'The Determinants Of Social Enterprises Performance In Malaysia And Singapore.', 'The ultimate mission of a social enterprise is to address the most pressing social or environmental issues in society. However, majority of the social enterprises in Malaysia and Singapore are confronted with the criticality of survival and low performance challenges, especially in financial sustainability. By integrating resource-based view and resource dependence theory, this empirical study established a framework to assess the influence of internal-oriented resources (i.e., entrepreneurial orientation, social salience and business planning), and external-oriented resources (i.e., financial support and training support), which moderated by socio-economic context, towards the financial and social performance of social enterprises.', 'determinants social performance', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business) ', '2018', 0),
(128, 'Syed Faisal Hyder Shah', 'Pathways To Empowerment: A Grounded Theory Study Of Pakistani Female Doctoral Students In Malaysian Public Universities.', 'In Pakistan, women have fewer opportunities for higher education than men. Additionally, a few women have a chance to avail foreign higher education. There are number of structural and socio-cultural barriers that impede womens access to higher education. However, due to unprecedented importance of higher education, a few women strive and succeed to avail educational opportunities abroad where they also come across myriad challenges. To this end, the present study primarily aims to explore the challenges that Pakistani female students experience while pursuing their doctoral education in the selected universities of Malaysia.', 'empowerment female students', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2018', 0),
(129, 'Helen Lee Yun Sin', ' Corrosion Inhibition Of Aquilaria Methanolic Leaf Extracts For Mild Steel In Hydrochloric Acid Solution.', 'Corrosion is a problem that negatively affects many industries and causes these industries monetary losses. Many synthetic inhibitors were developed to overcome the corrosion problem. However, these synthetic inhibitors are harmful to human and the environment. In this study, the methanolic leaf extracts of Aquilaria malaccensis (noninoculated) and Aquilaria subintegra (non-inoculated, chemical inoculated, physical inoculated) leaf were investigated as green and sustainable corrosion inhibitors for mild steel in 1 M HCl solution.corrosion leaf', 'corrosion leaf-extracts hydrochloric', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2018', 0),
(130, ' Arshad Mahmood', 'Holistic Human Resource Development Model: The Inclusion Of Spiritual Quotient And The Influence Of Islamic Teachings. ', 'Employees are the most valuable assets in organisations. HRD programmes aim to improve the development of employees and organisational effectiveness. HRD programmes help employees to develop their personal and organisational skills for organisational effectiveness. The conventional strategy of organisations in nurturing their employees focuses on enhancing an individuals knowledge, skills, and abilities (intelligence quotient) and emotional control (emotional quotient). However, despite this immense interest in human capital, organisations tend to fall short of a holistic approach to human resource development which eventually affects their performance.', 'human resource islamic', '', 'Pusat Pengajian Pengurusan (School of Management)', '2018', 0),
(131, 'Marzni Binti Mohamed Mokhtar', 'Penerapan Kemahiran Berfikir Aras Tinggi Dalam Pembelajaran Dan Pemudahcaraan Penulisan Karangan Argumentatif.', 'Kajian ini bertujuan untuk meneliti penerapan kemahiran berfikir aras tinggi (KBAT) dalam pembelajaran dan pemudahcaraan (PdPc) penulisan karangan argumentatif yang dilaksanakan oleh guru Bahasa Melayu di sekolah menengah. Dua orang guru Bahasa Melayu yang mengajar di Tingkatan Empat telah dipilih sebagai peserta kajian dengan menggunakan teknik persampelan bertujuan. Kajian ini telah dilaksanakan di sebuah sekolah menengah di Selangor. Reka bentuk penyelidikan kajian kes telah digunakan dalam kajian ini bagi menjawab tiga soalan kajian. Ketiga-tiga soalan kajian terdiri daripada (i) apakah pemahaman guru Bahasa Melayu di sekolah menengah terhadap penerapan KBAT dalam PdPc penulisan karangan argumentatif.', 'kemahiran berfikir-aras-tinggi ', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2018', 0),
(132, 'Hafiz Nidaullah', 'Prevalence, Antibiotic Resistance And Genetic Diversity Of Salmonella Serovars Isolated From Various Meats Of Wet And Hypermarkets In Pulau Pinang And Perlis Malaysia.', 'Present study has been endeavored to assess various niches of Salmonella in the chicken processing environment at various wet markets and small-scale processing plant in Penang and Perlis, Malaysia. In addition, qualitative risk characterization of antibiotic resistance, genotyphic resistance determinants, virulence potential and genetic diversity of Salmonella serovars isolated from various raw meats collected from different wet and hypermarkets was carried out in Penang, Malaysia. A total of 582 samples including chicken processing environmental samples (182) and various raw meat samples including beef, chicken, mutton, fish were collected from different wet markets (240) and hypermarkets (160).', 'prevalence antibiotic salmonella', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2018', 0),
(133, 'Mohamed Bin Sarbini', 'Kesediaan Malaysia Dalam Pelaksanaan Undang-Undang Jenayah Islam: Kajian Kes Ke Atas JKSM', 'Kesediaan memainkan peranan utama sebelum sesuatu pelaksanaan atau tindakan dilakukan lebih-lebih lagi apabila melibatkan aspek keagamaan. Tanpa kesediaan, seseorang mungkin akan tersilap melaksanakan sesuatu tidak teratur dan memberi kesan yang negatif atau sebalik daripada yang diharapkan. Beberapa kes seperti kes liwat Sukma Darmawan (2009), kes minum arak Kartika Sari (2009) dan kes qazaf yang membabitkan kejadian liwat (2015) menunjukkan tahap yang lemah dalam kesediaan dan kemampuan Mahkamah Syariah dalam menghadapi kes-kes jenayah syariah. Justeru, kajian ini mengandungi tiga objektif utama. Pertama, konsep kesediaan dalam pensyariatan hukum syarak ke atas individu mukallaf dan pemerintah.', 'undang-undang jenayah islam', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2018', 0),
(134, 'Ommar Hayat Abbasi', ' Non-State Actors And Nation Building In Pakistan: An Islamic Perspective.', 'Terrorism remains at the forefront of contemporary world stage. Conventionally, in the study of political science or international relations, the use of force has legally been understood as to be associated with the state and illegal and criminal for non-state entity(s). Therefore, the omnipotent states use force against any non-state entities involved in violence and declare them terrorists regardless of the nature of their demands. Because of its peculiarity, Pakistan has gone through sweetand- sour kind of relationship with the violent non-state actors (NSAs). Pakistans choice to adhere to which type of paradigm domestically was greatly influenced by its foreign relations. In this quagmire, it could neither build the state nor the nation as was needed. Although in the contemporary state-centric international structure, states remain the fountainhead of power.', 'nation-building islamic perspective', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2018', 0),
(135, 'Kamal Ibrahim Ahmed Alieyan', 'Rule-Based Approach For Detecting Botnet Based On Domain Name System', 'Botnets are a serious problem in todays Internet, and they result in economic damage for organizations and individuals. Botnets consist of thousands of infected hosts that receive instructions from command and control (C&C) servers operated by an individual. Traditionally, Internet Relay Chat (IRC) servers are used as C&C servers and communicate with the botnet through IRC channels. As a result, network administrators often block IRC traffic on their networks. Recent trends in botnet development have seen the use of alternative communication channels, such as domain name server (DNS), between the C&C servers and infected hosts (bots).', 'detecting botnet domain', '', 'Pusat IPv6 Termaju Negara (National Advanced IPv6 Centre of Excellence NAv6)', '2018', 0),
(136, 'Saif Addeen Ahmad Ali Alrababah', 'Multi Criteria Decision Making Approach For Product Aspect Extraction And Ranking In Aspect-Based Sentiment Analysis.', 'Identifying product aspects in customer reviews can have a great influence on both business strategies as well as on customers decisions. Presently, most research focuses on machine learning, statistical, and Natural Language Processing (NLP) techniques to identify the product aspects in customer reviews. The challenge of this research is to formulate aspect identification as a decision-making problem. To this end, we propose a product aspect identification approach by combining multi-criteria decision-making (MCDM) with sentiment analysis. The suggested approach consists of two stages namely product aspect extraction and product aspect ranking.', 'decision product ranking', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2018', 0),
(137, ' Nur Azzalia Kamaruzaman', 'Apoptosis And Genotoxicity Of Selected -Carboline Compounds Against Chronic Myelogenous Leukemia Using In Vitro Experimental Models.', '-carboline is known for its numerous traditional uses and has been widely investigated for various health indications. In particular, recently -carboline has shown some promising findings in the field of anticancer. Hence this study investigates the potential anticancer activity of -carboline compounds using in vitro models. Thirty synthesized -carboline compounds were tested using 3-(4,5-Dimethylthiazol-2-yl)-2,5-diphenyltetrazolium bromide (MTT) assay for anticancer activity and selectivity index (SI) against four human cancer (colon HT-29, cervical HeLa, liver Hep G2 and leukemia K562) and two non-cancer (mouse embryo fibroblasts BALB/c3T3 and human foreskin fibroblasts Hs27) cell lines.', 'genotoxicity carboline leukemia', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research)', '2018', 0),
(138, 'Mohannad Adel Mustafa Sayah', 'Fabrication Of Phantom For Quality Assurance Assessment In Cardiac Spect Imaging', ' Single-photon emission computed tomography (SPECT) is commonly used in nuclear imaging to detect myocardial infarction (MI) within a myocardial wall (MW). SPECT can identify areas of infarction in MW. In this work, a MI phantom was fabricated and designed to simulate the MW of the left ventricle (MWLV) in the end-diastole and end-systole stages. This work aimed to assess the MI phantom in both stages as a part of quality assurance assessment in cardiac SPECT imaging. In the end-diastole stage, when the defects were fixed at the anterior and inferior walls, the minimum detectable thickness was 2 mm regardless of the position of the phantom on the imaging table.', 'fabrication assurance cardiac', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(139, 'Suman Sinha', 'Structure Based Design And Synthesis Of Potential Dengue Virus NS2B-NS3 Protease Inhibitors', 'Dengue is transmitted by the bite of a mosquito infected with one of the five dengue virus serotypes. As far as anti-dengue drug discovery is concerned, among few established therapeutic targets, NS2B-NS3 protease is quite popular due to its role in production of mature viruses and plays a key role in maintaining infectivity. The work in this thesis described the computational and experimental studies in the design and synthesis of novel NS2B-NS3 protease from natural scaffolds such as lawsone and ferulic acid. In the case of naphthoquinone class of compounds, it was understood from docking studies that incorporation of molecular flexibility could lead to tighter binding compounds.', 'synthesis dengue inhibitors', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy) ', '2018', 0),
(140, 'Nuraddeen Usman', 'Automatic Interpretation Of Magnetic Data Using Euler Deconvolution With Modified Algorithm.', 'The conventional Euler deconvolution has five unknown parameters to be solve which are the location of source (x0, y0 and z0), the background field (B) and the structural index (N). Among these 5 unknowns, the structural index is to be manually selected by the user. The manual input of structural index into the Euler equation makes the technique to be subjective and semi-automated. The objectives of this research are, to automate Euler deconvolution equation and introduce a filter for discriminating reliable solution from the inversion output. It is also part of the objectives of this research, to assess the effect of inclination on the new technique and investigate the accuracy of the introduced algorithm.', 'interpretation magnetic deconvolution', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(141, 'Wong Ai Chin', 'The Effects Of Visual Signalling Principle In A Desktop Virtual Reality Based Learning Environment On Students Performance, Cognitive Load And Perceived Motivation. ', ' The purpose of this study was to investigate the effect of learning science laboratory safety using visual signalling principle in a virtual reality environment on students performance, cognitive load and perceived motivation among students with different spatial ability. A 22 quasi experimental factorial design was adopted in this research. The independent variables used in the learning of science laboratory safety were the two modes of courseware which is virtual reality with signalling (VRS) and virtual reality with non-signalling (VRNS). The moderator variable was the spatial ability.', 'visual virtual cognitive', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2018', 0),
(142, 'Muhamad Faizal Bin Pakir Mohamed Latiff', 'Adsorption Studies Of Heavy Metals On Activated Carbon Prepared From Agricultural Waste', 'Commercially available activated carbon (AC) is still considered expensive due to the use of non-renewable and relatively expensive starting material such as bituminous coal. Therefore, this study investigates the potential use of agricultural waste such as rubber seed coat (RSC) and corncob (CC) that available in Malaysia, as the precursor for the preparation of AC which can be applied for the removal of two types of heavy metal, which are Cu (II) and Zn (II) from aqueous solution. Physiochemical activation consisting of potassium hydroxide (KOH) impregnation plus carbon dioxide (CO2) gasification was used to prepare the ACs. The optimum preparation conditions of RSCAC-CU were found at activation temperature of 793 C, activation time of 1h and KOH impregnation ratio (IR) of 2.46. As for RSCAC-ZN, the optimum preparation conditions were at activation temperature of 797 C, activation time of 1h and IR of 2.61. Meanwhile, the optimum preparation conditions of CCAC-CU were found at activation temperature of 762 C, activation time of 2.7h and IR of 3.25. For CCAC-ZN, the optimum preparation conditions were at activation temperature of 768 C, activation time of 3h and IR of 3.5. All the activated carbons prepared were high BET surface area (>500 m2/g) and pore volume (>0.41 m3/g). RSCAC and CCAC demonstrated homogeneous and heterogeneous type pore structures, respectively. The effects of adsorbate initial concentration (10-100 mg/L), contact time, solution temperature (30-60 C), solution pH (2-6), isotherms and kinetics of the adsorption systems were evaluated through batch adsorption test. The Cu (II) and Zn (II) adsorption uptakes increased with increasing initial concentration and optimum contact time. Adsorptions of Cu (II) and Zn (II) on all ACs were best fitted by the Freundlich isotherm model. Adsorption kinetics of Cu (II) and Zn (II) followed pseudo-second-order on all the ACs. Fixed bed study showed that the exhaustion period for Zn (II) was greater than Cu (II) and the increase in bed heights resulted in higher exhaustion period.', 'adsorption metals waste', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2018', 0),
(143, 'Rosyaini Binti Afindi Zaman', 'Synthesize And Characterization Of Al2o3, Batio3, Tio2, CuoCcto Composites For Wideband Dielectric Resonator Application', 'Metallic antennas have been widely used in wireless communication system. In general this antenna is big in size with high tangent loss (tan ) and the bandwidth is narrow with low efficiency. These shortcomings can be solved by using ceramic materials with high dielectric constant (r) and low tan  such as CaCu3Ti4O12 (CCTO), known as dielectric resonator antenna (DRA). At 8 GHz, r is 62.76 and tan  is 0.1458 and resonated between 8.56 to 9.12 GHz with 6.6% bandwidth. However, its tan  is still considered as on the higher side (>0.1) and bandwidth coverage is less than 10% which is not able to cover a wider portion of the X band (8 GHz to 12 GHz) communication system. Therefore, to enhance the properties of DRA, CCTO properties can be modified through the addition with other oxides. In this research, Al2O3, BaTiO3, TiO2 and CuO, respectively, was added from 20, 40, 50, 60, and 80 wt% into CCTO. It was found that addition of Al2O3 has reduced r to 37.33 but has improved tan  value to the lowest value of 0.0520. This antenna resonated between 8.67 to 9.26 GHz with 5.61% bandwidth (addition 20 wt% Al2O3). The addition of BaTiO3 has increased r to 85.23 with addition 80 wt% and tan  in these series between 0.0627  0.0258. The result shows these composites resonated between 9.33 to 10.21 GHz with 8.91% bandwidth. The addition of 50 wt% of TiO2 shows r of 56.47 and tan  of these composites between 0.0165-0.1108, resonated from 10.03 to 11.36 GHz with 12.48% bandwidth. The highest r (67.52) was obtained from 50 wt% CuO added to CCTO, improved tan  (0.0203-0.0878) and resonated from 9.12  11.29 GHz with 21.26% bandwidth. These results show that all samples (mixtures) can be applied as DRA but mixture of 50CCTO/50CuO shows the best performance compare to others. For that reason, this mixture was further optimized and finally produced high r (67.52), low tan  (0.0141) and can also covered broader frequency range in X band which is suitable for the fabrication of a smaller DRA with better performance.', 'synthesize composites resonator', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2018', 0),
(144, 'Hayder Saad Abdulbaqi', ' HMRF Model For Brain Tumour Segmentation To Estimate The Volume Of MRI And CT Scan Images', 'Magnetic resonance imaging (MRI) and computed tomography (CT) are two of the most important imaging technologies that enable the doctors to gain a reliable segmentation and estimation of brain tumours. The current study aims to develop a diagnostic method for medical images (MRI and CT) to achieve an accurate and precise segmentation and estimation of brain tumours. The proposed method in the study was applied on datasets had been collected from the Cancer Imaging Archive (TCIA) and Iraqi hospitals. The proposed method based on adapting and developing hidden Markov random field (HMRF) model and threshold method to carry out the segmentation of the brain tumours.', 'brain segmentation scan-images', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(145, 'Hussien Salman Abdullah Al-Botany', 'Characteristics Of House Facade And Its Impact To Residents\' Visual Privacy In Erbil, Iraq', 'This study investigates the impact of house facade characteristics on the residents visual privacy in Erbil City, Iraq. The aim is to examine the correlation between house facade characteristics factors and residents visual privacy. The study will propose a conceptual model, which provides certain guidelines for architects to apply in designing modern houses facades. This study also aims to determine the most influential factor in achieving residents visual privacy. The study applies quantitative and qualitative research methods to answer the research objectives. Based on the mixed-method approach, a qualitative and a quantitative survey were carried out.', 'house facade residents', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2018', 0),
(146, 'Moayyad Mazen Alssabbagh', 'Design And Fabrication Of A 3d Printed Thyroid Phantom For Radiation Dosimetry.', 'Estimation of internal and external radiation dose from SPECT/CT procedures depends mainly on calculations of Medical Internal Radiation Dose (MIRD) methods. Currently, there is no dynamic thyroid phantom with a precise geometrical shape which can simulate the biokinetics of the radiopharmaceuticals in the thyroid. The goal of this study was to design and fabricate a three-dimensional (3D) dynamic thyroid phantom for dosimetry and image quality evaluation. Nine 3D printing materials were evaluated in terms of elemental composition, mass attenuation coefficients, CT numbers and mass density, where The Energy Dispersive X-ray Spectroscopy (SEM-EDS) machine.', 'fabrication thyroid radiation', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2018', 0),
(147, 'Marjan Ganjali Dashti', 'Transcriptomic Response Of Salmonella enterica Subspecies enterica serovar Typhi To Antibiotic Treatments During Biofilm Formation.', 'Salmonella Typhi (S. Typhi) is a human-specific pathogen which causes typhoid fever. One major factor contributing to typhoid persistence is the existence of asymptomatic typhoid carriers. Biofilm formation in the human gallbladder is postulated to be associated with development of the carrier-state. The aim of this study was to develop an optimized assay for S. Typhi biofilm formation in vitro that mimics the environment of the gallbladder. Six key variables involved in S. Typhi biofilm formation were optimized using Response Surface Methodology (RSM), and the resulting assay formed the basis for transcriptomic investigation of biofilm production, in the presence of the antibiotics kanamycin and chloramphenicol.', 'salmonella treatments formation', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2018', 0),
(148, 'Lam Kit Lay', ' Cytotoxic Effect, Anti-Proliferative And Cell Death Mechanism Of Latex C-Serum And Sub-Fractions Using Cell-Based Assay. ', 'Latex from Hevea brasiliensis, the natural rubber tree, has never been reported for folk medicinal use although highly regarded as an economic importance. Latex was thought to play a biological role in the plant defense system against microorganisms and insects. Due to scarce information available on the studies of its biological effects on mammalian system, cell viability assay using MTT, real-time PCR, cell cycle analysis and protein profiler analysis were used to evaluate the anticancer effects of and cell death pathway induced by whole C-serum (WC) and its fractions against the cancer-origin cell lines.\r\n\r\n', 'cytotoxic c-serum sub-fraction', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2018', 0),
(149, 'Siti Zahrah Mahfood', 'Kedudukan Politik Dan Sosioekonomi Masyarakat Melayu Dalam Akhbar Dan Majalah Terbitan Negeri Johor Sebelum Perang Dunia Kedua.', 'Tumpuan utama kajian ini adalah meneliti kedudukan politik dan sosioekonomi orang Melayu dalam akhbar dan majalah terbitan negeri Johor sebelum Perang Dunia Kedua. Selain meneliti faktor-faktor yang menjadikan Johor signifikan dalam kegiatan persuratkhabaran dan majalah sebelum Perang Dunia Kedua, objektif kajian ini adalah untuk menganalisis isu-isu berhubung kedudukan politik dan sosioekonomi orang Melayu yang dibahaskan dalam akhbar dan majalahterbitan negeri Johor dalam tempoh kajian. Kajian ini juga bertujuan meneliti isuisu tentang wanita yang dibangkitkan oleh majalah wanita keluaran negeri itu khususnya Bulan Melayu dari tahun 1930 hingga 1941.', 'politik sosioekonomi melayu', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2018', 0),
(150, 'Abdul Rauf Bin Abdul Rasam', 'Geospatial Modelling For Potential High Risk Tuberculosis Areas In Shah Alam, Selangor.', 'Malaysia has a medium burden of tuberculosis (TB) incidence based on World Health Organization (WHO) indicator, but the current trend of TB cases is generally increasing. The Ministry of Health (MOH), Malaysia has set up several guidelines to control the disease, however, the national TB technical report in 2015 highlighted that existing detection methods of TB on the site still need to be improved to strenghten the current TB control programme. A geospatial model is proposed in this study to identify potential high-risk areas of TB and targeted risk population especially for missing cases and undiagnosed people.', 'geospatial potential tuberculosis', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education) ', '2018', 0),
(151, 'Abdul Malik Haider Yusef Saad', ' High-Speed Implementations Of Fractal Image Compression For Low And High Resolution Images', 'Fractal Image Compression (FIC) is a very popular coding technique that is used in image/video applications due to its simplicity and superior performance. The major drawback of FIC is that it is a time consuming algorithm, especially when a full search is attempted. Hence, it is very challenging to achieve a real-time operation especially when this algorithm is run on a general or graphic processor unit. Therefore, in this research new hardware implementations of FIC are proposed for accelerating the encoding process by means of parallelism and pipelining. Various approaches have been investigated for achieving high speed performance. The computational complexity of fractal operations are first investigated in order to select the minimum and efficient bit sizes that can provide similar or nearly similar encoding quality. This has resulted in a relatively new FIC hardware which is referred in this thesis as Design I. In this design, a full-search approach was adopted in order to enable reconstruction at highest possible quality. However, full-search scheme is not suitable for encoding larger images since the encoding time is increased dramatically when processing high-resolution images. This problem is solved in Design II which used a partial-search based scheme in order to achieve high-speed operation. This method exploits the inherently high degree of correlation between pixels in the neighbourhood areas in digital image to restrict the search space to those areas. By fixing these areas for each group of range blocks and partitioning an image in which each domain block contains four range blocks, enabled two matching operations be performed simultaneously. This reduced the memory access by half, thereby, doubling the speed by a factor of 2. This design was extended to encode RGB image, resulting in another new design referred to as Design III. In this design, the strong cross-correlation between the image components was exploited so that only the G component was encoded using the same approach as in Design II, while the R and B components were encoded by searchless-based scheme with direct mapping between overlapped blocks. All three designs were examined in terms of runtime, peak-signal-to-noise-ratio (PSNR), and compression rate. The experimental results of Design I when implemented in Altera Cyclone II FPGA, showed speedup of 3 times, on average, while the PSNR was not significantly affected. Empirical results demonstrated that this firmware is competitive when compared to other existing full-search hardware with PSNR averaging at 30 dB, 5.82 % compression rate and a runtime of 9.8 ms. On the other hand, Design II was synthesised on Altera Stratix IV FPGA and showed an ability to encode a 10241024 image at 395 MHz in 10.8 ms with PSNR averaging at 27 dB and compression rate of 34. These results suggest that the proposed approach enables colour images be encoded at approximately same speed as grayscale images. Also the proposed architectures have achieved better performance compared to the state-of-the-art designs, with speed averaging at 100, 92 and 83 fps for Design I, II and III respectively.', 'high-speed image resolution', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2018', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(152, 'Luruthudass Annaniah', 'Development Of Inline Rapid Thermal Transient Test System For Crack Detection Of Alingap On Germanium Carrier', 'LEDs are the ultimate light source in the lighting technology and growing at double digit percentage for the past few decades. Despite of many virtues in LEDs, there are many challenges it have. One of it is die crack. In this work, the focus is on die-crack on die substrate of an AlInGaP LED at die attach (DA) process. Here the impact on electro-optical and thermal properties were investigated and a detection method was invented. The cracks were artificially created at Ge substrate using industrial grade DA equipment at bond force range from 40gF to 210gF. Die-crack length were measured using high magnification scope.', 'inline transient detection', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(153, 'Md Azharul Arafath', 'The Synthesis Of Group 10 Metals Schiff Base Complexes With Onn And Ons Groups: Characterization And Their Cytotoxicity And Antibacterial Activities', 'Twenty-one Schiff base ligands of salicyldehyde derivatives with heterocyclic amine, aniline and carbothioamide were synthesized. The ligands were coordinated to Group 10 transition metals Ni(II), Pd(II) and Pt(II). The synthesized compounds were characterized with physical parameters such as melting point and elemental analysis. These compounds were further characterized with spectroscopic techniques, i.e. FTIR, 1H NMR, 13C NMR, and UV-visible spectroscopy. The structure of most of the ligands were elucidated with single crystal X-ray diffraction analysis. The poly dentate ONS and ONN group containing ligands coordinated via imine nitrogen, phenolic oxygen and thiolate sulphur to form square planar complexes.', 'synthesis cytotoxicity antibacterial', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2018', 0),
(154, 'Hossien Bahri', 'A Multiple Case Study Of Integrating Translation Technology Modules Into Undergraduate Translation Programs. ', 'While the integration of translation technology modules into postgraduate translation programs has increased in recent years, this general trend is not commonly witnessed at the undergraduate level. There are still unresolved questions regarding the types of tools and resources, teaching, learning and assessment activities, the roles and qualifications of teachers, and how these translation technologies should be integrated into the undergraduate curriculum. To answer the above questions, an exploration of these practical issues was carried out from the perspectives of the module teachers and through the analyses of module documents.', 'integrating technology translation', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation)', '2018', 0),
(155, 'Nik Noorkhairulnissa Bt Nik Hassan', 'Kesan Modul Terapi Realiti (MTR) Terhadap Penghargaan Kendiri Dan Kemurungan Mangsa Buli.', 'Penganiayaan di sekolah merupakan tingkah laku buli dan telah menjadi satu masalah yang besar pada masa kini. Hal ini menunjukkan seolah-olah masalah buli ini merupakan satu budaya ketika di alam persekolahan. Kajian ini bertujuan membina dan menguji kesan Modul Terapi Realiti (MTR) terhadap penghargaan kendiri dan kemurungan mangsa buli. Berdasarkan modul ini, mangsa buli telah melalui enam sesi kaunseling sebagai intervensi. Modul ini dibentuk untuk membantu mangsa buli menangani isu berkaitan penghargaan kendiri dan tahap kemurungan. Tambahan lagi, kajian ini juga dijalankan untuk mengkaji kesan enam sesi kaunseling ke atas mangsa buli melalui ujian pra dan ujian pasca.', 'terapi kendiri mangsa-buli', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2018', 0),
(156, 'Saad Hatem Hasan Hidyan', 'Pragmalinguistic Analysis Of Selected Translations Of Surah Yusuf In The Holy Quran.', 'Dealing with the translatability of Speech Acts (SAs) in religious texts was the main focus of the present thesis. The present research carefully examined, detected, and analysed the presence of different speech acts in accordance with Austins and Searles classifications in the translation of Surah Yusuf. The verses in Surah Yusuf have been classified based on Austins and Searles categorisation. Moreover, they have been subject to a pragmatic analysis based on their associated contextual situations. The study consisted of six chapters. The first chapter presented the introduction, the statement of the problem, the objectives and the questions of the study.', 'pragmalinguistic translation surah-yusuf', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation)', '2018', 0),
(157, 'Wan Nurhadani Binti Wan Jaafar', 'Visualization Of Curve And Surface Data Using Rational Cubic Ball Functions', 'This study considered the problem of shape preserving interpolation through regular data using rational cubic Ball which is an alternative scheme for rational Bzier functions. A rational Ball function with shape parameters is easy to implement because of its less degree terms at the end polynomial compared to rational Bzier functions. In order to understand the behavior of shape parameters (weights), we need to discuss shape control analysis which can be used to modify the shape of a curve, locally and globally. This issue has been discovered and brought to the study of conversion between Ball and Bzier curve.', 'visualization rational cubic', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2018', 0),
(158, 'Jahanzeb Mudassir', 'Synthesis And Characterization Of pH-Sensitive Polyelectrolyte Nanogels For Oral Delivery Of Bovine Serum Albumin And Insulin As Model Proteins', 'Peptide and protein are administered parentrally owing to their instability and insufficient bioavailability through oral route. Parenteral administration is associated with poor patient compliance due to pain and discomfort by multiple injections. Oral administration can be beneficial to improve patient compliance and physiologic response to peptide and protein (e.g. insulin). The aim of the present study was to synthesize pH sensitive polyelectrolyte methyl methacrylate/itaconic acid (MMA/IA) nanogels to be used as a carrier for oral delivery of model proteins (BSA and insulin).', 'characterization polyelectrolyte bovine', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(159, 'Sabri Mansur Himeedh Shalbi', 'Shielding Properties Of Fly Ash Based Geopolymer Using Barium Sulphate For Diagnostic Radiology.', ' This work was conducted to study the properties of fly ash geopolymer (FAGP) in order to use as an alternative cement mortar (OPC) material as shielding material by adding barium sulphate (BaSO4) as an additional material. The fabrication of the FAGP involved the dissolution of aluminosilicate material in a highly alkaline solution and subsequent combination with sand. The shielding properties of FAGP were enhanced with the addition of BaSO4. The FAGP was dried in an oven for one day at 60 - 70 , and then cooled at room temperature for 28 days.', 'fly-ash geopolymer radiology', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2018', 0),
(160, 'Syed Muhammad Al-Amsyar Bin Syed Abd Kadir', 'The Synthesis Of Functionalized-Silica/Carbon Catalysts From Rice Husk For The Conversion Of Hexose Sugar Into Methyl Levulinate And 5-Hydroxymethylfurfural.', 'Recently, silica/carbon composite material has received much attention in heterogeneous catalysis due to its unique hybrid properties. However, the difficulties in designing green synthetic methods remain challenging. In this study, varied proportion of silica/carbon heterogeneous catalyst was prepared directly from rice husk by varying the carbonization temperatures (250, 300, 350, 400, and 450 C). The prepared composites were functionalized separately with sulfonic acid and aluminium oxide giving the following catalysts: sulfonated-silica/carbon (SO3H-SiO2/C-250, SO3H-SiO2/C-300, SO3H-SiO2/C-350, SO3H-SiO2/C-400, SO3H-SiO2/C-450) and silica/carbon-supported aluminium oxide (Al-SiO2/C-350, Al-SiO2/C-400, and Al-SiO2/C-450). For the SO3H-SiO2/C catalysts, the XRD data confirms these composites were amorphous.', 'silica conversion levulinate', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2018', 0),
(161, ' Nurazim Binti Ibrahim', 'Utilization Of Zeliac As An Alternative Adsorbent To Remove Low Level Concentration Of Nom In Riverbank Filtration', 'An increase of NOM in river water is a concern as it is the main precursor to health hazard disinfection by-products (DBPs) in conventional drinking water treatment system. River bank filtration (RBF) is a good option to reduce surface water pollution and overcome water shortage problem especially during extreme weather events such as droughts and floods. Therefore, this study aims to reduce the possibility of DBPs formation by controlling the level of NOM and treating it together with bio-colloids and ionic pollutant by composite adsorbent Zeliac in RBF. Water quality monitoring study shows that NOM in Kerian River recorded an average of 3.6 mg/L DOC and 0.10 cm-1 UV254. Total coliform exceeded the raw water quality standard with an average concentration of 1.5x104 MPN/100 mL. The same mean level of UV254 (0.03 cm-1) was determined in the water from RBF and LBWTP. Meanwhile, higher level of DOC measured from final treated water (1.6 mg/L) than RBF (0.81 mg/L). For bio-colloids in RBF, no E. coli was present but total coliform was still detected in the water. Other determined parameters were also reduced except for Fe and Mn. This finding signifies the water abstracted from RBF well still requires further treatment to ensure the water is safe and clean for human consumption. The characteristics study of Zeliac shows that the adsorbent has a surface area of 40.6 m2/g and average pore size of 16.5 nm. The existence of Ca, Si and Al makes Zeliac a good cations exchanger. In addition, hydroxyl and carboxyl groups proved that Zeliac can attract positive ions or anionic organic pollutants depending on the water sample acidity. According to the equilibrium and kinetic study, the removal of pollutants was controlled by multilayer adsorption onto heterogeneous surface of Zeliac. At optimum dosage of 7 g per 100 mL sample, the removal efficiency of UV254, colour and NH3-N were 72.8% (0.129  0.035 cm-1), 78.6% (42 - 9 PtCo) and 77.1% (0.70  0.16 mg/L), respectively. In column adsorption experiments, it was found that granular size of Zeliac gave no significant effect to the removal performance. The break point for UV254 and bio-colloids occurred at 103 and 31 hours of experiment respectively at hydraulic loading rate of 1 cm/min. These results show a good performance of Zeliac in removing both organic and ionic compounds in drinking water source as well as its capability as an alternative filter media in the RBF.', 'utilization concentration filtration', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2018', 0),
(162, 'Song Yoong Siang', 'Robust Controller Technique Of An Autonomous Underwater Vehicle For Underwater Pole Inspection.', 'The oil and gas offshore platform is facing unwanted marine growth problem. A periodic inspection of the submerged platforms leg is needed. This research studies the possibility to involve an Autonomous Underwater Vehicle (AUV) in the underwater pole inspection application. A predefined inspection path is needed to increase the efficiency of the AUV in the inspection mission. Besides, a robust control technique is needed suppress the effect of unknown hydrodynamic parameters and external disturbances on the AUV system. As a solution, this research proposed a time-optimal inspection path specifically for vertical pole inspection by using grid-based Coverage Path Planning (CPP). A planar map is modelled to represent the 3D target environment of the pole. Five patterns of inspection paths are designed and compared to choose the best inspection path among them. Moreover, a robust tracking control law combined with robust filter and fuzzy logic control techniques is proposed. The robust filter control technique is used to compensate the effect of added mass, hydrodynamic damping, model nonlinearities, coupling effect, and external disturbances on the AUV system, whereas the fuzzy logic control technique is used to improve the force profile. Furthermore, an open frame box-shaped AUV prototype which is suitable for pole inspection application is developed to verify the performance of the proposed controller. The proposed inspection path is designed based on Boustrophedons motion with smooth turning and vertical sweep direction. Calculation results show that the proposed inspection path can cover 99 % of the poles surface by the shortest inspection time and shortest trajectory length compared to others. Besides, simulation results show that the force profile of the proposed controller has been improved by the added fuzzy logic controller. The maximum control force generated by the proposed controller is 8.7 N less than that of the robust filter with high natural frequency. From the simulation results, the frequency of control signal given by the proposed controller is 0.1 Hz, which is lower than 2 Hz of Model Free High Order Sliding Mode Control (MFHOSMC) and 100 Hz of Time Delay Control (TDC). Besides, the maximum steady state error of the proposed controller is 0.0023 m, which is comparable to 0.0003 m of MFHOSMC and 0.0095 m of TDC. Furthermore, experiment results showed that the control signal of proposed controller has lower average switching frequency and lower saturation percentage than the MFHOSMC and TDC.', 'robust vehicle underwater', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2018', 0),
(163, 'Azrul Azizi Bin Amirrul', 'Reka Bentuk Pentas Dalam Falsafah Persembahan Wayang Kulit Kelantan.', 'Wayang kulit Kelantan adalah satu persembahan tradisional masyarakat Melayu. Persembahan wayang kulit Kelantan merupakan medium hiburan utama masyarakat Melayu tradisional hingga mencapai kemuncak penerimaannya pada awal tahun 60-an. Persembahan ini mempunyai unsur-unsur tradisional masyarakat melibatkan kepercayaan agama iaitu animisme, Hindu-Buddha dan Islam. Simbolik keagamaan Islam adalah tertumpu pada ilmu ketuhanan dan kerohanian. Setiap aspek persembahan saling berhubungan iaitu pendalangan, teks dan reka bentuk pentas mempunyai konotasi sistem kepercayaan agama masyarakat Melayu Kelantan.', 'pentas falsafah wayang-kulit', '', 'Pusat Pengajian Seni (School of the Arts) ', '2018', 0),
(164, 'Mohammad Faisal Bin Mohd Basir  ', 'Unsteady Boundary Layer Flow And Heat Transfer In Nanofluids With Microorganisms.', 'Boundary layer flows involving microorganism have attracted attention in recent years. Several problems involving such flows are investigated in detail in this thesis. The problems involve two dimensional laminar convective and threedimensional boundary layer flow with heat, mass and microorganism transfer under various physical configurations in the presence of velocity slip, thermal slip, mass slip, microorganism slip, Stefan blowing and zero mass flux boundary conditions. The fluid is assumed to be Newtonian (water), viscous, incompressible and has constant or variable transport properties.', 'boundary nanofluids microorganisms', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2018', 0),
(165, 'Chua Kah Heng ', 'The Effectiveness Of Nanoscience Activities In Improving Secondary School Students Attitude, Relevance, And Understanding Of Chemistry Concepts', 'Laboratory activities is seen as an essential part of teaching and learning of chemistry. In chemistry lessons, teacher is trying to extend students knowledge and develop their understanding of the ideas, theories and models that chemists have found useful in explaining and predicting its behaviour. At the same time foster a positive attitude towards chemistry lessons and increase the relevance of chemistry education among students. ', 'nanoscience students chemistry', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2018', 0),
(166, ' Abdul Haseeb', ' Evaluation Of Antimicrobial Stewardship Programs Implementation And Outcomes In Selected Hospitals At Makkah Region, Kingdom Of Saudi Arabia.', 'Antimicrobial stewardship programs (ASPs) are collaborative efforts to optimize antimicrobial use in healthcare institutions through evidence-based quality improvement strategies. The aim of this research was to evaluate the impact of ASPs in a critical care setting for improving antimicrobial use, cost efficiency and clinical outcomes at selected hospitals in Makkah, Kingdom of Saudi Arabia (KSA). In phase one study, an exploratory survey approach was adopted to determine the presence of morbidity caused by organisms in both out and in-patients blood isolates at two Saudi hospitals.', 'antimicrobial implementation hospitals', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2018', 0),
(167, 'Ayesha Imtiaz', 'Molecular Identification, Geometric Morphometrics And Phylogenetic Relationship Of Commercially Important Nemipteridae From Malaysian Waters And Neighboring Seas Inferred By mtDNA And Nuclear Genes', 'This study employed genetic and morphometric approaches to assess the molecular and morphometric differentiation as well as phylogenetic relationships among commercially important species of family Nemipteridae. Molecular investigations were conducted based on two mitochondrial and one nuclear genes on 210 individuals within 13 presumed species of family Nemipteridae from seven marine regions; Indian Ocean, Straits of Malacca, East South China Sea (ESCS), West South China Sea (WSCS), North South China Sea (NSCS), Sulu Sea (SS) and Celebes Sea (CS).', 'molecular geometric phylogenetic', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2018', 0),
(168, 'Muhammad Imran Sarwar', ' Rohc-Mpls Tunnel Architecture For Wireless Mesh.', 'Natural or human-made disasters are sudden events that can cause significant damage, especially to the network communication infrastructure. In these events, a rapid deployment of network communication systems is required in order to relay or receive the communication among the people in the disaster areas to conduct relief and rescue efforts. Wireless mesh networks have emerged and has been recognised for its potential for rapid deployment and last mile coverage of network infrastructure, which is highly suitable for emergency response management. While wireless mesh networks have beneficial attributes, it also introduces some crucial problems. During data transmission, the path recovery time is significantly higher resulting in the loss of data if node and link failures occur.', 'rohc-mpls architecture wireless', '', 'Pusat IPv6 Termaju Negara (National Advanced IPv6 Centre of Excellence NAv6) ', '2018', 0),
(169, 'Maryam Binti Sufian', 'Ecology, Distribution And Behaviour Of Rove Beetle, Paederus fuscipes Curtis (Coleoptera: Staphylinidae) In Relation To Human Settings', 'Paederus fuscipes Curtis has garnered tremendous interesin recent years because it causes nasty skin lesion in humans in tropical countries. This study focuses on the biological and behavioural aspects, the interactions with human residential premises and the isolation of bacteria associated with P. fuscipes. In the study of predator-prey interaction, P. fuscipes showed a Type II functional response for all prey species. At the high prey density they consumed predominantly more on Recilia dorsalis Motschulsky. Among the prey species, R. dorsalis and Nilaparvata lugens Stl were commonly preferred by P. fuscipes as compared to Nephotettix virescens Distant due to their small and soft body characteristics.', 'rove-beetle paederus human', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2018', 0),
(170, 'Omar F A Farhat ', 'Study Of Zinc Oxide Nanostructures Grown On Ptfe Substrate By Chemical Bath Deposition For Photodetector Application.', 'This project devoted to study physical properties of ZnO nanostructure grown on PTFE flexible substrate by chemical bath deposition. A flexible substrate (PTFE, trade name Teflon) was introduced to grow ZnO nanostructure for the first time for obtaining a substrate with a high melting point to improve the crystallization of the material deposited on it by annealing process. This flexible substrate may enable new markets for large-area printed electronics or low-cost disposable devices. Using flexible substrates to fabricate electronic devices promises lower manufacturing costs because of the additive, non-vacuum nature of the technology.', 'zinc-oxide substrate chemical', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2018', 0),
(171, 'Azharul Ariff Bin Kamarulzaman', 'Polycrystalline Gan Layer On M-Plane Sapphire Substrate For Metal-Semiconductor-Metal Photodetector.', 'This thesis describes work on depositing polycrystalline gallium nitride (GaN) on m-plane sapphire substrate using cost effective physical deposition technique; electron beam (e-beam) evaporator and radio frequency (RF) sputtering, followed by annealing treatment in ammonia (NH3) ambient. The work was then extended to develop metal-semiconductor-metal (MSM) photodetector using the most possible metal/metal oxide contact, to increase the efficiency of the device. The initial part of this thesis focus on ameliorating the properties of the polycrystalline GaN layer by controlling gas ambient, time, temperature, and gas flow rate of the annealing treatment.', 'polycrystalline sapphire metal', '', 'Institut Penyelidikan dan Teknologi Nano Optoelektronik (Institute of Nano Optoelectronics Research andTechnology (INOR)', '2017', 0),
(172, ' Azleena Binti Mohd Kassim', ' A Social- And Knowledge-Based Coalition Formation Using Modified Combinatorial Particle Swarm Optimization', 'The thesis main objective is to develop a new framework for social- and knowledge-based coalition formation (SKCF). The related sub-objectives are: 1) to define coalition and social factors to form a coalition formation model, 2) to develop a knowledge representation scheme to store knowledge of formed coalitions, and 3) to develop an effective algorithm to optimize the coalition which can also be treated as a clustering problem. In order to realize these objectives, the coalition factors are compiled from existing coalition formation work, whereas social factors are chosen to satisfy the coalitions payoff to address the selfish agent approach.', 'coalition combinatorial optimization', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '2017', 0),
(173, 'Ahmed Isam Khalee', 'Factors Affecting Nurses Motivation And Confidence For Increased Self-Regulated And Collaborative Learning In Second Life Environment', 'This study was conducted to investigate the potential use of Second Life (SL) to facilitate student nurses confidence and motivation, as well as its impact on their self-regulated and collaborative learning development. To build the SL environment, instructional design model of Dick and Carey was used to design the two learning scenarios of LifePak Defibrillator and anaesthesia machine. A quantitative research approach employing the survey method was used in this study. A model fit for Partial Least Squares (PLS)  Structural Equation Modeling (SEM) technique on 218 participants was produced to estimate the direct effect of environmental elements in terms of environment content design (ECD), environment interactivity (EI), and environment functionality (EF) on student nurses behaviour in terms of motivation and confidence.', 'nurses self-regulated learning', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2017', 0),
(174, 'Montawadee Krutmechai', ' Participatory Engagement And Womens Empowerment In An Alternative Public Health Model: A Case Study Of Buddhist Medicine Foundation Of Thailand ', 'It aims at identifying the nature of participatory engagement in BMFT, and the strategies used in creating participatory culture in the organisation. The study also explores whether BMFTs activities empower women, and assesses whether BMFT has the characteristics and potentials of a social movement. A mixed mode approach comprising survey questionnaires, in-depth interviews and participatory observations was employed to obtain data from seven groups of respondents, representing five regions of Thailand. A total of 1,413 respondents filled up the survey questionnaires and 60 respondents participated in the in-depth interviews.', 'participatory women public-health', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2017', 0),
(175, 'Leong Sim Siong ', 'Hydrodynamic Effect On Low Field Gradient Magnetophoresis Of Superparamagnetic Nanoparticles', 'Two-ways momentum transfer between moving magnetic nanoparticles (MNPs) and surrounding fluid (which is known as hydrodynamic effect) has been revealed to portray a vital role in low field gradient magnetophoresis conducted under microfluidic system. However, the effect of hydrodynamic on dynamical behavior of macroscopically scaled low gradient magnetic separation (LGMS) still remains unexplored even through it is particularly crucial in the design and optimization of magnetic separator for engineering applications. Therefore, it is the main purpose of this study is to understand the underlying mechanism of LGMS, especially to demonstrate the effect of hydrodynamic, and develop mathematical model to depict the dynamical behavior of this process. Evidently, magnetophoresis induced convective flow, which is resulted from hydrodynamic effect, was generated in MNP solution (even at very low particle concentration of 5 mg/L) subjected to low gradient magnetic field (<100 T/m) and significantly affects separation kinetics of it. Such induced convection is analogous to the natural convection found in heat transportation and can be characterized by the newly defined magnetic Grashof number. The analysis on magnetic Grashof number reveals that induced convection is only absent when particle concentration is below 0.05 mg/L. The intervention of hydrodynamic effect in LGMS has led to the two following phenomena: (1) the continuous homogenization of the MNP solution and (2) accompanying sweeping flow (convective velocity of 10-5 to 10-4 m/s was induced) that accelerates the collection of MNP (13 times fastercompared to the case without convection). Additionally, separation kinetics of hydrodynamically driven LGMS is solely controlled by the magnetic field gradient at the surface adjacent to the magnet (denoted as the collection plane of particles in this work) as well as the area of this surface and is independent of the magnetic field distribution across the solution. Also, the separation mechanism of LGMS can be classified according to the range of three dimensionless quantities (Reynold number', 'hydrodynamic magnetophoresisi nanoparticles', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2017', 0),
(176, 'Alotaiby Meshal Naif G', 'The Impact Of A Structured Counseling Technique By Pharmacist On Knowledge, Satisfaction, Quality Of Life, Adherence And Clinical Outcomes Among Asthma Patients At King Saud Hospital, Saudi Arabia.', ' The pharmacist is expected to play a vital role in chronic disease management. The present study aimed at developing an educational tool (booklet) and described a pharmacist--mediated structured medication counseling for asthmatic patients. It also determined the impact of pharmacist intervention on asthma patients knowledge, satisfaction, medication adherence, quality of life, clinical outcomes (peak expiratory flow rate, PEFR), and drug therapy-related problems (DTRPs). A randomized controlled trial compared the conventional routine counseling [control (n = 38)] with structured medication counseling provided by pharmacist [intervention (n = 37)] at the Outpatient Department of the Chest Clinic at King Saud Hospital, Qassim, Saudi Arabia.', 'counseling pharmacist asthma-patients', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2017', 0),
(177, 'Ng Kiaw Kiaw', 'Development Of A Peptide-Based System For Delivery Of Cas9:Sgrna Complexes Into Arabidopsis Thaliana.', 'Nowadays, CRISPR/Cas9 system has emerged as a powerful genome editing tool in various plant species, due to its simplicity and versatility. Typically, in plant system, Cas9 and sgNA are delivered into the plant cell in the form of DNA. However, the DNA delivery can be complicated with several problems, such as unexpected integration of exogenous DNA into plant genome, codon optimization and selection of promoter in respect to various plant species. To overcome these problems, a direct delivery system of Cas9:sgRNA complexes is needed for targeted genome editing in plants. Although there have been reports of the direct delivery Cas9:sgRNA complexes in protoplast and embryonic systems, there are no reports of the successful Cas9:sgRNA complexes delivery system in intact plant, owing to its hierarchical structures. Hence, the current study is aimed to develop a peptide-based delivery system for pre-assembled Cas9:sgRNA complexes into intact Arabidopsis thaliana for targeted genome editing.', 'peptide-based arabidopsis thaliana', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences) ', '2017', 0),
(178, 'Kavitha A/P Nowroji', 'Study Of Cytotoxic Mechanism And The Role Of Microrna In Mda-Mb-231 Cell Lines Treated With Phaleria Macrocarpa (Boerl.) Fruit Ethyl Acetate Fraction (Pmeaf)', 'Phaleria macrocarpa is a well-known medicinal plant which exhibited cytotoxicity against various cancerous cells. The objective of this study was to determine the in vitro cytotoxicity effect by biochemical assay through the regulation of miRNAs on MDA-MB-231 treated with Phaleria macrocarpa ethyl acetate fraction (PMEAF). Total phenolic content of PMEAF was expressed as 14.91  0.97 mg GAE/g. The 3-(4,5-dimethylthiazol-2-yl)-2,5-diphenyltetrazolium bromide (MTT) and CyQuant Cell Proliferation assay results indicated that PMEAF is a potential anticancer agent with the average IC50 values of 18.10 g/mL.', 'cytotoxic microrna phaleria', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2017', 0),
(179, 'Zain Rafique', 'Citizen Participation In Local Governance: A Case Study Of Health And Sanitation Sectors In Gujranwala, Pakistan', 'Contemporary development discourse confers a protuberant role to Citizen Participation (CP). To comply with this developmental demand, the Government of Pakistan introduced CP reforms and decentralization measures to use local governance system as a platform for localizing development and engaging local citizens. This thesis was designed to explore the level of Citizen Participation in the local governance system of Pakistan. The study explored both the subjective factors that include the role of stakeholders (local administrators, local political representatives, Civil Society Organizations and Citizens) and objective factors such as legal and administrative basis of CP.', 'citizen governance sanitation-sectors', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2017', 0),
(180, ' Izyan Yahaya', 'The Attitudinal Commitment Of Contractors For Site Environmental Practices In Malaysia. ', 'Direct involvement of contractors at construction site positioned them as the main party to influence the project environmental performance. However, the increasing concern of environmental issues at construction site indicated that commitment on this aspect need to be fortified. As the contractor firms consist of Top Management (TM) and Site Management (SM), their synchronized commitment is vital to strengthen their action towards environmental protection. This study aims to develop a framework of the contractors Attitudinal Commitment for Site Environmental Practices (SEPs) through the attainment of four research objectives, i.e. exploring the level of SEPs, assessing the Attitudinal Commitment of TM and SM, investigating the factors influencing the Attitudinal Commitment and demonstrating the connection of Attitudinal Commitment between the TM and SM. Two phases of investigations, i.e. (QUAN-QUAL) were employed in order to obtain more conclusive and comprehensive findings. In Phase 1, the level of SEPs implementation are explored and the Attitudinal Commitment of TM and SM are assessed. Through random sampling, a total of 194 responses were obtained from construction firms of grade G1-G7 from Peninsular Malaysia. Phase 2 involved interviews with 16 TM and SM from G7 firms that are identified through selective sampling.', 'attitudinal contractors site-environmental', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2017', 0),
(181, 'Noorulnajwa Diyana Binti Yaacob', ' Physio Mechanical, Thermal And Biodegradation Studies Of Paddy Straw Powder Filled Polylactic Acid And Poly 3 Hydroxybutyrate- Co-3- Hydroxyvalerate Biocomposites', 'Environmental problems associated with the use of synthetic polymers have resulted to the utilization of biodegradable polymer and natural fiber for producing fully biodegradable composite. This study has been carried out to produce such composites with the use of paddy straw powder (PSP) in the poly lactic acid (PLA) or poly(3-hydroxybutyrate-co-3-hydroxyvalerate) (PHBV). In this study, the effect of filler loading, treatment of natural filler and blending of two biopolymers on the mechanical, physical, thermal and biodegradability properties of composites were studied. Firstly, the PLA/PSP and PHBV/PSP composites containing 0-20 wt. % of PSP were prepared by using melt-blended mixing and compression molding method. The addition of PSP had resulted in reduced tensile strength for both of composites. The addition of PSP also showed reduction in thermal stability and has boosted up the water absorption percentages due to their hydrophilic nature. The tensile properties, FTIR, SEM and weight loss of soil buried samples proved the degradation activities over the predetermined time. In terms of comparison tensile strength of PHBV/PSP composites were lower than that of PLA/PSP composites. Thermal stability was also reduced but much lower as compared to PLA/PSP composites. After that the effect of chemical modification of PSP using acrylic acid (AA) and NaOH were studied on the mechanical properties, morphology and thermal properties of PLA/PSP composites. The treated composites with AA and NaOH have higher tensile properties compared to untreated composites. The chemical modification enhanced the thermal stability of treated composites. The FTIR analysis showed that chemical modification of PSP has reduced the hydroxyl group of PSP. The better interfacial interaction between PSP and PLA was proof by SEM. As compared both of the two types chemical modification, acrylic acid showed a good properties as compared to the sodium hydroxide. Furthermore, blending of two biopolymers which were PLA and PHBV was done in the ratio of 50:50. The PLA/PHBV blends were reinforced with the AA-treated PSP and the mechanical, thermal morphology and water absorption were studied. The tensile strength of the PLA/PHBV blends were slightly lower as compared to the pure PLA. The addition of the AA-treated PSP resulted in reduced tensile strength. As compared to the the PLA/PSP (AA-treated), the PLA/PHBV/PSP composites showed slightly lower tensile properties, thermal stability and water absorption. This may attributed to the relatively weak polymer-polymer interfaces and immiscibility between PLA and PHBV. Lastly, the fungal flora decomposing PLA/PSP and PHBV/PSP composites were investigated from the soil buried of these composites using streak plate method. 5 strains were isolated which are 3 strains from the PLA/PSP composites (PLA1, PLA2, PLA3) and 2 strains from PHBV/PSP composites PHBV1 and PHBV2). 18s sequencing method was applied in order to identify the species of the microorganisms. Based on the results, only two types of fungi, namely the Aspergillus fumigatus and Trichoderma harzianum were able to degrade the PLA/PSP composite, while for the PHBVB/PSP composite, two types of fungi also, namely the Aspergillus fumigatus and Aspergillus niveus, were involved.', 'physio biodegradation paddy-straw', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2017', 0),
(182, 'Lee Yie Vern', 'Screening For Potential Inhibitors Of Mycobacterium Tuberculosis Isocitrate Lyase: In Silico And In Vitro Approaches.', 'Tuberculosis (TB) that is caused by Mycobacterium tuberculosis (MTB) still remains as global epidemic and affects one-third of the world population, regardless of active TB or latent TB infection. The metabolism for active and latent MTB are different, for instance they have different energy generation cycle during active and latent stage. Instead of focusing on the drug targets during the active stage, which already have the effective therapeutic drugs, this study targeted isocitrate lyase (ICL), a potential target for dormant (latent) MTB energy generation cycle (glyoxylate cycle). Studies showed that without ICL, dormant MTB cannot survives within the lung of a murine model.', 'screening inhibitors tuberculosis', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2017', 0),
(183, 'Omalhassan Amir Abdelkarim Farag', 'Evaluation Of Clinical Outcomes And Direct Medical Cost Of Anemia Management Among End Stage Renal Disease Patients In Khartoum State Hemodialysis Centers', 'This research aimed to evaluate the prevalence of anemia, effectiveness of drug regimens, factors contributing to the control of hemoglobin levels, and factors contributing to cardiovascular events, hospitalizations, deaths, as well as, the annual direct medical costs of anemia treatment at government hemodialysis centers in Khartoum State, Sudan. This research was an observational prospective longitudinal study where all patients at the 12 dialysis centers were followed from August 2012 to July 2013. A total of 1015 patients were recruited in this study. Out of these, 194 (19.1%) patients were transferred to other centers, 165 (16.3%) died, 84 (8.3%) were lost during follow-up, and 38 (3.7%) underwent renal transplantation. A total of 534 (52.6%) patients completed the study and were included in the analysis. The majorities were males 307 (57.5%), the age ranged from 18-85 years, mean age was 48.716.1 years, and the median age was 50 years. The study found anemia in all the patients, hemoglobin level (<12 g/dL), whereas about 67% had a hemoglobin level <10 g/dL and only 20% had achieved the target Hb level (12 g/dL) in the last month. However, a significant improvement in mean Hb levels in seven drug regimens was found. Approximately 61% of patients received erythropoietin-stimulating agents (ESAs), and 87.1% received iron dextran. The most frequent anemia drugs regimen were \'ESA, intravenous (IV) iron, oral iron and vitamins (vitamin B12 and folic acid)\' for 39.5% of the patients. Only 27% of the patients were tested for ferritin and transferrin saturation.', 'clinical anemia renal-disease-patients', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2017', 0),
(184, 'Ismail Abdelwahab Ragab Fayed', ' Mall Apps Effects On Students\' Esl Writing Achievement, Attitudes Towards Learner Autonomy And Mobile Learning. ', 'This study investigates the effect of mobile assisted language learning (MALL) apps on students ESL writing achievement and their attitudes towards learner autonomy (LA) and mobile learning in the Foundation Program at Qatar University. A web-based writing app was developed by the researcher with different weekly learning modules and activities to be delivered through students own smartphones. The app modules were developed based on both the constructivist and the self-determination (SDT) learning theories. Moreover, the ASSURE instructional design model was used in the app design using a bring your own device (BYOD) approach.', 'mall-apps writing learning', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2017', 0),
(185, 'Ahmad Kainuwa', 'Dropout And Its Social Effects Among Secondary School Students Of Zamfara Nigeria. ', 'This research examined the dropout phenomenon and its social effects among secondary school students of Zamfara Nigeria. The discussion in the study is based on the theoretical framework of Social Capital Theory, Human Capital Theory and Self Determination Theory. A total of 620 respondents were involved in the quantitative study comprising of both dropout Students and non-dropouts. For the qualitative part, a sub-sample of dropouts, parents of dropouts, school teachers, administrators and senior education officers participated in the study.', 'dropout effect students', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2017', 0),
(186, 'Azam Abdelhakeem Khalid Ahmed', 'Relationship Between Internal Shariah Audit Characteristics And Its Effectiveness, Role Of Shariah Supervisory Board As A Moderator In Islamic Financial Institutions In Bahrain.', 'Audit Shariah dikendalikan oleh ketua jabatan audit dalaman di Institut Kewangan Islam (IFI) yang mempunyai pengetahuan dan kemahiran yang cekap terhadap Shariah. Kebanyakan daripada profesional tidak mempunyai waktu yang mencukupi untuk menimba pengalaman bagi memberi nasihat atau kecekapan dalam menguruskan transaksi IFI Shariah audit is performed by Head of internal audit department of Islamic financial institutions (IFIs) who is supposedly having adequate Shariah related knowledge and skills. Many professionals have not had enough time to gain the required experience to enable them to competently advise on or manage IFI transactions', 'shariah supervisory islamic-financial', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2017', 0),
(187, 'Malathi A/P Letchumanan', 'Exploring And Understanding The Use Of Mobile E-Book Among Mathematics Postgraduate Students', 'This study aimed to explore and understand the mathematics postgraduate students experience with mobile e-book. In particular this study presents appreciation of meaning and experience of mathematics postgraduate students in using the mobile e-book for their research activities.This study was guided by five research questions: (a) how do the mathematics postgraduate students use the mobile e-book?; (b) what are their main purposes of using the mobile e-book?; (c) what factors and how far these factors promote and hinder the use of the mobile e-book for learning activities; (d) how does the adoption of the mobile e-book affect the way the mathematics postgraduate students learn?; and (e) What are the information needed to develop guidelines to design future mobile e-book for the designers and academicians?', 'mobile e-book mathematics-students', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia) ', '2017', 0),
(188, ' Lalitha Muniandy', 'The Effects Of Structured Versus Unstructured Online Training Modules On Cyber Security Awareness And Perceived Behaviour Among College Students', 'This study investigated the effects of structured versus unstructured online training module on college students cyber security awareness and perceived cyber security behaviour. The two modes of online training modules were incorporated with the following cyber security aspects: password usage, phishing, social engineering, online scam and malware. The study was conducted in a well-established university college located in the Northern region of Peninsular Malaysia. A total of 240 respondents from four faculties of the university college participated in the study. A quasi-experimental, post-test design was adopted as a research design for the study. The respondents motivation types (intrinsic and extrinsic) as well as specialization areas (technical and non-technical) were manipulated as the moderating factors. Two instruments, Intrinsic and Extrinsic Motivation Scale Questionnaire (IEMSQ) and Cyber Security Behaviour and Awareness Instrument (CSBAI) were used in this study. IEMSQ was used to categorize the respondents according to their motivation types. CSBAI was used to measure the cyber security awareness and perceived cyber security behaviour after the training. The two online training modules were designed using the ADDIE Model, Gagnes Nine Events of Instruction and Mayers Cognitive Theory of Multimedia Learning. The contents of the modules were designed by incorporating Protection Motivation Theory (PMT). In structured online training module, the students were presented with the topics in a linear approach. The students were xxi presented with the learning materials in predetermined sequence. Conversely, in unstructured online training module, the student could choose and learn the sub topics of the main module according to their preference. Six null hypotheses were formulated for this study. Inferential statistical analysis methods, independent groups t-test and two-way ANOVA were used to analyze the data. The results of the study showed that structured online training module is more effective than the unstructured online training module in changing the perceived cyber security behaviour of the respondents. Both modules effectively instilled cyber security awareness among the respondents. The effect of motivation type is limited while specialization area did influence the cyber security awareness of the respondents. The types of online training modules played a more important role than the specialization areas in improving the perceived cyber security behaviour of the respondents. This shows that education and training are important in addressing issues related to cyber security awareness and behaviour of college students.', 'online training security-awareness', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2017', 0),
(189, 'Nuraini Binti Mohd Noor', 'Characterization, Pathogenicity And Chemical Control Of Colletotrichum Spp. Associated With Chilli (Capsicum Annuum And C. Frutescens) Anthracnose In Peninsular Malaysia', 'Anthracnose fruit rot caused by Colletotrichum spp. is a serious post-harvest disease causing losses of chilli in Peninsular Malaysia. For identification of the causal pathogen, many studies were only based on morphological characteristics which are not sufficient as many Colletotrichum spp. belongs to a species complex. Molecular characterization based on a single gene is also not sufficient especially to differentiate closely related species. Correct identification of Colletotrichum spp. associated with anthracnose is important to strategize suitable disease control methods and for quarantine purposes. In this study, morphological and molecular characteristics as well as pathogenicity of Colletotrichum isolates from chilli anthracnose were evaluated.', 'pathogenicity colletotrichum chilli', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2017', 0),
(190, 'Siah Poh Chiew', ' Effect Of Red Onion (Allium Cepa) Peel Extracts And Fractions On Cell Proliferative And Metastatic Activities In Mda-Mb-231', 'The present study was conducted with the objective to study the anti-cancer property of red onion (Allium cepa) peel extracts and its fractions by investigating the effects in MDA-MB-231, MCF-7 and Cal-27. The effects of red onion peel extracts and its fractions in the anti-proliferative activity, induction of apoptosis - programmed cell death and anti-metastasis were studied. In addition, the involvement of Wnt signalling pathway in the anti-cancer activity of red onion peel extracts and its fractions was also investigated. In the results, the extracts (E1 and E3) and fractions (F1, F2, F1W and F2W) showed promising inhibitory effect on cell viability of MDA-MB-231.', 'red-onion extracts proliferative', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2017', 0),
(191, 'Wong Yoke Ming', 'Design And Evaluation Of Artificial Catalysts That Possess Enzyme-Like Amidolytic Catalysis', 'In the present study, with the main goal of mimicking the amidase activity of protease,artificial polymer catalyst and peptide catalyst were designed and synthesized followed by various evaluations to investigate the validity of the design to possess enzyme-like amidolytic catalysis. Poly(N-isopropylacrylamide) microgel(NMG) has been developed by adding various functional groups to control surface charges, hydrophobicity, pKaand protein adsorption capacitybut seldom for enzyme mimics. Here, NMGsanchored with three types of functional groups were developed and studied aspolymercatalyststo hydrolyze amide bonds under evaluated mild conditions. Various evaluationstrategies were testedfor efficient hydrolysis activity on a p-nitroaniline-based substrate by using a colorimetric assay.', 'artificial enzyme amidolytic', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2017', 0);
