(237, 'Lee Woon Kiow', 'Detection Of Chipping In Ceramic Cutting Inserts From Workpiece Profile Signature During Turning Process Using Machine Vision', 'Ceramic tools are prone to chipping due to their low impact toughness. Tool chipping significantly decreases the surface finish quality and dimensional accuracy of the workpiece. Thus, in-process detection of chipping in ceramic tools is important especially in unattended machining. Existing in-process tool failure detection methods using sensor signals have limitations in detecting tool chipping. The monitoring of tool wear from the workpiece profile using machine vision has great potential to be applied in-process, however no attempt has been made to detect tool chipping. In this work, a vision-based approach has been developed to detect tool chipping in ceramic insert from 2-D workpiece profile signature. The profile of the workpiece surface was captured using a DSLR camera. The surface profile was extracted to sub-pixel accuracy using invariant moment method. The effect of chipping in the ceramic cutting tools on the workpiece profile was investigated using autocorrelation function (ACF) and fast Fourier transform (FFT). Detection of onset tool chipping was conducted by using the sub-window FFT and continuous wavelet transform (CWT). Chipping in the ceramic tool was found to cause the peaks of ACF of the workpiece profile to decrease rapidly as the lag distance increased and deviated significantly from one another at different workpiece rotation angles. From FFT analysis the amplitude of the fundamental feed frequency increases steadily with cutting duration during gradual wear, however, fluctuates significantly after tool has chipped. The stochastic behaviour of the cutting process after tool chipping leads to a sharp increase in the amplitude of spatial frequencies below the fundamental feed frequency. CWT method was found more effective to detect the onset of toolchipping at 16.5 s instead of 17.13 s by sub-window FFT. Root mean square of CWT coefficients for the workpiece profile at higher scale band was found to be more xxiv sensitive to chipping and thus can be used as an indicator to detect the occurrence of the tool chipping in ceramic inserts.', 'detection ceramic workpiece', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2017', 0),
(238, 'Ahmad Asad Abubaker', 'Automatic Multi-Objective Clustering Algorithm Using Hybrid Particle Swarm Optimization With Simulated Annealing.', 'Pengelompokan adalah suatu teknik pelombongan data. Di dalam bidang set data tanpa selia, tugas mengelompok ialah dengan mengumpul set data kepada kelompok yang bermakna. Pengelompokan digunakan sebagai teknik penyelesaian di dalam pelbagai bidang dengan membahagikan dan mengstruktur semula data yang besar dan kompleks supaya menjadi lebih bererti justru mengubahnya kepada maklumat yang berguna. Clustering is a data mining technique. In the field of unsupervised datasets, the task of clustering is by grouping the dataset into meaningful clusters. Clustering is used as a data solution technique in various fields to divide and restructure the large and complex data to become more significant thus transform them into useful information.', 'automatic algorithm optimization', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2016', 0),
(239, 'Armaghan Shafaei Darestani', 'Antihypertensive Properties Of Standardised Orthosiphon Stamineus Benth. Leaves Extracts And Its Nano Liposomes In Spontaneous Hypertensive Rats.', 'Kajian ini dijalankan untuk memenuhi jurang antara amalan herba peribumi dan sains perubatan kontemporari ke atas kesan antihipertensi daun Orthosiphon stamineus (OS). Kajian kualiti dan keselamatan bahan mentah tumbuhan diperiksa menggunakan analisis gravimetrik dan ujian had mikrob (MLT). This study was conducted to fulfill gaps between indigenous herbal practices and contemporary medicinal sciences on antihypertensive effect of Orthosiphon stamineus (OS) leaves. Quality and safety of the plant raw material were examined using gravimetric analysis and microbial limit test (MLT).', 'antihypertensive orthosiphon liposomes', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2016', 0),
(240, 'Abdallah Mohammad Mufadi Alharahsheh', 'The Translation Of Metaphors In Selected Political Speeches (1988  1999) Of King Hussein Of Jordan From Arabic Into English.', 'Peranan penting bahasa Arab di dunia telah mewujudkan permintaan yang signifikan bagi terjemahan daripada bahasa Arab kepada bahasa Inggeris. Metafora (isticarah) dalam retorik Arab merumus tahap pengetahuan dalam konteks gaya bahasa Arab dan ia merupakan elemen perbandingan penting yang mampu membangkitkan emosi yang kuat dan pemikiran yang mendalam pada manusia The growing role of Arabic language in the world affairs has created a significant demand for translation from Arabic to English. The metaphor (isticarah) in Arabic rhetoric, formulates the levels of knowledge within the context of styles of Arabic language and it is an essential comparative element that is capable of evoking strong emotions and deep thoughts in human beings', 'translation metaphors speeches', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2016', 0),
(241, 'Sun Qingjiu', ' Rural-Urban Migrants Sense Of Place In Baoding City, China.', 'Sejak tahun 1978 hingga 2015, kadar perbandaran di China meningkat daripada 17.92% ke 56.10%. Migrasi luar bandar-bandar, yang menjadi pemacu utama pertumbuhan bandar sejak beberapa dekad yang lalu, tidak hanya mengubah landskap sosial, ruang dan ekonomi di bandar-bandar di China, malah juga menjadikan latar bandar lebih pelbagai, hidup dan dinamik From 1978 to 2015, Chinas urbanization rate rose from 17.92% to 56.10%. Rural-urban migration, the main driver of urban growth in the past few decades, has not only changed the social, spatial, and economic landscapes of Chinese cities but also made the urban scene much more diverse, lively, and dynamic', 'rural urban migrants', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2016', 0),
(242, 'Elham Shafaei Darestani', ' The Significance Of Melancholia In Art', 'Kajian ini meneliti fenomena melankolia sebagai keadaan emosi yang kondusif dalam mewujudkan suasana minda yang produktif This research examines the phenomenon of melancholia as an emotional condition that is conducive for a productive state of mind', 'significant melancholia art', '', 'Pusat Pengajian Seni (School of the Arts)', '2016', 0),
(243, 'Wong Chyn Boon ', 'Development Of Lactobacillus Plantarum Antibacterial Proteins As Bacteriocides Against Staphylococcus Aureus', 'Empat puluh tiga strain bakteria asid laktik telah diasingkan dan dikenalpasti daripada sayur-sayuran segar, buah-buahan segar dan produk penapaian. Supernatan bebas sel (CFS) Lactobacillus plantarum USM8613 (L. plantarum USM8613) yang telah dineutralkan yang menunjukkan kesan rencatan lebih kuat (P<0.05) terhadap Staphylococcus aureus (S. aureus) berbanding semua strain yang dikaji telah dipilih untuk analisis seterusnya Forty-three strains of lactic acid bacteria (LAB) were isolated and identified from fresh vegetables, fresh fruits and fermented products. Neutralised cell-free supernatant (CFS) of Lactobacillus plantarum USM8613 (L. plantarum USM8613) exerted the strongest inhibitory effect (P<0.05) against Staphylococcus aureus (S. aureus) compared to all LAB strains studied. Thus, it was selected for subsequent analyses', 'lactobacillus bacteriocides staphylococcus', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology) ', '2016', 0),
(244, 'Baker (M. Tayseer) Abdallah Ababneh', 'Characterisation Of Solid Wood And Almond Gum Bonded Rhizophora Spp. Particleboard As Breast Phantom For Mri And Ct. ', 'Tujuan penyelidikan ini adalah mengkaji kesesuaian penggunaan keaslian (kayu padu asli) fabrikasi Rhizophora spp. Papan partikel sebagai fantom payu dara bagi penggunaan aplikasi MRT dan CT. Masa santaian T1 dan T2, nombor-nombor CT dan ketumpatan bagi Rhizophora spp. The aim of this research is to study the suitability of using natural (fresh solid wood) and fabricated Rhizophora spp. particleboard as a breast phantom for MRI and CT application. The relaxation times T1 and T2, CT numbers and density for the fresh Rhizophora spp.', 'solid wood rhizophora', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(245, 'Nurmawati Abdullah Basyah', 'Ciri-Ciri Psikometrik Instrumen Dan Profil Kualiti Kehidupan Kerja Guru Sekolah Rendah Di Acheh, Indonesia Dan Di Tiga Negeri Utara Malaysia', 'Kajian ini bertujuan untuk mengkaji kesetaraan pengukuran instrumen silang negara, dan melakukan evaluasi ciri-ciri psikometri item instrumen Kualiti Kehidupan Kerja Guru merentas negara antara Malaysia dan Indonesia. Konstruk Kualiti Kehidupan Kerja Guru terdiri daripada empat dimensi keperluan iaitu: Psikologi, Sosial, Politik, dan Ekonomi. Kajian merentas budaya antara Malaysia dan Indonesia melibatkan perbandingan sampel guru daripada populasi yang berbeza budaya. Kajian ini melibatkan 400 orang guru yang mengajar di sekolah rendah (dasar) di negeri Pulau Pinang, Kedah dan Perak (Malaysia) dan 400 orang guru yang mengajar di sekolah-sekolah dasar wilayah Acheh (Indonesia) iaitu: Banda Aceh, Pidie Jaya, Aceh Tamiang, dan Kota Langsa yang dipilih secara rawak.. Kajian ini dilaksanakan dengan mentadbirkan instrumen Kualiti Kehidupan Kerja Guru yang dibina oleh Nordin et al. (2009) dalam versi Malaysia dan Indonesia dan menilai ciri-ciri psikometrik instrumen merentas negara dari beberapa aspek seperti keserasian item dan individu, unidimentionaliti, kebebasan setempat, kebolehpercayaan item dan skor responden, serta pengesanan keterbezaan fungsi item (DIF) merentas Malaysia dan Indonesia. This study aims to examine and evaluate the measurement equivalence and psychometric properties of cross-cultural instruments measuring Teacher Quality of Work Life (TQWL) between Malaysia and Indonesia. The construct of Teacher Quality of Work Life (TQWL) consists of four main dimensions namely: Psychological Needs, Social Needs, Political Needs, and Economical Needs. This Cross-cultural study involves a comparison of 400 respondents from Malaysia and 400 respondents from Indonesia respectively. The sample in this study consists of teachers teaching in primary school in the state of Penang, Kedah and Perak (Malaysia) and in primary schools in Aceh province (Indonesia), namely: Banda Aceh, Pidie Jaya, Aceh Tamiang, and Kota Langsa. This study was conducted by administering TQWL instrument developed by Nordin et al. (2009) in Malaysia and Indonesian version and the psychometric properties were examined from several aspects such as fit statistic, unidimensionality, local independence, reliability and person scores, and Differential Item Functioning (DIF) across-nation between Malaysia and Indonesia.', 'psikometrik kualiti guru', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2016', 0),
(246, 'Nayel Musallam Ahmad Ramadneh', 'Evaluation Of Cader Ict Programme And Cader Ict Support System Management On Teachers Ict Proficiency', 'Kajian ini menilai program TMK CADER dan sokongan sistem TMK CADER terhadap sistem pengurusan terhadap penguasaan TMK guru. Penyelidik mengkaji kandungan program TMK CADER sistem sokongan TMK dan kemahiran ICT guru-guru sains \'yang dikehendaki oleh Kementerian Pelajaran. Perbincangan dalam kajian ini adalah berdasarkan kepada rangka kerja teori modal sosial, teori modal manusia dan model Dunn. Teori-teori dan model ini amat sesuai untuk kajian ini kerana dapat memberi kefahaman kepada para pembaca berkenaan program TMK CADER dan sokongan sistem pengurusan TMK CADER terhadap penguasaan profisiensi TMK ICT guru untuk dinilai. Seramai 15 orang responden telah terlibat dalam kajian kualitatif yang terdiri daripada pengurus dan jurulatih dari CADER, pengurus dan penyelia daripada Kementerian Pelajaran Jordan. Bagi kajian kuantitatif, seramai 254 responden telah digunakan. Mereka terdiri daripada guru-guru sains di sekolah-sekolah menengah yang mempunyai diploma dan juga datang daripada empat buah negeri di Jordan seperti Amman, AL-Zarqa, Al Balqa dan Madaba. This research evaluated the CADER ICT programme and CADER ICT support system management on teachers ICT proficiency. The researcher investigates the content of CADER ICT programme , CADER ICT support system and science teachers ICT proficiency required by the Ministry of Education. The discussion in the study is based on the theoretical framework of social capital theory, human capital theory and the Dunns model. These theories and model are appropriate for the study because they allowed the reader to understand how CADER ICT programme and CADER ICT support system management on teachers ICT proficiency were evaluated. A total of 15 respondents were involved in the qualitative study comprised of managers and trainers from CADER and managers and supervisors from Jordan Ministry of Education. For the quantitative study 254 respondents were used, these comprised of science teachers in secondary schools who had diploma and also come from four state of the middle region of Jordan which include Amman, AL-Zarqa, Al-Balqa and Madaba.', 'cader ict programme-support teachers', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2016', 0),
(247, 'Azlyn Binti Ahmad Zawawi', 'The Role Of Tasks, Composition, Context, And Trust As Predictors Of Nursing Team Performance In Malaysian Public Hospitals.', ' Kajian ini bertujuan untuk (a) mengkaji hubungan langsung antara ciri-ciri pasukan (tugas pasukan, komposisi pasukan, dan konteks pasukan) dengan prestasi pasukan; dan (b) mengkaji hubungan tidak langsung antara ciri-ciri pasukan (tugas pasukan, komposisi pasukan, dan konteks pasukan) dengan prestasi pasukan melalui kepercayaan pasukan sebagai perantara. Prestasi pasukan terbahagi kepada dua dimensi, iaitu prestasi tugas dan prestasi konteks. Prestasi tugas berkisar tentang pengetahuan teknikal pasukan dan aktiviti teknikal yang menjadi teras kepada organisasi. Sementara itu, prestasi konteks ialah aktivitiaktiviti yang melibatkan persekitaran sosial dan psikologi organisasi, seperti tingkah laku membantu, penerimaan terhadap cadangan atau kritikan, dan kerjasama ahli pasukan. Tiga peramal prestasi pasukan (tugas pasukan, komposisi pasukan, dan konteks pasukan) telah dikaji dalam kajian ini. Tugas pasukan termasuk identiti tugas, kepentingan tugas, dan kebergantungan tugas, manakala komposisi pasukan terdiri daripada ciri-ciri kepelbagaian dan kemahiran pasukan. Sementara itu, konteks pasukan terdiri daripada persepsi ahli terhadap sokongan pasukan dan gaya kepimpinan transformasi oleh ketua pasukan. Dengan kadar respons sebanyak 93%, kajian ini melibatkan 300 pasukan jururawat (1436 jururawat) daripada tujuh hospital negeri di Semenanjung Malaysia. This study was aimed to (a) examine the direct relationship between team characteristics (team task, team composition, and team context) and team performance; and (b) examine the indirect relationship between team characteristics (team task, team composition, and team context) and team performance via the mediating role of team trust. Team performance was operationalized as constituting of two dimensions which are: team task performance and team contextual performance. Team task performance revolved around the teams technical knowledge and the technical core activities of the organization. Meanwhile, team contextual performance involves activities that are affecting the organizations social and psychological environment, such as teammates helping behavior, acceptance towards suggestions or criticisms, and cooperation. Three predictors of nursing team performance (team task characteristics, team composition characteristics, and team context characteristics) were examined in this study. Team task characteristics include task identity, task significance, and task interdependence. Whereas, team composition characteristics consisted of team diversity and team skills. Meanwhile, team context characteristics comprise perceived team support and transformational leadership style of the team leaders. With a response rate of 93%, this study involved a total of 300 nursing teams (1436 individual nurses) from seven state hospitals in Peninsular Malaysia.', 'task nursing-team hospital', '', 'Pusat Pengajian Pengurusan (School of Management)', '2016', 0),
(248, 'Fouad Saleih Resq Al-Suede', 'Investigation Of Molecular Mechanisms Underlying The Anti-Tumor And Anti-Angiogenic Activities Of Orthosiphon Stamineus Towards Colorectal Cancer. ', 'Teh Orthosiphon stamineus Benth. (Lamiaceae) digunakan secara meluas dalam perubatan tradisional. Kajian terbaru menunjukkan bahawa 50% ekstrak ethanolik daripada Orthosiphon stamineus (EOS) dan sebatian aktif, asid rosmarinik (RA), memaparkan kesan-kesan anti-angiogenik, anti-radang dan anti-tumor yang ketara dalam pelbagai model eksperimen. Walau bagaimanapun, mekanisme yang mendasari sifat-sifat ini tidak dinilai dengan sepenuhnya. Kajian yang dijalankan ini bertujuan untuk menilaikan lagi mekanisme molekul yang mendasari anti-tumor dan anti-angiogenik. Dalam model eksperimen penghijrahan, perkembangan dan pembentukan tiub, cerakin kedua-dua EOS dan RA aktif menyebabkan perencatan ketara terhadap fungsi sel endothelial manusia (HUVECs) yang penting bagi merangsang proses angiogenesis. Dalam kedua-dua kajian in vitro dan in vivo, penindasan besar neovaskularisasi dalam model aorta tikus, CAM dan plug matrigel juga diperhatikan. Kajian cerakin multipleks menunjukkan pengurangan faktor pertumbuhan utama bagi lata pro-angiogenik dan perkembangan tumor iaitu faktor pertumbuhan endothelial vaskular (VEGF), faktor pertumbuhan fibroblast asas (b-FGF), transformasi faktor pertumbuhan transformasi (TGF-), faktor nekrosis tumor (TNF-) dan interleukin-1, 2, 7. Orthosiphon stamineus Benth. (Lamiaceae) tea is widely consumed traditionally for its vast medicinal value. Recent studies revealed that 50% ethanolic extract of Orthosiphon stamineus (EOS) and its active compound, rosmarinic acid (RA), displayed significant anti-angiogenic, anti-inflammatory and anti-tumor effects in various experimental models. However, the mechanisms underlying these properties have not been fully evaluated. The present work aims to further evaluate the molecular mechanisms underlying its anti-tumour and anti-angiogenic properties. In migration, proliferation and tube formation assay, both EOS and its active RA caused significant inhibition of human endothelial cell (HUVECs) functions crucial for promotion of angiogenesis. Both in vitro and in vivo studies revealed significant suppression of neovascularisation in rat aortic ring, CAM and matrigel plug. Multiplex array studies showed reduction of key growth factors for pro-angiogenic cascade and tumor development i.e. Vascular endothelial growth factor (VEGF), basic fibroblast growth factor (b-FGF), transforming growth factor alpha (TGF-), tumor necrosis factor (TNF-) and interleukin-1, 2, 7.', 'molecular anti-tumor anti-angiogenic', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2016', 0),
(249, 'Ashraf Ahmed Ali Abdusalsalam', ' In-Vitro And Molecular Docking Studies Of Seven Selected Myrtaceae Plants For Neuraminidase Activity. ', 'Virus influenza A menyebabkan masalah kesihatan yang teruk kepada manusia dan beberapa spesies haiwan yang boleh membawa kepada morbiditi dan kematian dalam kalangan pesakit yang dijangkiti. Influenza A virus cause severe health problems to humans and several animal species which could result in morbidity and mortality in infected patients. Oseltamivir (Tamiflu) and zanamivir (Relenza) are two current drug used NA inhibitors that have been approved by the Food and Drug Administration (FAD, USA).', 'in-vitro myrtaceae neuraminidase', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy) ', '2016', 0),
(250, 'Mohd.Razealy Anuar', 'Acid-Base Bifunctionalized Hydrotalcite Catalyst for Biodiesel Production from Waste Cooking Oil Using Ultrasound-Assisted Reactor System', 'This research work is focused on the development of an advanced catalytic fatty acid methyl ester (FAME) production from waste cooking oil using an ultrasound-assisted system. Hydrotalcite (HT) catalyst prepared using combustion method was employed with some structural modification in order to develop acid-base bifunctionalized HT. The acid-base bifunctionalized HT was meant to be beneficial in conducting simultaneous transesterification and esterification reaction. The use of ultrasound-assisted system could overcome the emulsification and mass transfer limitations due to immiscibility of oil and alcohol. Hence, reaction time could be significantly shortened. Two important parameters to synthesize MgAl based HT i.e. calcination temperature (550 oC850 oC) and fuel type (saccharose, glucose and fructose) were particularly investigated. Alteration on MgAl based HT structure was done by introducing second divalent metals (nickel, copper and zinc). The amphoteric properties of these transition metals successfully resulted in bifunctional acid-base properties of HT. The structural, crystallinity, surface morphology, thermal decomposition, bonding characteristics and acid strength of the synthesized HT were elucidated by several characterization techniques. The dependence of HTs characteristics on the synthesis parameters and correlations with their catalytic performance under ultrasound condition were successfully studied. The MgAl based HT catalyst prepared using saccharose and calcined at 650 oC showed high biodiesel yield (about 76.45 %) in just 60 minutes in the presence of low ultrasound amplitude (~11 kHz). Meanwhile, HT introduced with 10 % nickel demonstrated the highest FAME yield of about 86.84 % in just 60 minutes. The simultaneous transesterification and esterification reactions were evidently demonstrated by carrying out the FFA test reaction. The FAME yield was found to increase due to the esterification of FFA to FAME. The HT catalyst synthesized was highly stable which was capable to perform several cycles of reaction with significantly low total FAME reduction (4.52 %) and with no significant leaching of active component. The optimization study successfully demonstrated effects of 4 independent reaction variables i.e. reaction time (30-90 min), methanol to oil ratio (7:1-23:1), amplitude (40-60 %) and catalyst amount (0.06-0.08 g catalyst/ g oil). A quadratic model is generated with 95.84 % of confidence level. The most reasonable optimum parameters with the smallest error (1.15 %) are identified. The quality of the obtained FAME was evaluated which conform to the ASTM D6751 and EN 14214 specifications. Lastly, kinetic study was also investigated and the apparent activation energy for the simultaneous transesterification and esterification reactions (73.11 kJ/mol) is lower than that of transesterification reaction (81.16 kJ/mol) which indicates an accelerated reaction.', 'acid-based biodiesel reactor-system', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2016', 0),
(251, 'Mohd Fahmi Bin Awalludin', 'Preparation And Optimization Of Liquefied Oil Palm Trunk Based Adhesive For Particleboard Application.', 'Pemanfaatan sisa batang kelapa sawit (OPT) melalui kaedah pencecairan merupakan subjek yang diberikan perhatian. Ujikaji pencecairan OPT dalam etilena glikol dan gliserol, dengan pemangkin H2SO4, pada suhu 150 C telah dijalankan berdasarkan rekabentuk eksperimen (DoE) dengan bantuan perisian Stat-Ease Inc., Design-Expert Versi 7. Rekabentuk 24-1 pecahan faktoran telah digunakan di peringkat saringan di mana faktor-faktor seperti jenis pelarut, peratusan pemangkin asid sulfurik (H2SO4) dan masa pencecairan adalah penting kepada hasil pencecairan. Walaubagaimanapun, faktor stok suapan OPT dilihat kurang memberikan kesan. Faktor-faktor yang penting tadi beserta kesan percampuran pelarut pencecairan dikaji lebih lanjut dengan bantuan rekabentuk gabungan D-optimal. Proses pencecairan OPT dalam gliserol memberikan lebih banyak hasil berbanding dalam etilena glikol. Model yang telah dipilih ialah Linear (L) untuk campuran manakala 2Faktor Interaksi (2FI) untuk proses. Ketika proses pengoptimuman dan pengesahan, keadaan eksperimen yang dicadangkan untuk hasil yang optimum ialah campuran 34% etilena glikol terhadap 66% gliserol, 4% H2SO4, dan masa pencecairan selama 116 minit. Utilization of waste oil palm trunk (OPT) through liquefaction is the subject of interest. Liquefaction of OPT in ethylene glycol and glycerol, with H2SO4 as a catalyst, at a temperature of 150 C was carried out based on experimental design (DoE) aided by software Stat-Ease Inc., Design-Expert Version 7. A 24-1 fractional factorial design used in screening phase showed that factors such as types of solvents, percentage of sulphuric acid (H2SO4) catalyst and liquefaction time found to be important. However, factor of OPT loading was found to be less important. Those important factors and different solvent mixtures were studied further by implementing combined D-optimal design. Liquefaction of OPT in glycerol found to give more yield than in ethylene glycol. The selected empirical model was Linear (L) for mixture, while 2Factor Interactions (2FI) for process. For optimization and model verification, the proposed solution for an optimal result was a mixture between 34% ethylene glycol to 66% glycerol, 4% H2SO4, and 116 minutes liquefaction time.', 'liquefied oil-palm particleboard', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2016', 0),
(252, 'Noor Nazihah Binti Bahrudin', 'Fabrication, Photocatalytic And Adsorption Of Immobilized Tio2/Chitosanmontmorillonite And Tio2/polyaniline Bilayer Systems For The Removal Of Methyl Orange Dye From Aqueous Solutions.', 'Kajian ini adalah usaha untuk membangunkan dua sistem dwilapisan terpegun untuk penyingkiran secara fotomangkinan-penjerapan pewarna metil oren (MO) daripada larutan akueus. Sistem dwilapisan terpegun melibatkan penjerap spesifik dan TiO2 di atas plat kaca yang dinamakan TiO2/kitosan-montmorilonit (TiO2/CS-MT/GP) dan TiO2/polianalina (TiO2/PANI/GP) masing-masing telah difabrikasi melalui teknik pelitupan celup. This study was an effort to develop two immobilized bilayer systems for the photocatalytic-adsorptive removal of methyl orange (MO) dye from aqueous solution. The immobilized bilayer systems involving specific adsorbents and TiO2 on the glass plates namely TiO2/chitosan-montmorillonite (TiO2/CS-MT/GP) and TiO2/polyaniline (TiO2/PANI/GP) systems had been fabricated via a dip coating technique. In this study, CS-MT and PANI, respectively functioned as the sub-layer while TiO2 photocatalyst was made as the top layer.', 'chitosanmontmorillonite polyaniline methyl-orange-dye', '', 'Pusat Pengajian Sains Kimia (School of Chemistry) ', '2016', 0),
(253, 'Maryam Bijami', 'The Effects Of Socio-Cultural Factors And Socio-Economic Status On The Writing Performance Of Iranian Tertiary Learners.', 'Kajian ini mengkaji bagaimana faktor sosiobudaya dan status sosioekonomi memberi kesan terhadap prestasi penulisan pelajar ijazah pertama Iran yang mengikuti pengkhususan dalam terjemahan dan literatur bahasa Inggeris. Perlu dicatatkan bahawa faktor sosiobudaya dalam kajian ini mencakupi gender, penglibatan ibu bapa, penglibatan adik-beradik, maklum balas guru dan juga maklum balas rakan. Sementara itu, status sosioekonomi (SES) mencakupi pendidikan ibu bapa, pekerjaan ibu bapa dan pendapatan keluarga. Bagi memenuhi objektif kajian dan persoalan penyelidikan, suatu reka bentuk penyelidikan kaedah bercampur digunakan untuk mentriangulat kedua-dua data kualitatif dan kuantitatif. Penyelidik menggunakan pensampelan bukan-kebarangkalian (jenis bertujuan) di empat buah universiti, iaitu Shahid Bahonar University, Vali-e-Asr University, Isfahan University dan Shiraz University. Seramai 400 orang pelajar daripada keempat-empat universiti tersebut yang mengikuti pengkhususan dalam bidang terjemahan dan literatur bahasa Inggeris, terlibat sama dalam kajian ini secara sukarela. Bagi fasa kuantitatif, data diperoleh daripada tugasan penulisan dan soal selidik. Sebaliknya bagi fasa kualitatif, data dikumpul daripada temu bual separa struktur. Dapatan kajian gagal menunjukkan sebarang perkaitan yang signifikan di antara gender, pengibatan ibu bapa, penglibatan adik-beradik, maklum balas rakan dengan prestasi penulisan pelajar. This study examines the extent to which socio-cultural factors and socioeconomic status affect the writing performance of Iranian undergraduates majoring in English language translation and English language literature. The sociocultural factors in the present study comprise gender, parents\' and siblings\' involvement and feedback from teachers and peer. The aspects of socioeconomic status taken into consideration in this study include parents\' education and occupation and family income. In order to fulfill the objectives of the study and the nature of research questions, a mixed-methods research design was adopted to triangulate both the qualitative and the quantitative data. The researcher used non-probability sampling (purposive type) in four universities namely Shahid Bahonar University, Vali-e-Asr University, Isfahan University and Shiraz University. Four hundred participants from these universities majoring in English language translation and English language literature participated in the present study on a voluntary basis. For the quantitative phase, data was obtained from the writing task and the questionnaire while qualitative data, was collected from the semi-structured interviews. The findings of the present study did not reveal any significant relationship between gender, parents\' involvement, sibling\'s involvement, peer feedback and participants\' writing performance.\r\n\r\n', 'socio-cultural socio-economic writing-performance', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2016', 0),
(254, 'Aziz Nasser Boraik Ali', 'Anchor Point Approach For Initial Population Of Bat Algorithm For Protein Multiple Sequence Alignment', 'Penjajaran pelbagai turutan atau Multiple sequence alignment (MSA) adalah satu langkah asas kepada banyak aplikasi bio-informatik seperti pembinaan pokok filogenetik, ramalan struktur sekunder dan pengenalpastian motif domain dan yang dipulihara. Kebolehpercayaan dan ketepatan aplikasi-aplikasi ini bergantung kepada kualiti MSA. Multiple sequence alignment (MSA) is a fundamental step for many bioinformatics applications such as phylogenetic tree construction, prediction of the secondary structure and identification of domains and conserved motifs. The reliability and accuracy of these applications depend on the quality of MSA.', 'population algorithm sequence', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2016', 0),
(255, 'Chai Yuan Lin ', 'Characterization Of Cal 27 Oral Squamous Carcinoma Cell Line As A Model For Cancer Stem Cell Study.', ' Peratusan sel stem kanser (CSC) agak rendah di kalangan populasi sel barah. Oleh itu, langkah-langkah pengasingan dan pengayaan CSC telah menjadi rutin bagi kerja-kerja penyelidikan yang melibatkan CSC. CAL 27 (ATCC CRL-2095 TM) yang berasal daripada tisu lidah manusia, merupakan salah satu titisan sel epitelium skuamus karsinoma yang sering digunakan. Tujuan kajian ini dijalankan adalah untuk mewujudkan satu model titisan sel yang bersesuaian untuk mengkaji perkembangan CSC secara cekap, dengan mengurangkan masa bagi proses pengasingan dan juga langkah pengayaan sel. Kajian dijalankan untuk menentukan transformasi morfologi dan juga fisiologi sel titis CAL 27, terutamanya berkenaan dengan pengekspresian penanda sel stem mesenkima, tempoh masa penggandaan sel, rintangan terhadap rawatan, kebolehbalikan fenotaip, ciri invasif dan keupayaan metastatik. Selain itu, penglibatan lekatan sel dan peralihan epitelium-mesenkima (EMT), bersama dengan isyarat laluan Wnt juga diselidik. Hasilnya, pemanjangan sel CAL 27-O (sel CAL 27 dari generasi ke-6 dan seterusnya) dari sel CAL 27-Y (sel CAL 27 sebelum generasi ke-6) dikaitkan dengan peningkatan keupayaan invasif dan metastatik, rintangan rawatan yang lebih tinggi, pembalikan fenotaip yang mencirikan sel-sel epitelium, selain peningkatan kadar pembaharuan sel. The percentage of cancer stem cells (CSCs) is relatively low in tumour bulk population. Therefore, isolation and enrichment steps for CSCs have become routine for research works involving CSC. CAL 27 (ATCC CRL-2095 TM) is one of the commonly used squamous epithelial carcinoma cell lines derived from human tongue tissue. The present study was conducted with the objective to establish a suitable cell line model for studying CSC development efficiently, by reducing the time consuming isolation and enrichment steps. Experiments were carried out to determine the morphological as well as physiological transformations of CAL 27 cell line, particularly on the expression of mesenchymal stem cell markers, cell doubling time, treatment resistance, phenotype reversibility, invasiveness and metastatic ability. In addition to that, involvement of cell adhesion and epithelial-mesenchymal transition (EMT), together with Wnt signaling pathway were investigated. As for the results, elongation of CAL 27-O cells (CAL 27 cells from 6th passage onwards) from CAL 27-Y cells (CAL 27 cells below 6th passage) were found to be associated with enhanced invasive and metastatic capability, greater resistance to treatment, reversal of phenotype characterizing epithelial cells, besides enhanced proliferation.', ' squamous carcinoma cancer-stem-cell', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2016', 0),
(256, 'Forough Ebrahimi', 'Nmr-Based Metabolomic Approaches To Evaluate The Effects Of Eurycoma Longifolia Extracts On Rat Spermatogenesis', 'Eurycoma longifolia (Tongkat Ali, TA) dikenali untuk meningkatkan kesuburan lelaki dan libido. Suatu analisis metabolomik analisis berasaskan resonans magnetik nuklear (NMR) dikombinasi dengan kaedah kimometrik termaju telah dibangunkan, divalidasikan dan digunakan serentak untuk pengenalan dan kuantifikasi serentak metabolit dalam E. longifolia dan cecair mamalia (air kencing dan plasma tikus). Eurycoma longifolia (Tongkat Ali, TA) is known for boosting male fertility and libido. A nuclear magnetic resonance (NMR)-based metabolomics analysis in combination with advanced chemometric methods was developed, validated and applied for the simultaneous identification and quantification of metabolites in E. longifolia and mammalian fluids (rat urine and plasma).', 'matabolomic eurycoma spermatogenesis', '', 'Pusat Pengajian Sains Kimia (School of Chemistry) ', '2016', 0),
(257, 'Motahher Abdallah Hassan Qaeed', 'Synthesis Of Inn, Gan And Ingan Nanoparticles By A Chemical Method At Low Temperature For Solar Cell Applications', ' Kajian ini mengkaji sintesis partikel nano InN, GaN, dan InGaN (NPs) dengan kaedah kimia pada suhu rendah bagi diaplikasikan dalam sel solar. Bagi menjalankan kajian ini, para pengkaji telah menggunakan beberapa konsep teori dan persamaan yang relevan. Proses yang dilaksanakan, termasuklah tindak balas bahan dalam penyejat berputar, pengacau bermagnet, pengemparan, dan proses salutan berputar untuk mendepositkan partikel nano bagi fabrikasi sel solar. Larutan Oleyamine (OAm) digunakan semasa tindakbalas sebagai bahan pelarut. HNO3 dan NH4OH digunakan sebagai sumber Nitrogen untuk mensintesis InN, GaN, dan InGaN (NPs). Dua jenis sel solar yang difabrikasi, iaitu: pertama, sel solar heterosimpang (n-InN/P-Si) dan (n-GaN/P-Si), yang menggunakan Si p (111) sebagai substrat, kedua, sel solar homosimpang (n-InGaN/p-InGaN) yang menggunakan Polyethylene terephthalate PET sebagai substrat. Sintesis InN/GaN/InGaN (NPs) dicirikan oleh Field Emission Scanning Electron Microscopy FESEM, Energy Dispersive X-ray Spectroscopy EDX, Transmission Electron Microscopy TEM, X-ray Diffraction XRD, Photo-Luminescence PL, Raman Spectroscopy, dan UV Spectroscopy, di mana sel solar yang difabrikasi dicirikan dengan menggunakan Keithely 2400 electrometer di bawah simulasi cahaya matahari pada 30 mW/cm2. Partikel nano InN, GaN, dan InGaN disintesis pada masa dan suhu yang berbeza, dan keputusan terbaik diperoleh pada (12jam) di mana suhu 90C merupakan faktor utama dalam sintesis ini. This study examined the synthesis of InN, GaN, InGaN nanoparticles (NPs) by a chemical method at low temperature in order to use in solar cell applications. To carry out this, the researcher has employed a number of relevant theoretical concepts and equations. The processes, which were performed, included the materials reaction in the rotary evaporator, stirrer magnetism, centrifugation, and spin coating process to deposit the nanoparticles for fabricating solar cells. Oleylamine (OAm) solution was used during the reaction and it played the role as a solvent. HNO3 and NH4OH were used as a Nitrogen source to synthesize InN, GaN, InGaN (NPs).The fabricated solar cell including two types of solar cells: the first type is hetero-junction solar cell (n-InN/P-Si) and (n-GaN/P-Si) which use Si p-(111) as a substrate, the second type is homo-junction solar cells (n-InGaN/p-InGaN) where Polyethylene terephthalate PET used as substrate. The synthesis of InN/GaN/InGaN (NPs) materials was measured and characterized by Field Emission Scanning Electron Microscopy FESEM, Energy Dispersive X-ray Spectroscopy EDX, Transmission Electron Microscopy TEM, X-ray Diffraction XRD, Photo-Luminescence PL, Raman Spectroscopy, UV- spectroscopy, where the fabricated solar cell characterized by using Keithely 2400 electrometer under simulated sun light at 30 mW/cm2..InN, GaN, and InGaN NPs were synthesized under different times and temperatures, and the best results were found at (12h) where the 90C was the important key factor in this synthesis.', 'synthesis nanoparticles solar-cell', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(258, 'Zhwan Dilshad Ibrahm Sktani', 'Fracture Toughness Enhancement of Zirconia Toughened Alumina (ZTA) Through Additions Of Combination Of CaCO3 And CaO.', 'Zirconia Toughened Alumina (ZTA) is a successful ceramic compound in new technological industry. However, its low fracture toughness limited the usage of ZTA in many engineering applications. Therefore, the enhancement of fracture toughness is necessary. Nonetheless, it is crucial to maintain high hardness and enhance the fracture toughness to make ZTA more reliable for technological applications. In-situ formation of elongated CaAl12O19 grains inside ZTA ceramics during sintering process is preferred. This is due to its easy to be sintered, safety from health hazards and to avoid more complicated and less economical methods of sintering. CaO and CaCO3 powders were added into ZTA, wet-mixed, uniaxially pressed and ZTA samples formed by pressureless solid state sintering. The current study is divided to three parts. The first part is the addition of CaCO3 alone into ZTA. The fracture toughness was improved from 5.95 MPa.m1/2 for pure ZTA to 6.3 MPa.m1/2 for ZTA added with 0.5 wt. % of CaCO3 due to crack deflection mechanism along elongated CaAl12O19 grains. However, the hardness decreased due to emission of CO2 which creates porous microstructure. Hence, CaO and CaCO3 added together into ZTA to reduce the porosity and simultaneously, obtain elongated CaAl12O19 grains which enhances the fracture toughness of ZTA through crack deflection and crack bridging mechanisms. In the second part, combination addition between CaO with CaCO3 was fixed at 0.5 wt. %. The hardness was improved and better fracture toughness was obtained due to less xxii porous microstructure of ZTA and control of the size and shape of CaAl12O19 grains. The optimum ZTA composition was added with 0.4 wt. % CaO combined with 0.1 wt. % CaCO3. This composition has the maximum fracture toughness (6.51 MPa.m1/2) and reasonable hardness (1592 HV). Therefore, the CaO/CaCO3 ratio of 4:1 was selected as the base for the third part. The third part is to study the interaction effects of three parameters: sintering temperature, soaking time and combination addition between CaO and CaCO3 on the two responses: fracture toughness and Vickers hardness of ZTA. The Design of Experiments (DOE) was implemented to reduce the number of tests and meanwhile the optimisation process was employed to optimise the effective range of responses. After applying Response Surface Methodology (RSM), it was proved that sintering temperature is the most influence parameter on the fracture toughness and hardness of ZTA ceramics. The optimum results (fracture toughness of 6.84 MPa.m1/2 and hardness 1615 HV) obtained from sintering temperature at 1600 C, combination addition between CaO and CaCO3 of 0.95 wt.%, and soaking time for 2.14 hr. The other designs such as Analysis of Variance (ANOVA), Lack of Fit (LOF), 3D mapping and Residual Analysis have also confirmed the adequacy of the result. However, confirmation results obtained from experiments found that the optimum results (fracture toughness 7.1 MPa.m1/2 and Vickers hardness was 1584 HV) were obtained from 1.05 wt.% of combination addition between CaO and CaCO3 into ZTA samples, sintering temperature of 1600 C and soaking time of 2.9 hr. These values are comparable with empirical formulas from RSM.', 'fracture zirconia combination ', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2016', 0),
(259, 'Iylia Binti Idris', 'Direct Contact Membrane Distillation for Palm Oil Mill Effluent Treatment. ', 'Palm oil mill effluent (POME) is a major waste produced by the palm oil industry. The increase in the production of POME has caused environmental pollution, which ultimately has adverse effects on humans and aquatic life. POME is discharged at high temperature (~ 90 degree Celsius), requires days and spaces to cool it before undergone conventional treatment. Viewing the potential of reducing the treatment period, spaces and heat wasted to the environment, a direct contact membrane distillation (DCMD) treatment system was investigated consisting of pre-treatment and membrane processes. Coagulation study identify optimum coagulant dosage obtained was 4 g/L at pH 6.5, and the percentage of suspended solids removal was found to be 82% at 50 C. The application of the direct contact membrane distillation (DCMD) was studied using two types of membranes: modified and unmodified PVDF hollow fibre membranes. Modified PVDF membrane was carried out to increase the hydrophobicity (contact angle: 150.3  1.1) through coating with Low density polyethylene (LDPE) solution. The highest flux was obtained at 80 C for both types of membranes. The permeate water fluxes for unmodified and modified PVDF hollow fiber membranes were 2.63 L/m2.h and 2.38 L/m2.h, respectively. Furthermore, it was found that the unmodified PVDF hollow fiber membrane could not withstand long operation times compared to the modified PVDF hollow fiber membrane. The TPC values obtained for the modified PVDF hollow fiber membrane ranged between 0.57 to 0.62 at a temperature range of 60 to 80 C. Meanwhile, the TPC values for the unmodified PVDF hollow fiber membrane at 60 to 80 C were 0.59 to 0.64. This process can be classified as a well-designed system. The Artificial Neural Network (ANN) is a simple simulation that was implemented to carry out predictions of the permeate water flux. A multilayer Feedforward Artificial Neural Network (FANN) model was developed with three input variables (feed temperature, feed velocity, and type of membrane) and one output (permeate water flux) with 18 experimental data points. This optimized FANN model consisted of 1 hidden layer with 13 hidden neurons. The lowest mean square error (MSE) obtained was 0.0034, while the regression coefficient (R) values for training, validation, and testing were 0.9859, 0.9986, and 0.9984, respectively. These results showed a good training and performance agreement between the ANN models predicted data and the experimental data. The selectivity analysis was done to determine the sensitivity of the operating parameters. The most sensitive parameter was the feed temperature compared to feed velocity. The DCMD system is highly potential to replace the conventional treatment of POME. This system eliminate heat waste, shorten treatment period and the treated water generated from the system can be used for other process and safely discharged into the environment.', 'contact membrane palm-oil', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2016', 0),
(260, 'Abdulkarim Kanaan Jebna', 'The Impact Of Entrepreneurial Orientation And Market Orientation On Manufacturing Small And Medium Enterprises Satisfaction With The Moderating Effect Of E-Commerce Utilization In Malaysia.', 'Walaupun Malaysia sebuah negara yang sedang rancak membangun di Asia Tenggara, kepustakaan menunjukkan bahawa kadar kegagalan Industri Kecil dan Sederhana (IKS) dalam sektor pembuatan memang tidak dapat dielakkan. Although Malaysia is a fast developing country in Southeast Asia, the literature revealed that the failure rate of Small and Medium Enterprises (SMEs) in the manufacturing sector is inevitable.', 'entrepreneurial enterprises e-commerce', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2016', 0),
(261, 'Junidah Lamaming', 'Isolation And Characterization Of Cellulose Nanocrystals From Oil Palm Trunk.', 'Kajian ini bertujuan untuk mengkaji sifat-sifat selulosa nanokristal (CNC) yang diekstrak daripada batang pokok kelapa sawit (Elaeis guineensis) (OPT). Enam jenis CNC diekstrak daripada OPT dengan menggunakan dua kaedah yang berbeza. Empat jenis CNC yang diperolehi daripada OPT secara keseluruhan iaitu nanokristal yang terhasil daripada bahan asal tanpa rawatan dan rawatan air panas serta daripada parenkima dan berkas vaskular OPT melalui kimo-mekanikal diikuti hidrolisis dengan asid sulfurik. Dua jenis nanokristal selulosa lagi diperolehi melalui pra-hidrolisis dan tanpa pra-hidrolisis air disediakan melalui pemulpaan soda diikuti pelunturan ozon dan dihidrolisis dengan asid hidroklorik. Sifat-sifat fizikal, dan kimia, sifat-sifat termal dan indeks penghabluran nanokristal selulosa yang masing-masing ditentukan menggunakan pengimbas mikroskop electron (SEM), penghantaran elektron mikroskop (TEM), potensi zeta dan penganalis unsur, Fourier transformasi inframerah (FTIR), analisis termal gravimetrik (TGA) dan analisis pembelauan sinar-X (XRD). This study investigated the properties of cellulose nanocrystal (CNC) isolated from oil palm trunk (Elaeis guineensis) (OPT). Six types of CNCs were extracted from OPT using two different methods. Four types of CNCs were derived from the OPT as a whole that is CNCs from raw and water treated and also from separated parenchyma and vascular bundle of OPT using chemo-mechanical followed by sulfuric acid hydrolysis. Two more types of CNC with and without water pre-hydrolysis were prepared by soda pulping followed by ozone bleaching and hydrolyzed with hydrochloric acid. Physical and chemical properties, thermal behaviour, and also crystallinity index of all obtained CNCs were determined using scanning electron microscopy (SEM), transmission electron microscopy (TEM), zeta potential, elemental analyzer, fourier transform infrared (FTIR), thermogravimetric analysis (TGA) and X-ray diffraction (XRD), respectively.', 'cellulose nanocrystals oil-palm', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology) ', '2016', 0),
(262, 'Lambang Trijono', ' From Rebel Movement To Political Party: Study On The Post-Conflict Democratic Transformation Of The Free Aceh Movement', 'Kajian ini mengkaji peranan yang boleh dimainkan oleh parti politik untuk mentransformasikan konflik dan membina perdamaian di kawasan pasca-konflik. Dengan melihat kepada kes transformasi politik oleh Gerakan Aceh Merdeka (GAM) kepada parti-parti politik tempatan, kajian ini melihat keupayaan pendekatan transformasi politik untuk menyelesaikan konflik jenis penentuan nasib sendiri serta pembinaan perdamaian yang berkekalan. This study examines the roles that can be played by a political party to transform conflict and build peace in a post-conflict region. It specifically focuses on the political transformation facilitated by a peace agreement to end the conflict. By looking at the case of the political transformation of the Free Aceh Movement (GAM) into local political parties, this study sees the viability of the political transformation approach to resolve self-determination conflict and build sustainable peace and a stable democracy.', 'movement political transformation', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences) ', '2016', 0);
