(285, 'Amna Hassan Sirelkhatim', 'Surface-Modified Zinc Oxide Nanoparticles And Their Bioactivity Towards Hela Cell Lines, Escherichia Coli And Shigella Flexneri.', 'Objektif utama tesis ini adalah untuk mengkaji struktur and sifat-sifat fiziko-kimia zarah nano zink oksida (ZnO-NPs) dengan hubung kaitnya terhadap aktiviti anti -kanser titisanpada sel kanser serviks manusia (HeLa). Aktiviti antibakteria ZnO-NPs terhadap E.coli and Shigella Flexneri telah diuji untuk mendapatkan kajian penuh mengenai bioaktiviti ZnO-NPs. Tiga sampel ZnO telah digunakan untuk pencirian lengkap bagi sifat-sifat struktur, morfologi (FESEM , TEM, ESI, EDS, XRD), optik (penyerapan UV-Vis dan FTIR), dan keelektrikana (ukuran IV, potensi zeta). Pengubahsuaian pada permukaan telah dilakukan melalui dua pendekatan iaitu penyaduran dengan Pluronic F127 ko-polimer yang telah menstabilkan sampel ZnO-I dan pencahayaan UVA telah menghasilkan sampel ZnOUVA. TEM dan FESEM menunjukkan rod nano dan mikro sebagai struktur utama dalam ZnO-UVA dan ZnO -I selain daripada plat nano dan mikro dalam struktur dimensi yang berbeza. Manakala ZnO-II terdiri daripada plat nano dan mikro termasuk beberapa nanorods, tetrapod dan struktur lain. Analisis XRD menunjukkan sifat kristal kesemua sampel dan penghabluran. ESI menunjukkan pengagihan Zn dan O atom pada struktur ZnO dengan pemetaan yang menunjukkan nisbah O:Zn. Nisbah Zn yang tinggi menyebabkan kadar pennyaherapan oksigen yang lebih tinggi pada permukaan ZnO-UVA dan ZnO-I yang meningkat kekonduksian-foto (7.51nS dan 5.19nS masing-masing, manakala ZnO-II menunjukkan 1.49nS). The main objective of this thesis is to investigate the structural, morphological, optical and physiochemical properties of zinc oxide nanoaprticles (ZnO-NPs) with their correlation on anti-cancer activity towards human cervical cancer cell lines (HeLa). The antibacterial activity of ZnO-NPs towards E.coli and Shigella Flexneri was studied as well to get considerable indication of the bioactivity of ZnO-NPs. Three ZnO-NPs samples were used, initially a systematical comprehensive characterization for their structural, morphological (FESEM, TEM, ESI, EDS, XRD), optical (UV-Vis absorption and FTIR), and electrical (I-V measurements, zeta potential) properties have been carried out. Surface modification was performed via coating with Pluronic F-127 copolymer obtained stabilized sample, namely ZnO-I. And UVA illumination, the sample recalled, ZnO-UVA, while the third sample, was bare denoted ZnO-II. TEM and FESEM showed major nano/micro- rods structures in ZnO-UVA and ZnO-I and nano/micro plated structures of different dimensions. ZnO-II showed mainly nano/micro plates and some nanorods, few tetrapod and other structures. TEM showed particle sizes around 80 nm, and XRD analysis revealed the crystallinity of the samples whereas ESI displayed the elemental maps of Zn and O atoms of ZnO structures showing the ratios of O: Zn. Higher Zn ratio resulted in higher desorption of oxygen on ZnO-UVA and ZnO-I surfaces, revealed by the increased photoconductivities of 7.51 nS and 5.19 nS, respectively, while ZnO-II showed 1.49 nS.', 'zinc-oxide bioactivity escherichia', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(286, 'Ali Akbar Zeinali', 'An Evaluation Of Word Formation In The Translation Of English Medical Terms Into Persian.', 'Kajian ini merupakan satu analisis perbandingan ciri-ciri istilah perubatan bahasa Inggeris, menggunakan garis panduan penamaan universal dan prinsip penamaan tempatan dalam bahasa Parsi. This study provides a comparative analysis of the characteristics of Persian medical terms, using the universal naming guidelines and local naming principles in Persian.', 'word translation medical', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2016', 0),
(287, 'Wasana Boonsong', 'Household Electrical Power Meter Using Embedded Rfid With Wireless Sensor Network Platform.', 'Smart monitoring utility electrical power meter plays an important role in the energy awareness scheme. The aim of this study is to develop a machine-to-machine (M2M) communication by embedding an active RFID technology with wireless mesh sensor network (WMSN) platform with heterogeneous data transfer to monitor and identify the household electrical consumption. A household electrical power meter is designed with chosen Zigbee-Pro as a RF transceiver module with WSN functionalities to communicate between RFID tag to the RFID reader wirelessly. The development of this project involves three main parts in the proposed RFID communication system which consists of: the EPRFID (embedded RFID module with household electrical power meter), reader and application software at a work station. The EPRFID module is designed to take power supply from a household electric power meter with the introduction of power management circuit developed inside the proposed module. It comprises of voltage and current sensors which is functioning to precisely sense the actual status of the resident electrical power consumption from the appliance loads. Then, the data signal is directly transferred to the central processing unit (CPU) to precisely calculate the current power consumption. The CPU is the central part to effectively communicate and command all defined operations. The real time clock is readily available to generate the local real time clock. It is combined into the memory module package which used to minute the total accumulated power. Simultaneously, the display unit shows the monitored information data such as local time, current, voltage and power values. Lastly, the application software at a personal computer (PC) was designed by using the Microsoft Visual C# software. It shows the performances of received information data from the end meter devices such as tag ID, time sent, receive, delay, accumulated power, RSSI and amount of received bytes. In this research, the EPRFID prototype was intensively examined as follows: the voltage and current calibration versus the distance ranges; the transmitted power calibration; energy analysis; energy tradeoffs based on measured dc characteristics; anti collision performance; radiation pattern; maximum read range; tag collection and latency delay time; throughput evaluation. The experimental results indicated that the proposed EPRFID prototype successfully worked wirelessly with tolerable power consumption is within a range of 1.61 W to 1.69 W. This model is to facilitate some daily life processes, saving time, and reduces the operating cost because of the reduction in the manpower requirement and error in information system that can be omitted through humans. Thus, improving the M2M communication can provide higher reliability on the communication system because the current development will focus on local control strategies. In addition, this study can be guidelines to the electrical power utility company and consumers for alternatives in electrical consumption billings in the future.', 'electrical wireless network', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2016', 0),
(288, 'Kang Chia Chao', 'Development Of Ultra High Frequency Energy Harvester Using Circular Spiral Array With Corporate Feeding. ', 'This thesis is to design an alternative antenna structure that will increase gain of the antenna, the amount of harvested energy and provide high power during rectification. The research works generate a steady output at a frequency of 956 MHz for RF energy harvesting system. The design of the circular spiral antenna is performed using Computer Simulation Technology (CST) and Advanced Designed System (ADS). The circular spiral antenna is integrated with the rectifying circuit to efficiently convert the input RF signal from alternating current (AC) to direct current (DC). Three configurations of the antenna designs were proposed namely single circular spiral antenna, 1x2 circular spiral antenna and 2x4 circular spiral antenna. The proposed antenna that had been developed is based on the basic antenna characteristic such as return loss, radiation pattern and gain. The 1x2 array antennas and 2x4 array antenna were designed using the corporate feed method that will increase the gain and enhanced the RF harvesting output voltage. The rectification of RF to DC energy used zero bias schottky diode that convert the incoming harvested energy. The results show that all the three design posses gain of 2.3 dBi, 3.2 dBi and 5 dBi, while the output voltage generated were 17 mV, 59.4 mV and 79 mV respectively. It is found also that the circular spiral antenna can provide a constant output DC voltage which is useful for UHF application.', 'high frequency circular-spiral', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2016', 0),
(289, 'Khalaf Ali Al-Jumah', 'Assessment Of Pharmacist Intervention On Depression Patients\' Adherence And Clinical Outcomes In A Tertiary Care Centre At Riyadh, Saudi Arabia', 'Kemurungan atau depresi merupakan penyakit mental kronik yang mempunyai kesan yang boleh menimbulkan ketidakupayaan yang signifikan terhadap kualiti hidup pesakit. Prevalens kemurungan mencecah 15% di seluruh dunia dan 18% di Arab Saudi. Secara am, ubat antikemurungan menjadi kurang berkesan kerana ketidakpatuhan pesakit dalam pengambilan ubat. Hal ini boleh menyebabkan akibat yang serius seperti kegagalan rawatan, komplikasi, penggunaan penjagaan perubatan yang tinggi, dan kerosakan tubuh sehingga tidak berupaya melakukan sesuatu kerja. Peranan ahli farmasi dalam sistem penjagaan kesihatan kini menjadi lebih luas sehingga meliputi kerja-kerja ujian klinik, ekonomi kesihatan, pendidikan pesakit, dan penjagaan pesakit secara langsung. Intervensi ahli farmasi terbukti dapat memberi manfaat dalam usaha meningkatkan hasil rawatan dalam pelbagai keadaan penjagaan kesihatan. Justeru, projek penyelidikan ini bertujuan untuk menilai impak intervensi ahli farmasi yang berdasarkan perkongsian pembuatan keputusan bagi memperbaiki tahap kepatuhan mengambil ubat antimurung dan hal-hal yang berkaitan dengan kesan pada pesakit. Satu kajian keratan rentas analisis deskriptif telah dijalankan untuk memerihalkan populasi Saudi yang mengalami kemurungan berhubung dengan kepatuhan pengambilan ubat antimurung dan untuk menentukan faktor-faktor risiko dan hubungan antara kepatuhan dengan kesan-kesan berkaitan pesakit yang lain. Depression is a chronic mental illness with a significant disabling effect on the patients quality of life. Depression lifetime prevalence reach up to 15% worldwide and up to 18% in Saudi Arabia. In general the effectiveness of antidepressants is reduced due to patients non-adherence. This may result in serious consequences such as treatment failure, complications, high medical care utilization, and impairment in work functioning. The role of pharmacists in the healthcare system has expanded to include involvement in clinical trials, health economics, patient education, and direct patient care. Pharmacist interventions have proved to be beneficial in improving treatment outcomes in a variety of healthcare settings. Therefore, this research aims to evaluate the impact of a pharmacist intervention based on shared decision making to improve adherence to antidepressant medication and related patient outcomes. A cross-sectional descriptive analysis study was carried to describe depressed Saudi population with respect to adherence to antidepressant and to determine the risk factors and the association between adherence and other patient-related outcomes.', 'assessment depression patients', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2016', 0),
(290, 'Mukhtar Abubakar Balarabe', 'The Meteorological Contributing Factors To Aerosol Variability And Modelling In Nigeria.', 'Satu kajian aerosol jangka panjang adalah satu tugas yang sukar kerana stesen pemerhatian aerosol yang terhad dan musim (yang menyebabkan kehilangan data dan pencemaran awan). Bagi menangani masalah ini, kajian ini pertamanya bertujuan untuk menganalisis ciri-ciri dan jenis aerosol menggunakan rekod jangka panjang (1998-2013) kedalaman optik aerosol (AOD) dan eksponen angstrom , dari Aerosol Robotic Network darat (AERONET). Kajian ini menunjukkan bahawa atmosfera Nigeria sangat tercemar yang mengandungi kebanyakannya zarah kasar sebagaimana yang ditunjukkan oleh frekuensi tinggi pada berlakunya eksponen angstrom di bawah 1 (78 dan jenis 81%) semasa Harmattan (November-Mac) dan musim panas (April-Oktober). Analisis selanjutnya menunjukkan bahawa zarah-zarah tersebut adalah kebanyakanya aerosol debu semasa Harmattan dan musim panas ( 82% dan 79%). Kedua, kebolehubahan ruang dan masa bagi indeks aerosol min bulanan (AI) (penunjuk kualitatif bagi kehadiran aerosol debu dan asap) dan parameter meteorologi (kelajuan angin, penglihatan, suhu dan kelembapan relatif) yang diperolehi daripada Total Ozone Mapping Spectrometer (TOMS) dan Ozone Monitoring Instrument (OMI) dalam tempoh 1984-2013 bagi Nigeria telah dianalisis. Data meteorologi diperolehi daripada pusat data iklim National Oceanic and Atmospheric Administration-National Climate Data Center (NOAA-NCDC). A long-term aerosol study is a difficult task due to limited aerosol observation stations and seasons (resulting in missing data and cloud contamination). To address these problems, this study first aimed at analyzing the characteristics and type of aerosols using long-term (1998-2013) record of aerosol optical depth (AOD) and angstrom exponent , from ground-based Aerosol Robotic Network (AERONET). The study showed that Nigeria atmosphere is highly polluted containing mostly coarse particles as indicated by high frequency of occurrence of angstrom exponent below 1 (78 and 81%) during Harmattan (November-March) and summer (April-October). Further analysis revealed that these particles are mostly dust aerosol (DA) for both Harmattan and summer seasons (82% and 79%). Secondly, the temporal and spatial variability of the monthly mean aerosol index (AI) (qualitative indicator of the presence of dust and smoke aerosols) and meteorological parameter (wind speed, visibility, temperature and relative humidity) obtained from the Total Ozone Mapping Spectrometer (TOMS) and Ozone Monitoring Instrument (OMI) during the period of 1984-2013 for Nigeria were analyzed. The meteorological data were obtained from the National Oceanic and Atmospheric administration-National climate data center (NOAA-NCDC).', 'meteorological aerosol variability', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(291, 'Nuru Gambo', 'Relationship Between Cost Factors And Performance Of Small Scale Local Government Contractors In Nigeria', 'Pengekalan prestasi yang lemah kontraktor-kontraktor kerajaan tempatan berskala kecil memberikan satu cabaran yang besar kepada pembangunan mampan industri pembinaan di negara-negara membangun seperti Nigeria. Prestasi yang lemah kontraktor-kontraktor berskala kecil kebanyakannya akibat daripada kesan faktor-faktor kos yang mempengaruhi prestasi projek. Perkara ini membawa kepada kos dan masa projek yang berlebihan untuk menghasilkan produk yang lemah dan pengabaian projek. Kajian ini bertujuan untuk membangunkan satu model hubungan antara faktor-faktor kos dan prestasi kontraktor-kontraktor kerajaan tempatan berskala kecil melalui pengenalan kepada sokongan pelanggan sebagai pengantara. Kajian ini meninjau prestasi kontraktor-kontraktor kerajaan tempatan berskala kecil di tiga zon geo-politik Nigeria. Kajian ini adalah menggunakan pendekatan kuantitatif; kajian ini mempunyai tiga konstruk dan sembilan dimensi. Konstruk terdiri daripada faktor-faktor kos, sokongan pelanggan dan prestasi kontraktor. Data untuk kajian ini diperolehi dengan menggunakan reka bentuk soal selidik yang baik strukturnya. Keseimbangan kaedah persampelan rawak berstrata telah digunakan untuk memilih responden yang terdiri daripada pihak-pihak berkepentingan utama (pelanggan, kontraktor dan perunding) dalam industri pembinaan Nigeria. The persistence of poor performance of small scale local government contractors posed a challenge to the sustainable development of construction industry in developing countries like Nigeria. Poor performance of small scale contractors were mostly as a result of the effects of cost factors that affect performance of projects. This lead to project cost and time overruns substandard products and the abandonment of projects. This study is aimed at developing a model for the relationship between cost factors and performance of small scale local government contractors through introduction of client support as mediator. The study surveyed the performance of small scale local government contractors in the three geo-political zones of Nigeria. This research is quantitative in approach; the study had three constructs and nine dimensions. The constructs were cost factors, clients support and performance of contractors. The data for this study were collected by using well structured design questionnaire. A proportionate stratified random sampling method was used to select the respondents which comprised of major stakeholders (clients, contractors and consultants) in Nigerian construction industry.', 'cost-performance government contractors', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2016', 0),
(292, 'Muhammad Javed', 'The Development Of Reading Modules And Usage Of Reading Strategies In Esl Classroom', 'Kajian ini memberi tumpuan kepada pembangunan modul pemahaman bacaan untuk guru Bahasa Inggeris sekolah menengah bagi membantu pemahaman bacaan di kalangan murid sekolah menengah dalam Malaysia. Strategi kefahaman bacaan yang digunakan oleh guru Bahasa Inggeris untuk mengajar literal, pengolahan semula dan soalan kefahaman inferensi dengan menggunakan modul bacaan yang dibangunkan oleh penyelidik juga telah dikenalpasti. Satu set modul pemahaman bacaan telah dibangunkan dan setiap modul dibahagikan kepada tiga bahagian seperti Bahagian A (pemahaman literal), Bahagian B (pemahaman pengolahan semula) dan Bahagian C (pemahaman inferensi). Setiap bahagian modul mengandungi 5 teks pelbagai genre dan tema yang telah dipilih dan diadaptasi daripada pelbagai sumber sahih. Tahap kesukaran dan panjang teks meningkat secara beransur-ansur daripada modul 1 ke modul 6 sejajar dengan keupayaan membaca murid (aras 1 hingga aras 6). Di samping itu, lima soalan pemahaman telah dibina bagi setiap teks dalam setiap modul bacaan. Data kualitatif dikumpulkan menggunakan pemerhatian yang melibatkan 12 guru Bahasa Inggeris sekolah menengah dan 240 murid Tingkatan Empat yang telah dipilih melalui persampelan purposive daripada dua sekolah menengah di Pulau Pinang, Malaysia. The current study focused on the development of reading comprehension modules for secondary school ESL teachers to facilitate reading comprehension abilities among secondary school ESL students in Malaysia. Besides, the reading comprehension strategies used by ESL teachers to teach literal, reorganisation and inferential comprehension questions using the reading modules developed by the researcher were also identified. A set of six reading comprehension modules was developed and each module was divided into three parts namely; Part A (literal comprehension), Part B (reorganisation comprehension) and Part C (inferential comprehension). Each part of the modules consists of 5 texts with diverse genres and themes that were selected and adapted from various authentic sources. The difficulty level and length of the texts increased gradually from module 1 to module 6 in line with students reading abilities (band 1 to band 6). In addition, five comprehension questions were also constructed under each text in each reading module. The qualitative data were collected through observation that involved 12 secondary school ESL teachers and 240 Form Four students that were selected through purposive sampling from two secondary schools from Penang, Malaysia.', 'reading modules strategies', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2016', 0),
(293, 'Muthana Hameed Khalaf', ' Translation Of Explicit Quranic Proverbs And Their Rhetorics Into English. ', 'Menterjemah peribahasa Al-Quran dan ungkapan retoriknya merupakan tugas yang paling mencabar bagi penterjemah dan sarjana linguistik kerana ia memerlukan usaha selanjutnya untuk menghasilkan semula kata-kata Allah dengan seberapa tepat dan benar yang mungkin. Kajian ini ialah satu kajian perbandingan antara empat versi terjemahan Al-Quran dalam bahasa Inggeris yang melibatkan perspektif linguistik, sastera dan translasi untuk mencerminkan kreativiti dan retorik peribahasa Al-Quran. Metodologi kajian menunjukkan bahawa Kajian ini adalah satu usaha yang baru dalam bidang penyelidikan penterjemahan. Peribahasa al-Quran terdiri daripada empat komponen iaitu; (1) The Proverbed-to (2) The proverbed (3) Ciri peribahasa Al- Quran dan (4) Unsur Peribahasa Al-Quran. Komponen-komponen peribahasa Al-Quran ini merupakan sumber dan pencapaian utama dalam menyediakan huraian yang tepat tentang peribahasa Al-Quran yang dikaji. Keempat-empat komponen ini telah dikenal pasti dan dianalisis dari perspektif linguistik dan retorik berasaskan jenis QP-Mathal iaitu, peribahasa yang berunsurkan pepatah, peribahasa yang berunsurkan metafora, peribahasa yang bertemakan analogi dan peribahasa brachylogy. Data telah dikaji dan dianalisis berdasarkan teori Abdul Raof (2006), Saghir (1992) dan Delisle (2013). Translating Quranic proverbs, on the one hand, and their rhetorical expressions, on the other is one of the most challenging tasks for translators and linguistic scholars because further effort is needed to reproduce the words of Allah as accurately and as faithfully as possible. In this research, a comparative study of four translated versions of the Quran involving linguistic, literary and translational perspectives to show the creativity and rhetoric of the Quranic proverbs is carried out to provide the translation field with a new type of academic research. The research methodology indicates that the Quranic proverbs consist of four components: (1) The proverbed-to, (2) The proverbed, (3) The Quranic proverbs feature and (4) The Quranic proverbs element. These components of Quranic proverbs constitute the main source and achievement in providing a valid description of the Quranic proverbs under scrutiny. These components have been identified and analysed linguistically and rhetorically based on the types of QP-mathal, which are the proverbial simile, proverbial metaphor, proverbial allegory and proverbial brachylogy. The data are then examined and analysed based on the theories of Abdul-Raof (2006), Saghir (1992) and Delisle (2013).', 'translation quranic proverbs-rhetorics', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation)', '2016', 0),
(294, 'Hashim Aliwy Mohammed Nakhilawi', 'Ethnosemantic, Pragmatic, And Textual Analysis Of Kinship Terms In Arabic And English Discourse.', ' Kajian ini bermatlamat mengkaji serta membandingkan aspek etnosemantik, pragmatik dan tekstual daripada istilah pertalian kekeluargaan dalam bahasa Arab dan bahasa Inggeris. Hal ini kerana kebanyakan kajian terdahulu hanya menerangkan asas sosiologi atau etnologi daripada struktur pertalian kekeluargaan dan pengelasan. Selain itu, terlalu sedikit perhatian yang diberikan terhadap aspek linguistik terutamanya pragmatik dan keagamaan daripada istilah pertalian kekeluargaan. Kajian ini adalah suatu analisis kandungan kualitatif yang bertujuan menjalankan pemeriksaan yang menyeluruh dan sistematik tentang istilah pertalian kekeluargaan dalam dua puluh buah teks keagamaan dan perundangan yang dipilih; untuk mengenal pasti kewujudan konsep pertalian persaudaraan dan juga untuk menunjukkan persamaan dan perbezaan di antara kedua-dua bahasa dan budaya, Oleh itu, untuk memahami sifat istilah pertalian kekeluargaan dalam kedua-dua budaya sosiolinguistik, penyelidik memberi tumpuan terhadap dua tahap analisis: analisis perbandingan dan analisis teks. Justeru, penyelidik menyesuaikan beberapa teori sosiobudaya yang disarankan oleh Descent, Alliance, Sponsorship dan Murdocks (1965) classification of kinship terms, dan teori linguistik yang diutarakan oleh Hallidays (1978; 1985; 2009) Systemic Functional Linguistic Teory (SFL). This study aims at investigating, comparatively, the ethnosemantic, pragmatic, and textual aspects of kinship terms in Arabic and English languages. This is because most of the previous kinship studies have focused on explaining the sociological or ethnological basis of kinship structures and classifications. Moreover, little attention has been given to the linguistic aspects specifically pragmatics as well as the religious aspect of kinship terms. The current study is a qualitative content analysis that aims to provide a thorough and systematic examination of kinship terms in twenty selected religious and legislative texts to identify the co-occurrences of kinship concepts and to reveal the similarities and differences between the two languages and cultures in this respect. Consequently, in order to understand the nature of kinship terms in both sociolinguistic cultures, the researcher focuses on two levels of analysis: textual analysis and comparative analysis. Because the study is of twofold (comparative analysis and textual analysis), the researcher adopts some socio-cultural theories represented by Descent, Alliance, Sponsorship as well as Murdocks (1965) classification of kinship terms, and a linguistic theory represented by Hallidays (1978; 1985; 2009) Systemic Functional Linguistic theory (SFL).', 'ethnosemantic pragmatic kinship-terms', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation)', '2016', 0),
(295, ' Rosazlina Binti Rusly', 'Molecular Dna Markers In Parentage Identification And Clonal Genetic Structure Of Cryptocoryne purpurea Ridl. nothovar. purpurea Hybrid Populations', 'Penghibridan semulajadi telah diyakini kerapkali berlaku pada Cryptocoryne Wydler dan dianggap sebagai sumber kepada kerumitan taksonomi pada genus ini. Penyelidikan ini melibatkan gabungan kajian daripada data jujukan DNA (kawasan tertranskripsi dalaman (ITS) DNA nuklear ribosom dan gen matK daripada DNA kloroplas) untuk mengenalpasti induk kepada hibrid putatif Cryptocoryne daripada Semenanjung Malaysia. Berdasarkan kepada ciri-ciri morfologi tumbuhan ini dikenalpasti secara tentatif sebagai Cryptocoryne purpurea Ridl. nothovar. purpurea; tumbuhan steril yang telah lama dianggap sebagai hibrid, kemungkinan daripada dua spesies yang berkaitan; Cryptocoryne cordata Griff. var. cordata dan Cryptocoryne griffithii Schott. Status hibrid dan induk-induk ini dibuktikan secara bebas dengan kehadiran pada individu hibrid corak jujukan ITS daripada kedua-dua spesies induk ini. Tumbuhan hibrid ini berkongsi persamaan jujukan matK daripada C. cordata var. cordata dan C. griffithii, menunjukkan kedua-dua spesies induk putatif ini telah menjadi induk betina. Penghibridan timbal balik di antara kedua-dua spesies ini dilihat sebagai simetri dan bukan satu arah. Kajian ini juga bertujuan untuk membangunkan penanda mikrosatelit menggunakan jujukan generasi (Roche 454 pyrosequencing) daripada DNA genomik C. cordata var. cordata. Natural hybridization has been confirmed to occur frequently in Cryptocoryne Wydler and considered a source of taxonomic complexity in this genus. This research involved a combined study of DNA sequencing data (internal transcribed spacer (ITS) of nuclear ribosomal DNA and matK gene of chloroplast DNA) to identify the parentage of a putative Cryptocoryne hybrid from Peninsular Malaysia. Based on the morphological characters the plant was tentatively identified as Cryptocoryne purpurea Ridl. nothovar. purpurea; a sterile plant which has long been considered a hybrid, possibly from two related species; Cryptocoryne cordata Griff. var. cordata and Cryptocoryne griffithii Schott. The hybrid status and its putative parents was independently confirmed by the presence in hybrid individuals of an additive ITS sequence pattern from these two parental species. The hybrid plants shared the identical matK sequences from C. cordata var. cordata and C. griffithii, which indicated that both putative parental species had functioned as the maternal parent. Reciprocal hybridization between the two species seems to be symmetrical rather than unidirectional. This study also aimed at developing microsatellite markers using next generation sequencing (Roche 454 pyrosequencing) from the genomic DNA of C. cordata var. cordata.', 'dna parentage genetic', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2016', 0),
(296, 'Suriati Binti Saad', 'Examination Of Report-Derived Perception (RDP) On Corporate Social Responsibility (CSR) Disclosure In The Oil And Gas Industry In Malaysia', 'Peningkatan perhatian terhadap Tanggungjawab Sosial Korporat (CSR) dalam operasi perniagaan menunjukkan bahawa masyarakat kini menuntut perbadanan mengamalkannya kewajipan moral. Selari minat yang semakin meningkat, laporan tahunan berkaitan inisiatif CSR juga telah diberi keutamaan walaupun melaporkan CSR masih diklasifikasikan sebagai tindakan sukarela. Laporan CSR telah menjadi rutin kebanyakan organisasi di setiap industri termasuk minyak dan gas. Kajian ini bertujuan untuk menganalisis apa yang termasyhur dari pendedahan laporan CSR. Persepsi laporan yang diperolehi boleh membantu organisasi untuk merancang agenda komunikasi CSR perlu dilaporkan untuk mendapatkan persepsi yang baik dari pembacaan laporan. Kajian ini memberi tumpuan kepada laporan CSR oleh organisasi yang beroperasi dalam industri minyak dan gas di Malaysia dengan memberi tumpuan kepada organisasi yang menyediakan keperluan pengguna isi rumah. Analisis data telah dilakukan dengan menggunakan pendekatan interpretasi dengan kaedah analisis kandungan. Dapatan kajian menunjukkan organisasi dilihat sebagai bertanggungjawab apabila agenda laporan itu melaporkan apa yang organisasi boleh dan telah lakukan kepada masyarakat dan alam sekitar. The growing interest on Corporate Social Responsibility (CSR) in everyday business operation shows that our society now demands for corporations to practice it moral obligation. Hence, CSR has no longer become an optional extra for corporation business operation. Social performance such as that of CSR can be a deciding factor for important decision making by stakeholders. Paralleled to the growing interest, reporting on the CSR initiatives has also become fundamental, although the content is still at voluntarily basis. CSR reporting in many organisations across various industries including oil and gas is done through a communication medium such as the annually produced corporate social disclosure. Exploring the impact of the CSR disclosure on readers perception is an avenue to understand the readers expectations of the organisations. This research is to analyse what transpire from CSR disclosure. The perception derived from readers of the report can help organisation to plan for how their CSR communication agenda should be incorporated in reporting practices.', 'corporate social responsibility', '', 'Pusat Pengajian Komunikasi (School of Communication)', '2016', 0),
(297, 'Yong Cheng Chung', 'Effects Of Protein-Rich Fraction From Lactobacillus Plantarum Usm8613 Against Dermal Staphylococcus Aureus', 'Tiga puluh enam strain bakteria asid laktik telah diasingkan daripada tenusu, daging dan produk penapaian tempatan. Ekstrak extrasel (CFS) daripada L. plantarum USM8613, yang didapati daripada sosej yang ditapai, menunjukkan aktiviti perencatan dan penghasilan asid laktik yang lebih tinggi ( < 0.05) telah dipilih untuk analisis seterusnya. Kajian ex-vivo menunjukkan CFS daripada L. plantarum USM8613 berupaya merencatkan pembentukan biofilem dan pertumbuhan S. aureus pada kulit khinzir. Fraksi yang kaya dengan protein, lemak dan polisakarida yang diekstrak daripada CFS L. plantarum USM8613 telah diuji untuk aktiviti perencatan. Kajian menunjukkan fraksi yang kaya dengan protein memberi kesan yang lebih ketara berbanding dengan fraksi yang kaya lemak and polisakarida. Fraksi yang kaya dengan protein dari L. plantarum USM8613 juga berupaya merencatkan ( <0.05) pertumbuhan S. aureus klinikal dan pembentukan biofilem pada kulit khinzir. Rawatan topikal yang mengandungi 800 AU/mL fraksi yang kaya dengna protein daripada L. plantarum USM8613 didapati berupaya mengurangkan ( < 0.05) bilangan sel S. aureus ditapak luka tikus. Thirty-six strains of lactic acid bacteria were isolated from local dairy, meat and fermented products. Cell-free-supernatant (CFS) of L. plantarum USM8613, isolated from fermented sausage, was selected for subsequent analyses. The CFS exhibited a significantly stronger ( < 0.05) inhibitory activity against S. aureus and produced a higher amount of lactic acid as compared to all strains studied. Ex-vivo study demonstrated CFS from L. plantarum USM8613 inhibited the growth and biofilm formation of S. aureus on porcine skins. CFS of L. plantarum USM8613 was fractionated into protein-rich, lipid-rich and polysaccharide-rich fractions, and all fractions exhibited significant inhibitory activity, with a more prevalent effect from the protein-rich fraction. The antimicrobial and anti-biofilm effects of the protein-rich fraction were further confirmed with S. aureus-infected porcine skins. Topical application of ointment containing 800 AU/mL of the protein-rich fraction from L. plantarum USM8613 significantly reduced ( < 0.05) the cell counts of S. aureus in the wound site of S. aureus infected-rats.', 'protein lactobacillus dermal', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2016', 0),
(298, 'Yousaf Ali', 'Evaluation Of Ovicidal And Larvicidal Effects Of Plant Extracts From Family Anacardiaceae Against Aedes Aegypti And Aedes Albopictus (Diptera: Culicidae). ', 'Fitokimia telah mendapat lebih tumpuan dalam program kawalan nyamuk sebagai pengganti kepada racun perosak sintetik pada masa ini. Objektif kajian ini adalah untuk meneroka kesan-kesan daripada Anacardium occidentale, Gluta renghas, Mangifera indica dan Melanochyla fasciculiflora dari keluarga Anacardiaceae terhadap vektor denggi; Aedes aegypti dan Ae. Albopictus di peringkat ovicidal serta larvicidal masing-masing dan juga perbandingan biologi progeni mereka. Vektor denggi dari strain makmal serta lapangan didedahkan dengan ekstrak metanol dari bahagian batang dan daun. Tangkai dari Gl. renghas menunjukan nilai LC95 paling rendah untuk kedua-dua strain makmal dan lapangan nyamuk Aedes diikuti oleh Mn. indica, Ml. fasciculiflora dan An. occidentale. Gluta renghas dan Mn. indica telah dipilih untuk penilaian lapangan sebagai perbandingan untuk Abate dan kumpulan kawalan. Ekstrak stem Gl. renghas adalah berkesan mengurangkan jumlah telur untuk vektor denggi dalam keadaan kering berteduh. Sebaliknya, ekstrak stem dari Mn. indica adalah lebih baik dalam keadaan kering dengan tidak berteduh dalam kawalan jumlah telur vektor denggi. Ekstrak daun dari Gl. renghas telah mempamerkan kadar hayat yang paling kurang terhadap nyamuk dewasa untuk kedua-dua musim (33.5%). Phytochemicals are getting hype in mosquito control programs as a pertinent substitute to synthetic pesticides. The objective of this study is to explore the ovicidal and larvicidal effects of Anacardium occidentale, Gluta renghas, Mangifera indica and Melanochyla fasciculiflora from family Anacardiaceae against the dengue vectors; Aedes aegypti and Ae. albopictus and biological comparisons of their progenies. Laboratory and field strains of dengue vectors were exposed to methanolic extracts of stem and leaf parts. Gluta renghas stem displayed the lowest LC95 values for both laboratory and field strains of Aedes mosquitoes followed by Mn. indica, Ml. fasciculiflora and An. occidentale. Gl. renghas and Mn. indica were selected for the field evaluation with comparison to Abate and control. Gluta renghas stem extracts effectively reduced the number of eggs for dengue vectors in dry shaded conditions. Whereas, Mn. indica stem extracts were better in dry unshaded conditions. Gluta renghas leaf extract exhibited least survival rate of adults during both seasons (33.5%).', 'ovicidal larvicidal aedes', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2016', 0),
(299, 'Hafizah Hanim Binti Mohd Zaki ', ' Formation Of Single Phase Niti Shape Memory Alloy Via Solid State Processing In Reducing Environment', 'The fast growing application especially in medical and engineering fields demands the development of novel-structured NiTi which requires an alternative processing technique, other than the conventional melt-casting method. Solid state synthesis is an alternative processing technique that has been attempted for producing novelstructured NiTi such as porous NiTi and other novel forms. Whilst shape memory effect is a unique advantage of NiTi shape memory alloy like, no successful attempt so far to produce single phase NiTi with good transformation. NiTi produced via solid state synthesis have complex microstructures involving multiple phases of Ti2Ni and TiNi3. These phases do not exhibit martensitic transformation and jeopardise the shape memory behaviour of NiTi. Apart from that, the formation of oxides may hinder the formation of single phase NiTi. Therefore, this research examines the processing conditions that produce single phase NiTi with optimum transformation behaviour and also identifies the possible obstacles for forming single phase NiTi. This study synthesised Ni-Ti and Ni-TiH2 powder mixtures in flowing argon and reducing environment using CaH2 and MgH2 powder as the in situ reducing agent. Several effects of parameters such as sintering temperature, time, composition, and post-sintering were studied and a systematic comparative investigation was performed on phase formation, transformation behaviour, shape memory effect, and deformation behaviour of the sintered specimen. Elemental powder sintering of Ni-Ti did not result in single phase NiTi and no distinct peaks of martensitic transformation were observed on the sintered specimens. The use of TiH2 to replace Ti increased the volume fraction of NiTi and displayed martensitic transformation peaks, albeit with low transformation heat (13 J/g) revealing that oxidation is an active obstacle in producing single phase NiTi. Synthesis of Ni-TiH2 in reducing the environment, especially the use of CaH2 as an in situ reducing agent, resulted in the formation of single phase NiTi with enthalpy change of ~25-26 J/g, similar to melt-cast NiTi alloys. The surface analysis showed a significant reduction in oxide formation, thus minimising the effects on balanced composition between Ni and Ti. This reflects that an oxygen-free environment allows unhindered Ni-Ti reaction, which leads to the formation of single-phase NiTi. This work established the fact that, other than the thermodynamic considerations often being discussed in similar work as obstacles to single phase formation, oxidation appears to have profound effects on single phase formation in NiTi synthesized in solid state.', 'formation alloy processing', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2016', 0),
(300, 'Myo Thuya Thein', 'Synthesis And Characterization Of Wox Zno Nanocomposites On Polyethylene Terephthalate (Pet) Fiber For Photocatalytic Application', 'The drawback of using ZnO semiconductor photocatalyst to treat synthetic dyes is its poor photocatalytic activity. This is attributed to its rapid recombination of charge carriers, and loses of particles by flowing water during photodegradation process. In this research, ZnO rods were synthesized by solution precipitation method. By studying synthesis parameters such as capping agent (PVP), growth duration and growth temperature, ZnO rods with the best photocatalytic performance in removal of RhB dye under UV irradiation were synthesized using PVP at growth duration of 30 min and growth temperature of 90 oC. These ZnO rods achieved photodegradation efficiency of 98.8 % and rate constant of 0.058 min1 after 75 min UV irradiation, respectively. It is noted that although ZnO nanodisks offered a larger (002) polar surface, their photodegradation efficiency was poor as compared to ZnO rods. Refined growth mechanisms of stacked ZnO rods and ZnO nanodisks are proposed based on the zeta potential analysis. In order to improve the photocatalytic performance, Ni particles were deposited onto the ZnO rods using solution precipitation method, followed by calcination and reduction in H2 atmosphere at 500 oC for 2 h. The deposition of Ni particles on the surface of ZnO rods was confirmed by the results of field emission scanning electron microscope (FESEM), energy dispersive X-ray spectroscopy (EDX), transmission electron microscope (TEM), room temperature photoluminescence (RTPL) and X-ray photoelectron spectroscopy (XPS). The Ni/ZnO nanocomposites experienced surface plasmon resonance (SPR) effect in RTPL measurement with a RUV/Vis ratio up to 40.6. However, this unique optical property did not favor for the photocatalytic performance of ZnO rods. The Ni particles introduced defects (recombination centers) which deteriorated the photocatalytic activity of Ni/ZnO nanocomposites. The best Ni/ZnO nanocomposites, with photodegradation efficiency of 61.7 % and rate constant of 0.033 min1 (after 30 min UV irradiation), were produced under calcination temperature of 500 oC and 0.03 M of nickel nitrate solution concentration. The WOx/ZnO nanocomposites were synthesized using solution precipitation method too. The WOx particles consisted of a mixture of WO2 and WO3 as proven by XPS analysis. Generally, >90 % photodegradation efficiency of RhB dye removal could achieved at 30 min by these WOx/ZnO nanocomposites as compared only 74.4 % by ZnO rods. In order to minimize the lost of particles in water system, WOx/ZnO nanocomposites were grown on PET fibers. This was achieved by depositing WOx particles on the ZnO rods pre-grown on the PET fibers. The optimized photocatalytic performance (RhB solution under stagnant condition, UV irradiation) was achieved for WOx/ZnO nanocomposites prepared at 0.01 M sodium tungstate solution in which the photodegradation efficiency and rate constant are 89.5 % and 0.030 min1, respectively. The WOx particles/ZnO nanocomposites under circulated RhB solution still maintained good coverage on PET fiber with consistent photocatalytic performance (rate constant of 0.0073 min1) even after 15 h.', 'wox-zno polyethylene photocatalytic', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2016', 0),
(301, 'Rohani Abdullah', 'Green Supply Chain Management Practices And Sustainable Performance Among Iso 14001 Manufacturing Firms: The Moderating Effect Of Supply Chain Integration. ', 'Peningkatan kesedaran dan kepentingan kelestarian alam sekitar memberi tekanan kepada firma-firma agar memberi perhatian yang sewajarnya terhadap kesan aktiviti-aktiviti industri yang dijalankan kepada alam sekitar. Tekanan ini lebih dirasai oleh industri pencemaran tertinggi. Di Malaysia, industri pembuatan merupakan penyumbang terbesar kepada indeks pencemaran negara. Oleh itu, sebarang usaha untuk mengurangkan kesan terhadap alam sekitar oleh industri ini akan menyumbang kepada penambahbaikan terhadap perlindungan alam sekitar dan pembangunan lestari. Justeru, amalan Pengurusan Rantaian Bekalan Hijau (GSCM) kini semakin popular sebagai satu pendekatan pengurusan dalam menguruskan hal yang berkaitan isu-isu alam sekitar. Walau bagaimanapun, amalan GSCM masih kurang diterima pakai oleh firma pembuatan di Malaysia kerana ramai tidak menyedari tentang kepentingannya dalam membantu kelestarian perniagaan. Oleh yang demikian, kajian ini telah dijalankan di kalangan firma pembuatan yang mendapat pengiktirafan ISO 14001 dengan tujuan untuk mengkaji sejauh mana pelaksanaan amalan GSCM dan hasil pelaksanaannya dari sudut prestasi lestari. Kajian ini juga bertujuan untuk memastikan kesan penyederhanaan Integrasi Rantaian Bekalan (SCI) di antara hubungan amalan GSCM dan prestasi lestari. The increasing awareness and interest in environmental sustainability is creating a pressure on firms to pay more attention on the impact of their industrial footprints to the environment. This pressure is felt more in high polluting industries. In Malaysia, the manufacturing industry is the largest contributor to the country\'s pollution index. Therefore, any effort to minimize the environmental footprints of this industry will provide considerable improvement in environment protection and sustainable development. Hence, Green Supply Chain Management (GSCM) practices is now gaining popularity as a management approach in facilitating matters related to environmental issues. However, GSCM practices are still less adopted by manufacturing firms in Malaysia since many are not aware of its importance to sustain the business. Thus, this study was conducted among ISO 14001 certified manufacturing firms with the aim to investigate the extent of GSCM practices implementation and the outcomes of its implementation in terms of sustainable performance. This study also sought to ascertain the moderating effect of Supply Chain Integration (SCI) on the relationship between GSCM practices and sustainable performance.', 'green-supply practices manufacturing', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2016', 0),
(302, ' Christy Ayi Alademerin', 'The Quality Of School Life And Its Influence On The Students Attitudes Towards School In Three Secondary Schools In Abuja, Nigeria.', 'Kajian ini meneroka dan menumpukan pada kualiti kehidupan sekolah (Quality of School Life) dan pengaruhnya terhadap tingkah laku pelajar sekolah menengah awam di Abuja, sebuah bandaraya di Nigeria. This study investigated and focused on the quality of school life (QoSL) and its influence on the attitudes of students towards school in public secondary schools in Abuja the federal capital territory (FCT) of Nigeria; aimed at improving and maintaining a good QoSL to reflect positive attitudes of students towards school.', 'school influence attitudes', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2016', 0);
