(322, 'Wan Normila Mohamad', 'The Effects Of Service Quality, Companions Satisfaction And Delight On Behavioural Intention In Private Hospitals For Medical Tourism. ', 'Kajian ini mengkaji perkaitan kualiti perkhidmatan dalam konteks pelancongan perubatan di hospital-hospital swasta di Malaysia. Ia merangkumi dimensi kualiti perkhidmatan komunikasi, budi bahasa, sokongan emosi, kemudahan hospital dan keperluan pendamping yang boleh meningkatkan niat tingkah laku melalui kepuasan dan kegembiraan berdasarkan pengalaman pendamping ini. Kajian ini juga menyiasat kesan yang sederhana daripada fasilitator pelancongan perubatan antara kualiti perkhidmatan dan niat tingkah laku dalam industri pelancongan perubatan. Model ini menggabungkan tiga teori; teori jangkaan disconfirmation, teori pemprosesan sosial dan teori psiko-evolusi emosi. Seramai 438 responden pendamping pesakit mengambil bahagian dalam kajian ini dari empat buah hospital swasta yang diluluskan di Pulau Pinang, Melaka dan Kuala Lumpur melalui kajian soal selidik yang dibangunkan daripada sastera yang berkaitan. Data dikumpulkan dengan menggunakan soal selidik yang dibangunkan daripada kajian sastera yang berkaitan dan kemudian dianalisis menggunakan pemodelan persamaan struktur melalui Smart PLS. This research examined the relevance of service quality in the context of medical tourism of the private hospitals in Malaysia. It encompasses the service quality dimensions of communication, courtesy, emotional support, hospital amenities and the companions need that can influence intention of returning for retreatment, accompanying and promoting Malaysia private hospitals through satisfaction and delight based on the companions experience. This research also investigates the moderating effect of medical travel facilitators between service quality and behavioural intention in the medical tourism industry. The model incorporates three theories; the expectancy-disconfirmation theory, the social information processing theory and the psycho-evolutionary theory of emotions. A total of 438 respondents of patients companions participated in this study from four approved private hospitals in Penang, Malacca and Kuala Lumpur via survey questionnaire developed from related literature. Data was collected by using self-administered questionnaire developed from related literature and then analysed by using structural equation modeling via Smart PLS.', 'service medical tourism', '', 'Pusat Pengajian Pengurusan (School of Management)', '2016', 0),
(323, 'Ng Soon Min', 'Development of Evaluation System for Groundwater Level in Relation to Slope Stability Forecasting.', 'The aim of this study focused on developing a new evaluation system of groundwater level for slope stability forecasting by conducting a case study at a cut slope in Precinct 9, Putrajaya, Malaysia. This system involved the development of subsurface conceptual model, development of groundwater table fluctuation model, stability assessment and investigation of unsaturated soil behaviour which incorporates the response of pore air pressure. Subsurface characterization of the study area was carried out by using the integration of borehole drilling, electrical resistivity survey and seismic refraction survey. Three dimensional (3D) models of stratigraphy, electrical resistivity and seismic velocity were proven to be effective in identifying the potential failure zone that coincides with the past slope failure zone. The potential failure zone that consist of silt soil was identified to have high water content with electrical resistivity ranges from 10m to 300m and intermediate P-waves velocity (vp) of 500m/s to 1000m/s. Subsequently, the multi tank model and numerical analysis was developed to determine the groundwater table fluctuations and pore water pressure distributions of the slope. The multi tank model was able to produce a root mean square error (RMSE) of 0.156 and 0.169 for the calibration model using year 2011 data and prediction model using year 2012 data respectively. The factor of safety (FOS) of the slope throughout the year 2012 varies according to the fluctuations of groundwater table analyzed by using both limit equilibrium method (LEM) and finite element method (FEM). Furthermore, the FOS for the slope model assigned with multi tank model groundwater table produced approximately 1% error compared to the slope model assigned with the observed groundwater table. Therefore, this outcome proven that the developed evaluation system can be utilized as an assessment tool for slope stability forecasting. In addition, the component of pore air pressure which is often neglected in unsaturated soil behaviour during rainfall infiltration was also investigated through one dimensional (1D) soil column numerical simulation and physical modelling. It was found that the development of pore air pressure can be influenced by soil type, rainfall intensity, and initial water content. Both results of numerical simulation and laboratory experiment show that the soil sample from site with rainfall intensity of 26751.6mm/hr and initial water content of 21% produced the maximum pore air pressure. Finer particle size with higher rainfall intensity and initial water content lead to the development of confined pore air as the rainwater cannot replace the pore air smoothly subsequently resulting in pore air pressure build up.', 'development groundwater stability', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2016', 0),
(324, 'Ng Hee Song', 'The Influence Of Transformational Leadership And Competence On Small Enterprise Success In Malaysia: The Mediating Effect Of Innovativeness', 'Penyelidikan ini memberi tumpuan terutamanya kesan kepimpinan transformasi, kecekapan peluang keusahawanan, kecekapan pemacu keusahawanan, kecekapan teknikal ke atas kejayaan perusahaan kecil di Malaysia di bawah pengaruh perantaraan daya inovatif. Berlandaskan pandangan berasaskan sumber dan perspektif keupayaan dinamik, penyelidikan ini membuat satu model konsep untuk mengkaji hubungan tersebut di atas. Penyelidikan juga mengkaji sejauh manakah kesan perantaraan daya inovatif produk, daya inovatif proses, dan daya inovatif kelakuan ke atas perhubungan di atas. Data dikumpul melalui soal selidik berstruktur berdasarkan pelan pensampelan dari pengkalan data perusahaan kecil dengan mengunakan kaedah pensampelan pengadilan, menghasilkan set data sebanyak 178 responden daripada para pemilik merangkap pengurus perusahaan kecil di Malaysia. Data dikumpul melalui soal selidik berstruktur. Data dianalisa dengan menggunakan SPSS dan SmartPLS. Penemuan kajian mengesahkan model ramalan kajian ini dan menyokong limabelas daripada lapanbelas hipotesis. This study predominantly focused the impact of transformational leadership, entrepreneurial opportunity competence, entrepreneurial drive competence, and technical competence on small enterprise success in Malaysia under the mediating effect of innovativeness in product, process and behaviour. Drawing mainly on both the resource-based view and the dynamic capabilities perspective, this study developed a conceptual model to support the relationships. This study also investigated the extent of the mediating effect of product, process and behavioural innovativeness on the four aforementioned relationships. Data was gathered through structured questionnaire from the sampling plan of small enterprise database using purposive sampling method, generating a dataset of 178 respondents as small enterprise owner-managers in Malaysia. Data collected were analysed using both SPSS and SmartPLS. The empirical findings partially confirmed the research model and supported fifteen out of eighteen direct hypotheses.', 'leadership enterprise innovativeness', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2016', 0),
(325, 'Sahabeh Safarpour Nikou Langeroodi', 'Statistical Assessment Of Terra Modis Aerosol Optical Depth (C051) Over Coastal Regions. ', 'Produk aerosol dari Spektrometer Pengimejan Resolusi Sederhana (MODIS) telah digunakan secara meluas untuk menangani alam sekitar dan isu-isu berkaitan perubahan dengan liputan global setiap hari. Kedalaman optic aerosol (AOD) yang diambil oleh algoritma yang berbeza berdasarkan permukaan piksel, menentukan antara tanah dan laut. Produk MODIS-Terra dan Global Aerosol Robotik Network (AERONET) boleh didapati daripada Multi-sensor Aerosol Product Sampling System (MAPSS) bagi kawasan-kawasan pantai sepanjang tahun 2000-2010. Dengan menggunakan data yang dikumpul daripada 83 stesen pantai dan 158 bukan pantai di seluruh dunia dari AERONET 2000-2010, penilaian ketepatan dibuat untuk kedalaman optic aerosol pantai (AOD) diambil dari MODIS di atas satelit Terra. Tujuan utama penilaian statistik AOD di kawasan pantai adalah untuk melahirkan MODIS AOD terubahsuai dengan ralat yang minimum berbanding dengan nilai rujukan yang diberikan oleh AERONET. Moderate Resolution Imaging Spectroradiometer (MODIS) aerosol products have been widely used to address environment and climate change issues with daily global coverage. Aerosol optical depth (AOD) is retrieved by different algorithms based on the pixel surface, determining between land and ocean. MODIS-Terra and Global Aerosol Robotic Network (AERONET) products can be obtained from the Multi-sensor Aerosol Products Sampling System (MAPSS) for coastal regions during 2000-2010. Using data collected from 83 coastal and 158 non-coastal stations worldwide from AERONET from 2000-2010, accuracy assessments are made for coastal aerosol optical depth (AOD) retrieved from MODIS aboard the Terra satellite. The main aim of this statistical assessment of AOD over coastal regions is to produce modified MODIS AOD with minimum error when compared with the reference value given by AERONET.', 'terra modis aerosol', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(326, 'Yousef Moradi Shahgharyeh', 'Development Of Drought Risk Map Of Zayandehrud Dam Catchment Using Water Resource Approach Process.', 'The overall goal of this study is to improve a methodology to appraise drought trends and understanding of appropriate way, rely on the real condition catchment area, to reduce drought impacts. A total of 15 meteorological stations and 9 streamflow gauges across Zayandehrud Dam Catchment (ZDC), central of Iran were selected for analysis. Furthermore, as selected framework of this investigation make use Water Resources Approach Process model (WRAP), which is a hybrid technique, geological and morphometric data were used to better understanding impacts and trends of water scarcity. An assessment of existing meteorological drought indices namely, the Standardised Precipitation Index (SPI), the Z-Score Index (ZSI) and Deciles was first conducted to assess their suitability for the determination of drought conditions. The use of the Standardised Precipitation Index (SPI) was found to be suitable for analysing meteorological droughts in Iran. SPI was also operative in identifying the onset and the end of historical droughts. For analysing streamflow the Standardised Streamflow Index (SSFI) was used. Several scatter plot and curve diagrams of SPI and SSFI were shown to be closely correlated. MannKendall (MK) test, Sens slope and LOWESS test were used to estimate significance of temporal trends in both precipitation and streamflows. A semiparametric and a parametric process associated with the fractional autoregressive integrated moving average modelling approach and a MK scaling test are employed to assess significance of temporal trends. The results of the study propose that for the majority of the time series of streamflows in contrast to precipitation in drought duration shows parallel trends, which indicates that majority of runoff in short lag time and in less infiltration flows to downstream. Majority of rain stations and streamflow gauges shown downward trends. Highest variations occurred in western part of case study area. In north and north-east a weak upward trends was detected, this is due to influence of dam evaporation. Major problem of mountainous area is lack of reasonable aquifer, so geological structures and stratigraphical systems provides the main groundwater holder. On the other hand central and north-eastern part of ZDC contained significant aquifers but low precipitation and high stress on groundwater resulted from subsidence and land degradations. Vulnerability and risk map were developed by integrating basic maps with i.e. drought and climatic maps, geological map, morphometric data and erosion map.', 'drought dam water-resource', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2016', 0),
(327, 'Tan Zi Ni', 'Physicochemical Properties And Prebiotic Potential Of Native, Resistant And Hcl-Resistant Starches From Sago (Metroxylon Sagu)', 'Kanji rintang jenis III (RS3) telah dihasilkan daripada sagu (Metroxylon sagu) dan dinilai sifat fizikokimia and potensinya sebagai prebiotik. Sampel mengandungi 35.7% kanji rintang (dikenal sebagai sagu RS) telah dihasilkan apabila kanji sagu asli diautoklaf dalam air suling pada suhu 121 C selama 1 jam, dinyahcabang dengan 20 U pullulanase per g kanji pada 60 C selama 24 jam dan seterusnya diautoklaf sekali lagi pada 121 C selama 1 jam sebelum disimpan pada 4 C selama 24 jam. Seterusnya, kandungan kanji rintang meningkat sehingga 63.8% (sampel dikenal sebagai HCl-sagu RS) selepas sagu RS dihidrolisiskan dengan 0.5 M HCl pada suhu 60 C. Granul sagu RS dan HCl-sagu RS menunjukkan corak pembelauan sinar X jenis B, suhu puncak yang tinggi (143.7 C and 146.5 C, masing-masing) dan struktur permukaan yang tidak sekata dan kasar. Granul kanji sagu asli menunjukkan corak pembelauan sina X jenis C, suhu puncak 74.6 C dan permukaan yang sekata. Keterlarutan dan kuasa pembengkakan sampel HCl-sagu RS ialah 14.9% dan 1.94 g/g, masing-masing, iaitu lebih rendah berbanding sagu RS (27.4% and 2.82 g/g, masing-masing). Resistant starch type III (RS3) was produced from sago (Metroxylon sagu) and evaluated for its physicochemical properties and potential as a prebiotic. A sample with 35.7% RS3 content (designated as sago RS) was produced when the native sago starch was suspended in distilled water, gelatinized by autoclaving at 121 C for 1 h, followed by debranching with 20 U pullulanase per g starch at 60 C for 24 h, autoclaved again at 121 C for 1 h before storage at 4 C for 24 h. RS3 content was further increased with the treatment of sago RS with 0.5 M HCl at 60 C (sample designated HCl-sago RS) to 63.8%. Granules of sago RS and HCl-sago RS had B-type X-ray diffraction pattern, high peak temperatures (143.7 C and 146.5 C, respectively) and showed irregular and rough surface structure. While granules of native sago starch had C-type diffraction pattern, peak temperature of 74.6 C and smooth granular surface. The solubility and the swelling power of HCl-sago RS samples were 14.9% and 1.94 g/g, respectively, which were lower than that of sago RS (27.4% and 2.82 g/g, respectively).', 'physicochemical prebiotic sago', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2016', 0),
(328, 'Tee Hui Siang', 'Water Balance, Host Utilisation, And Mass Rearing Improvements Of The Cockroach Oothecal Parasitoids, Aprostocetus Hagenowii (Hymenoptera: Eulophidae) And Evania Appendigaster (Hymenoptera: Evaniidae)', 'Tesis ini menumpu kepada keseimbangan air, penggunaan perumah and peningkatan kultur massa Aprostocetus hagenowii (Ratzeburg) (Hymenoptera: Eulophidae) dan Evania appedigaster (Linnaeus) (Hymenoptera: Evaniidae), dua parasitoid ooteka lipas Amerika Periplaneta americana (Linnaeus) (Blattidae: Dictyoptera). This thesis focuses on the water balance, host utilization and mass rearing improvements of Aprostocetus hagenowii (Ratzeburg) (Hymenoptera: Eulophidae) and Evania appeindgaster (Linnaeus) (Hymenoptera: Evaniidae), two ootheca parasitoids of the American cockroach, Periplaneta americana (Linnaeus) (Blattidae: Dictyoptera).', 'utilisation improvements cockroach', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2016', 0),
(329, 'Nagarajan A/L Thangavelu', 'Talent Retention Strategies, Organizational Commitment And Intention To Stay In Commercial Banks In Malaysia: The Moderating Role Of Person-Organization Fit', 'Kajian ini bertujuan untuk meneliti kesan akibat strategi pengekalan pekerja yang berbakat (komunikasi, sokongan penyelia, peluang latihan, sokongan pembangunan kerjaya and kepuasan gaji) terhadap keputusan pekerja untuk terus kekal untuk kerja. Komponen komitmen organisasi (komitmen afektif, komitmen berterusan dan komitmen normatif) di kaji sama ada memainkan fungsinya sebagai medium pengantara di antara strategi pengekalan pekerja berbakat dengan keputusan pekerja untuk terus kekal berkerja. Tambahan lagi, kajian ini juga menganalisa keserasian individu-organisasi sebagai moderator dalam mempengaruhi hubungan di antara komitmen organisasi (melalui tiga komponennya) dengan keputusan pekerja untuk terus kekal untuk kerja. Kajian ini dilakukan terhadap 405 pengurus dan pegawai yang kerja di 27 buah bank perdagangan di Malaysia. Kajian ini di bina dan di selidik atas dasar teori pertukaran sosial dan teori keserasian individu-persekitaran. Data yang dikutip di analisa menggunakan dua alat statistik iaitu SPSS dan SmartPLS. The purpose of this research is to examine the effects of talent retention strategies (communication, supervisor support, training opportunities, career development support and pay satisfaction) in predicting intention to stay. Components of organizational commitment (affective commitment, continuance commitment and normative commitment) has been postulated to mediate the relationship between talent retention strategies and intention to stay. Additionally, person-organization fit has been explored as a moderator between organizational commitment and intention to stay. The survey was conducted among 405 managers and officers who works in 27 commercial banks in Malaysia. In essence, the research has built a framework based upon social exchange theory and person-environment fit theory. The data collected was analyzed using SPSS and SmartPLS statistical tools.', 'retention commitment commercial-banks', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business) ', '2016', 0),
(330, 'Xiao Li ', 'Ace and Actn3 Polymorphisms, Aerobic and Anaerobic Capacities, Bone and Muscular Performance in Malay Athletes and Non-athletes. ', 'Kajian ini bertujuan untuk menyiasat hubungan antara polimorfisme gen ACE I/D dan polimorfisme gen ACTN3 R577X, kapasiti aerobik dan anaerobik, tulang dan prestasi otot dalam kalangan atlet dan bukan atlet Melayu. Seramai 132 peserta telah menyertai kajian ini. Kesemua peserta atlet (atlet lelaki, n = 33; atlet wanita, n = 33) dan bukan atlet (lelaki bukan atlet, n = 33; perempuan bukan atlet, n = 33) Melayu telah dikenalpasti genotip polimorfisme ACE gen I/D dan polimorfisme ACTN3 gen R577X mereka dengan menggunakan teknik PCR This study investigated the association between ACE gene I/D polymorphism and ACTN3 gene R577X polymorphism, aerobic and anaerobic capacities, bone and muscular performance in Malay athletes and non-athletes. A total of 132 participants were recruited in this study. Malay athletes (male athletes, n=33; female athletes, n=33) and non-athletes (male non-athletes, n=33; female non-athletes, n=33) participants were genotyped for ACE gene I/D polymorphism and ACTN3 gene R577X polymorphism by using PCR technique', 'polymorphisms capacities athletes/non-athletes', '', 'Pusat Pengajian Sains Kesihatan (School of Health Sciences)', '2016', 0),
(331, 'Seah Choon Ming', 'Synthesis Of Monolayer Graphene On Polycrystalline Nickel And Nickel-Copper Bimetallic Catalyst And Study Toward The Reuse Of Nickel Catalyst.', 'Graphene is a layer of sp2 hybridized carbon atoms with a thickness of only one atom, which exposed most of its atoms to the surrounding medium. Since the discovery of graphene in 2004, it has become the main subject of research around the world. The attractiveness of graphene is mainly attributed to its remarkable mechanical, optical, thermal and electrical properties, enabling graphene to be potentially used in various applications. To date, CVD is the promising method to produce wafer-scale graphene, because it allows an easier separation of graphene from the catalytic substrate. With the assist of fast cooling, monolayer graphene was grown directly on polycrystalline Ni foil under atmospheric pressure CVD with temperature of 850 C, methane partial pressure of 0.2 atm and reaction duration of 5 min. However, monolayer graphene could not be formed on Cu under the chosen CVD conditions. Fast cooling after CVD allowed the quenching of the activity of the catalyst and limiting diffusion of dissolved carbon to the surface of Ni, which later facilitate the formation of predominantly wafer scale monolayer graphene. To further improve the uniformity of monolayer graphene, a facile technique was applied to grow monolayer graphene simultaneously on both polycrystalline Ni and Cu foils using a Ni-Cu bilayer catalyst at temperature of 950 C, methane partial pressure of 0.2 atm and reaction duration of 5 min. High uniformity and quality of the crystalline structure of the grown graphene was evidenced by Raman spectroscopy mapping and High Resolution Transmission Electron Microscope. The straightforward bimetallic catalytic system allows the control of carbon diffusion to the interface of Ni and Cu. In particular, carbon accessibility is reduced at the inner Ni surface, and Cu behaves as a carbon barrier. The growth mechanism of monolayer graphene was facilitated by carbon diffusion through the bulk and Ni grain boundary, the driving force coming from concentration gradient between carbon-rich surface to carbon-lacked surface. The grain boundaries were shown to play a crucial role in carbon control during the growth stage. Facilitated by the applied fast cooling, the quenching process reduced the amount of carbon atoms segregated, only the carbon atoms situated near the surface had enough time to segregate and form graphene. Meanwhile, diffusion of carbon atoms at the middle of the Ni foil was highly inhibited; forming Ni3C. Ni3C is known to offer good protection against corrosion. The presence of Ni3C combined with the use of iron nitrate (0.5mol/L) as soft etchant for graphene separation, the Ni foil could be reused again up to 6 cycles without causing a huge deviation on the quality and the uniformity of bilayer graphene. Ni3C is indeed able to limit the etching effect of the Ni foil. This work has successfully demonstrated a simple and novel route to synthesize monolayer graphene with high quality.', 'monolayer nickel reuse', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2016', 0),
(332, 'Haider Mohammed Naima Zwain', 'Treatment Of Recycled Paper Mill Effluent Using Modified Anaerobic Inclining-Baffled Reactor.', 'Calcium oxide (CaO) based materials have been proposed as potential candidates for CO2 adsorption to reduce the emission of carbon dioxide (CO2) into the atmosphere especially from the combustion of fossil fuel power plants. In this research, aragonite (CaCO3), calcite (CaCO3), calcium hydroxide (Ca(OH)2) and inert materials incorporated calcium hydroxide (Ca(OH)2) were synthesized by hydrothermal, sol-gel assisted hydrothermal and precipitation methods, respectively. Various parameters such as hydrothermal temperature (8 h - 72 h), addition of polyacrylamide (PAM), sodium hydroxide (NaOH) concentration (2 M - 10 M), cetyltrimethyl ammonium bromide (CTAB) concentration (0.2 M - 0.9 M) and different inert incorporated materials (Mg, Zr, Ce and (Zr-Ce)) on as-synthesized samples were characterized. And then, the CO2 adsorption performances of calcium oxide (CaO) based adsorbents derived from as-synthesized samples were investigated. In the case of hydrothermal method, 1D aragonite (CaCO3) nanorods are observed at 72 h hydrothermal reaction time when PAM is used as an additive, whereas 1D aragonite nanorods are obtained without using PAM at 12 h reaction time. In sol-gel assistance hydrothermal method, 3D calcite (CaCO3) hollow microspheres are attained with 2 M of NaOH concentration, while nanostructured calcium hydroxide (Ca(OH)2) is obtained by precipitation method at high CTAB concentration of 0.9 M. On the other hand, Mg, Zr, Ce and (Zr-Ce) incorporated Ca(OH)2 samples exhibit different surface morphologies. The CO2 adsorption capacities of calcium oxide (CaO) derived from 1D aragonite CaCO3 nanorods, 3D calcite CaCO3 hollow microspheres and nanostructured calcium hydroxide Ca(OH)2 after first cycles are 0.80 g-CO2/g-adsorbent, 0.62 g-CO2/g-adsorbent and 0.71 g-CO2/g-adsorbent, respectively. However, these capacities drop to 0.38 g-CO2/g-adsorbent, 0.39 g-CO2/g-adsorbent and 0.48 g-CO2/g-adsorbent after 10 cycles, respectively. It can be seen that CaO derived from Ca(OH)2 with surface area 64.57 m2/g exhibits the best CO2 adsorption capacity after 10 cycles (0.48 g-CO2/g-adsorbent), but the decay in adsorption capacity with number of cycles is observed. The development of cyclic stability can be observed in CaO-based adsorbents derived from Mg, Zr, Ce and (Zr-Ce) incorporated Ca(OH)2 samples. The CaO-based adsorbent derived from Mg-Ca(OH)2 shows slightly decrease in capacity from 0.67 g-CO2/g-adsorbent after first cycle to 0.57 g-CO2/g-adsorbent after 10 cycles, while CaO-based adsorbents produced from Zr and Ce-incorporated Ca(OH)2 samples exhibit the obvious cyclic stability during 10 cycles, 0.38 g-CO2/g-adsorbent and 0.24 g-CO2/g-adsorbent, respectively. The CaO-based adsorbent derived from (Zr-Ce) acetates incorporated Ca(OH)2 sample increases the capacity from 0.59 g-CO2/g-adsorbent after first cycle to 0.63 g-CO2/g-adsorbent after 10 cycles. The higher adsorption capacity and better cyclic stability during 10 cycles are attributed to the high BET surface area (155.80 m2/g), a wide range of micro/mesopore size distribution (1.7 nm - 30 nm) and the presence of high temperature sintering resistance Ce2Zr3O10 compound.', 'recycled-paper anaerobic reactor', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2016', 0),
(333, 'Saad Fahad Aldawood', 'Washback Of Continuous Assessment In Efl Classrooms In Saudi Arabia: Teachers Perceptions And Practices', 'Dalam linguistik gunaan, fenomena di mana ujian mempengaruhi pengajaran dan pembelajaran dikenali sebagai washback atau backwash oleh banyak pendidik (Alderson, 1986; Morrow, 1986; Pearson, 1988; Hughes, 1989; Morris, 1990). Oleh kerana washback memainkan peranan yang penting dalam pengajaran dan pembelajaran, pihak yang terlibat dalam proses pengajaran dan pembelajaran perlu memahami konsep washback ini sebagai satu fenomena pendidikan yang umum, dan bagaimana konsep ini boleh dimanipulasikan secara positif. Penilaian secara berterusan (Continuous assessment/CA) telah diperkenalkan sebagai sebahagian daripada ujian dan inovasi penilaian dalam sistem pendidikan Saudi. CA bertujuan menggantikan penilaian tradisional (penilaian sumatif) untuk menilai prestasi dan pencapaian pelajar dengan lebih berkesan di samping menambahbaikkan proses pengajaran dan pembelajaran secara keseluruhan. Kajian ini mengkaji persepsi guru terhadap faedah washback dalam CA dan kesannya terhadap pengajaran dan pembelajaran subjek Bahasa Inggeris. Secara khususnya, kajian ini juga mengkaji kesannya terhadap amalan guru di kolej Technical and Vocational Training Corporation (TVTC) di Saudi Arabia. In applied linguistics, the phenomenon of tests influences on teaching and learning is denoted by many educationalists as washback or backwash (Alderson, 1986; Morrow, 1986; Pearson, 1988; Hughes, 1989; Morris, 1990). Because of the significant role that washback plays in instruction and learning, those connected to the learning and teaching processes are required to completely understand the concept of washback, as a common educational phenomenon, and how to manipulate it in a positive way. Continuous assessment (CA) has been introduced as a part of the examination and assessment innovation in the Saudi educational system. CA is intended to substitute the traditional assessment (summative assessment) to better assess and evaluate students\' performance and achievement and improve the whole process of teaching and learning. This study investigates teachers\' perception of the beneficial washback of CA and its impact on the English teaching and learning; and, more specifically, its impact on teachers\' practices at the Technical and Vocational Training Corporation (TVTC) colleges in Saudi Arabia.', 'washback classroom teachers', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2016', 0),
(334, 'Alonge Olayiwola Richard ', 'Development Of Hybrid Cementitious Composite (HCC) For Sustainable Construction In Sea Water Environment.', 'Perbalahan utama dalam komuniti pembinaan ialah untuk menghasilkan konkrit bertetulang gentian (FRC) yang mempunyai ciri-ciri kejuruteraan yang baik serta keupayaan lenturan yang lebih tinggi. Metakaolin (MK) mempamerkan potensi yang sangat baik sebagai bahan bersimen tambahan (SCM) kerana tahap kereaktifan pozzolan yang tinggi serta pengurangan Ca(OH)2 seawal satu hari untuk menghasilkan kekuatan awal. Demikian juga, ia menguatkan adunan campuran simen untuk menjalani proses pemadatan yang telah ditetapkan. Proses penerokaan eksperimen ini melibatkan penghasilan MK oleh makmal yang berasal daripada kaolin mentah dan pencirian MK dalam empat campuran adunan simen yang terdiri daripada simen, Coloids Nanosilica (CNS) dan Epoxy Resin. Komposisi kimia dan sifat fizikal MK telah dinilai menggunakan penganalisis laser partikel zarah, X-ray Fluorescence (XRF) dan X-ray Diffraction (XRD). The major challenge in the construction community is to advance a new type of fibre reinforced concrete (FRC) which possesses favourable engineering features that yield a high flexural ability. Metakaolin (MK) display great potentials as a supplementary cementitious material (SCM) because of its high pozzolanic reactivity as well as reduction of Ca(OH)2 as early as one day to produce early strength. Likewise, it intensifies the blended cement paste to undergo definite densification. The experimental exploration involves the laboratory production of MK from raw kaolin and characterization of MK quaternary blended cement mortar consists of cement, colloids nanosilica (CNS) and epoxy resin. The chemical compositions and physical properties of the MK were appraised using a laser particle size Analyzer, Xray Fluorescence (XRF) and X-ray Diffraction (XRD).', 'cementitious construction seawater-environment', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2016', 0),
(335, 'Ebrahim Bazrafshan', 'The Effect Of Independent Board On Stock Liquidity In East Asian Countries.', 'Kajian ini menyiasat hubungan antara komposisi ahli lembaga dan kecairan saham syarikat dengan menggunakan sampel dari negara Asia Timur. Data yang dikumpulkan merangkumi 2,407 buah firma-tahun untuk syarikat disenaraikan dalam bursa saham di negara China, Hong Kong, Jepun, Malaysia, Singapura, Korea Selatan, Taiwan, Thailand, dan Indonesia dari tahun 2003 hingga 2013. Untuk menekankan isu endogeniti, kajian ini mengendalikan panel Generalized Method of Moments (GMM) yang dinamik bagi mengawal endogeniti yang dinamik, heterogeniti yang sukar diperhatikan dan keserentakan. Kajian ini menemui bukti yang kukuh bahawa secara signifikannya, semakin besar kebebasan lembaga maka semakin tinggi kecairan saham dalam syarikat tersebut. Kajian ini mencadangkan bahawa impak kebebasan ahli lembaga terhadap kecairan saham dipengaruhi oleh tiga saluran. Saluran-saluran tersebut adalah mengenai aliran maklumat daripada pengurus syarikat kepada pihak lembaga dan orang awam: (1) Apabila pihak lembaga sedang mempertimbangkan penggantian CEO, aliran maklumat daripada CEO kepada lembaga syarikat mungkin akan terhalang. Situasi menjadi semakin teruk apabila lembaga lebih bebas daripada CEO. Kajian ini mendapati dalam tempoh pertimbangan penggantian tersebut, pengaruh daripada kebebasan ahli lembaga terhadap kecairan saham akan terjejas. (2) Apabila pembuat pasaran bersedia untuk memproses maklumat secara bebas, kepentingan kebebasan lembaga terhadap kecairan saham akan berkurang. (3) Akhirnya, kajian ini juga mendapati bahawa apabila terdapat perlindungan yang besar terhadap para pelabur, kepentingan penyeliaan lembaga pengurus terhadap kecairan saham berkurang, dan seterusnya mengurangkan pengaruh kebebasan ahli lembaga terhadap kecairan saham. This study investigates the relationship between board composition and liquidity of a firms shares using sample from East Asian countries. The data comprises 2,407 firm-year observations of listed companies in the stock markets of China, Hong Kong, Japan, Malaysia, Singapore, South Korea, Taiwan, Thailand, and Indonesia over the period 2003-2013. To address endogeneity issue, this study conducts a dynamic panel generalized method of moments (GMM) to control for dynamic endogeneity, unobservable heterogeneity, and simultaneity. The present study finds strong evidence that greater board independence significantly increases liquidity. In this study, the impact of board independence on liquidity is suggested to be affected by three channels of information flow from managers to the board and the public: (1) when the board is in the midst of considering replacing the CEO, the flow of information from the CEO to the board may be impeded. This effect clearly can be exacerbated when the board is more independent of the CEO, and this study finds that in these periods, the beneficial impact of independence on liquidity is impaired; (2) when market makers are better equipped to process information independently, the importance of board independence on liquidity is reduced; (3) finally, when there are already greater investor protections in place that make board supervision of managers less crucial, this will reduce the impact of independence board on liquidity.', 'board stock liquidity', '', 'Pusat Pengajian Pengurusan (School of Management)', '2016', 0),
(336, 'Rohani Bt Che Hashim', 'Hubungan Antara Tekanan Hidup, Sumber Sosial, Kemahiran Daya Tindak Dan Kesejahteraan Spiritual Dengan Penghargaan Kendiri Remaja Ponteng', '.Kajian ini adalah untuk menentukan hubungan dan pengaruh tekanan hidup, sumber sosial, kemahiran daya tindak dan kesejahteraan spiritual terhadap penghargaan kendiri remaja ponteng. Pengaruh kesejahteraan spiritual sebagai faktor pengantara tekanan hidup, sumber sosial, kemahiran daya tindak dan penghargaan kendiri juga dikaji. Reka bentuk kajian adalah kajian kuantitatif. Sampel kajian terdiri daripada 400 orang remaja ponteng yang telah dipilih secara rawak bertujuan dari tiga buah negeri di utara Semenanjung Malaysia. Mereka terdiri daripada 200 responden dalam kalangan remaja ponteng di lokasi bandar dan 200 responden lagi terdiri daripada remaja ponteng di lokasi luar bandar. Remaja ponteng lelaki yang terlibat dalam kajian ini ialah seramai 249 orang (63.3%) manakala remaja ponteng perempuan pula seramai 151 orang (37.8%). Remaja ponteng telah di pilih dari negeri Pulau Pinang, Kedah dan Perlis melibatkan 20 buah sekolah. This study was conducted to determine the relationship and the influence of life stress, social resources, coping skills and spiritual well-being of the self-esteem of school truancies amongst teenagers. Influence of spiritual well-being as a mediator factors influence the life stress, social resources, coping skills and self-esteem has also been studied. This study adopted a quantitative research design. The sampling comprised 400 teen truants who were chosen using purposive random sampling from three states in the North of Peninsular Malaysia. 200 respondents were from the urban area whilst another 200 respondents were from the rural area. Truant boys involved in the research comprised of 249 people (63.3%) meanwhile truant girls comprised 151 people (37.8%). The respondents were chosen from the states of Kedah, Penang and Perlis involving twenty schools.', 'sosial spritual remaja', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2016', 0),
(337, 'Eugene Obiora Eugene ', 'Nigerias Military Involvement In Liberia 1990-1997: A Realist Assessment.', 'Negara Liberia terjerumus ke dalam kancah perang saudara antara tahun 1990 hingga 1997. Kerajaan Nigeria pada masa itu telah melancarkan dan mengetuai campur tangan ketenteraan dengan dominasi tentera Nigeria dalam cubaan menamatkan perang saudara tersebut. Campur tangan ketenteraan Nigeria ini, dari perspektif realis, dilakukan untuk mempertahan kepentingan nasionalnya dengan mengembalikan keamanan di Liberia melalui mekanisme yang dipersetujui secara multilateral. Namun, hal ini tidak dibuktikan dalam penulisan sedia ada setakat ini. Oleh itu, satu kajian yang cuba mengisi lompang ilmu dalam penulisan sedia ada perlu dibuat. Maka, objektif kajian ini adalah pertama untuk mengenal pasti sama ada penglibatan tentera Nigeria di Liberia memenuhi kepentingan nasional Nigeria; dan kedua, menentukan sama ada campur tangan yang dipimpin Nigeria ini merupakan inisiatif antarabangsa hasil muafakat multilateral yang patut dicontohi, atau satu duluan berbahaya dalam hubungan antarabangsa. The Liberian nation was plunged into civil war between 1990 and 1997. The Nigerian military government at the time, in its perceived attempt to stop the war, initiated and led a military intervention in the country predominantly using the Nigerian Army. In realist terms, Nigerias military involvement was to defend her national interest by restoring peace to Liberia through a consensual multilateral mechanism. Indications from extant literature, so far, have not shown any convincing evidence of this expectation in the Nigerian involvement. This is a knowledge gap that needs to be filled. The objectives of this study, therefore, are first, to ascertain if the Nigerian military involvement in Liberia was in her national interest; and second, to clarify if the Nigerian-led intervention was a commendable, multilateral, consensual international initiative as assumed, or if it was a dangerous precedent in international relations.', 'military involvement realist', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2016', 0),
(338, 'Yuvaraj A/L Ganesan', 'Non-Audit Services, Business Performance And Corporate Social Responsibility: The Case Of Small And Medium Manufacturing Companies In Malaysia.', 'Menyedari manfaat yang boleh diperolehi daripada amalan Tanggungjawab Sosial Korporat (CSR) di kalangan perniagaan kepada negara, kerajaan telah melaksanakan pelbagai dasar, peraturan dan telah melabur sejumlah besar wang untuk menggalakkan syarikat-syarikat untuk mengamalkan CSR. Walau bagaimanapun, kajian yang lalu menunjukkan bahawa tahap amalan CSR di kalangan syarikat-syarikat Malaysia masih tidak pada tahap yang memuaskan, terutamanya dalam sektor perkilangan. Tambahan pula, terdapat kekurangan penyelidikan CSR dalam konteks Perusahaan Kecil dan Sederhana (PKS), yang membentuk sebahagian besar daripada syarikat-syarikat yang ditubuhkan di seluruh dunia dan memainkan peranan yang penting dalam ekonomi, masyarakat dan alam sekitar. Oleh itu kajian ini dijalankan untuk menghuraikan mengenai isu ini daripada perspektif PKS. Realising the benefits that could be brought from Corporate Social Responsibility (CSR) practice among businesses to the nation, the Malaysian government implemented many policies, regulations and invested a significant amount of money to encourage companies to practice CSR. However, past literature showed that the level of CSR practice amongst Malaysian companies was still not at a satisfactory level, mainly in the manufacturing sector. Furthermore, there was a lack of CSR research in the context of Small and Medium Enterprises (SMEs), which make up a significant portion of companies establishments around the world and plays an important role on economy, society and environment. Therefore, this study was undertaken to shed some light on the issue from SMEs perspective.', 'corporate social responsibility', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business) ', '2016', 0),
(339, 'Nur Aili Hanim Hanafiah', 'Pengaruh Pulau Haba Bandar Terhadap Keselesaan Terma Dalaman Bangunan Untuk Pekerja Di Pulau Pinang. ', 'Penyelidikan mengenai pengaruh pulau haba bandar terhadap keselesaan terma dalaman bangunan untuk pekerja telah dilakukan di kawasan Majlis Bandaraya Pulau Pinang (MBPP). Penyelidikan ini mempunyai tiga objektif. Objektif yang pertama adalah mengkaji kewujudan pola dan ciri suhu serta fenomena pulau haba bandar di kawasan Majlis Bandaraya Pulau Pinang, objektif kedua adalah mengenapasti kesan cuaca persekitaran terhadap keselesaan terma pekerja dalam bangunan dan objektif ketiga adalah menentukan kaedah/langkah-langkah yang sesuai untuk menguruskan fenomena pulau haba bandar. Kawasan kajian meliputi kawasan MBPP iaitu seluruh kawasan pulau negeri Pulau Pinang. Kaedah penyelidikan ini melibatkan penggunaan data sekunder yang tersedia dan perolehan data primer. Data primer dilakukan melalui empat kaedah utama bagi menjawab semua objektif penyelidikan yang telah ditentukan. Empat kaedah utama tersebut adalah kaedah pengedaran borang soalselidik kepada pekerja dalam bangunan, kaedah pengukuran suhu di dalam dan luar bangunan organisasi, kaedah ujikaji suhu dalam bilik (room experiment) melibatkan individu terpilih serta kaedah pencerapan suhu di lapangan bagi mengenalpasti kewujudan pulau haba bandar. Hasil yang diperolehi menunjukkan bahawa pulau haba bandar telah wujud di kawasan MBPP hasil imej terma yang diperolehi dari data penderiaan jauh ARSM pada tahun 2000 dan 2009. Research on the urban heat islands effect on office workers thermal comfort has been carried out in the area of Penang Municipal Council (MBPP). This research has three objectives. The first objective is to investigate the pattern and type of temperature and the existence of urban heat island phenomenon in Penang Municipal Council area. The second objective is to identify the effect of weather on the office workers thermal comfort and the third objective is to determine the appropriate methods / measures to manage the urban heat island phenomenon. The study area covers MBPP area which is the whole state of Penang island. This research method involves secondary and primary data. Primary data is collected via four methods to achieve all research objectives. The four methods include distributing questionnaires to office workers, temperature measurement inside and outside the office, room experiment involving selected individuals and temperature measurement in the field to identify the existence of urban heat islands. The results obtained that urban heat island has existed in the MBPP by thermal images obtained from ARSMs remote sensing data in 2000 and 2009.', 'pulau-haba bangunan pekerja', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2016', 0),
(340, 'Norsyifa Binti Harun ', 'Studies Of Mitragynine, The Principle Alkaloid Of Mitragyna Speciosa Korth (Kratom) On Its Abuse And Addictive Properties In Rat Behavioural Models.', 'Mitraginina adalah alkaloid aktif utama yang dipencil daripada daun Mitragyna speciosa atau kratom. Sementara mitraginina atau kratom menghasilkan kesan-kesan analgesik, anti-radang dan relaksi otot, namun sedikit yang telah diketahui tentang sifat-sifat penyalahgunaan dan penagihannya. Diberikan kemungkinan kepentingan sistem opioid dalam perantaraan kesan-kesan farmakologi mitraginina, kajian ini bertujuan meninjau kesan-kesan tingkah laku daripada mitraginina menggunakan tatacara pendiskriminasian drug dan pemberian sendiri drug. Tikus jantan jenis Sprague Dawley telah dilatih untuk mendiskriminasi antara mitraginina dan pembawa menggunakan tatacara pendiskriminasian drug dua tuil di bawah pembolehubah selang secara tandem (VI-60 saat) dan nisbah tetap (FR-10) dalam jadual pengukuhan makanan. Tikus-tikus itu telah berjaya memperoleh pendiskriminasian mitraginina (15.0 mg/kg, i.p.) yang mirip dengan kumpulan tikus yang satu lagi dengan pendiskriminasian morfina (5.0 mg/kg, i.p.) Mitragynine is the main active alkaloid isolated from the leaves of Mitragyna speciosa or kratom. While mitragynine or kratom provides analgesic, anti-inflammatory and muscle relaxant effects, little is known about its abuse and addictive properties. Given the likely importance of opioid system in mediating the pharmacological effects of mitragynine, the present study aims to explore the behavioural effects of mitragynine using drug discrimination and drug self-administration procedures. Male Sprague Dawley rats were trained to discriminate between mitragynine and vehicle in two-lever drug discrimination procedure under a tandem variable-interval (VI-60 sec) and fixed-ratio (FR-10) schedule of food reinforcement. The rats successfully acquired mitragynine discrimination (15.0 mg/kg, i.p.) which was similar to another group of rats with morphine discrimination (5.0 mg/kg, i.p.).', 'mitragynine alkaloid additive', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research)', '2016', 0),
(341, 'Ammar Imad Hazim Al Ganaby ', 'Pharmacokinetics And Investigation Of The Anxiolytic-Like Effect Of Mitragynine In Rats.', 'Mitragyna speciose Korth (Rubiaceae) merupakan sejenis pokok yang berasal dari bahagian utara Semenanjung Malaysia dan selatan Thailand. Alkaloid utama dalam tumbuhan ini, iaitu mitraginina (MG), telah dilaporkan bertanggungjawab terhadap kebanyakan sifat farmakologinya. Dos MG yang digunakan dalam kebanyakan kajian farmakologi mempunyai perbezaan yang ketara, sekaligus menggambarkan bahawa cadangan pemilihan dos dalam pelbagai kajian yang lepas adalah berkemungkinan dijalankan secara empirikal iaitu tanpa asas saintifik yang sewajarnya. Walaubagaimanapun, kajian semasa mendedahkan bahawa terdapat variasi dos yang besar telah digunakan. Hal ini disebabkan oleh sifat fizikokimia MG tetapi variasi dos tersebut tidak pula terbatas hanya kepada sifat fizikokimia MG. Disebabkan penilaian farmakokinetik merupakan komponen penting dalam proses pemilihan dos, maka usaha diperlukan untuk menentukan sifat farmakokinetik MG seperti perkadaran dos, akumulasi drug, ikatan protein plasma dan taburan tisu dalam tikus. Mitragyna speciosa Korth (Rubiaceae) is an indigenous tree found in the Northern Malaysian Peninsula and in Southern Thailand. The principal alkaloid of this plant, Mitragynine (MG), has been reported to be responsible for most of its pharmacological properties. Doses of MG employed in most pharmacological studies vary greatly, which suggests that the selection of these doses was possibly carried out empirically without proper scientific basis. However, recent studies revealed that large dose variation was due but not limited, to MG physicochemical properties. Since pharmacokinetic evaluation is an essential component in the dose selection process, work was undertaken to determine MG pharmacokinetic properties such as dose proportionality, accumulation, plasma protein binding and tissue distribution in rats.', 'pharmacokinetics anxiolytic-like mitragynine', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research)', '2016', 0);
