(342, ' Nor Azliza Binti Ismail', ' Characterisation And Toxicity Studies Of Fusarium Isolates.', 'Spesies di dalam genus Fusarium merupakan kulat patogenik kepada pelbagai tumbuhan di seluruh dunia. Beberapa spesies mampu menghasilkan fumonisin B1 (FB1) sejenis mikotoksin yang berbahaya kepada manusia dan haiwan. Tujuan kajian ini adalah untuk mengenal pasti dan menciri spesies Fusarium yang berassosiasi dengan sembilan perumah di Malaysia, menentukan hubungan filogenetik di antara spesies, menentukan kebolehan spesies ini menghasilkan FB1 dan toksisiti ekstrak kasar kulat mengandungi FB1 terhadap anak pokok padi dan larva nyamuk Aedes. Di dalam kajian ini, 125 pencilan daripada sembilan perumah dikenalpasti sebagai F. verticillioides (12 pencilan), F. proliferatum (51 pencilan), F. fujikuroi (24 pencilan), F. andiyazi (enam pencilan) dan F. oxysporum (32 pencilan) menggunakan jujukan TEF-1. Pohon filogenetik parsimoni maksimum mnggunakan jujukan TEF-1 dan -tubulin memisahkan kelima-lima spesies kepada lima klad berbeza di mana pencilan daripada spesies yang sama dikelompokkan dalam klad yang sama. Species in the genus Fusarium are pathogenic fungi to a wide variety of plants worldwide. Some species are able to produce fumonisin B1 (FB1), a mycotoxin that is harmful to humans and animals. The aims of this present study were to accurately identify and characterise Fusarium species associated with nine hosts in Malaysia, to determine the phylogenetic relationship between the species, to determine the ability of these species to produce FB1 and to test the toxicity of fungal crude extract containing FB1 on rice seedlings and mosquito larvae. In this study, 125 isolates of Fusarium species from nine hosts were identified as F. verticillioides (12 isolates), F. proliferatum (51 isolates), F. fujikuroi (24 isolates), F. andiyazi (six isolates) and F. oxysporum (32 isolates) using TEF-1 sequences. Maximum parsimony phylogenetic tree using TEF-1 and -tubulin sequences resolved the species into five different clades of which the isolates from the same species were grouped in the same clade.', 'characterisation toxicity fusarium', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences) ', '2016', 0),
(343, 'Redhwan Mohammed Ahmed Saad', ' ICMPv6 Echo Request Ddos Attack Detection Framework Using Backpropagation Neural Network', 'Pertumbuhan pesat Internet dalam beberapa tahun kebelakangan ini telah mendedahkan had ruang alamat dalam protokol Internet semasa (IP), iaitu, IPv4. Permintaan yang semakin meningkat dalam penggunaan alamat IP telah mengakibatkan kehabisan alamat IPv4 seperti yang dijangkakan. Untuk menangani kebimbangan ini, IPv6 baru telah dibangunkan untuk menyediakan ruang alamat yang mencukupi. IPv6 dimuatkan dengan protokol baru, iaitu, versi Protokol Mesej Kawalan Internet 6 (ICMPv6), dan protokol baru ini membuka pintu bagi penyerang untuk menyerang rangkaian IPv6. Salah satu jenis serangan yang paling kerap dalam rangkaian IPv6 pada lapisan rangkaian adalah satu serangan banjir ICMPv6 DoS / DDoS. Laporan Arbor Network pada tahun 2014 menunjukkan bahawa ancaman terhadap IPv6 semakin meningkat (72% merupakan kebanjiran trafik/serangan DDoS). Di samping itu, ICMPv6 adalah protokol wajib dalam rangkaian IPv6 tidak seperti dalam IPv4, iaitu ICMP boleh disekat atau diturunkan melalui get laluan lalai. The rapid growth of the Internet in the last few years have exposed the limitation of address space in the current Internet protocol (IP) namely IPv4, due to the increasing consumption of IP addresses. The IPv6 has been developed to provide sufficient address space. It ships with a new protocol. i.e., the Internet Control Message Protocol version 6 (ICMPv6), this protocol is a mandatory protocol in IPv6 networks unlike in IPv4, in which ICMP can be blocked or dropped. ICMPv6 opens the door for attackers to attack IPv6 networks. The most frequent types of attack in IPv6 networks at the network layer is an ICMPv6 DDoS flooding attack. One of the main problem in ICMPv6 DDoS flooding attacks is accuracy detection, which suffers from a high false alarm rate. Thus, protecting infrastructure service is a critical issue that urgently needs to be addressed.', 'detection backpropagation network', '', 'Pusat IPv6 Termaju Negara (National Advanced IPv6 Centre of Excellence NAv6)', '2016', 0),
(344, 'Roya Monsefi', 'Wordplay And Transformational Strategies In English-Persian Online News Headlines Of Euronews.', 'Dalam aliran maklumat tanpa henti yang terdapat di pasaran media berita, bahasa tajuk berita dapat disifatkan melalui beberapa ciri linguistik, pragmatik, retorik dan fungsian yang membezakannya daripada pelbagai bahasa lain yang tidak khusus. Dalam tesis ini, kajian dibuat terhadap ciri-ciri retorik tajuk berita dalam bahasa Inggeris dan terjemahannya dalam bahasa Parsi melalui penggunaan mainan perkataan. Kajian ini menggunakan 200 sampel tajuk berita (100 bahasa Inggeris, 100 bahasa Parsi). Mainan perkataan dikaji kerana mainan perkataan ini membawa kepada daya pemujukan melalui mesej yang kadang-kadang begitu halus sehingga pembaca tidak mungkin akan dapat mengenalinya. Satu taksonomi mainan perkataan dibina mengikut model Leigh (1994) yang memungkinkan pengkaji untuk mengakses senarai semak yang komprehensif. Cara unsur pemujukan, iaitu mainan perkataan, disampaikan kepada pembaca tajuk berita bahasa Parsi dikaji menggunakan kaedah deskriptif dan berdasarkan analisis retorik teks. Rangka kerja teori ini berdasarkan model strategi transformasi van Dijk (1988a) terutama kerana konsep terjemahan dalam berita global cukup unik dan melibatkan aktiviti seperti pengolahan semula, penyuntingan, pensintesisan dan penyediaan semula berita sumber itu. Oleh yang demikian, perubahan dalam pengekalan mainan perkataan dapat ditentukan. Within the endless stream of information available on the news media market, news headline language is characterised by several linguistic, pragmatic, rhetorical and functional features that distinguish it from other varieties of language that are not specialised. In the present thesis, the rhetorical features of English news headlines and their translation in Persian, through wordplay investigation, using a sample of 200 news headlines (100 English, 100 Persian) are studied. Wordplay is investigated because it leads to the persuasiveness of message that is sometimes so subtle that the readers might not even recognise it. A taxonomy of wordplays is constructed according to Leighs (1994) model which made it possible to access a comprehensive checklist. The way the persuasive element, i.e. wordplay, is presented for the Persian headline readers is examined using the descriptive method and in light of textual rhetorical analysis. The theoretical framework is based on van Dijks (1988a) model of transformational strategies primarily because the concept of translation in global news is quite unique and involves transformational activities like reshaping, editing, synthesising and repackaging of the source news.', 'wordplay transformational english-persian', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2016', 0),
(345, 'Saleh Ahmad Mousa Al-Wahsh', 'Host-Guest Interactions Between Betacyclodextrin And Selected Fluoroquinolones: A Molecular Modelling Study.', 'Fluorokuinolon (FQs) ialah satu kumpulan antibiotik penting yang terdiri daripada gelang kuinolon hidrofobik dan gelang piperazina hidrofilik. Betasiklodekstrin (-CD) dan terbitannya kini digunakan secara meluas dalam sistem penghantaran ubat, kerana rongga hidrofobiknya mampu membentuk kompleks rangkuman dengan pelbagai molekul organik. Dalam kajian ini, interaksi perumah tetamu antara FQs dan -CD menggunakan tiga teknik permodelan molekul iaitu mekanik kuantum, pengedokan molekul dan dinamik molekul telah dijalankan. Rangkuman molekul FQ ke dalam rongga -CD boleh berlaku melalui dua orientasi iaitu dengan gelang kuinolon (orientasi A) atan gelang piperazina (orientasi C) menghadap rongga -CD. Kesan pelarut dimodelkan secara implisit menggunakan model kontinuum berkutub (PCM) dalam pengiraan mekanik kuantum dan dengan menggunakan model caj titik mudah (SPC) dalam simulasi dinamik molekul 100 ps. Fluoroquinolones (FQs) is an important group of antibiotics made up of a hydrophobic quinolone and a hydrophilic piperazine rings. Beta-cyclodextrin (-CD) and its derivatives are currently being widely used in drug delivery systems, owing to its hydrophobic cavities which are capable of forming inclusion complexes with a variety of organic molecules. In this work, the host-guest interactions between FQs and -CD were investigated using three molecular modelling techniques, i.e. quantum mechanics, molecular docking and molecular dynamics. The penetration of FQ molecules into the -CD cavity take place via two orientations which are Aorientation with the quinolone ring or C-orientation with the piperazine ring facing towards the -CD cavity. The effect of solvent was modeled implicitly using polarizable continuum model (PCM) in the quantum mechanics calculation and by simple point charge water model (SPC) in a 100 ps molecular dynamics simulation.', 'host-guest betacylodextrin fluoroquinolones', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research)', '2016', 0),
(346, 'Vignes A/L Ponniah ', 'Determining Critical Success Factors For Sustainable Construction.', 'Pembinaan lestari merujuk kepada aktiviti pembinaan bangunan yang berdaya saing dan menguntungkan dengan mengutarakan aspek-aspek seperti kualiti kehidupan manusia, ruang untuk perubahan, aktiviti pembinaan berasaskan mesra alam dan keberkesanan penggunaan sumber. Faktor-faktor kejayaan kritikal pembinaan lestari merujuk kepada faktor-faktor yang menyumbang kepada kejayaan pembinaan lestari. Faktor-faktor tersebut sepertimana yang diutarakan oleh para penyelidik sebelum ini adalah terdiri daripada enam faktor iaitu faktor berkenaan projek, pengurus projek, pasukan projek, peralatan dan bahan binaan, pelanggan projek dan faktor luaran. Pembangunan pembinaan berasaskan lestari masih kurang memuaskan walaupun wujud peluang dan kemudahan untuk mendapat sumber tenaga yang diperbaharui di Malaysia. Justeru itu, pembangunan kerangka yang berciri senarai faktor-faktor kejayaan kritikal pembinaan lestari perlu dilaksanakan untuk memotivasikan pemaju dan pihak-pihak yang terlibat dalam pembinaan lestari di negara ini. Sustainable construction refers to construction activities which is competitive and profitable while focusing on several important aspects such as the quality of human life, space for changes, environmental concerned construction activities and utilised available resources. Critical success factors of sustainable construction refers to factors which contributed to success of sustainable construction. According to research studies carried out by previous researchers, the six factors are factors related to project, project manager, project team, material and equipment, client and external factors. The sustainable construction development is still poor although opportunities and facilities to obtain renewable energy resources are exist in Malaysia. Therefore, development of framework which focused on the criteria of success factors in sustainable construction is essential to motivate developers and other construction parties to involve in sustainable construction in the country.', 'critical-success sustainable construction', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning) ', '2016', 0),
(347, 'Sam Rany', 'The Influence Of Institutional Factors And Integration Towards Students Intellectual Developments: A Case Study Of Three Cambodian Public Universities', 'This study examines the influence of institutional factors (curriculum syllabus, teacher teaching, evaluation and examination, facilities, and student support services) and institutional integration factors which are academic (faculty concern for student development and institutional, and goal commitment) and social (faculty student interaction and peer-group interaction) on the students intellectual development and academic performance in selected public universities in Cambodia. This quantitative study adopted the cross sectional survey design. A self-reported questionnaire was administered involving 381 third-year students, which were chosen equally from the top three Cambodian public universities using the stratified random sampling method. The partial least squares structural equation modelling (PLS- SEM) tools were employed to analyze the data. Statistical results showed that five independent variables of institutional factors explained approximately 22 % of the variance in the dependent variable (R2=0. 224).\r\n\r\n', 'institutional integration intellectual', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2016', 0),
(348, 'Irfan Shah', 'Preparation, Characterization And Applications Of Multi-Functional Iron Oxides-Impregnated Activated Carbon Materials', 'This study was conducted to investigate the preparation, characterization and different applications of iron oxides-impregnated activated carbon materials (FeACs). The surface of activated carbon (AC) was initially oxidized by using potassium permanganate (KMnO4) followed by the iron impregnation using ferrous sulphate (FeSO4.7H2O) as iron precursor using different molar ratios of the oxidizing agent to the iron precursor to examine the impact of iron impregnation on the physicochemical characteristics of the newly prepared carbon materials. Various characterization techniques such as surface area, SEM, EDX, TEM, HRTEM, SAED, XRD, FTIR, CHN, TCC, TG/DTA, XPS, VSM, TPR/TPD and pHpzc analyses were carried out. The surface impregnation of AC varies the surface area as well as the porosity of the newly prepared materials to a great extent. It depicted an increase in the surface area up to 1640 m2/g for modified AC having molar ratio 0.1 KMnO4 : 0.1 FeSO4.7H2O (B), which was comparatively higher than the raw AC (1094 m2/g).', 'multi-functional oxides-impregnated carbon', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2016', 0),
(349, 'Fazidah Aguslina Siregar', 'Recommendation strategies for the prevention and control of high morbidity of dengue hemorrhagic fever in North Sumatera province.', 'Background: The incidence of dengue hemorrhagic fever (DHF) in North Sumatera Province remains high despite effort to control it. Objectives : This study aimed to document information about the adequacy of the current Indonesia surveillance system for DHF and factors responsible for high DHF transmission. These will be used for recommending strategies for the prevention and control for DHF in North Sumatera Province. Material and Methods: Five study designs were adopted in this study. In the exploratory study, all key personnels involved in the surveillance system for DHF at the district and health facility levels in the selected six districts were interviewed to determine the function and performance of the surveillance system. The case cohort study recruited a total of 682 respondents with case: subcohort ratio 1:1. Simple and Multiple logistic regression were applied to determine the factors associated with DHF. For the comparative cross sectional study, 688 households both in high and low incidence district were selected using multistage sampling. Simple and Multiple logistic regression were again applied to determine the factors associated with DHF among the households in districts with high incidence. In the entomology study, Independent T test and Two Way Anova were used to determine the effect of larvae positive containers on DHF transmission, whereas for larvae and adult indices Simple and Multiple logistic regression were applied. Theclimatic study utilises monthly a years climatic (2003-2011) secondary data. The relationship between climatic and dengue hemorrhagic fever incidence was determined by Pearson correlation and the impact of climates on DHF incidence by Time series regression. Seasonal Autoregressive Integrated Moving Average (SARIMA) model was then developed to predict the occurrence of DHF. Results : The structure of DHF surveillance system was good but suboptimum with major deficiencies that include unavailability of guidelines, insufficient resources and poor core and supportive functions. Socio-cultural and environmental factors associated with DHF incidence were investigated through casecohort and comparative cross sectional studies. Significant factors include experience with DHF in family, travelling history, length of stay, frequency of cleaning water container, frequency of cleaning garbage disposal, education, knowledge, practices in preventive measure, source of drinking water, house style and house with gutter. Aedes larvae and adult indices were above the critical level especially in the high incidence districts with house indices as the predictor for dengue transmission. Climatic factors that include rainfall, rainy days, temperature and relative humidity were significantly associated with DHF incidence. SARIMA model (0,1,1)(0,1,1)12 was able to predict DHF occurrence. Conclusion: The existing surveillance system for DHF need to be strengthened in every aspect. Socio-cultural and environmental factors associated with DHF should be addressed and controlled. Measures should be taken to eliminate or being down the density of Aedes vectors. Climatic factors should be integrated in the national prevention and control program for DHF.', 'prevention dengue hemorrhagic-fever', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2016', 0),
(350, 'Risna Wijayanti', 'The Role Of Consistency In Sharia Status On The Relationship Between Internal Corporate Governance Mechanisms And Investors Confidence: Evidence Among Indonesian Sharia Compliant Companies.', 'Kegawatan pasaran saham yang dicetuskan oleh skandal perniagaan, penipuan perdagangan, dan kegagalan bank telah menyebabkan keyakinan pelabur menjunam. Berdasarkan latar belakang ini, syarikat-syarikat yang mematuhi Shariah, walaupun bahagian pasaran modalnya adalah kecil berbanding pelaburan konvensional, mengalami pertumbuhan luar biasa akibat daripada permintaan pelabur yang tinggi bagi pematuhan korporat dengan standard etika dan tadbir urus korporat yang lebih baik. Untuk menangani jurang perbezaan ini, kajian ini memeriksa pengaruh maklumat mengenai kualiti kawalan dalaman (proses lembaga pengarah, struktur lembaga pengarah, komposisi lembaga pengarah, dan karakteristik lembaga pengarah) keatas keyakinan pelabur, serta kesan interaksi yang konsisten dalam status patuh Shariah keatas kualiti hubungan antara mekanisme dalaman tadbir urus korporat (proses lembaga pengarah, struktur lembaga pengarah, komposisi lembaga pengarah, dan karakteristik lembaga pengarah) dan keyakinan pelabur. Kajian ini menganalisa 227 sampel syarikat bukan kewangan yang terdapat dalam Senarai Shariah Sekuriti (DES) di Indonesia dengan menggunakan descriptive statistics, t-tests, and moderated multiple regressions. Stock market turmoil triggered by business scandals, trading fraud, and bank failures has caused investor confidence to plummet. However, against that background, Sharia-compliant companies though relatively small in terms of market shares compared to their conventional counterparts have experienced phenomenal growth due arguably to high investor requirements for corporate compliance with ethical standards and improved corporate governance. To address this gap, this study examines the influence of information relating to the quality of internal corporate governance mechanisms (board process, board structure, board composition, and board characteristic) on investor confidence, and the influence of consistency in Sharia compliant status on the quality of the relationship between internal corporate governance mechanisms and investor confidence. A total of 227 samples of nonfinancial companies from the Sharia Securities (DES) in Indonesia was analysed using descriptive statistics, t-tests, and moderated multiple regressions.', 'sharia corporate-governance investor', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2016', 0),
(351, 'Rizky Wisnoentoro', 'The Conundrum Of A Bank\'s Csr Program A Case Study Of \"Kampoeng Bni\" In Rawa Belong Area, Jakarta', ' This thesis discusses the conundrum of a CSR program conducted by Indonesia\'s Bank BNI with a program name \"Kampoeng BNI\" in Rawa Belong area (Jakarta, Indonesia). The objectives of this research are: 1. To analyze the perception of the BNI officials towards the program Kampoeng BNI, especially in the context of Rawa Belong; 2. To analyze the perception of the impacted public in Rawa Belong; including the community leaders, the traders, and the public at large; 3. To map out the various narratives, indigenous or otherwise, and construct a framework of CSR interactivity between BNI and the public of Rawa Belong. Adopting the qualitative case study method, and with reference to Social Construction of Reality, Co-Orientation theory, and the studies in CSR, this research found some important results. First, BNI officials are confident with the well-established reputation about the company and the program of Kampoeng BNI itself.', 'corporate social responsibility', '', 'Pusat Penyelidikan Dasar & Kajian Antarabangsa (Centre for Policy Research and International Studies (CenPRIS)', '2016', 0),
(352, 'Ali Zahabi', 'The Effect Of Task Complexity And Task Condition On Iranian Efl Learners\' Accuracy, Complexity And Fluency Of Written Task Performance.', 'The purpose of this study is to investigate how increasing the level of task complexity (Here-and-Now vs. There-and-Then tasks) influences the written task performance of Iranian EFL Learners while performing open vs. closed tasks led by Robinson\'s Cognition Hypothesis (2001). Sixty four first year undergraduate students studying at Islamic Azad University of Gorgan, Iran served as the participants of this study. They were randomly selected and divided into two equal groups of those with Here-and-Now tasks and those with There-and-Then tasks. Each group was asked to narrate two different types of stories under the two different conditions, open vs. closed. In the four experimental groups, the participants were presented with the cartoon picture which was a nine-frame picture story. Then, their writing performance was measured for complexity, accuracy, and fluency (CAF). To test the way the two independent variables of Here-and-Now task and There-and-Then task affect the dependent variables, the raw scores of the participants were fed into the computer software SPSS (version 20).', 'complexity condition written-task', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2016', 0),
(353, 'Nwe Ni Hlaing', 'Synthesis, Characterization And Co2 Adsorption Of Caco3, Ca(Oh)2 And Inert Materials Incorporated Ca(Oh)2', 'Calcium oxide (CaO) based materials have been proposed as potential candidates for CO2 adsorption to reduce the emission of carbon dioxide (CO2) into the atmosphere especially from the combustion of fossil fuel power plants. In this research, aragonite (CaCO3), calcite (CaCO3), calcium hydroxide (Ca(OH)2) and inert materials incorporated calcium hydroxide (Ca(OH)2) were synthesized by hydrothermal, sol-gel assisted hydrothermal and precipitation methods, respectively. Various parameters such as hydrothermal temperature (8 h - 72 h), addition of polyacrylamide (PAM), sodium hydroxide (NaOH) concentration (2 M - 10 M), cetyltrimethyl ammonium bromide (CTAB) concentration (0.2 M - 0.9 M) and different inert incorporated materials (Mg, Zr, Ce and (Zr-Ce)) on as-synthesized samples were characterized. And then, the CO2 adsorption performances of calcium oxide (CaO) based adsorbents derived from as-synthesized samples were investigated. In the case of hydrothermal method, 1D aragonite (CaCO3) nanorods are observed at 72 h hydrothermal reaction time when PAM is used as an additive, whereas 1D aragonite nanorods are obtained without using PAM at 12 h reaction time. In sol-gel assistance hydrothermal method, 3D calcite (CaCO3) hollow microspheres are attained with 2 M of NaOH concentration, while nanostructured calcium hydroxide (Ca(OH)2) is obtained by precipitation method at high CTAB concentration of 0.9 M. On the other hand, Mg, Zr, Ce and (Zr-Ce) incorporated Ca(OH)2 samples exhibit different surface morphologies. The CO2 adsorption capacities of calcium oxide (CaO) derived from 1D aragonite CaCO3 nanorods, 3D calcite CaCO3 hollow microspheres and nanostructured calcium hydroxide Ca(OH)2 after first cycles are 0.80 g-CO2/g-adsorbent, 0.62 g-CO2/g-adsorbent and 0.71 g-CO2/g-adsorbent, respectively. However, these capacities drop to 0.38 g-CO2/g-adsorbent, 0.39 g-CO2/g-adsorbent and 0.48 g-CO2/g-adsorbent after 10 cycles, respectively. It can be seen that CaO derived from Ca(OH)2 with surface area 64.57 m2/g exhibits the best CO2 adsorption capacity after 10 cycles (0.48 g-CO2/g-adsorbent), but the decay in adsorption capacity with number of cycles is observed. The development of cyclic stability can be observed in CaO-based adsorbents derived from Mg, Zr, Ce and (Zr-Ce) incorporated Ca(OH)2 samples. The CaO-based adsorbent derived from Mg-Ca(OH)2 shows slightly decrease in capacity from 0.67 g-CO2/g-adsorbent after first cycle to 0.57 g-CO2/g-adsorbent after 10 cycles, while CaO-based adsorbents produced from Zr and Ce-incorporated Ca(OH)2 samples exhibit the obvious cyclic stability during 10 cycles, 0.38 g-CO2/g-adsorbent and 0.24 g-CO2/g-adsorbent, respectively. The CaO-based adsorbent derived from (Zr-Ce) acetates incorporated Ca(OH)2 sample increases the capacity from 0.59 g-CO2/g-adsorbent after first cycle to 0.63 g-CO2/g-adsorbent after 10 cycles. The higher adsorption capacity and better cyclic stability during 10 cycles are attributed to the high BET surface area (155.80 m2/g), a wide range of micro/mesopore size distribution (1.7 nm - 30 nm) and the presence of high temperature sintering resistance Ce2Zr3O10 compound.', 'co2 caco3 inert-materials', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2016', 0),
(354, 'Sima Ahmadpour', 'Enhanced Statistical Modelling For Variable Bit Rate Video Traffic Generated From Scalable Video Codec. ', ' Designing an effective and high performance network requires an accurate characterization and modelling of the network traffic. This work involves the analysis and modelling of the Variable Bit Rate (VBR) of video traffic, usually described as the core of the protocol design and efficient network utilization for video transmissions. In this context, an Enhanced Discrete Autoregressive (EDAR (1)) model for the VBR video traffic model, which is encoded by a Scalable Video Codec (SVC), has been proposed. The EDAR (1) model was able to accurately generate video sequences, which are very close to the actual video traffic in terms of accuracy. The model is validated using statistical tests in order to compare simulated and original traces. The validation is done using graphical (Quantile-Quantile plot) and statistical measurements (Kolmogorov-Smirnov, Sum of Squared Error, and Relative Efficiency), as well as cross-validation.', 'bit rate video', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '2016', 0),
(355, 'Ibrahim Suliman Al-Aboudi', 'Economic And Behavioural Assessment Of A Diabetes Self-Management Education Programme Among Type 2 Diabetes Patients At Diabetes Centre In Riyadh, Saudi Arabia.', ' The prevalence of diabetes mellitus has increased tremendously among the Saudi population during the last decade. This represent as a major economic burden in health care system. The objective was to evaluate the effectiveness of the Diabetes Self- Management Education (DSME) programme in improving clinical outcomes, self-care behaviours and Health Related Quality of Life and to perform an economic evaluation of DSME on health status in type 2 diabetes patients at the Diabetic Centre in King Abdulaziz University Hospital, Riyadh, Saudi Arabia. The study include three phases a cross sectional, pre and post interventional and economic study.', 'economic diabetes education', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2016', 0),
(356, ' Samira A  Atman', 'Comparison Of Soil Salinity Between Laboratory Analysis And Remote Sensing Data In Al-Jafarah, Libya. ', ' The aim of this research is to map the spatial of the distribution of saline soils in the different locations in the Al-jafarah plain and to determine the level of salinity in the soil and compare against the satellite images landsat 7 ETM+. Sixty samples were collected randomly from the 10-50 cm surface soil layer and measured for salt content in accordance with Libyan laboratory standard procedures. Data collected for this study involves laboratory testing and satellite images landsat ETM+ 2010. Landsat 7 Enhanced thematic mapper plus (ETM+) was used to map and observe saline soil in the study area. The results derived from the laboratory and satellite images, when compared against each other, have found that the saline soil is present in marshes, none in other areas.', 'soil-salinity laboratory remote-sensing', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2016', 0),
(357, 'Beh Boon Chun', 'Surface Reflectance And Discriminant Analysis For Mapping Of Mangrove Species In Kuala Sepetang Mangrove Forest Reserve, Perak', ' The identification of mangrove species by using traditional approach has been commonly developed and studied. Due to the high cost of field work and the difficulty in assessing the mudflat areas of mangrove ecosystem with conventional methods, remote sensing techniques have been widely used to examine mangrove species at either the scale level or leaf level. In this study, two remote sensing methods have been utilized to identify and discriminate the mangrove species in the Kuala Sepetang Mangrove Forest Reserve, Perak, Malaysia. The first method is to develop an algorithm that was based on species surface reflectance to map the mangrove species by using high-resolution CropCam Unmanned Aerial Vehicle (UAV) data. The airborne images were acquired through the three band channels (blue, green and near-infrared) of the Normalized Difference Vegetation Index (NDVI) camera that was mounted on the CropCam UAV. The Top of Atmosphere (TOA) reflectance was retrieved from the mosaicked airborne image, which covered the entire study site with an area of 50.12 ha. The distributions of five mangrove species were successfully mapped by using the retrieved reflectance values.', 'reflectance discriminant mapping-mangrove', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2016', 0),
(358, 'Teguh Darsano', ' Fabrication Of Gold Nanodot On Silicon Substrate By Scanning Probe Microscopy And Its Characterization', 'Penggunaan teknik-teknik berasaskan mikroskop siasat imbasan (SPM) sebagai suatu alat pembuatan dan pencirian telah dilakukan. Mod AFM tak-sentuh yang dioperasikan pada suhu bilik dan di bawah keadaan vakum telah digunakan untuk mendepositkan nanodot emas di atas substrat silikon. Perkara ini dapat diperolehi dengan mengawal jarak antara tip-sampel menggunakan sistem kawalan maklum balas melalui penggunaan suatu daya elektrostatik luaran. Penggunaan suatu denyut voltan yang sama ada berpolariti positif atau negatif ke atas tip kantiliver bersalut emas 70 nm dilakukan untuk mendepositkan nanodot emas. Dimensi nanodot emas yang difabrikasi mempunyai diameter 42.5  150.4 nm dan ketinggian 2.3  7.8 nm. Dapat diperhatikan bahawa terdapat kecenderungan diameter nanodot meningkat dengan meningkatnya denyut voltan. Sementara itu, ketinggian nanodot meningkat dengan meningkatnya tempoh denyut voltan. Suatu gabungan arbitrari amplitud denyut voltan gunaan dan jarak tip-sampel tidak menghasilkan deposit. Pergantungan jarak tip sampel menunjuk kebergantungannya kepada parameter-parameter medan elektrik yang mengawal proses pendepositan dan didapati bahawa takat ambang medan elektrik ialah di sekitar 8 V/nm. Kajian sifat-sifat keelektrikan nanodot di atas substrat silicon telah dilakukan menggunakan suatu AFM pengalir dan menunjukkan bahawa ciri (I-V) substrat ini bertindak sebagai sebuah diod halangan Schottky. Ciri-ciri (I-V) diod ini telah dianalisa berasaskan teori pelepasan termionik. Parameter asas diod seperti faktor keunggulan (n) dan ketinggian halangan (', 'gold silicon microscopy', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2016', 0),
(359, 'Foong Choon Pin', 'Diversity And Characterization Of Polyhydroxyalkanoate Synthase (Phac) In Seawater And Mangrove Metagenomes. ', ' The microbial communities of two local Penang mangrove soils (Batu Maung and Balik Pulau) which are under anthropogenic influences were investigated using culture-independent shotgun metagenome sequencing approach. Two metagenome data sets (~250 GB) were generated from the Illumina HiSeq next-generation sequencing (NGS) platform and then deposited in Metagenomic-Rapid Annotations using Subsystems Technology (MG-RAST) public server. Microbial taxonomic analysis showed that both Penang mangrove soils were dominated by Bacteria (97 %), Proteobacteria (43 %) and Deltaproteobacteria (15 %) at the domain, phylum and class levels, respectively. At the genus level, predominance of anaerobic bacteria was observed and mostly belonged to Deltaproteobacteria. A large portion of the reads belonged to unknown or yet uncultured microbial species (70 %) and microbial phyla (32 %).', 'polyhydroxyalkanoate seawater metagenomes', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences', '2016', 0),
(360, 'Sharareh Khosravi Haftkhani', 'Capacity And Attitude Of Host Community Towards Negative Environmental Impacts Of Tourism In Langkawi Island, Malaysia.', 'This research dwelt upon the premise that a community with higher capacity in conserving natural environment may express better attitude toward negative environmental impacts of tourism, which in turn, help tourism to directly maintain development process and reduce creation of negative environmental impacts. This study used five dimensions of community capacity for conserving natural environment, namely; shared vision, sense of community, participation, knowledge and skills, and lifelong learning, as major predictors of attitude toward negative environmental impacts of tourism. The conceptual framework was empirically tested to investigate the relationship between community capacity and attitude toward negative environmental impacts of tourism. Survey questionnaires were used as an administered tool for data collection. The sample for this study was proportionally stratified among the local residents populations with tourism-related jobs in the six residential districts in Langkawi Island, as the study site.', 'host-community environmental tourism', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning) ', '2016', 0),
(361, 'Indri Indarwati', 'Peminggiran Sosial Wanita Ketua Isi Rumah Dalam Komuniti Nelayan Bandar Di Jakarta Utara, Indonesia', 'Peminggiran sosial dalam kalangan wanita sebagai ketua isi rumah (WKIR) merupakan penghalang bagi mereka untuk berperanan ke arah mencapai pembangunan dan kesejahteraan sosial. Objektif utama kajian ini adalah untuk: 1) mengkaji permasalahan dan keperluan WKIR; 2) menganalisis bentuk peminggiran sosial yang dialami WKIR; 3) menganalisis pelaksanaan aktiviti pemerkasaan bagi WKIR; dan 4) mencadangkan model pemerkasaan WKIR bagi komuniti nelayan bandar di Jakarta Utara. Kajian kualitatif dengan penumpuan kepada kajian kes ini melibatkan 10 orang informan dan 20 orang peserta yang terlibat secara langsung dalam perbincangan kumpulan fokus. Kajian ini turut melibatkan pihak berkepentingan yang terdiri daripada wakil Kementerian Kelautan dan Perikanan, Kementerian Sosial, dan kerajaan tempatan. Teknik pengumpulan data adalah melalui temu bual mendalam, perbincangan kumpulan fokus, pengamatan penyertaan dan analisis dokumen. Antara permasalahan utama WKIR adalah berkait rapat dengan anggapan bahawa WKIR hanya berperanan sebagai suri rumah, dibebani dengan kerja domestik berganda sehingga memberi halangan dalam melaksanakan kefungsian sosial.', 'peminggiran wanita ketua-rumah', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2016', 0),
(362, 'Fairooz Binti Johan', 'Chlorophyll A Concentration Of Fresh Water Phytoplankton Analysed By Algorithmic Based Spectroscopy', ' Phytoplankton are microscopic single-celled plants that play an important role in the ecosystem as a major primary producers through photosynthesis. The main objective of this study was to investigate properties through reflection and chlorophyll a concentrations of phytoplankton in freshwater. In this study, reflection phytoplankton were taken using spectroradiometer to observe the relationship between the reflectance and the wavelengths of phytoplankton in freshwater. The lake selected for this study is known as Tasik Harapan located in Universiti Sains Malaysia. In this study, 20 litres water samples undergone the filtering using phytoplankton net. The water samples collected were analyzed in the laboratory to determine the reflectance and chlorophyll a concentration of phytoplankton. Two spectrometers were used in this study, firstly, spectroradiometer which was used to measure the reflectance of phytoplankton and secondly, spectrophotometer which was used to measure the concentration of chlorophyll a. The water samples taken were prior to culture in the medium known as Bold\'s Basal Medium before the reflections were taken so that accurate reflection measurements on phytoplankton can be acquired.', 'chlorophyll phytoplankton spectroscopy', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2016', 0),
(363, 'Jasim Uddain ', 'AgrobacteriumMediated Transformation Of Dendrobium Broga Giant Orchid With Chitinase Gene.', 'Dendrobium Broga Giant (Dendrobium Bobby Messina  Dendrobium superbiens) is a new hybrid orchid in Malaysia. This study has established Agrobacterium-mediated transformation protocol using protocorm-like bodies (PLBs) to produce transgenic Dendrobium Broga Giant (DBG) orchid with an antifungal gene. A simple and competent micropropagation technique was established for the successful PLBs proliferation of DBG. Half-strength of Murashige and Skoog (MS) semi-solid media supplemented with 1.0 mg/L BAP and 0.5 mg/L NAA produced the highest PLBs proliferation. The interaction between Agrobacterium and PLBs was evaluated based on bacterium motility and attachment capability. Mildly wounded PLBs displayed higher Agobacterium motility as well as attachment capacity compared to other treatments. Successfully transformed PLBs were evaluated using selection agents such as geneticin (G-418), kanamycin and neomycin to determine the minimal inhibitory concentration required. Geneticin displayed highest effectiveness with 50 mg/L completely killed the non-transformed PLBs and allowed the survival of the transformed PLBs.', 'agrobacteriummediated dendrobium', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences) ', '2016', 0),
(364, 'Mohammad Hossein Azariyan', 'Synthesis And Characterization Of Organic-Inorganic Films Based On The Composites Of Epoxidized Natural Rubber (Enr-50)/Polyaniline And Zirconia.', ' The current thesis focuses on the synthesis and characterization of novel Inorganic-Organic Composites (IOCs) materials with enhanced properties. Epoxidized natural rubber (ENR-50) was used as the polymer matrix and its composition with zirconium (IV)-n-propoxide and polyaniline (Pani) was investigated. The hydrogen bonding which contributes to the formation of the composite materials was observed by calorimetric and various spectroscopic analyses. Initially, ENR-50-zirconia hybrid films were synthesized through the sol-gel route by varying the amount of zirconium (IV)-n-propoxide ranging from 10 to 50 wt%. The prepared hybrid films exhibited very high optical transparency. With 30 wt% zirconium (IV)-n-propoxide addition, zirconia nanoparticles were uniformly and homogeneously distributed to the ENR-50 matrix with the particle sizes ranging from 50 to 70 nm. New composite materials from ENR-50 and polyaniline were successfully prepared using the solvent casting technique.', 'organic-inorganic rubber', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2016', 0),
(365, 'Nur Juliani Binti Shafie', 'Ecological Aspects Of Fruit Bats (Megachiroptera) In Penang Island, Malaysia', ' This study focuses on the distribution, ecology, feeding behaviour and knowledge and awareness of local community on conservation related issues of fruit bats in Penang Island. Data collection was conducted from 2012 until 2014. The first objective was to determine the effect of urbanisation on the species richness, species abundance and body size of fruit bats. A total of 521 individuals consisting of eight species were captured. There was a significant difference of abundance across the urban-rural gradient (one-way ANOVA, F (2, 18) = 5.4947, p  0.0162). The abundance of fruit bats was highest in suburban and lowest in urban sites. Urbanisation has a positive effect on body size of Cynopterus sphinx. However, the correlation was weak (r = 0.333, n =18, p  0.05).', 'ecological fruit bats', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences) ', '2016', 0),
(366, 'Abdul Rashid Bin Jamaludin', 'Development Of High Performance Porcelain And Alumina Foam Structure For Porous Medium Burner. ', 'The requirements for better combustion process that emits low emissions can be achieved through porous medium burner (PMB). For that, the porous medium or porous inert media (PIM) installed inside PMB should have better properties. Therefore, the goal of this research is to fabricate PIM from porcelain (tri-axial compositions of kaolin clay, feldspar, and silica) and Al2O3 for PMB using a sponge replication technique (SRT). Inside the PMB, porcelain-PIM was installed as preheater zone, whilst Al2O3-PIM as combustion zone. The emphasized was given to Al2O3-PIM as it involved in combustion process. For the fabrication of PIM, natural (sago and tapioca starch) and synthetic poly(vinyl alcohol) (PVA) were used as the binder for slurry preparation. These binders were diluted and mixed with porcelain and Al2O3, respectively to form slurries. The slurries show pseudo-plastic behaviour, and was used for replication process using polyurethane (PU) sponge template. The replicated template was sintered at 1250 C and 1600 C, respectively to yield porcelain- and Al2O3-PIM substrates. The porosity of both substrates is within 79% to 90%. Porcelain- and Al2O3-PIM substrates with natural binders have bulky and finer surface morphology (skeleton strut), but defects (micropores and cracks) were evident compared to PVA added samples. During compressive test, the Al2O3-PIM substrate added with PVA destroyed in fragments, while sample contained natural binder collapsed steadily due to the existing defects. Subsequently, the Al2O3-PIM substrate was dip-coated with SiC-, Ni-, and Cr-based solutions (catalyst materials) and re-sintered at 900 C, 1150 C, and 1250 C in vacuum atmosphere. A consolidated coating layer was observed at 1250 C, which contributed to reduction in micropores, cracks, and open cells. The porosity of dip-coated Al2O3-PIM also dropped significantly. Improvement in compressive strength (from 0.22 MPa to 0.78 MPa) and thermal conductivity (from 0.3446 W/mK 0.5476 W/mK) was observed for dip-coated samples. Finally, the dip-coated Al2O3-PIM was employed as combustion zone inside a prototype PMB. Combustion test was conducted at different fuel inlet. Comparison was made between the plain and dip-coated Al2O3-PIM. Plain Al2O3-PIM substrate shows maximum surface flame temperature of 634 C, whilst the temperature achieved by SiC-, Ni-, and Cr-coated Al2O3-PIM are 750 C, 741 C, and 739 C, respectively. The improved surface flame temperature for dip-coated samples have reduces CO (from 1300 ppm to 23 ppm) and COu emission (from 1190 ppm to 37 ppm). This signifies better combustion process due to the deposition of catalyst coating.', 'porcelain alumina porous', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2016', 0),
(367, 'Thaer Jasim Mohammed', ' Improving Torsional Behaviour Of Reinforced Concrete Beam Strengthened With Ultra High Performance Fibre Reinforced Concrete.', 'Reinforced concrete members subjected to torsion may fail suddenly due to insufficient transverse steel reinforcing resulting from construction errors, or increased loading due to a change in purpose. Therefore, strengthening and upgrading is the most cost-effective and convenient solution. The proposed techniques to strengthen concrete members such as steel plates, polymers or concrete have important deficiencies in adherence and durability. So, the use of ultra-high performance steel fibre concrete (UHPFC) can effectively resolve these problems. On the other hand, there have been very little studies on the torsional behaviour of reinforced concrete (RC) beams with UHPFC composite. This work aims at studying the strengthening of rectangular beams with or without stirrups using UHPFC with different types of configurations and thicknesses to improve the torsional resistance of RC beams. Thereby, an experimental study has been made through this investigation to understand the behaviour of RC beams with UHPFC under torsion. Moreover, simulation of the experimental beams was studied using finite element analysis. The FE method from the ANSYS program is used. Variables considered in the test program include; influence of UHPFC configuration (full, U-jacked and left-right sides), influence of UHPFC layer thickness (10, 15, 20 and 25 mm), and influence of transverse steel reinforcement. Test results are discussed in this research based on torque-twist behaviour, torque-strain curve, influence of UHPFC on cracking and ultimate torque, crack patterns and mode of failure of each beam. Results show that the UHPFC matrix can generally be used as an effective external torsional reinforcement for RC beams with or without stirrups. The UHPFC contribution to torsional strength is increased when thickness increases, for all cases of strengthened beams. Moreover, the UHPFC material can be cast in a thin layer, while sandblasting of the specimen surface ensures good adhesion of the U-jacket without using any primer, which subsequently prevents premature failure of the structure and a significant increase in torque capacity. Despite the positive effect in increasing the torque capacity, left-right wrappingis not the most efficient and economical scheme for strengthening reinforced concrete using UHPFC. The fully wrapped beams exhibited considerably higher torque capacity and torsional behaviour. Therefore, the cracking and maximum torque capacity of the strengthened beams is dependent on both configuration and volumetric ratios of UHPFC. Meanwhile, the FE results show good agreement with the experimental results. The ratio of experimental values of the cracking torque to the predicted valuesfrom the FE results for all beams hasa mean of 1.059 and standard deviation of 0.089.The ratio of experimental values of the maximum torque to the predicted values from the FE results for the beams has a mean of 1.038 and standard deviation of 0.062.It is worth mentioning, the possibility of increasing the durability of the member by applying the UHPFC matrix, due to the reduced crack openings and to the compactness of the UHPFC matrix. Hence, the use of UHPFC appears to be a good method to enhance the torsional performance of RC beams.', 'concrete beam fibre-reinforced', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2016', 0);
