(368, 'Indra Surya', 'The Potential Of Alkanolamide As A New Additive In Natural And Synthetic Rubber Compounds.', 'The potential of Alkanolamide (ALK) as a new additive in natural and synthetic rubber compounds was studied. The ALK was prepared by reacting Refined Bleached Deodorized Palm Stearin (RBDPS) with diethanolamine. The unfilled Natural Rubber (NR) and Polychloroprene Rubber (CR) compounds, silica-filled NR compound, and Carbon Black (CB) filled NR, Epoxidised Natural Rubber (ENR-25) and Styrene-Butadiene Rubber (SBR) compounds were carried out. In this study, various loading of ALK was incorporated into the rubber compounds which were vulcanised with sulphur accelerated vulcanization system. The main objective is to investigate the effect of ALK loading on properties of the different types of rubber compounds. It was found that ALK could be utilised not only as a curative additive but also as an internal plasticiser in the rubber compounds. The ALK has improved the cure characteristics of the rubber compounds where the increased in cure rates and torque differences were observed. The scorch and cure times of unfilled and silica-filled NR, CB-filled NR, ENR-25 and SBR compounds were shortened as the increased of ALK loadings. The torque difference was increased up to a certain optimum ALK loading of each type of rubber compounds. The ALK also exhibited higher tensile modulus, tensile strength, hardness, resilience and crosslink density, especially up to certain optimum loadings of ALK; 0.6 and 5.0 phr for unfilled and silica-filled NR compounds, respectively; 5.0 phr for CB-filled NR and SBR compounds, and 1.0 phr for CB-filled ENR-25 compound. Study on reinforcement effects of CB and silica on the rubbers showed that the higher mechanical properties of silica-filled NR compound, and CB-filled NR, ENR-25, SBR compounds were achieved. These were attributed from a better dispersion and stronger rubber  filler interaction as well as the cure enhancement phenomenon due to the functions of ALK as a plasticiser and accelerator in the filled rubber compounds. The infrared spectroscopic study on unfilled CR and silica-filled NR vulcanisates proved that ALK has an ability to form crosslinks with CR molecules through the formation of CO chemical bonds; and the formation of ONO coupling bonds proved that ALK has interacted chemically with the silica. The morphology study on the rubber vulcanisates with and without ALK proved that Scanning Electron Microscopy (SEM) micrographs of silica-filled and CB-filled NR compounds, CB-filled ENR-25 and SBR compounds with ALK exhibited a greater matrix tearing line and surface roughness due to better filler dispersion and stronger rubber  filler interaction. The higher elongations at break and lower torques minimum of the vulcanisates of filled and unfilled NR, CB-filled ENR-25 and SBR compounds as the loadings of ALK were increased together with the better filler dispersion proved the function of ALK as an internal plasticiser.', 'alkanolamide additive rubber', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2016', 0),
(369, 'Nadia Binti Abdul Wahab', 'The Effects Of Personalized Multimedia App On Knowledge, Perceived Awareness And Perceived Motivation Of Cyber-Bullying Among Adolescents. ', 'Kajian ini bertujuan untuk merekabentuk, membangun dan mengkaji kesan app multimedia ke atas pengetahuan dan persepsi kesedaran terhadap buli siber dan juga persepsi motivasi terhadap bahan pengajaran di kalangan para remaja. The purpose of this study is to design, develop and investigate the effects of multimedia app on the knowledge and perceived awareness of cyber-bullying and as well as on the perceived motivation towards the learning material among adolescents.', 'multimedia-app cyber-bullying adolescents', '', 'Pusat Teknologi Pengajaran & Multimedia (Centre for Instructional Technology & Multimedia)', '2016', 0),
(370, 'Mahmoud  Akbari', 'Exploring Common Risks In The Management And Operations Of Translation Companies.', ' Risk management practices have turned into an essential part of many industries while there is yet no published record of standards or guidelines defining the risks inherent in translation industry and the methods available to treat and manage them. The present Sequential Exploratory research aimed at identifying the most common risks in daily operations of translation companies and categorizing those risks, investigating the maturity level of translation companies in terms of risk management, and uncovering the attitudes of translation companies toward the application of a comprehensive risk management framework into their activities. The study had two phases of qualitative and quantitative research and each incorporated a pilot study. A total of 400 projects were observed in 4 translation companies during the qualitative phase. The quantitative phase used a survey as its instrument which was completed by 226 companies around the world.', 'risk management operations', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2016', 0),
(371, 'Behnoosh Shamsollahi', ' Cultural Landscape And Urban Identity: A Case Study Of Yazd City, Iran.', ' Today, local landmarks are declining as a result of the diffusion of Western Culture in the cultural landscape of cities especially in developing urban societies. Hence, this process leads to the shaping of homogenous and non-distinguishable urban landscapes. Accordingly, if this situation persists, this would lead to the shaping of alien and meaningless cities in the future which will not be able to respond to their residents with regard to their original historical and cultural identity. Hence, this study emphasizes the importance of preserving and reviving local landmarks in the cultural landscape of cities, particularly historical cities, as cultural capital of each nation, and the factors and features that make cities distinguishable from each other. This study is designed based on case study strategy as a qualitative strategy in social sciences. The data collected is based on, interview, observation and documentary studies. In this study, 35 respondents (18 men and 17 women) participated in the interviews. The respondents were chosen based on purposive sampling and in coordination with the research questions.', 'cultural landscape urban', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2016', 0),
(372, 'Lim Chia Yean ', ' A Triad-Based Contextualisation Approach For Understanding A Critical Issue. ', 'Dalam bidang kejuruteraan perisian, terdapat suatu masalah yang telah lama wujud iaitu pihak berkepentingan tidak dapat memahami keperluan perisian dengan betul dan juga menyampaikan penyelesaian yang betul untuk menangani isu-isu kritikal. In software engineering field, there is a long-standing problem whereby the stakeholders were unable to correctly understand the software requirements and deliver the right solutions to resolve critical issues.', 'contextualization understanding critical-issue', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2016', 0),
(373, 'Low Chee Soon ', 'Exploring A-Level Students Mathematical Flexibility And Adaptivity Through Continual Exposure To Multiple-Solution Tasks And Strategies.', 'This study employed a mixed methods research design to explore A-Level students solution strategies for multiple-solution tasks, their levels of flexibility and adaptivity, and the reasons for their performance and solution choices.', 'students mathematical multiple-solution', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2016', 0),
(374, 'Basma M. Abd Razik', 'Conventional Organic Solvents And Ionic Liquid Mediated Synthesis Of New Azomethine Compounds As Potent Cholinesterase Inhibitors. ', ' Five new series of azomethine derivatives were synthesized by condensation of substituted benzaldehydes and amino derivatives in ethanol a conventional organic solvents and a green ionic solvent, 1-butyl-3-methylimidazolium bromide ([bmim]Br), respectively.', 'conventional ionic azomethine', '', 'Pusat Pengajian Sains Kimia (School of Chemistry) ', '2016', 0),
(375, ' Norhusna Binti Mohamad Nor', 'Preparation Of Mw-Assisted N-Modified Palm Shell Activated Carbon For H2s Removal From Simulated Pome Biogas', 'The presence of H2S in biogas could disturb the conversion of methane (CH4) to renewable energy due to its corrosive effect to equipment and its toxicity to human health. The main objective of this study is to develop a nitrogen-modified palm shell activated carbon (N-PSAC) via microwave (MW) heating method for H2S removal from simulated POME biogas. A preliminary study on choosing preferable method of producing high performance of sorbent was done and MW heating method was selected compared to conventional heating method. The preparation of a high quality of N-PSAC sorbent was done under MW heating variables; 900 C of MW heating temperature, 400 ml/min of N2 flow rate, 10 minute of MW heating time and 3 g of sample amount. MW heating method provides better incorporation of nitrogen functional groups in the N-PSAC carbons matrix and well-developed surface and porous structures are believed to be predominant factors that contribute in high H2S sorption capacity. The details characterizations of the N-PSAC sorbent before and after H2S sorption concluded that both physical and chemical sorptions were taken place during the sorption process. A complete breakthrough analysis of various operating conditions namely relative humidity, operating temperature, amount of sorbent, biogas feed flow rate and H2S feed concentration were influencing the sorption capacity of H2S onto N-PSAC sorbent. It can be concluded that the existing settings in Felda Besout palm oil mill (i.e. 35 C, 45% RH and 3000 ppm H2S) are favorable for H2S sorption by using the N-PSAC sorbent without altering the operating parameters. The MW dry-regeneration method is proven to regenerate H2S saturated N-PSAC sorbent up to 100% regeneration efficiency and was tested for 20 regeneration cycles. The predictions of H2S sorption equilibrium showed that Freundlich isotherm model fitted well with the experimental data. The thermodynamic properties evaluates the H2S sorption using N-PSAC sorbent as an exothermic process with spontaneous and randomly distributed. The activation energy and frequency factor for H2S sorption were found to be 15.60 kJ/mole and 3.90 x 102 cm3/g.min, respectively. The deactivation kinetic model was found to give a very good agreement with the experimental data of H2S sorption.', 'mw-assisted carbon biogas', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2016', 0),
(376, 'Iqbal Tariq', 'Fabrication of a Reuseable Plastic Based X-ray Dosimeter for Radiotherapy.', ' The aim of this study was to fabricate a plastic composite dosimeter for the measurement of radiation doses of X -ray photons used in radiotherapy. The criteria for the proposed dosimeter were low cost, ease of use, non toxic, and reusable. As a dosimeter, it should have acceptable sensitivity and reliability in the dose measurements range of interest in radiotherapy.', 'reuseable x-ray ragiotherapy', '', 'Pusat Pengajian Sains Kesihatan (School of Health Sciences)', '2016', 0),
(377, 'Thalpawila Widana Kankanamge Osantha Nayanapriya', 'A Study Of Peacebuilding And Reconstruction Process In The Post- War Era In Sri Lanka. ', ' The post-LTTE and post-war situation left the Sri Lankan government with no credible opposition to challenge or influence the post-war reconstruction and peacebuilding activities. This study examines the process of post-war peacebuilding that took place during the period of President Rajapaksas regime to explore its impact on sustainable peace in the country. The research tries to answer three questions: What were the governments post-war reconstruction and peacebuilding initiatives? What exactly were the benefits and who were the beneficiaries? Were these initiatives able to address the root causes of the conflict and achieve success in building a long lasting peace? To accomplish this task, the study uses the qualitative method of using primary sources of data such as interviews with the affected people, policy makers, implementers and independent actors along with secondary sources such as governmental as well as non-governmental reports and documents for content analysis and chronological reviews.', 'peacebuilding reconstruction post-war', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2016', 0),
(378, 'Afifah Binti Mohd Ali', 'Wear Resistance Performance Of Zirconia Toughened Alumina (ZTA) Cutting Tool Added With MgO and CeO2. ', 'Prestasi rintangan haus alumina diperkuat zirkonia (ZTA) dengan bahan tambah MgO dan CeO2 diselidik. Komposisi optimum bahan tambahan telah digunakan dalam alumina / zirkonia terstabil yttria (YSZ). Tiga jenis komposisi adalah ZTA + 0.7 wt.% MgO (ZMM, partikel mikro), ZTA + 1.1 wt.% MgO (ZMN, partikel nano) dan ZTA + 0.7 wt.% MgO (partikel zarah) + 5.0 wt.% CeO2 (ZNC). Komposisi-komposisi ini dicampur, ditekan dalam satu arah ke dalam acuan berbentuk mata pemotong rombus 80 dengan 0.8 mm jejari muncung dan disinter pada suhu 1600 C selama 4 jam dibawah keadaan tanpa tekanan. Analisa pemotongan dilakukan ke atas rod keluli tahan karat kormesial 316L dengan diameter 50 mm sebagai bahan kerja. Bahan kerja ini telah dipotong pada 1500, 1750 dan 2000 rpm. Kadar suapan dibezakan pada 0.1, 0.3 dan 0.5 mm/putaran manakala kedalaman potongan dikekalkan pada 0.2 mm. Faktor - faktor yang memberi kesan kepada prestasi alat memotong ZTA iaitu parameter pemesinan, serpihan pemotongan dan transformasi fasa yang disebabkan oleh proses pemesinan telah dikaji. Rintangan haus dan kekasaran permukaan bahan kerja diukur. Empat jenis kelakuan rintangan haus dapat dilihat iaitu haus rusuk, haus kawah, haus hidung dan sumbing. Kelajuan putaran dan kenaikan kadar suapan menyebabkan semua jenis haus meningkat terutamanya haus rusuk dan haus hidung. Haus kawah sangat dipengaruhi oleh pembentukan serpihan semasa proses pemotongan. Pembentukan serpihan sebaliknya sangat dipengaruhi oleh kenaikan kadar suapan kerana beban berlebihan pada mata pemotong. Kebanyakan sumbing diperhatikan apabila kadar suapan berada pada 0.5 mm/putaran. Kekasaran permukaan sebaliknya menurun dengan kenaikan kelajuan putaran dan meningkat dengan kenaikan kadar suapan. ZMM sangat terkesan dengan haus rusuk dan haus kawah kerana kekerasannya yang rendah. ZMN sebaliknya terkesan oleh serpihan di mana luas sumbing alat pemotong ZMN adalah lebih besar berbanding dengan ZMM dan ZNC. Selain itu, ZNC memberikan nilai tertinggi haus hidung. Mata pemotong ZMM memberikan nilai kekasaran permukaan yang terbaik dengan kekasaran paling rendah di mana-mana parameter manakala ZMN memberikan nilai kekasaran permukaan yang paling tinggi. Panjang dan bentuk serpihan juga memberi kesan kepada kemajuan haus kawah. Serpihan yang panjang menyebabkan haus kawah menjadi teruk. Serpihan berbentuk tiub panjang yang paling teruk menjejaskan alat memotong seramik. Ini dapat dilihat daripada corak haus kawah di mana kawasan haus kawah tertinggi dapat diperhatikan apabila serpihan berbentuk tiub panjang terhasil semasa proses pemesinan. Disebabkan transformasi fasa dalam alat pemotongan berlaku semasa proses pemesinan, kekerasan meningkat manakala keliatan patah menurun bagi semua jenis alat memotong (ZMM, ZMN dan ZNC). ZMM menunjukkan kadar tertinggi kenaikan kekerasan (22.0%) dan susutan keliatan patah (21.1%) diikuti oleh ZNC dengan masing-masing 11.8% dan 9.4%. ZMN mempunyai kenaikan terkecil kekerasan sebanyak 2.6% dan pengurangan keliatan patah sebanyak 8.4%. Kesimpulannya, ZMN menunjukkan prestasi yang terbaik sebagai alat memotong berbanding ZMM dan ZNC.', 'zirconia alumina mgo', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering', '2016', 0),
(379, 'Daruliza Kernain Binti Mohd Azman', 'Functional characterization of the interactions between CTCF truncated transcriptional factor with y-box binding protein-1 and the CTD of POL II.', 'CCCTC sequence binding factor (CTCF) involved in the regulation of transcription, insulator function, control of imprinting and the X-chromosome inactivation. Two of the CTCF protein interacting partners were the transcriptional factor YB-1, a member of the Y-box binding protein 1 and the second protein was the large subunit of RNA polymerase II (LS Pol II) the principal enzyme for transcription. Previous studies have shown the interaction between CTCF and YB-1 occurred at the Zinc finger (ZF) and Cold Shock Domain (CSD) respectively whereas the interaction between CTCF and RNA Pol II occurred at the C-terminal domains (CTD) for both proteins. The objectives of this study are to determine the interaction between CTCF and YB-1 in Recurrent Glioblastoma Multiforme (RGBM) cell line and to identify the motif within CTCF CTD that is critical for binding with RNA Pol II CTD. CTCF truncated proteins were produced and used to map the interaction to YB-1 in RGBM cell line. The interaction of these truncated proteins was mapped using co-immunoprecipitation (Co-IP) and pulldown assay and the functional significant of the interaction was characterized via mammalian two hybrid system. On the other hand, CTCF and RNA Poll II interactionswere characterized by identifying two sites within CTCF C-terminal domain important for the interaction and seven candidates CTCF C mutant variants named 1A, 1B, 1A1B, 2A, 2B, 2A2B and CM deficient for binding with Poll II CTD were produced. The interaction of these mutants to Poll II CTD was characterized via Coimmunoprecipitation (Co-IP) and pull-down assay, while the ability of these mutants to induce apoptosis in recurrent glioblastoma multiforme (RGBM) cell line was also analysed using Caspase 3/7 Glo assay. From the results obtained for CTCF and YB-1 interactions, the co-immunoprecipitation (co-IP) showed that CTCF was able to form a complex with YB-1 in the RGBM total cell lysate. From pull down assay results, CTCFZF was the only domain binds with YB-1 Cold Shock Domain (CSD) and the rest of domains fail to interact. As for CTCF and RNA Pol II interactions, the Co-IP results shown positive interaction for CTCF wild-type and all the mutant variants in RGBM cell line. The interaction was further characterized using pull-down assay and EEEE motif was identified as a critical motif for binding to Pol II CTD. The effects of CTCF C mutant variants on cell death by apoptosis assay showed that CTCF complete mutant (CM) induced highest apoptosis percentage in the cell as compared to the wild-type CTCF. As conclusion, CTCF ZF domain was found to interact with YB-1 CSD in RGBM cell line and the important motif in CTCF C terminal region critical for Poll II CTD binding was successfully identified. The EEEE motif was found to be a critical motif for binding; hence further study is needed to determine the significant of these motifs in CTCF and RNA Poll II interactions.', 'interactions ctf binding-protein ', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences) ', '2016', 0),
(380, 'Wan Zalani @ Wan Zanani Wan Abdullah', 'The Role and influence of corporate leader values on corporate governance mechanisms and financial reporting quality.', 'Even after twenty years of implementing corporate governance system, corporate scandals and failures are still happening. Most empirical studies show inconsistent and at best, inconclusive findings regarding the effects of corporate governance mechanisms such as board and audit committee characteristics and ownership structure on a quality of financial reporting. The effectiveness of corporate governance is also affected by institutional factors that are shaped by history and political contexts. Most corporations in developing countries including Malaysia demonstrate high concentration ownership, government intervention and family dominance. This would lead to low transparency, inadequate disclosure and minority shareholder expropriation as majority shareholders tend to maximise their private benefits. The enforcement of corporate governance principles practised by corporations does not reflect the quality of corporate people who actually govern the corporations. Hence, it is important to study the role of corporate leader values as an organization is typically shaped up by the attitude, values and vision of a corporate leader. The vision, philosophy, future direction shared by the CEO is important to corporations in ensuring all governance related matters are handled as efficiently and as effectively as possible. The values held and shared by the leader will shape the extent of reporting quality by the corporation.', 'leader-governance mechanism financial', '', 'Pusat Pengajian Pengurusan (School of Management)', '2016', 0),
(381, 'Wong Kok Leong', 'Examining Salesperson Performance In Pharmaceutical Industry In Malaysia : Influence Of Control, Empowerment, Adaptive Selling Behavior And Emotional Intelligence.', ' This study aims to examine the influence of managerial factors of supervisory control and empowerment on salesperson performance in the pharmaceutical industry in Malaysia. Control and empowerment were often seen as contradictory managerial practices and these practices were rarely studied simultaneously. However, scholars opined that control and empowerment practices should co-exist in the context of modern management. Thus, this empirical study intends to validate that both control and empowerment practices have to be present to enhance salesperson performance. This study also investigates the mediating effect of salespersons adaptive selling behavior on the relationships between these managerial practices and salesperson performance. Besides that, it also examines how emotional intelligence of the salesperson moderates the relationship between salespersons adaptive selling behavior and salesperson performance. The empirical findings involving 133 salespersons using Partial Least Square method revealed that certain dimensions of control and empowerment can co-exist.', 'salesperson pharmaceutical behavior', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business) >', '2016', 0),
(382, ' Nellie Wong Su Chee', 'Development And Competition In Rice Weevil, Sitophilus Oryzae (L.) And Red Flour Beetle, Tribolium Castaneum (Herbst), And Their Responses To Active Compounds In Selected Spices.', ' Stored product insects causes more than 20 % in total damages to stored products in developing countries and 9 % in total damages to stored products in developed countries on a yearly basis. Food security is threatened especially with the rapid increase in world population. This thesis focuses on the behavioural and control aspects of Sitophilus oryzae (L.) and Tribolium castaneum (Herbst). Both are two of the most common stored products insect attacking stored products in tropical countries. A study on the insects development rates in different mediums were carried out. Sitophilus oryzae were exposed to unpolished brown rice, local polished rice, parboiled rice, calrose rice basmati rice, red rice, black glutinous rice and fragrant polished rice. The weevils preferred mediums with lower carbohydrate contents but higher contents of ash and fibre.', 'rice-weevil sitophilus tribolium', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2016', 0),
(383, 'Ang Lee Fung', 'Complex Coacervated Microcapsules In Cream For Topical Delivery Of The Curcuminoids And Quercetin.', ' The curcuminoids and quercetin possess antioxidant, anti-inflammatory and antibacterial activities which are beneficial for wound healing. However, poor solubility, poor bioavailability, photosensitivity and color staining properties of these two compounds make them not acceptable for topical administrations.', 'microcapsules curcuminoids quercetin', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2015', 0),
(384, 'Andy Anderson Anak Bery', 'Enhancement In Resistivity Resolution Based On Data Amalgamation Technique', ' The 2-D electrical resistivity imaging measured resistivity distribution at the subsurface. Improvement in 2-D resistivity data quality was carried out by the data levels amalgamation (DLA) technique which is based on overlapping data levels with two different arrays combination.', 'resistivity data amalgamation', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(385, 'Mohammad Reza Esfandiari', 'Translation Competences, Translators Needs, And Translation Market Standards And Demands : Views Of Professional Translators', 'Translator training programs have expanded extensively due to the need for intercultural communication. As a result, a growing sensitivity has formed stating that the training of the translators should be founded on a proper educational basis.', 'translation standards demands', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2015', 0),
(386, 'Godella Pathirannahalage Terrence Sampath Hemakumara', 'Geo-Spatial Model Of Household Inhabitants\' Behaviour On Conversion Of Low-Lying Areas In Sub-Urban Colombo Metropolitan Region, Sri Lanka. ', ' Many metropolises in the tropical Asian region are situated in environmentally sensitive low lying areas that were originally uninhabited, but many driving forces had led to the conversion of the land. Of those, the role played by individual households in suburban areas as converter of lands is crucial.', 'household behavior conversion', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2015', 0),
(387, 'Jalihah Md Shah', 'Nelayan Dalam Bandar Dan Pembangunan Komuniti Di Kg. Pulau Gaya, Sabah.', ' The concept of urban fishermen presented in this study is a new concept in the study of fishing communities in Malaysia due to the fact that fishing activities is often regarded as rural-based occupation. This study was conducted in fishing communities in Pulau Gaya village, Kota Kinabalu, Sabah.', 'nelayan bandar pembangunan-komuniti', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(388, 'Emmanuel Jairaj Moses', 'Regulation Of Telomerase Reverse Transcriptase (Tert) By The Leukaemic Fusion Gene Aml1/Eto.', ' The chromosomal translocation t(8;21) is a common chromosomal aberration that occurs in up to about 15% of all de novo acute myeloid leukaemia (AML) cases. This translocation results in the formation of a fusion onco-protein known as AML1-ETO (also known as AML1/MTG8, RUNX1/ETO or RUNX1/RUNX1T1).', 'telomerase transcriptase leukaemic', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI))', '2015', 0),
(389, 'Mercy Halleluyah A/P Periayah', 'Understanding Platelet Thrombogenicity Cascade Of The Biodegradable Chitosan Derivatives In Von Willebrand Disease In Vitro.', ' Chitosan has become one of the most promising local hemostatic agents because it is of particular interest as it functions independently on platelets and normal clotting mechanisms. The present study was designed with the aim to test the ability of the mechanisms of blood platelets towards the action of biodegradable chitosan in normal donors and von Willebrand disease (vWD) patients in vitro.', 'thrombogenicity biodegradable disease', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences) ', '2015', 0),
(390, 'Danilah Binti Salleh', ' Accountability Practices In A Malaysian Local Authority : A Grounded Theory Approach.', 'The Malaysian government has spearheaded various initiatives to upgrade and improve accountability practices in its local authorities. Despite concerted efforts, accountability continues to remain an issue at the local authorities and the effectiveness of these initiatives is debatable.', 'accountability local authority', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(391, 'Md. Baharuddin Bin Abdul Rahman ', 'Kesan Pemantauan Interaktif Bersistematik Pembelajaran Berasaskan Projek (Pbp) Terhadap Motivasi Pembelajaran, Regulasi Kendiri Dan Metakognisi Dalam Kalangan Pelajar Politeknik.', 'The purpose of this study was to pilot test the Project Based Learning (PjBL) in order to examine its effectiveness towards learning motivation, self-regulation and metacognition among mechanical engineering students, among KPM Polytechnic.', 'pembelajaran rugulasi metakognisi', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2015', 0),
(392, 'Mohd Nasir Ayub', 'Pemikiran Pendidikan Islam Menurut Badiuzzaman Said Nursi Dalam Risalah Al-Nur', ' This research is a discussion on the Islamic education thought and practice according to the views of Badiuzzaman Said Nursi in Risalah al-Nur. Since he lived in the era of Western colonialism, the Muslim social structure began to be influenced by Western thought, including the education system. This research is carried out to achieve three main objectives; First, to introduce Said Nursi as an important figure in the field of Islamic education. Second, to examine of Risalah al-Nur in issues related to Islamic education. Third, to analyse the system of Islamic education according to the view of Said Nursi in Risalah al-Nur. In order to achieve these objectives, the researcher has chosen two basic methods of research which are the method of data and information collection, and the method of data analysis.', 'islam badiuzzaman al-nur', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2015', 0),
(393, 'Lee Ting', 'Methane Adsorption Microcalorimetry By Activated Carbon Fibre Derived from Empty Fruit Bunch Fibre', 'Empty fruit bunch (EFB) fibre of oil palm is anagricultural waste available abundantly from palm oil processing industry. In present work, EFB fibre was utilised as a precursorfor preparation of activated carbon fibre (ACF) as an adsorbent for adsorbed natural gas (ANG) application. The ACFs were produced via carbonisation, followed by physicochemical and activation. Physicohemical activation was carried out using sulphuric acid treatment followed by CO2 gas flow. The effects of different combustion and pyrolysis temperatures on the prepared ACFs were analysed. In addition, the effect of acid treatment on EFB fibres was further studied by switching the sequence of acid treatment before and after combustion and pyrolysis. Intercalation and exfoliation reactions on the acid-treated EFB fibre due to sulphuric acid resulted in a higher thermal degradation rate compared to raw EFB fibre without acid treatment. The highest BET surface area and total pore volume obtained amongst the ACF samples treated with acidwas found to achievevalues as high as 1049 m2/g and 0.45 cm3/g, respectively, after optimisation of the processing parameter. ACF exhibited predominantly micropore with pore width of 1.2 nm, which fulfil one of the requirements as an ideal adsorbent for ANG application.The maximum volumetric methane adsorption by the ACFs was observed to be 136 V/V at practical ANG conditions; viz. 298 K and 3.5 MPa. The volumetric storage capacities of these ACFs were comparable to the adsorptioncapacities of selected carbon materialscommercially available in the market, which are mainly derived from petroleum products after rationalising with packing density. Low deterioration in methane storage performance from subsequent adsorption cyclic operation indicated that the EFB fibre-derived ACF has good reusability, which is suitable for ANG application.', 'methane carbon empty-fruit', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2015', 0),
(394, 'Mazlina Binti Mamat', 'The Influence Of Internal Customer Service Experience In Public Universities In Malaysia.', ' Growing competition among Malaysian public universities makes it imperative to understand the important role of internal customer service experience in todays higher education service environment. As a pillar of the university, Academic Affairs Department (AAD) is entrusted to meet the needs and demands of its customers especially the academic staff of the university. In service organizations, like public universities, employee (academic staff) service experience directly correlates with student satisfaction and university performance. Therefore, it is crucial to understand the factors that influence academic staffs service experience. Hence, the primary focus of this study is to examine the relationship of service environment factors and situational factors in influencing customer service experience of academic staff in Malaysian public universities. The study also assesses the moderating influence of self-efficacy on the relationships between the independent variables and the dependent variable. The research model hypothesized that service environment factors and situational factorshave significant impact on customer service experience. The study employed a quantitative research.', 'customer service public-universities', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(395, 'Mohd Taufik Bin Mohammad', 'The Readiness Of Stakeholders In The Criminal Justice System On The Implementation Of Restorative Justice In Malaysia', ' Previous studies have supported that restorative justice is effective in addressing the needs of the victims of crime and the offenders. However, a successful implementation of restorative justice requires a comprehensive understanding on the experiences of the victims of crime, the importance of the presence of the victims of crime in the criminal justice system, as well as a less punitive attitude towards the offenders; especially juvenile offenders. This study aims at understanding the perceptions and experiences of the victims of crime, the juvenile offenders, and the probation officers in the criminal justice system. This study combined quantitative and qualitative approach. The findings have shown mixed satisfaction levels from the victims of crime on the ways they were treated by the criminal justice system based on genders, salary, and age. The juvenile offenders reported lower satisfaction with the police but high satisfaction with the other personnel such as the ones in the court and the detention center.', 'stakeholders justice restorative', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences) ', '2015', 0),
(396, 'Muhammad Yusuf ', ' Molecular Dynamics Studies Of The Effects Of Neuraminidase Mutation On Oseltamivir Resistance', ' The increased number of reports on oseltamivir (OTV) resistant strains of influenza virus (e.g. H274Y mutation on its neuraminidase, NA) has created some causes for concern. Many studies have been conducted to uncover the mechanism of OTV resistances in H274Y NA.', 'molecular neuraminidase resistance', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2015', 0),
(397, 'Farhad Pourpanah Navan', ' Hybrid Models Of Fuzzy Artmap And Qlearning For Pattern Classification.', 'Pattern classification is one of the primary issues in various data mining tasks. In this study, the main research focus is on the design and development of hybrid models, combining the supervised Adaptive Resonance Theory (ART) neural network and Reinforcement Learning (RL) models for pattern classification. Specifically, the Fuzzy ARTMAP (FAM) network and Q-learning are adopted as the backbone for designing and developing the hybrid models. A new QFAM model is first introduced to improve the classification performance of FAM network. A pruning strategy is incorporated to reduce the complexity of QFAM. To overcome the opaqueness issue, a Genetic Algorithm (GA) is used to extract fuzzy if-then rules from QFAM. The resulting model, i.e. QFAM-GA, is able to provide predictions with explanations using only a few antecedents. To further improve the robustness of QFAM-based models, the notion of multi agent systems is employed. As a result, an agent-based QFAM ensemble model with a new trust measurement and negotiation method is proposed. A variety of benchmark problems are used for evaluation of individual and ensemble QFAM-based models. The results are analyzed and compared with those from FAM as well as other models reported in the literature. In addition, two real-world problems are used to demonstrate the practicality of the hybrid models. The outcomes indicate the effectiveness of QFAM-based models in tackling pattern classification tasks.', 'hybrid artmap qlearning', '', 'UNSPECIFIED', '2015', 0),
(398, 'Isawasan Pradeep', 'Variants Of Array-Rewriting P Systems For Generating Picture Arrays.', 'Inspired by the structure and functioning of the living cells, the field of membrane computing was initiated around the year 2000. Since then the theoretical model introduced in this area, called P system has been intensively investigated for properties and applications. One such P system known as array-rewriting P systems provides a link between two dimensional formal language theory and membrane computing. In formal language theory, one of the main studies is on the language generating capability of the grammars, referred to as the generative capacity, which depends on the types of rules. Also a standard technique to increase the generative capacity is to endow the rules with additional features. Here the array-rewriting P system is investigated by endowing the grammatical rules of the system with three such features, namely, permitting symbols, parallel rewriting and grouping of rules. Thus this thesis introduces and develops three such variants of the array-rewriting P system and brings out their advantages.', 'array-rewriting picture arrays', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '2015', 0),
(399, 'Khairul Arifah Binti Saharudin', ' Development Of Nonmetal-Doped Tio2 Nanotube Photocatalyst For Decolorization Of Methyl Orange.', 'Well aligned TiO2nanotubes (NT) arrays have attracted substantial attention in the area of photocatalysis (PC). Although TiO2 is a widely used catalyst support, its poor visible light absorption and high recombination of charge carriers remains a major challenge for its application. Hence, this work aims to develop carbon (C) incorporated TiO2 NT and carbon phosphorus (CP)incorporated TiO2 NT for photocatalytic decolorization of methyl orange (MO) dye. The formation of C-TiO2 NT by anodization was successful in fluorinated organic electrolyte. Glycerol and ethylene glycol (EG) were the organic electrolyte with their neutral pH. The properties including morphology and structural of the nanotubular oxide formed were investigated. During anodization, the main factors effecting nanotubular structures are types of electrolyte, its composition, anodization voltage applied to anode and anodization time.C-TiO2 NT arrays were rapidly grown in EG containing 0.89 wt% of water (H2O) and 0.66 wt% of ammonium fluoride (NH4F). The optimized rate of formation was 308 nm/min. The incorporation of C into TiO2 NT induced the formation of a new state above valence band (VB), which is attributed to the C 2p state of the interstitial carbon, as well as new state below the conduction band (CB), corresponding to antibonding CO state produced due to the formation of oxygen vacancies.C-TiO2 NT arrays annealed at 500 C with average pore size of 95 nm, wall thickness of 18 nm and length of 18.5 m, with high aspect ratio (141.2) and surface area (1025.6 m2g-1) exhibited decolorization of about 39% under visible light illumination with rate constant of k = 5.9 x 10-3 min-1as compared to TiO2 nanoparticle of 25 nm which possessed 11% decolorization. In order to improve further the photocatalytic activity of C-TiO2 NT, incorporation of P into C-TiO2 NT was done via anodization of Ti in EG containing 1 M phosphoric acid (H3PO4) and wet impregnation in H3PO4. It was found that C-TiO2 NT impregnated in 0.02 M H3PO4 for 90 min at 40 C and annealed at 500 C exhibited 45% decolorization with rate constant of k = 8.1 x 10-3 min-1. It was found that the doped phosphorus existed in a pentavalent oxidation state, replacing part of Ti4+ in the anatase lattice in the form of Ti-O-P bonds, thus extended the spectral response of TiO2 NT to the visible region.\r\n\r\n', 'nonmetal-doped photocatalyst methyl-orange', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering', '2015', 0),
(400, 'Noor Ainee Binti Zainol', 'Diplazium Esculentum Leaf As A Natural Coagulant Aid In Landfill Leachate Treatment.', 'Coagulationflocculation treatment is recognized as one of the alternative methods for treating landfill leachate. However, the conventional coagulants utilized in this process may adversely impact the environment because most are chemical-based and not environmentally friendly. Hence, the production of an environmentally friendly coagulant is necessary to achieve sustainable development. The use of extracts from Diplazium esculentum leaves as coagulant and coagulant aid has not been discussed in literature. In this research, the capability of extracts from D. esculentum leaves, namely, D. esculentum aqueous (DEaqs) and D. esculentum powder (DEpowd), to act as coagulant and coagulant aid in combination with polyaluminum chloride (PACl) was evaluated using stabilized leachate from the Kuala Sepetang Landfill Site (KSLS) and the Kulim Landfill Site (KLS) through a jar test. This research also examined its chemical characteristics (i.e., isoelectric point, molecular weight, Fourier Transform Infrared, and elemental analysis). Identified as polymers with high molecular weight, DEaqs (221 kDa) and DEpowd (275 kDa) act as anionic coagulants and are capable of promoting the coagulation process in leachate saturated with negative particles. The main functional groups that induce the coagulationflocculation process by DEaqs and DEpowd are carboxyl, hydroxyl, and amine groups, which all contain hydrogen in their molecules. Jar test results were analyzed based on the coagulation activity and removal efficiency (RE) of suspended solids (SS), turbidity, colour, chemical oxygen demand (COD), and ammonia-N. Operating conditions during coagulationflocculation, floc strength, and sediment percentage characteristics were also studied. Results indicated that 200 mg/L DEaqs at pH 12 in KLS leachates showed the highest removal with 94%, 92%, and 43% of SS, turbidity, and ammonia-N, respectively compares to PACI . In addition, at 1000 mg/L and pH 10, DEaqs yielded the highest removal for ammonia-N (69%) compared to PACl (38%) in KSLS leachates. A 50% reduction in the volume of PACl from its optimum dosage, with the DEaqs and DEpowd dosages below 1000 mg/L, exhibited a synergic effect of all the measured parameters in KSLS leachates. Flocs formed by 1000 mg/L PACl in conjunction with 500 mg/L DEaqs also displayed better shear resistance with a higher strength factor of 121, which was significantly higher than the factor of 86 for PACl alone. Therefore, the use of extracts from D. esculentum leaves as coagulant and coagulant aid can be proposed as an alternative in the treatment of landfill leachate via coagulationflocculation.', 'diplazium coagulant leachate', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2015', 0),
(401, 'Nur Shaylinda Binti Mohd Zin', 'Treatment Of Partially Stabilized Andfill Leachate Using Composite Coagulant Derived From Prehydrolyzed Iron And Tapioca Starch', 'Treatment of leachate before discharge is crucial to ensure the safety of the environment. Various treatment methods are available and choosing the most suitable means depends on the characteristics of the leachate. One of the most commonly adopted method is by using a coagulation process. Application of coagulation-flocculation in reducing pollutant from leachate was proven to be effective. However the use of chemical coagulant will indirectly affect the health of living organisms, thus to reduce the effect, substituting the chemical coagulant with natural material (tapioca flour (TF)) can be adapted. A combination of chemical and natural coagulant as a composite coagulant is able to simplify the process and offer many benefits. Instead of using iron chloride (IC), prehydrolyzed of iron chloride (PHI) was chosen as it offers more advantages than those offered by iron chloride alone. The aim of this study is to investigate the capability of composite coagulant made from prehydrolyzed iron and tapioca flour (PHITF) on partially stabilized leachate in a coagulation/flocculation process. The performance of this combination in removing suspended solids (SS), colour, Chemical Oxygen Demand (COD), and ammonia were investigated. Partially stabilized leachate from Matang landfill (MLS) and Kuala Sembeling landfill (KSLS) were used in this study. PHITF, PHI, PHI+TF, TF and IC were tested separately for to compare their performances. The optimization process of PHITF for pH and dose has been carried out based on conventional and response surface methodology (RSM) methods. Through a jar test, the best basicity of PHI was 0.1 and the best PHITF weight to weight (w/w) ratio was 0.7. PHITF (0.7) is characterized as acidic (pH 1.34), low conductivity (0.291 S/m), high molecular weight (11600 KDa) and low charge density (0.245 mV). At optimum condition (dose=0.2 g/L Fe and pH=4.71) of PHITF, the removals were 94.7% for SS, 91.3% for colour, 48.7% for COD, and 6.6% for ammonia. An optimization by using RSM revealed that the performance of PHITF was at par with that of PHI, PHI+TF and IC especially on SS, colour, and COD removals. PHITF reduced 64% usage of dose from IC dose. The formation of floc and sludge of PHITF is through particle bridging and charge neutralization.. Thus, resulted in better floc and sludge formation of PHITF compared to those resulted from PHI, PHI+TF (dual coagulant) and IC (iron chloride). Application of PHITF on leachate for different landfills (KSLS) has resulted in 96%, 91%, 69% and 4% removals for SS, colour, COD, and ammonia respectively. This indicate the applicability of PHITF for the treatment of leachate from different sites of landfill. Based on the study, it can be concluded that PHITF can be a potential coagulant for the treatment of partially stabilized leachate.\r\n\r\n', 'andfill coagulant tapioca', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2015', 0),
(402, 'Ahmed Nidhal Khdiar', ' Image Based Congestion Detection Algorithms And Its Real Time Implementation.', 'In recent years, intelligent traffic management have included many new fields and features. One of the important fields which directly affect our life is the traffic congestion alert system i.e. a complete system which is able to detect congestion and alert concerned parties to save time, fuel and man power. Recent methods in congestion detection need prior knowledge about the road or several minutes are taken to produce results or a huge infrastructure is needed to implement the system, even then, not in real time. Most of the current studies in image processing are not reliable for real implementation because they either lack accuracy or do not work in real time. The proposed system aims to find a new congestion detection method that has high accuracy and having real time processing time, also it aims to demonstrate the transmit/receive process for image transmission using Software Defined Radio. The proposed system offers a complete detection and alert network that captures an image of the road situation, determine whether the road is congested or clear and finally report the results wirelessly to the traffic management bodies to take action and inform people to avoid the congested areas in real time. The proposed system uses a fast and reliable method to detect traffic congestions. The methodology includes vehicle detection by using backlight pairing feature algorithm and modified Watershed algorithm. The results returned by the algorithms are transmitted and received wirelessly using the SFFSDR platform, including the use of RF, FPGA, and DSP modules for variable distances. The system shows an accuracy of detection up to 98-98.8% with time consumption of up to 3 seconds which make it feasible for real time implementation. The wireless system has been tested using different distances between SDR antennas. The received power, bit loss percentage and PSNR for the received image have been obtained, results shows a 35dB PSNR for normal distance between SDR antennas (20cm) and 7dB for 150cm, while bits are totally lost when reaching 200cm.', 'congestion algorithms implementation', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering) ', '2015', 0);
