(403, 'Navid Fatehi Rad', 'The Influence Of Culture, Individual Differences And Time Pressure On Negotiation Styles Of Iranian And Malaysian Business Negotiators', ' The present study examined the influence of culture and individual differences in terms of personality, emotional intelligence and gender on negotiation styles (competing, collaborating, compromising, avoiding and accommodating) of both Iranian and Malaysian business negotiators. This research also investigated the moderating effect of time pressure on the relationship between culture and negotiation styles of business negotiators from Malaysia and Iran. Non-random purposive sampling technique was applied to collect data through survey questionnaire developed from related literature and studies. The data were analyzed by using SPSS software. Findings indicated that dimensions of culture (collectivism, masculinity, power distance and uncertainty avoidance) had significant influences on negotiation styles of both Iranian and Malaysian business negotiators. In addition, based on the results of data analysis (multiple regression analysis) collaborating, compromising and accommodating styles were highlighted as the most preferred negotiation styles of Iranian business negotiators (according to the absolute value of  coefficient). Competing and avoiding styles were highlighted as the most preferred negotiation styles of Malaysian business negotiators (according to the absolute value of  coefficient).', 'culture time negotiation', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2015', 0),
(404, 'Rohaizu Roslan', 'Isolation And Characterization Tempo Oxidized Nanocrystalline Cellulose From Oil Palm Empty Fruit Bunch', ' Oil palm empty fruit bunch nanocrystalline cellulose (OPEFB-NCC) has been successfully isolated, with yields of 67%, from OPEFB-MCC via a chemical and mechanical process using 4-acetamido-TEMPO/NaBr/NaClO oxidation and ultrasonic treatment. TEM images indicate the morphology of OPEFB-NCC as straight crystals of cellulose with lengths 122  45 nm, and uniform widths of 4  2 nm. FTIR and 13C-NMR/MAS solid state analysis suggests that oxidation occurred at the site of the primary (C6) hydroxyl groups on the cellulose chain and that OPEFB-NCC consists primarily of crystalline cellulose I. XRD and 13C-NMR/MAS indicated that OPEFB-NCC had a lower crystallinity index than the OPEFB-MCC starting material. Thermal analysis revealed that OPEFB-NCC degraded at lower temperature than OPEFB-MCC, but had a much higher char content of 46% to the 7% of OPEFB-MCC.', 'isolation oxidized oil-palm', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2015', 0),
(405, 'Ali Qusay Zahroon Al-Faris', 'Development Of Techniques For The Detection Of Tumours In Breast Magnetic Resonance Imaging.', 'Breast cancer is the leading cause of death amongst cancer patients afflicting women and the second most common cancer around the world. Magnetic Resonance Imaging (MRI) is one of the most effective radiology tools to screen breast cancer. However, image processing techniques are needed to help radiologists in interpreting the images and segmenting tumours regions to reduce the number of false-positive. In this study, a segmentation approach with automatic features is developed for breast MRI tumours. The methodology starts with data acquisition followed by pre-processing. This is then followed with breast skin-line exclusion using integrated method of Level Set Active Contour and Morphological Thinning. Next, regions of interests are detected using proposed Mean Maximum Raw Thresholding method (MMRT). In the tumour segmentation phase, two modified Seeded Region Growing (SRG) methods are proposed; i.e. Breast MRI Tumour using Modified Automatic SRG (BMRI-MASRG) and Breast MRI Tumour using SRG based on Particle Swarm Optimization Image Clustering (BMRI-SRGPSOC). The RIDER breast MRI dataset was used for evaluation and the results are compared with the ground truth of the dataset. From analysing the evaluation results, it can be noticed that the proposed approaches scored high results using various measures comparing to previous methods. The results of skin-line exclusion scored high average performance in both stages; border segmentation stage (sensitivity = 0.81 and specificity = 0.94) and removal stage (sensitivity = 0.86 and specificity = 0.97). The quality evaluation of MMRT showed improved results with average of PSNR = 69.97 and MSE = 0.01. In the tumour segmentation phase, the sensitivity results of the two proposed methods; BMRI-MASRG and BMRI-SRGPSOC showed more accurate segmentation with averages of 0.82 and 0.84 respectively. Similarly, the specificity results also scored better performance compared to previous methods. The averages of BMRI-MASRG and BMRI-SRGPSOC are 0.90 and 0.91 respectively.', 'techniques tumours resonance-imaging', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2015', 0),
(406, 'Norizan Binti Baba Rahim', 'Protean Career Orientation And Individual Well-Being Among Professional Engineers In Malaysia: Mediating Role Of Proactive Career Management Behaviours', 'Individual well-being refers to employee engagement that generates higher frequency of positive affect such as job satisfaction, commitment, joy, fulfilment, interest, and caring. However, for the engineers in Malaysia, the conflict between fulfilling the work demand structured by the organization and their aspiration to be visionaries, ambitious, having their own goals and expectation, have influenced their well-being.', 'protean engineers behavior', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2015', 0),
(407, 'Chan Poh Ying', 'Bioregeneration Of Granular Activated Carbon Loaded With Phenol And P-Nitrophenol: Effects Of Physico-Chemical And Biological Factors.', 'Bioregeneration is defined as a process during which the adsorbent surface is renewed by living microorganisms for further adsorption. The effects of acclimated biomass concentration, adsorbent dosage, type of granular activated carbon (GAC) and biomass acclimation concentration on the efficiency and rate of bioregeneration of GAC loaded with phenol and p-nitrophenol (PNP) were investigated by determining the time courses of adsorbed substrate amount and residual substrate concentration during bioregeneration under the sequential adsorption and biodegradation approach. The mean bioregeneration efficiencies of phenol- and PNP-loaded GAC were found to be 78  2 % and 77  1 %, respectively. The results revealed that increasing the acclimated biomass concentration and adsorbent dosage did not have an observable effect on the bioregeneration efficiencies of phenol- and PNP-loaded GAC. Additionally, bioregeneration efficiencies of phenol-loaded GAC 830 and GAC 1240+ did not show any observable difference but the bioregeneration efficiency of PNP-loaded GAC 1240+ was greater than that of PNP-loaded GAC 830.', 'bioregeneration granular physicochemical', '', 'Pusat Pengajian Sains Kimia (School of Chemistry) ', '2015', 0),
(408, 'Farah Diana Binti Mohd Daud', 'Synthesis And Characterization Of Calcium Oxide And Magnesium Oxide Supported Calcium Oxide For Carbon Dioxide Adsorbent.', 'Many studies reported that calcium oxide (CaO) used for CO2 removal suffer from structural instability, thus reduced the adsorption capacity and sorbent recyclability. Therefore, the ultimate aim of this work was to produce CaO with high surface area and good structural stability for widespread application of CaO as CO2 sorbents. The effect of solvent, time, temperature of the reaction and calcination for the formation of CaO from Ca(OH)2 phase via precipitation method was investigated. Then, the addition of MgO in CaO to delay sintering and consequently improved sorbent recyclability was studied. It was found that ethanol/deionized water (ethanol/DIW) and dimethylformamide/deionized water (DMF/DIW) with volume of 78 ml/02 ml for 30 minutes at 35 C produces homogenous pods structure of Ca(OH)2 sorbent. Solvent with high amount of ethanol/DIW and DMF/DIW with volume (78 ml/ 2 ml and 80 ml/0 ml) acts as good capping agent to suppress the growth of Ca(OH)2 crystal at (1010) direction while induce anisotropic growth along (0001) direction. Comparatively, the sorbent produce in ethanol/DIW have highest surface area (30.45 m2/g), high pore volume (0.235 cm3/g) and small pore diameter (3.8 nm) than DMF/DIW which have surface area (20.66 m2/g), pore volume (0.111 cm3/g) and pore diameter (19.02 nm). The time of reaction determines the formation of homogeneous structure while temperature determines the solubility of the calcium ions. The adsorption capacity was 60% (16 mmol CO2/sorbent) subsequently reduced to 35% (8 mmol CO2/g sorbent) after 10 cyclic carbonation. This is due to sintering problem. However, the addition of MgO in the range of 5 to 30 wt% have improves the microstructure whereby demonstrated less sintering effect with high structural stability. The 5 and 10 wt% of MgO added CaO exhibited high specific surface areas and enhanced the sintering-resistant over multiple cycles for CO2 adsorption. Most importantly, 10 wt% MgO added CaO sorbent showed constant CO2 adsorption capacity (50%) over 10 carbonation cycles. Without MgO addition, the CO2 capacity of pure CaO decreases by 35 wt% but with 10 wt% MgO remained constant. In summary, the results of this research showed 10 wt% MgO is sufficient to form sorbents with high surface area with good structural stability for enhanced cyclic CO2 adsorption capacity.', 'calsium magnesium carbon', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2015', 0),
(409, 'Eman Mohammed Mohammed Ahmed Barakat', 'Interpreter Education And Training In Yemen: A Case Study.', ' Education and training are two facets of learning; education is about gaining knowledge and developing intellect, whereas training is undertaken for the purpose of acquiring a specific skill to perform adequately a given task. Education and training are necessary for the professionalisation of translators and interpreters, as it is the case with other disciplines. The aims of interpreter education and training programmes are to develop the skills and knowledge required to interpret, and to develop an awareness of suitable conduct and membership as practitioners of a profession. In Yemen, interpreter education and training is offered as part of translation programmes in the form of two or three courses. There are no programmes designed specifically to train interpreters want-to-be. The aim of this study is to draw a complete picture of interpreter education and training in the Yemeni context which covers major educational issues including curriculum components, teaching and learning practices, and assessment procedures. This broad aim is achieved by conducting a case study of interpreter education and training offered at the University of Science and Technology which is the first university in Yemen to offer interpreter education and training at a bachelors degree level. To answer research questions, a mixed-method approach is adopted for the purpose of collecting data from different sources, and converging these data via triangulation', 'interpreter education training', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(410, 'Seyed Mehrshad Parvin Hosseini', ' A Study Of Firm Level Innovation In Malaysian Manufacturing.', 'This study investigated five aspects of firm level innovation in Malaysian manufacturing, namely: (1) factors that determine the decision to innovate; (2) the extent of innovation; (3) characteristics of an innovating firm; (4) types of innovation undertaken, and (5) the factors that drive and enable different types of innovation. A conceptual model and a cost-benefit framework were developed to explain a firms decision to innovate.', 'firm innovation manufacturing', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(411, 'Norshahida Binti Sarifuddin', 'Mechanical, Physical, Thermal And Biodegradability Studies Of Low Density Polyethylenethermoplastic Sago Starch Kenaf Core Flour Biocomposites. ', 'Environmental problems associated with the use of typical plastics or so called synthetic polymers have direct to the utilization of biodegradable polymer and natural fiber for producing a degradable composite. The efforts currently are underway in producing such composites with the use of thermoplastic sago starch (TPSS) and kenaf core fillers (KCF) in the low density polyethylene (LDPE). In this work, the effect of blend ratio, treatment of natural filler and hybridization with inorganic mineral fillers on the mechanical, physical, thermal and biodegradability properties of composites were studied. Firstly, the LDPE/TPSS/KCF composites containing 0-40 wt. % of TPSS and 0-40 phr KCF were prepared by using melt-blended mixing and compression molding method. The addition of 10 wt. % of TPSS as well as 10 phr KCF had resulted the highest tensile strength. Chemical similarity of TPSS and KCF formed hydrogen bonding as shown in IR spectra and such interaction indicated better interfacial adhesion detected by SEM morphology. As such, the addition of both TPSS and KCF showed an improvement in thermal and has boosted up the water absorption percentages due to their hydrophilic nature. The deteriorating impact of composites due to exposure to natural weathering can be seen with the collapse of overall tensile properties upon addition of TPSS and KCF. The IR spectra is further confirming the photo-degradation occurred with the appearance of carbonyl (C=O) peaks. Likewise, tensile properties, FTIR, SEM and weight loss of soil burial samples also proved the degradation activities over a predetermined time. Next, the effects of graft copolymerization of methyl methacrylate (MMA) onto KCF as well as their loading on the composites were examined. Grafted KCF is found to be a promising reinforcement to augment the tensile strength, particularly at 10 phr loading and this is evidenced by the adhesion of matrices onto the filler surface in SEM morphology. This is further confirmed by FTIR results whereby grafted KCF formed ester carbonyl groups which are assumed to provide linkage between filler and matrix.Subsequently, the tensile properties of composites with grafted KCF are somehow slightly retained upon exposure to weathering. However, they are still susceptible to degradation due to the presence of monomer and it is verified by FTIR, SEM and weight loss. Lastly, the influences of inorganic mineral filler (halloysite clay) incorporation into the composites at various loadings (3-15 phr) were evaluated. Addition of filler raised the tensile strength up to 12 phr loading. When the filler is loaded beyond 12 phr, the strength tended to decline. Correspondingly, the composites became thermally stable upon inclusion of this silicate fillers. Upon weathering, composite samples with halloysite results a progressive decay in tensile properties compared to the control samples. Similar tendency was obtained from soil burial samples. The severity of deterioration upon degradation was confirmed by the formation of the larger pores and cracks as well as greater weight loss.', 'biodegradability polythylenethermoplastic biocomposites', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2015', 0),
(412, 'Bashiru Kayode Sodipo', 'Ultrasound Assisted Non-Seeded Method On Surface Modification Of Superparamagnetic Iron Oxide Nanoparticles For Magnetic Resonance Imaging Probe', 'In this thesis, a new non-seeded and facile ultrasonic method of incorporating SPION into silica was developed and analysed. Mixture of both SPION and silica nanoparticles synthesized separately by co-precipitation and sol-gel method, respectively was ultrasonically irradiated at different pH ranges between 3 and 5.', 'ultrasound superparamagnetic resonance-imaging', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2015', 0),
(413, 'Tan Inn Shi', 'The Production Of Third-Generation Bioethanol From Eucheuma Cottonii Using Dowex (TM) DR-G8.', 'The red macroalgae, Eucheuma cottonii (EC) is a third-generation biomass, and it contains large amount of carbohydrate that can be readily fermented into bioethanol. Up to now, the use of the liquid acid-catalyst have been reported for the hydrolysis of carbohydrates from various biomass to fermentable sugar. However, the need of easily separable and reusable solid acid catalyst is considered essential in the hydrolysis process. In this study, for the first time, Dowex (TM) Dr-G8 was explored as a potential solid catalyst to hydrolyze carbohydrates from dried raw EC or macroalgae extract (ME) and pretreatment of macroalgae cellulosic residue (MCR), to simple reducing sugar prior to the fermentation process. The reaction condition for hydrolysis of EC (6 % w/v Dowex (TM) Dr-G8, 120 C, 1 h) and ME (8 % w/v Dowex (TM) Dr-G8, 120 C, 1 h) resulted to a galactose yield of 43.2 % and 49.4 %, respectively. This result was slightly lower compared with the feedstock by using ME. However as for MCR, the solid acid catalyst (Dowex (TM) Dr-G8) was used in the pretreatment process to enhance enzymatic conversion of MCR to reducing sugar. Reusability of Dowex (TM) Dr-G8 was also investigated in this study, the galactose yield maintained at around 46.7 % till the fifth run. This shows that Dowex (TM) Dr- G8 was not significantly deactivated even after repeated used. The pretreatment condition for MCR is 10 % (w/v) Dowex (TM)-Dr G8, 120 oC, and 30 min. An optimum sugar yield of 99.8 % was attained when pretreated MCR (P-MCR) was used as substrate for enzymatic hydrolysis after 30 h. Catalyst recyclability study were performed and a sixth-times reuse was accomplished without any loss of catalytic activity. In addition, a novel concept for the synthesis of stable polymer hybrid matrix was developed. In this study, glutaraldehyde crosslinked -carrageenan was used for the immobilization of -glucosidase using the covalent method via polyethyleneimine and glutaraldehyde. The immobilized -glucosidase was then used to hydrolyze PMCR for the production of reducing sugar and a hydrolysis yield of 73.4% was obtained. When a solid acid hydrolysate containing 35 g/L of galactose were fermented with an inoculums amount of 16.0 g/L, an optimum bioethanol production of 11.63 g/L was achieved (64.6 % of the theoretical value) after 72 h. Bioethanol production by PSSF (prehydrolysis and simultaneous saccharification and fermentation) process was observed to be more effective than the SHF (separate hydrolysis and fermentation) process, producing 5.80 mg/mL of bioethanol, with a theoretical yield of 91 %. Scale up of SHF of solid acid hydrolysate was carried out in a 5 L fermenter resulting to 61.6 % of bioethanol yield, while scale up study of PSSF process was carried out in a 5 L fermenter conducted with optimized conditions resulting to 87.1 % of bioethanol yield, which is almost the same as in shaking flasks. This result indicated that the fermentation process using macroalgae biomass could be easily scaled-up to large fermenter without compromising its performance. On the other hand, the estimated bioethanol production cost using macroalgae was 0.77 USD $/L. Compared to other feedstocks, bioethanol production cost from macroalgae are competitive and economically viable. A consequential life cycle assessment (LCA) and exergy analysis of macroalgae-based bioethanol were performed. Results suggested that the purification of bioethanol (S6) is found to have the highest impact in all the impact categories considered. The proposed technology in this study using solid acid catalyst was found feasible for the production of bioethanol from EC.', 'bioethanol eucheuma-cottoni dowex', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) >', '2015', 0),
(414, 'Tham Wei Ling', 'Preparation And Properties Of Poly (Lactic Acid) Halloysite Nanotube Nanocomposites', 'In this research, halloysite nanotube (HNT) was used to improve the properties of poly(lactic acid) (PLA). The PLA/HNT nanocomposites were prepared using melt compounding followed by compression molding. Three types of impact modifiers i.e., maleic anhydride grafted styrene-ethylene/butylene-styrene copolymer (SEBS-g- MA), N,N-ethylenebis(stearamide) (EBS), and epoxidized natural rubber (ENR), were used to toughen the PLA nanocomposites. The properties of PLA/HNT nanocomposites were characterized by mechanical tests (i.e., tensile, flexural, and impact tests), thermal analysis (i.e., differential scanning calorimetry (DSC) and thermogravimetric analysis (TGA)), morphological analysis (i.e., field emission scanning electron microscopy (FESEM) and transmission electron microscopy (TEM)), and Fourier transform infrared spectroscopy (FTIR). The impact strength of PLA/HNT nanocomposites was increased significantly to approximately 300% by the addition of 15 wt% ENR. A finely dispersed HNT could eventually increase its nucleation effect and assist in the crystallization process of PLA whilst in the presence of EBS and ENR. Nevertheless, the presence of SEBS-g-MA and HNT retard the formation of large crystallites of PLA. The kinetics of water absorption of PLA/HNT nanocomposite fitted Fickian diffusion behaviour at immersion temperatures of 30oC and 40oC. For the samples exposed to 50oC, the water uptake followed Fick\'s law during the initial stages, but at longer time periods, deviations and weight loss were observed. This may have been due to the hydrolysis of PLA at higher immersion temperatures, which was confirmed by the pH change, reduction of molecular weight, increase in carbonyl index (CI) values, and thermal property changes. From the TGA results, it was found that single decomposition took place in the nitrogen atmosphere, while a double-stage decomposition process occurred in the oxygen atmosphere. The incorporation of EBS and ENR could improve the thermal stability of PLA/HNT under oxygen atmosphere. The PLA/HNT6/ENR5 nanocomposites exhibited high thermo-oxidative stability under oxygen atmosphere. Furthermore, the addition of 5 wt% of ENR in PLA/HNT6 nanocomposites increased the oxidation onset temperature (OOT) (from 239.5oC to 296.5oC). The PLA/HNT6/ENR5 showed the lowest oxygen permeability coefficient ( O2 P ) value of approximately 1.567x10-4 cm3.m.m-2.day-1.kPa-1. However, the incorporation of SEBS-g-MA could not improve the oxygen gas barrier properties of PLA/HNT nanocomposites. From the UV-Vis spectroscopy analysis, the incorporation of impact modifiers in PLA/HNT nanocomposites decreases light transmittance and nearly no UV light can be transmitted through thin film at 300 nm. Nevertheless, all PLA/HNT nanocomposites remain transparent from visual view. In summary, the addition of ENR in PLA/HNT nanocomposites can effectively improve the properties of polymer nanocomposites in term of impact strength, activation energy of water diffusion (Ea), OOT, and oxygen gas barrier properties among the others impact modifiers.', 'preparation properties lactic-acid', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2015', 0),
(415, 'Tariq Tawfeeq Yousif Alabdullah', 'The Role Of Executive Turnover As A Moderator In Determining Corporate Performance And Financial Leverage In Jordan.', 'In the last few decades, corporate governance has increasingly become a key hurdle to the firms and their performance. In Jordanian context, Amman Stock Exchange (ASE) has made several changes in terms of regulations through issuing corporate governance mechanism in 2009.', 'executive-turnover corporate financial', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2015', 0),
(416, ' Zhwan Dalshad Abdullah', 'The Relationships Between Students Attitudes Towards Information Technology, Computer Self-Efficacy, Self-Esteem And Their Academic Achievements In Koya University', ' The purpose of the study was to investigate factors underlying the attitude towards IT and computer self-efficacy among students, and the relationships between students attitudes towards information technology, the use of PowerPoint by lecturers in class, computer self-efficacy, and self-esteem with their academic achievements. The study approach was carried out via a quantitative method with a survey design. The sample size was selected from the second and fourth year students, consisted of 800 respondents who were randomly selected using proportional stratified random sampling from the Koya University. The survey consists of two sections. Section one contains the respondents demographic information. Section two discusses the attitude towards IT, attitude towards the use of PowerPoint, computer self-efficacy, and self-esteem. The response rate was 85.1 %.', 'students information-technology/computer academic', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2015', 0),
(417, 'Mohamed Sufian Bin Mohd Nawi', 'Ligand Based Drug Discovery Of Novel Dengue-2 NS2B-NS3 Protease Inhibitors', ' The reported dengue cases are increasing yearly, yet no anti-dengue agent is available in the market. Therefore, the search for anti-dengue is critical. In Malaysia, Dengue-2 (DEN-2) is the most prevalent serotype. NS2B-NS3 protease is the enzyme for the cleavage of polyprotein precursor, which is crucial for the flavivirus replications. This makes it a potential target for the development of therapeutics against the dengue virus. In this study, ligand-based approach was implemented in searching for the new potential DEN-2 NS2B-NS3 protease inhibitors. Pharmacophore models were developed from diverse reported structures of DEN-2 NS2B-NS3 protease inhibitors, comprising peptide and non-peptide molecules. The selected pharmacophore models were employed to screen the US National Cancer Institute (NCI) list of compounds to search for new DEN-2 NS2B-NS3 protease inhibitors.', 'ligand dengue inhibitors', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy) ', '2015', 0),
(418, ' Shanmugapriya Perumal', 'Antibacterial Activity Of Euphorbia Hirta (L.): Euphorbiaceae And Isolation Of Its Bioactive Constituents', 'Natural products, especially medicinal plants, remain as a valuable source offering a revolutionary green approach to the discovery of novel antibacterial compounds. Euphorbia hirta (L.) plant is traditionally used in many tropical countries for the treatment of gastrointestinal, bronchial and respiratory ailments caused by nosocomial infectious agents. In this study, various solvent extracts (methanol, ethanol, ethyl acetate, dichloromethane and hexane) of E. hirta were subjected to phytochemical screening to determine total phenolic and flavonoid contents. The potential antibacterial activities of the crude extracts were assessed via in vitro antibacterial test using broth microdilution method against a panel of clinically resistant pathogens and American Type Culture Collection (ATCC) strains. The most bioactive extract, the methanol extract was further purified in a bioactivity-guided fractionation and isolation method using column chromatography, which finally yielded three pure antibacterial compounds.', 'antibacterial euphorbiaceae bioactive', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2015', 0),
(419, 'Salih Hamza Abbas', 'Preparation And Immobilization Of Palladium(ii) And Nickel(ii) Salen Complexes Onto Mcm-41 From Rice Husk For Suzuki-Miyaura And Oxidation Reactions', ' MCM-41 was successfully prepared from rice husk ash (RHA) using cetyltrimethylammonium bromide as a directing agent via sol-gel method at 100 oC. MCM-41 was functionalized with 3-chloropropyltriethoxysilane (CPTES) as a functioning agent and the solid obtained was labeled as Cl-MCM-41.', 'palladium rice-husk oxidation', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2015', 0),
(420, 'Chow Tan Wei', 'Study On The Involvement Of Wif-1 In Oral Carcinogenesis Via Egfr And Wnt Signaling Pathways.', ' WNT inhibitory factor 1 (WIF-1) is a physiological inhibitor in WNT signaling pathway via its WIF domain. The function of EGF-like domain in WIF-1 remains unclear.', 'wif-1 carcinogenesis pathways', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2015', 0),
(421, 'SuduSingha Liyanage Jothirathna Fernando', 'Site Suitability Model For Ecotourism At The Kirala Kele Partial-Nature-Based Wetland Of Southern Sri Lanka.', ' Wetland resources form an integral part of the environment and their management must be pursued in the context of an interaction between conservation and the national development strategies.Sri Lanka has a tremendous partial nature based wetland resources that have a great potential for further development in Southern Asia. In this study a literature based spatial model is developed to explain the potential of a partial-nature-based wetland to be developed as an ecotourism site. Analytic Hierarchy Process (AHP)model is used to analyze the site suitability for ecotourism development of the partial-nature-based wetland. Six integrated criteria; biodiversity, water resources, terrain, land use and land cover, road network and settlements are identified. Several evaluating indicators which are based on literature survey, experts opinions, questionnaire survey from households, and field excursions are used for the preparation of site suitability map for ecotourism development.', 'site ecotourism partial-nature-based-wetland', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2015', 0),
(422, 'Sultan Hamed Hilal Al Ghafri', 'An Analysis Of Technical Writing Needs Of Students In Colleges Of Technology In Oman', ' The overall aim of this study is to analyze the writing needs of students in the Colleges of Technology (CTs) in Oman. Within this broad perception, the study endeavored finding out to what extent the Technical Writing (TW) course materials meet the TW course features and the students writing needs. It also assessed the students writing needs in the CTs in Oman to investigate the gap between the current practice and the best practice. Five groups of participants were approached for the purpose of data collection; students, technical writing teachers, technical departments lecturers, CTs graduates and employers. The students writing needs were analyzed by means of questionnaires, interviews and genre analysis. Data was analyzed quantitatively and qualitatively. The triangulation of sources of information and instruments helped in obtaining a more tangible picture of the students actual writing needs. The study revealed a level of mismatch between the TW course content, delivery and assessment and the students actual writing needs and the TW theory.', 'writing students technology', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2015', 0),
(423, 'Maleerat Ka-Kan-Dee', 'Analyzing Efl Students argumentative Writing Difficulties And Teaching Strategies Employed By Lecturers In Selected Universities In Thailand.', 'The main aim of this study was to identify the argumentative writing difficulties encountered by Thai EFL English major students. This study also investigated the teaching strategies used by two Thai EFL lecturers to develop their students argumentative writing competence. Think aloud protocols (TAP) were used as a tool for analysing argumentative writing difficulties encountered by 16 EFL English major students. A semi structured interview, stimulated recall interviews and classroom observations were used to collect detailed information from two EFL lecturers about the difficulties they encountered in teaching argumentative essays and the teaching strategies they used to help improve their students writing skill. This study draws on the cognitive process theory developed by the Flower and Hayes (1980) in analysing the students writing process while conducting Think aloud protocols.', 'writing teaching lecturers', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2015', 0),
(424, 'Muhammad Rafiq Khan Kakar', 'Effects of adhesion failure on moisture damage of warm mix asphalt containing cecabase additive. ', 'Warm Mix Asphalt (WMA) is a technology that allows significant reduction in mixing and compaction temperatures of conventional hot mix asphalt. It is a cost effective technology that can improve mixture workability, reduces greenhouse gas emissions, and is environmental friendly. However, WMA is susceptible to moisture damage due to its lower production temperature. This can cause adhesion failure, hence stripping of asphalt binder from the aggregates. In this research, Cecabase warm mix additive was used to lower the production temperature and enhance the asphalt binder adhesion properties with aggregate. Two binders, PG-64 and PG-76, were used to prepare the test specimens. As a surfactant and when blended with asphalt binder, Cecabase promotes adhesion at the binder-aggregate interface. Therefore, the overall laboratory test results showed that addition of Cecabase had no significant effects on binder rheology and optimum binder content. A novel approach using image analysis was used to measure the asphalt mixture adhesion failure susceptibility due to moisture damage. The results showed that adhesion failure increased with the number of freeze and thaw cycles and mixtures prepared with PG-76 binder exhibited lower adhesion failure compared to PG-64 binder. To assess the adhesion failure, binder-aggregate substrate direct tensile and pull-off tension tests were carried out. An accelerated laboratory vacuum saturator (ALVS) moisture conditioning was fabricated to condition the binder-aggregate specimens.', 'adhesion mix-asphalt cecabase', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering) ', '2015', 0),
(425, 'Lai Kong Seng', 'Organisational Culture To Support Innovation Creation And Adoption In Malaysian Architectural Firms.', ' The construction industry and innovation play significant roles in strengthening the growth of nations. However, innovation tends to fail at times. In fact, innovation in Malaysias construction industry has been determined to be inadequate. The related literature suggests that innovation comes in two orientations, namely, creation and adoption. However, these orientations have not been differentiated from each other by most innovation studies. Therefore, the recent trend indicates the extensive need to distinguish such orientations in organisational and innovation studies. Architectural firms consist of innovation-oriented and knowledge-intensified organisations, yet they receive less scholarly attention compared with large companies such as housing developers. Therefore, the first objective of the current research is to examine the state of innovation orientations (creation and adoption) in architectural firms. In relation to the backward scenario in the construction industry, organisational culture is recognised as the key for improving innovation.', 'culture innovation architectural', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning) ', '2015', 0),
(426, 'Syed Abidur Rahman', 'Organizational Support To Business Success Among Base Of Pyramid Entrepreneurs: A Case Of Grameenphone Bangladesh Limited', 'The concept of integrating business and socio-economic development has been reflected in the well contentious market-based approach BoP 1.0. However, the BoP 1.0 has been suspected as a way of exploiting poor people as they are being considered as consumer or producer. In this setback, BoP 2.0, came into existence which outlines the business model of entrepreneurship creation that treats BoP people as entrepreneurs and thus ensure the wellbeing of the BoP segment. Therefore, the main objective of this research is to examine the factors that could enhance business success of the BoP entrepreneurs and subsequently analyze its impact on the subjective wellbeing of these BoP entrepreneurs. The study aimed to investigate the role of private organization support i.e. information, technical, and training support that lead to success of the businesses through the entrepreneurial competencies. It also considered the moderating role of government and NGO support. A mixed method approach was applied with a major focus on quantitative data collection and analysis, followed by qualitative approach.', 'organizational business entrepreneurs', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(427, 'Tan Pei Lei ', 'Production Of Bacteriocin Sf By Lactobacillus Gasseri Sf For Use In Dermal Bacterial Infection And Wound Healing', ' Sixteen strains of Lactobacillus and Bifidobacterium were screened based on their growth in reconstituted skimmed milk. However, six strains (B. longum 8643, L. plantarum 8943, L. casei 1268, L. fermentum 8312, L. fermentum 8848, and L. gasseri SF) exhibited significantly higher viability (P< 0.05). Extracellular extracts of these strains contained bioactives at concentrations capable of promoting dermal health. Meanwhile, crude protein fractions fractionated from extracellular extracts of all six strains exhibited significantly higher antagonistic activity on skin pathogens, probably due to the production of putative bacteriocins. Putative bacteriocin produced from L. gasseri SF exhibited significantly higher (P< 0.05) antagonistic activity on Enterococcus faecalis FM 2138, and fitted the characteristics of class II bacteriocin and was thus renamed as bacteriocin SF. Bacteriocin SF was found to be heat-stable, with an apparent molecular mass of 3.5 kDa. Bacteriocin SF at a concentration of 10240 AU/mL significantly reduced (P< 0.05) the negative charge on the cellular surface of E. faecalis FM 2138, subsequently leading to membrane depolarization and pore formation, as visible in electron micrographs.', 'bacteriocin dermal infection/healing', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology) ', '2015', 0),
(428, 'Teow Sin Yeang', 'Cell-Penetrating Antibodies For Targeting Hiv-1 P24 Capsid Protein.', 'The capsid protein plays seminal roles in both early and late stages of the HIV replication cycle. Hence, HIV-1 capsid protein is considered an important target for developing novel drugs to treat HIV/AIDS. Capsid molecule (CA)-targeting peptide inhibitors (CAP-1, CAI and NYAD-1) have been reported to disrupt the capsid protein functions in HIV-infected cells.', 'antibodies hiv capsid-protein', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM)', '2015', 0),
(429, 'Alawiah Binti Ariffin, ', 'Glow Peak Analysis Of Pure And Ge-Doped Silica Flat Fiber At Ultra High Dose Electrons', ' Silica flat fiber (FF) is being proposed as the basis for a novel radiation sensor of the thermoluminescence (TL) produced. The TL performance of the FFs and its respective glow curves were studied using a linear accelerator (LINAC) delivering doses of clinical radiotherapy within the range of 0.2-10.0 Gy. An electron accelerator (Alurtron) was used to deliver the ultra-high dose. The TL dose response, dopant effect, heating rate effect and kinetic parameters of the deconvoluted glow peaks were investigated. The glow curve of FFs shifted to the higher temperature region as the heating rate increases. The kinetic parameters show dependence on the heating rate for both doped and un-doped FFs. It is found that the Burlin Cavity Theory (BCT) fit model can be used to predict the energy response of FF, accurately.', 'glow peak silica', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(430, 'Rodchares Hanrinth', 'Development Of The Comprehensive Community-Based Model For Managing Dementia Patients With Bpsd In A Rural Area In Thailand. ', 'Behavioural and psychological symptoms of dementia (BPSD) are common in dementia patients and one of the causes that burden caregivers. No long-term care facility in rural Thailand creates the needs for the community involvement in managing dementia patients with BPSD.', 'community dementia rural-area', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy) ', '2015', 0),
(431, 'Khamees Khalaf Hasan Al-Jumail', 'Development Of Efficient Multi-Level Discrete Wavelet Transform Hardware Architecture For Image Compression', ' Focusing on the intensive computations involved in the discrete wavelet transform (DWT), the design of efficient hardware architectures for a fast computation of the transform has become imperative, especially for real-time applications.', 'wavelet architecture image-comprehension', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering) ', '2015', 0),
(432, 'Hasan Mugbil Khalaf Abu Al Ese', 'Execution Trace Analysis Using Utility Class Detection And Decoupling In Object-Oriented Software Comprehension', ' Object-oriented software systems are the most used platforms in most today organizations in the world. The maintenance of these systems indeed is becoming an important task in order to assure the software keep updated with changes of the recent workload and technologies. One method to do the maintenance is to trace the executions of the system and yet analyze them which is called execution trace analysis technique. However, object-oriented software has classes and coupling features that make the analysis difficult. The execution traces of current software systems tend to be very large in terms of complexity and size. The classes and coupling features form a very complicated interwoven lattice of the dependencies. This applies particularly to utilities which are inherently more reusable and having very tight coupling. This thesis introduces a new trace analysis technique that simplifies and eases the execution tracing process.', 'trace detection-decoupling software', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2015', 0),
(433, 'Afshin Akhshani', 'Quantum Chaotic Cryptography : A New Approach', ' Since 1990s chaotic dynamical systems have been widely used to design new strategies to encrypt information in analog and digital areas. Recently, many digital chaos-based cryptosystems are proposed and a number of them have been cryptanalyzed.', 'quantum chaotic cryptography ', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(434, 'Abouzed Salah Berrim', 'The Use Of Geographic Names Information System Among Government Officers; A Case Study In Tripoli, Libya', ' Technology has been regarded as a main key of countries developing in economic growth, wealth, prestige and competitiveness. Technology has also recognized to be a decisive tool for advancing the effectiveness and efficiency of government performance. The Geographic Information Systems (GIS) and Geographic Name Information System (GNIS) have been recognized as effective tools to solve the challenges that faced by the government. The main challenges are; to cope with new technology and the lack of technical human resources who can easily cope and adopt with the GNIS technology. This thesis designed to investigate the intention towards the use of the GNIS among government officers in Libya. The main objective of this thesis is to investigate the level of intention to use (GNIS) among government employees of the survey department at Tripoli city Libya, To analyze the relationship between the organizational factors and intention to use GNIS among government officers in Libya,', 'geographic information-system officers', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2015', 0),
(435, 'Abbas Hasan Faris', 'Preparation And Characterization Of Formaldehyde Free Wood Adhesives Lignin Extracted From Oil Palm Empty Fruit Bunch.', ' In this work, environment-friendly lignin/tannin and liquefied OPEFB-based wood adhesives have been studied to prepare formaldehyde-free wood adhesives and to increase the proportion of renewable environmentally friendly materials in these wood adhesive formulations.\r\n\r\n', 'formaldehyde lignin oil-palm', '', 'Pusat Pengajian Sains Kimia (School of Chemistry) ', '2015', 0),
(436, 'Ruhaibah Hassan', 'Ciri-Ciri Psikometrik Malaysian University Selection Inventory (Munsyi) Menggunakan Model Pengukuran Rasch', 'The purpose of this study is to validate the psychometrics characteristics of the Malaysian University Selection Inventory (MUnSyI) as a high-stakes university admission test using the Rasch Measurement Model. The MUnSyI is a new selection process which utilized on well-established psychological and psychometric principles based on Classical Test Theory, was introduced into Universiti Sains Malaysia (USM), in its goal of selecting better qualified and more suitable candidates for entering undergraduate programs. The MUnSyI is a 310-item designed to capture 4 intrinsic qualities i.e., Personality, Career Interest, Integrity and Emotional Quotient. Data were secondary data sources collected by Majlis Peperiksaan Malaysia and USM and analyzed using Winsteps version 3.71.0.1. Research finding revealed that items from the 30 subscales represented a broad range of abilities, with major exception being a lack of items at the lower and upper extremes of the subscales.', 'psikomentrik model-pengukuran-rasch', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2015', 0),
(437, 'Khairol Anuar Bin Ishak', 'Relationship Quality In Franchising : Antecedents And Outcomes.', ' This study attempts to examine empirically two constructs namely relational mechanisms and transactional mechanisms which may influence the relationship quality in franchising relationship. Furthermore, this study examines two main outcomes of relationship quality namely performance and loyalty in franchising relationships.', 'relationship franchising antecedents', '', 'Pusat Pengajian Pengurusan (School of Management) >', '2015', 0),
(438, 'Md. Latiful Islam', ' Breeding And Larvae Rearing Of The Green Mud Crab, Scylla Paramamosain (Estampador 1949) In Captivity.', 'This pioneer study on the captive broodstock breeding of the mud crab (Scylla paramamosain) consisted with a series of experiments. The larvae rearing trial was fed with Artemia umbrella, enriched rotifer and rotifer from Z1 to Z2 stages followed by Artemia nauplii, enriched Artemia nauplii and commercial diet, respectively from Z3 to megalopa. Highest larval stage index (LSI), significantly higher (p<0.05) megalopa and crablet survival was achieved from enriched rotifer followed by enriched Artemia feeding schemes that had the eicosapentaenoic acid (EPA), docosahexaenoic acid (DHA), n-6 to n-3 and EPA to DHA ratios of 17.32%, 3.82%, 0.20 and 0.22, respectively in megalopa for subsequent metamorphosis to crablet. Growth of mud crab displayed the sigmoid pattern for both sexes with significantly higher (p<0.05) weight gain in males.', 'breeding green-mud-crab captivity', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2015', 0),
(439, 'Ejaz Ahmed Mian', 'The Relationship Of Entrepreneurial Orientation And Entrepreneurial Marketing With Performance Of Owner-Managed Small Firms In Karachi, Pakistan.', 'Small firm performance is vital for growth of Pakistans economy and for providing employment to its 180 million people. Unfortunately, like many developing countries, small firms are plagued with multifarious problems. It is important to understand how small firms can be more successful and play a more meaningful role as expected of them.', 'entrepreneurial small firms', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(440, 'Ezzeddin Kamil Bin Mohamed Hashim', 'Classification Of Cpg Island And Promoter Regions Using Rare K-Mer Motifs.', ' Empirical analysis on DNA k-mers is proven to be an effective means to discover functional elements in the human genomes. Among the empirical works, rare k-mer\" (RKM) is a very interesting subject to be studied due to their unique sequence properties.', 'cpg k-mer motifs', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2015', 0),
(441, 'Fadhilah Mohd Zahari', 'Determinants And Consequences Of Green Innovation Adoption: A Study On Iso 14001 Manufacturing Firms In Malaysia.', 'The fact that the sustainability agenda is becoming a central focus globally, Malaysia also is not without exception. Eventually, the countrys aspiration to steer a balance in its development plan and economic growth has triggered the main interest in this research', 'green innovation adoption', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(442, 'Jo Thy Lachumy A/P Subramanion', 'In Vitro And In Vivo Radioprotective Activities Of Polyalthia Longifolia Against Lethal Irradiation.', ' Medicinal plants rich with various phytochemicals with antioxidant properties could serve as an alternative radioprotective agent. The current study was designed to evaluate the P. longifolia leaf extract as a potential radioprotector.', 'radioprotective polyalthia irradiation', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM) ', '2015', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(443, 'Samina Khan Yusuf Zai', 'Synthesis, Characterization And Microbial Activity Of New Thiazole, Thiazolidinone, Thiadiazole And Phenylacrylohydrazide Substituted Coumarin Derivatives.', ' Thiazoles, thiazolidinones, thiadiazoles, phenylacrylohydrazides and coumarins, are few of the very important classes of heterocyclic compounds having great medicinal and pharmacological importance. In the present study, six series of 67 new biologically active coumarin derived compounds have been synthesized by substituting thiazole, thiazolidinone, thiadiazole and phenylacrylohydrazide units into the coumarin core, in order to increase their use as important therapeutic agents. The structures of all the new compounds were characterized by spectroscopic techniques such as, IR, 1D NMR (1H and 13C) and CHN analysis together with LCMS. The structures of the selective compounds from each series were further confirmed by 2D NMR (COSY, HMQC and HMBC) spectroscopic techniques. In addition to this X-Ray diffraction analysis was used to confirm, the structures for those compounds obtained as single crystals. The structures of all the synthesized starting materials were confirmed by the comparison of their spectroscopic data with those already reported in literature. Melting point measurements was done for all the synthesized compounds, in order to check their purity.', 'synthesis microbial coumarin', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2015', 0),
(444, 'Ekele Alih', 'Cluster-Based Estimators For Multiple And Multivariate Linear Regression Models', ' In the field of linear regression modelling, the classical least squares (LS) regression is susceptible to a single outlier whereas low-breakdown regression estimators like M regression and bounded influence regression are able to resist the influence of a small percentage of outliers. High-breakdown estimators like the least trimmed squares (LTS) and MM regression estimators are resistant to as much as 50% of data contamination. The problems with these estimation procedures include enormous computational demands and subsampling variability, severe coefficient susceptibility to very small variability in initial values, internal deviation from the general trend and capabilities in clean data and in low breakdown situations. This study proposes a new high breakdown regression estimator that addresses these problems in multiple regression and multivariate regression models as well as providing insightful information about the presence and structure of multivariate outliers.', 'estimator regression models', '', 'Pusat Pengajian Sains Matematik (School of Mathematical Sciences)', '2015', 0),
(445, ' Muhammad Najib Bin Abdul Hamid, ', 'Analysis of Drum Brake Squeal. ', 'The operational deflection shapes were used to identify the mode of vibration for the brake shoes in drum brake squeal. The measurement of the operational deflection shapes of the brake shoes during drum brake squeal, which was in the torsional mode, was similar to that of the modes obtained from the experimental modal analysis of the brake shoe under the in-contact static condition. A two-degree-of-freedom model was developed on the basis of the experimental modal analysis data within the limited bandwidth of the squeal frequency of 1850 Hz. In this work, the operational deflection shape was used for determination of a structural dynamic modification to be carried out on the brake shoes in order to maximize the damping of the torsional mode as a way to improve the stability of the system. The lumped parameter model was then used to assess the effect of the structural dynamic modification on the squeal based on the transient analysis, which showed a similar trend and can assist brake designers in evaluating the critical parameter to obtain a squeal-free drum brake design. The drum brake squeal was further analysed using finite element method. The second part of this study was the dynamic instability of a drum brake system, which consists of a rotating drum and two immobile brake shoes which took into consideration the rotation effect on the complex eigenvalue. The Coriolis force and the centrifugal load represented the effect of the rotation of the drum. The results indicated an unstable mode at 1658 Hz, which is equivalent to the measured frequency of the drum brake squeal. As the speed was increased, the positive real part of the complex eigenvalue Re() decreased and became negative at speeds beyond 600 rpm.', 'drum brake squeal', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering', '2015', 0),
(446, 'Ang Boon Sin ', 'A Study Of Knowledge Creation In Six Sigma Dmaic Project Success And Its Impact On Organizational Performance', ' There are number of empirical researches that are studying the relationship of Six Sigma and organizational performance. However, most of them are focusing on direct relationship of Six Sigma and organizational performance. There is no detail investigation how Six Sigma can lead to the improved organizational performance. This research suggests that by integrating organizational knowledge creation processes the link between Six Sigma and organizational performance can be explained and developed. This study investigates the existence of a relationship between organizational knowledge creation processes in Six Sigma DMAIC project, knowledge, Six Sigma project success and organizational performance', 'study six-sigma organizational', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2015', 0),
(447, 'Tahir Mehmood Khan', 'Effectiveness And Tolerability Of Pregabalin Usage Among Patients In King Fahad Hospital, Saudi Arabia: A Quasi Longitudinal Study', ' A quasi, non-randomized longitudinal study was conducted to assess the effectiveness of 75mg pregabalin post hemodialysis (pHD) once daily orally in treatment-resistant uremic pruritus (UP), and the safety and tolerability among ESRD patients at Aljaber kidney center, King Fahad Hospital, Alahsa Saudi Arabia. Assessment for the severity and intensity of itching was done using the validated Arabic version of 5D- itching scale (= 0.847, p=0.001, Kaiser- Meyer-Oklin value= 0.810). Safety and tolerability of pregabalin was done by using Naranjos algorithm. The effect of the pregabalin over the time was assessed using the generalized linear model. Furthermore, to pinpoint the differences in the effect of pregabalin at different time intervals, generalized estimated equations were used. Finally for the assessment of the association among demographics and UP severity, Monte Carlo simulations were preferred.', 'pegabalin patients hospital', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2015', 0),
(448, 'Ommi Kalsom Mardziah Binti Yahaya', 'Characterization Of Sala Mango Quality Attributes Via Visible And Near Infrared Spectroscopy Techniques', ' Fruits growers and local agriculture authorities in general have increasingly realized the importance of acquiring fruits with high quality in order to satisfy the market demands, specifically the consumers. Therefore, quality evaluations of fresh fruits using optical technique through spectroscopy measurement have been developed to non-destructively assess and measure internal quality attributes of Sala mangoes. In this research, several approaches with different technique of measurements (i.e. reflectance and interactance) have been performed and their competences were compared using Jaz, QE 65000 and FieldSpec 3 spectrometers via visible and near infrared spectral as well as visible monochromatic measurement systems for measurement of firmness, soluble solid content (SSC) and acidity (pH). Judging from the prediction performance, MSC was found to be the best preprocessing technique prior to multiple linear regression (MLR) for firmness measurement using QE 65000 spectrometer via reflectance mode with a coefficient of determination (R2) and root mean square error of prediction (RMSEP) at 0.857 and 1.005 kgf , respectively. For soluble solids content (SSC), SNV was found to be the best pre-processing technique with R2 = 0.882 and RMSEP = 0.783Brix through measurement using QE 65000 spectrometer via interactance mode.', 'mango attributes spectroscopy', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(449, 'Jimoh Kayode Adewole ', 'High Pressure Co2 Separation Using Membranes Membrane Selection and Process Modeling', 'Separation of CO2 from natural gas (NG) has attracted research interest due to increasing demand for energy and the need for more energy efficient and environmental friendly gas purification techniques. Most of the NG is coproduced with CO2 which need to be removed in order to increase its calorific value. Membrane separation is one of the widely used technologies for CO2 removal. However, its market share is still very small as compared to other gas separation processes. This is due to the use of membrane materials with poor separation performance and the use of non-optimum module operating conditions. Systematic optimization of every stage of membrane preparation and high pressure module operation was proposed to solve this problem. One major challenge of high pressure operation is penetrant-induced plasticization phenomenon which is caused by increasing the feed pressure. Commercial polysulfone polymer was modified to optimize its separation performance. High pressure experimental studies and mathematical modeling were performed to evaluate the separation performance of the membrane. To establish the highest possible feed pressure which can be attained during CO2 removal without plasticization, transport properties of the membrane were evaluated using permeation tests at pressure up to 57 bar. Also, dynamic evaluation of membrane performance was performed using timedependent permeation experiments over a period ranging from 5 hours to 1080 hours (45 days) at various pressures between 6 and 57 bar. Mathematical model was developed based on the theory of dual-sorption and the total immobilization models. The optimization for membrane selection was achieved using a multi-objective optimization method while that of module operating conditions was achieved using non-linear programming constraint optimization model and a Golden search algorithm which was implemented using MATLAB. The plasticization pressure of the prepared membrane is 41.07 bar while the permeability and selectivity at this pressure are 5.99 Barrer, and 44.19 respectively. This is equivalent to a 17.65% and 66.39% increase in plasticization pressure and permeability, respectively. However, the membrane lost about 79.65% of its permeability at this pressure while its selectivity increased by 91.13% as compared to the value at 5 bar. The timedependent permeability tests revealed plasticization pressure as possible equilibrium point which can be used as constraint during membrane gas separation process optimization. The mathematical model developed showed an excellent predictive capability for plasticization pressure. It was also shown that membrane materials selection can be efficiently optimized using the multi  objective optimization approach.', 'co2 membranes process', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2015', 0),
(450, 'Mohamed Ibrahim Nor', 'The Volatility Of Somalias Unregulated Exchange Rates', ' Historically, the monetary system of Somalia was stable and its national currency (Somali Shilling) had very strong value but Somali shilling started to depreciate after 1980s and its value reached to a very low level. Somalias central government collapsed in 1990 following three decades of stability. Following the collapse of the government, the national currency continued to circulate without sovereign support and the countrys FX market has been operating without regulation. Though Somali people have been using this FX market, the market is criticized of not having the basic foundations of an FX market. During this period, the value of the Shilling experienced unpredictable volatility in particular in 1997, 2001, 2008, and 2011.', 'volatility exchange rates', '', 'Pusat Pengajian Pengurusan (School of Management) >', '2015', 0),
(451, 'Mohammed Ali Alzahrani', 'The Patterns Of Family Upbringing And Its Influence On Behavioral Deviations And Academic Achievement Among Talented Students In Jeddah, Saudi Arabia.', ' This study aims to identify the influence of family upbringing patterns used by the parents (father and mother) on deviant behavior and academic achievement of children ages 13 to 15 years old in Jeddah, Saudi Arabia. A total of 98 talented students and their parents from Jeddah were purposively selected. Data obtained from the sample comprised demographic variables and ratings from a scale of the family upbringing patterns. The patterns are composed of democracy-authoritarian and excessive protection and negligence. The Burks Behavior Rating Scale (BBRS) was used to measure the nature of the behavioral deviations. Harold F Burks developed the BBRS, which consists of seven deviant behaviors, namely, withdrawal, dependability, inability to control actions, inability to control anger, excessive aggression, stubbornness and resistance, and lack of social obedience.', 'family behavioral academic ', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2015', 0),
(452, 'Ahmed A. A. Abusnaina', ' Adapting and enhancing mussels wandering optimization algorithm for supervised training of neural networks', ' Developing efficient training method for Neural Networks (NN) in terms of high accuracy is a challenge. In addition, training NN is still highly-time consuming. The Mussels Wandering Optimization (MWO) is a recent metaheuristic optimization algorithm inspired ecologically by mussels movement behavior. The major objective of this thesis is to achieve better performance in terms of convergence training time and classification accuracy for pattern classification by proposing new supervised training methods for Artificial Neural Networks (ANN) based on the MWO algorithm. Increasing the performance, especially in terms of classification accuracy led to an adapted version of the MWO; known as Enhanced-MWO (E-MWO) algorithm.', 'mussels algorithm neural-networks', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2015', 0),
(453, 'Ali Fareed Jameel Al-Jassar', 'Numerical And Approximate- Analytical Solution Of Fuzzy Initial Value Problems.', ' Fuzzy differential equations (FDEs) are used for the modeling of some problems in science and engineering and have been studied by many researchers. Certain problems require the solution of FDEs which satisfy fuzzy initial conditions giving rise to fuzzy initial problems (FIVPs). Examples of such problems can be found in physics, engineering, population models, nuclear reactor dynamics, medical problems, neural networks and control theory. However, most fuzzy initial value problems cannot be solved exactly. Furthermore, exact analytical solutions obtained may also be so difficult to evaluate and therefore numerical and approximate- analytical methods may be necessary to evaluate the solution.', 'numerical analytical problems', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '2015', 0),
(454, 'Ishola Kehinde Saheed', 'Development Of Unified Integrated Model To Characterize Geophysical Data Using Image Processing Technique.', ' Conducting geophysical surveys using electrical resistivity imaging where different electrode array configurations are used or multiple geophysical techniques are employed in order to obtain comprehensive information about the layered Earth model.', 'integrated geophysical image-processing', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(455, 'Tan Kok Chooi', 'Regression Analysis Of Column Ozone And Selected Atmospheric Parameters In Peninsular Malaysia From Sciamachy Data', ' Ozone (O3) is unique among pollutants because it is not emitted directly into the air, and its results from complex chemical reactions in the atmosphere. O3 can bring different effects for all the living on earth (either harm or protect), depending on where O3 resides. This is the main reason why O3 is such a serious environmental problem that is difficult to control and predict.', 'regression atmospheric sciamachy-data', '', 'Pusat Pengajian Sains Fizik (School of Physics)', '2015', 0),
(456, 'Wong  Yee Shian ', 'Production Of Biogas And Fatty Acids Phase Behaviour From Palm Oil Mill Effluent Via Thermophilic And Mesophilic Anaerobic Suspended Growth Degradation Process.', 'The anaerobic degradation of palm oil mill effluent (POME) was carried out under thermophilic (550C) and mesophilic (350C) temperature in anaerobic suspended growth closed bioreactors (ASGCB). The termophilic and mesophilic ASGCB were operated by a series of continuous experiments using feed flow-rates of 0.58, 0.70, 0.88, 1.17 and 1.75 liters of raw POME wastewater per day, which correspond to hydraulic retention time (HRT) of 24, 20, 16, 12 and 8 days.', 'biogas palm-oil degradation', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2015', 0),
(457, 'Yuni Nustini ', 'Determinants Of The Enterprise Resource Planning (Erp) Systems Post-Implementation Benefits In Indonesia: The Moderating Role Of Systems Customization And User Resistance', 'Investment in ERP systems worldwide has been growing steadily including Indonesia. ERP systems solution has shown to offer considerable benefits to adopting organizations. Issues related to the lack of understanding about factors that determine the success of ERP Post Implementation benefits, as well as the benefits gained have not been extensively studied in Indonesia.', 'enterprise planning implementation', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(458, 'Azhar Jasim Ali', 'Fragmentation As Gender Trap: A Feminist Reading Of Selected Dramas By Henrik Ibsen And George Bernard Shaw.', 'Henrik Ibsen dan George Bernard Shaw sering dianggap sebagai individu yang memperjuangkan hak wanita Henrik Ibsen and George Bernard Shaw have often been regarded as advocates of womens rights.', 'fragmentation feminist dramas', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) ', '2015', 0),
(459, 'Anderes Gui', 'Determinant Of Information Technology Project Success: The Mediating Effect Of Information Technology Governance In Banking Industry In Indonesia.', 'Information technology (IT) projects are considered successful if they are able to be completed within the stipulated time, meet the specified scope, do not exceed budget allocated, meet quality specified, and meet users expectation. There are five objectives of this study and they are to examine whether Internal Audit Quality and Board of Director Quality will have an influence on IT Project Success; whether Internal Audit Quality and Board of Director Quality will influence Information Technology Governance; whether IT Governance will lead to IT Project Success and whether IT Governance mediates the relationship between Internal Audit Quality and Board of Director Quality to IT Project Success.', 'information technology banking', '', 'Pusat Pengajian Pengurusan (School of Management)', '2015', 0),
(460, 'Kew Sook Ling', 'Immobilized Biomass In Polymeric Gels For The Bioregeneration Of Granular Activated Carbon Loaded With Isomeric Cresol Compounds.', 'Adsorption method using activated carbon as the adsorbent has been widely used for the removal of phenolic compounds from wastewater. As the adsorption capacity of the adsorbent will diminish with prolonged application, regeneration of the spent adsorbent is a good option to reduce wastes and conserve resources.', 'biomass bioregeneration isomeric', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2015', 0),
(461, 'Rohit Kumar', 'Generic Medicines: Assessment Of The Knowledge And Perceptions Of Medical Specialists And General Practitioners In Malaysia', ' In recent years, pharmaceutical expenditure has grown faster than many of the other components of healthcare spending. Globally, pressure to manage pharmaceutical spending has led governments and non-governmental health organizations to promote the use of generic drugs. In 2012, Malaysias out-of-pocket (OOP) expenditure on healthcare was 79% of private sector spending and it was twice the high income countries out-of-pocket payments (OOPPs), which average at 37% of private sector expenses. To bring down the OOPPs and reduce financial burden on patients in private healthcare sector, it is highly recommended to promote the use of generics.', 'medicines specialist practitioners', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2015', 0),
(462, ' Mohd Suhardi Bin Mat Jusoh', 'Pelaksanaan Program Tarbiah Dalam Kalangan Pelajar Asrama Sekolah Menengah Kebangsaan Agama ( Smka ) Pulau Pinang.', 'The tarbiah programmes implemented at the hostels of religious secondary schools in Penang basically have the objective of shaping the character and personality of students. Despite the fact that the programmes have long been implemented, it appears that they have not been able to achieve their fundamental objectives.', 'program tarbiah pelajar-asrama', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2015', 0),
(463, 'Elmoiz Marghni Mkawi Mrzog', 'Cu2ZnSnS4 (CZTS) Thin Film Grown By Electrochemical Deposition For Solar Cell', ' Cu2ZnSnS4 (CZTS) quaternary compounds have attracted much attention in the last few years as an abundant new low-cost and non-toxic material with desirable properties for thin film photovoltaic (PV) applications. In this thesis, a cost-effective solution processing method is developed for the fabrication of CZTS thin film absorbers by electrochemical deposition of Cu, Zn, and Sn precursors on molybdenum (Mo)-coated soda-lime glass (SLG) substrate, followed by a heat treatment in sulfur atmosphere. The effects of varying the electrochemical deposition parameters on the properties and growth of the CZTS thin films were investigated. The influence of the triangle wave pulse on the properties of the CZTS thin films improves the structural and morphological properties of samples by increasing the opportunities for different elements to come into contact.', 'Cu2ZnSnS4 electrochemical solar-cell', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2015', 0),
(464, 'Ooi Guat See', 'Community Pharmacy Services In Malaysia : Perspectives From General Practitioners, Community Pharmacy Practitioners, Consumers And Health Policy Stakeholders. ', 'Roles of community pharmacists (CPs) have evolved in many parts of the world. In developing countries such as Malaysia, little is known about the CPs role in the broader context of the healthcare system.', 'community pharmacy perspectives', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy) ', '2015', 0),
(465, 'Ranjan Roy', 'Modelling And Policy Integration Of Sustainable Rice Farming Systems In Bangladesh', 'Realizing the state of food insecurity and agricultural pollution in the world, rice farming has emerged as a crucial concern of socio-economic development. Rice is the staple food for more than one-half of the worlds population and rice farming provides the single largest source of the livelihood for rural Asians.', 'integration rice farming', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2015', 0),
(466, 'Nurdalila Binti Saji', 'Factors Influencing The Modification Of The Single Storey Terraced House Design In Melaka Tengah.', 'Terraced house modification has been a trend in recent years. It has been done excessively either with or without consent from the local authorities. However, there are no proper steps taken to overcome this problem. The reason is that terraced house modification has become a necessity for the resident to cater for the growing number of household. Therefore, a research is done in studying the level of modification and the households preference in terms of residents personality, tastes, interest, lifestyle, values and social status.', 'influencing modification terraced-house', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning) ', '2015', 0),
(467, 'Dede Kuswanda Sartawa', 'Pengurangan Risiko Bencana Tanah Runtuh Berasaskan Penyertaan Komuniti Di Desa Mekarwangi, Kecamatan Lembang, Bandung Barat, Indonesia', 'Kajian Pengurangan Risiko Bencana Tanah Runtuh Berasaskan Penyertaan Komuniti di Desa Mekarwangi Kecamatan Lembang Kabupaten Bandung Barat Indonesia ini bertujuan untuk memperoleh gambaran menyeluruh berkaitan risiko (risk) bencana tanah runtuh yang meliputi ancaman, pendedahan dan kemampuan komuniti dalam penanganan bencana.', 'risiko tanah-runtuh komuniti', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(468, ' Mohd Naeim Bin Ajis ', 'Pembuatan Dan Pentadbiran Dasar Pekerja Asing Di Malaysia.', 'Kemasukan pendatang asing khususnya pekerja asing ke Malaysia telah menyebabkan pelbagai dasar dibentuk oleh kerajaan untuk mengawalnya tetapi ia dilihat masih kurang berkesan bagi menangani masalah migrasi terutama isu kebanjiran PATI. The inflow of foreign workers into Malaysia has caused the formation of various policies to control this situation. However, they are still seen as ineffective in managing the problem of migration particularly the overflow of illegal immigrants.', 'dasar pekerja asing', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(469, 'Eleonora Emkic', 'From Segregation To Sustainable Positive Peace Through Reconciliation And A Sustainable Education System In Bosnia And Herzegovina', 'Nineteenth years after the war, Bosnia and Herzegovina (BiH) is still facing a problem of weak national identity and ethnic and religious divisions that are further preventing the country from reaching sustainable peace and development. The educational system is divided too. By tracing the roots of these problems, this study tries to answer research questions about challenges that BiH has been facing on its way to peace transformation; about relation between current educational system and development of sustainable peace in BiH; as well as to answer how to achieve positive and sustainable peace in BiH through peace education. The data collection included secondary data analysis and semistructured in-depth interview with stakeholders in BiH', 'positive-peace reconciliation education', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(470, 'Che Norlia Bt Hassan', '  An Evaluation Of Soft Skills Development Of A Degree Programme In A Public Higher Education Institution.', 'Tujuan kajian ini adalah untuk menilai program ijazah Sarjana Muda (program AB) dari satu fakulti di sebuah universiti awam (Universiti AA) di Malaysia, dalam membangunkan kemahiran insaniah dengan menggunakan model penilaian Tyler. The purpose of this study is to evaluate a Bachelors degree (AB programme) from a faculty in AA University, one of the public universities in Malaysia, in developing soft skills utilizing Tylers evaluation model.', 'soft-skills degree programme', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2015', 0),
(471, 'Shabnam Khosravihaftkhany', 'Ultrasound-Assisted Biosorption Process For The Removal Of Lead And Iron On Landfill Leachate Using Pretreated Oil Palm Biomass', ' Four oil palm-based biomasses which were oil palm frond (OPF), oil palm bark (OPB), oil palm leave (OPL) and empty fruit bunch (EFB) were examined in batch mode for removal of Pb (II) and Fe (III) from 3 different aqueous solutions (2 single metal solution and bimetal). The experiments were done in certain ranges of variables: pH (2-12), biosorbent size (200 m-1400 m), dosage (0.25 g/L-1.75 g/L) and contact time (5 min-80 min). Oil palm bark (OPB) showed the highest adsorption efficiency of 80 % and 78 % for lead and iron in bimetal solution, respectively, and 79 % for lead solution and 77 % for iron solution, because OPB had the higher surface area and pore volume in compare with other biosorbents.', 'ultrasound removal pretreated', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology', '2015', 0),
(472, 'Li Lijuan ', 'Effects Of Metacognitive Scaffolding On Reading Strategy Use And Reading Performance Of Chinese Efl Tertiary Students.', 'Being particularly important among the four language skills, reading has always received special attention in the EFL teaching and learning situations. In China, the EFL reading instruction has always been given primary prominence.', 'metacognitive reading students', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) >', '2015', 0),
(473, ' Amin Maghsoudi', 'Inter-Organizational Factors, Coordination Mechanism Initiatives, And Performance: Study Of Humanitarian Supply Chains', 'As a result of the dramatic increase in natural and man-made disaster losses, humanitarian practitioners and academicians are seeking effective and efficient means of minimizing the tremendous losses. Although various theoretical underpinnings are beneficial to understand the importance of supply chain in a humanitarian context, the management of coordination mechanism along the humanitarian supply chain has yet to be explored', 'inter-organizational mechanism humanitarian', '', 'Pusat Pengajian Pengurusan (School of Management', '2015', 0),
(474, 'Sarab Kadir Mugair', 'A Stylistic Study Of Conversion In William Shakespeares Julius Caesar And The Rape Of Lucrece.', 'Penyelidikan ini merupakan suatu usaha untuk menganalisis stailistik daripada bahasa sastera yang digunakan oleh William Shakespeare dalam Julius Caesar dan The Rape of Lucrece. The present research is an attempt to conduct a stylistic analysis of William Shakespeares selected literary language in Julius Caesar and The Rape of Lucrece. The focus is on examining the concept of conversion which provides idiosyncrasy to his writings.', 'conversion william shakespeare', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation)', '2015', 0),
(475, 'Amalorpavamary Vairappan', 'Using Kce Questioning Model In Eliciting Critical Responses In The Literature Classroom.', 'Kebolehan guru-guru dalam kaedah penyoalan untuk menggalakkan pemikiran maklumbalas kritis di dalam bidang pendidikan merupakan satu cabaran. Teachers ability in questioning to promote critical responses in the field of education is a challenge.', 'questioning critical literature', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2015', 0),
(476, 'Chang Ching Ching ', 'Phosphorylation And Regulation Of Human Choline Kinase Beta By Protein Kinase A', ' Choline kinase (CK) is the first enzyme involved in CDP-choline pathway for the biosynthesis of phosphatidylcholine, the major component of membrane phospholipid. CK exists as three isoforms, which are CK1, CK2 and CK. The regulation of these enzymes is physiologically important. Metabolic alterations of CK are associated with tumorigenesis, while mutation or deletion of chk gene leads to the development of muscular dystrophy.', 'phosphorylation human kinase a', '', 'Pusat Pengajian Sains Kesihatan (School of Health Sciences) ', '2015', 0),
(477, 'Mohammad Aktaruzzaman Khan', ' Socio-Economic And Training Programmes Towards The Socioeconomic Development Of Ngo Beneficiaries In Bangladesh', 'Pertumbuhan yang besar dan pesat dalam kalangan NGO di Bangladesh memberi cabaran khusus terhadap falsafah pembangunan, terutama dalam pembangunan sosioekonomi (SED). Walaupun usaha pembangunan yang dijalankan oleh NGO tempatan dan antarabangsa menunjukkan tumpuan yang berkesan, namun secara praktikal ia tidak disokong dalam beberapa hasil penyelidikan. The huge and rapid growth of NGOs in Bangladesh imposes specific challenges on the development philosophy, especially, in the socio-economic development (SED). The development endeavours, by the local and international NGOs, though seemingly focused effective, in practical not supported rather contested in some of the research findings', 'socio-economic proggrammes ngo ', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2015', 0),
(478, 'Amri Bin Mohamad', 'Information Technology Investment And Manufacturing Firm Performance: The Moderating Effect Of Decentralized Decision Making. ', 'Tesis ini membentangkan kajian empirikal berkaitan dengan pengukuran prestasi pelbagai dimensi di dalam syarikat-syarikat pembuatan barangan elektrik dan elektronik di Malaysia. This research was carried out mainly to find out the results on the relationship between IT investment and multidimensional performance measurement in the electrical and electronic manufacturing setting in Malaysia.', 'information technology decentralized', '', 'Pusat Pengajian Pengurusan (School of Management) ', '2015', 0),
(479, 'Hafizul Othman', 'Profiling Ict Academics At Malaysian Research Universities (Rus) On Their Commercialization Approaches Based On Personal Attributes: A Grounded Theory Study. ', 'Penglibatan dan pilihan dalam keusahawanan oleh ahli akademik amat jarang dilihat dari perspektif ahli akademik ataupun keupayaan individu akademik itu sendiri. Malah, pihak universiti amat kekurangan budaya pengkomersialan yang efektif. Oleh itu, kajian ini bertujuan untuk mendalami perspektif peringkat mikro bagaimana ahli akademik memilih kaedah-kaedah pengkomersialan dan mencadangkan satu pemahaman yang unik terhadap mereka. Projek kajian ini mengadaptasikan kaedah teori asas dengan kepelbagaian kes di lima buah universiti penyelidikan yang terdapat di Malaysia. The academics entrepreneurial involvement and decisions are rarely made from the perspective of the academics or even through the individuals capabilities. In fact, universities are found to be lacking the effective nurturing culture for commercialization. Therefore, this research aims to explore the micro level perspective of how academics choose their commercialization approaches and propose a unique window of understanding the academics.', 'ict commercialization attributes', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences) >', '2015', 0),
(480, ' Kasthuri A/P Veratharaju', ' Secondary School English Language Teachers Professional Development Needs, Expectations And Practices In Malaysia', 'Keperluan pembangunan profesional yang tidak memuaskan, jangkaan yang tidak ditepati dan amalan pembangunan profesional yang tidak mencukupi menjadi halangan kepada guru Bahasa Inggeris (BI) untuk ikut serta dan berjaya dalam pembangunan profesional BI (2007-2009). Unsatisfied professional development needs, unfulfilled expectations and insufficient professional development practices became the stumbling blocks for the English Language (EL) teachers to successfully participate in EL professional development (2007-2009).', 'english development practices', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2015', 0),
(481, 'Norrimi Rosaida Awang', 'Assessment Of Fluctuational And Critical Transformational Behaviour Of Ground Level Ozone.', 'Ground level ozone (O3) is a noxious air pollutant that imposed adverse effects to human health, crop yield and the environment. Hence, it is important to understand their fluctuation and transformation characteristics in Malaysia in order to design abatement and control strategies properly. Therefore, this study aimed at investigating the characteristics of O3 fluctuation and transformation from its precursors as well as to introduce the critical conversion point (CCP) of O3 formation in 18 monitoring stations across Malaysia from 1999 to 2010. The next hour O3 prediction models during daily, daytime, nighttime and critical conversion time were also developed using multiple linear regression (MLR) and principal components regression (PCR) to predict O3 concentrations in different groups of monitoring stations. Groups of monitoring stations were based on the Department of Environment, Malaysia in terms of classification and newly developed groups using ranking of means and cluster analysis. Although majority of the recorded data was below 100 ppb, total of 1,995 hour of exceedances have been recorded, with Shah Alam contributed 885 hour or 44.5%. O3 diurnal cycles suggested a uni-modal peak between 12 p.m. to 4 p.m., while minimum concentrations were consistently measured at 8 a.m.. Results of PCA showed the contributions to O3 variation by NO2, NO, temperature and UVB up to 80%, whereas the composite diurnal plots confirmed that variation is highly influenced by NO2 and NO concentrations. The CCP of O3 formation were identified to occur between 8 a.m. to 11 a.m.. The MLR model based on cluster group during daily exhibited optimal performance in terms of coefficient of determination, prediction accuracy, and index of agreement with values of 0.9351, 0.9671 and 0.9831,respectively.', 'fluctuational transformational ozone', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2015', 0),
(482, 'Mohd Sharizal Bin Abdul Aziz', 'Study Of Wave Soldering Using Thermal-Fluid Structure Interaction Technique On Pin Through Hole In Printed Circuit Board', 'Wave soldering is one of the most familiar and well-established processes in the electronics assembly industry, which is used to assemble the pin-through hole (PTH) component onto the printed circuit board (PCB). The solder joint defects such as cracks, void formation, and incomplete filling of the PCB hole may weaken the PTH solder joint. In the present research, the PTH vertical fill was carried out experimentally by using a newly developed adjustable fountain wave soldering machine (0 conveyor angle). A similar PCB and components were assembled by using a conventional wave soldering machine (6 conveyor angle). A non-destructive X-ray computed tomographyscanning machine was employed to inspect the vertical fill of each solder joint. On the other hand, the wave soldering process considering thermal-FSI phenomenon was the focus on this research. The thermal-FSI simulation was carried out by using finite volume (FLUENT) and finite element (ABAQUS) based software through the real time coupling technique using Mesh-based parallel Code Coupling Interface (MpCCI) software. It was found that the adjustable fountain wave soldering yielded higher vertical fill (~99.4%) than the conventional wave soldering machine (~90.8%). Apart from that, the simulations were broadening to the parametric studies on various process and design factors such as conveyor angle and PTH geometry (i.e. offset position, shape, diameter,offset angle). The influences of these parameters on the fluid flow distribution, structural displacement, pressure distribution, and stress have been highlighted. Moreover the optimization of PTH connector in the wave soldering process using response surface methodology (RSM) was handled to study the interactive relationship between independent variables to the responses. The optimum geometrical and process parameters for the PCB and PTH connector were characterized by 0.12 mm of PTH offset position, 0.17 mm of PTH diameter, 0o of offset angle and 473.15 K of molten solder temperature. Finally the case study on the effects of PCB configuration during wave soldering was investigated. Five PCB configurations were considered based on the position of the components. Results show that PCB component configurations significantly influence the PCB and yield unfavorable deformation and stress. The research findings are expected to be significant contributions in for the microelectronic industry', 'wave-soldering circuit board', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering', '2015', 0),
(483, ' Mohd Dinie Muhaimin Bin Samsudin', ' Stochastic Modelling Of Bioethanol Fermentation By Saccharomyces Cerevisiae Grown In Oil Palm Residues', 'In oil palm industry, large quantity of oil palm trunk (OPT) and palm oil mill effluent (POME) are generated. These residues are not fully utilised, in fact, they serve as wastes leading to serious environmental pollution. In this study, it was found that OPT sap contained high glucose concentration (49.08  49.16 g/L), and POME contained all essential nutrients required by microorganisms. Therefore, OPT sap was used as carbon source, while POME was utilized as nutrient supplier for fermentation process to produce bioethanol by Saccharomyces cerevisiae. Process optimization in shake flasks culture using one-factor-at-a-time (OFAT) method produced bioethanol yield of 0.428 g/g. Response surface methodology (RSM) via face centered central composite design (FCCCD) optimization was also conducted. The highest bioethanol yield was achieved (0.453 g/g) at OPT sap to POME ratio of 63:37, inoculum size 4.3% (v/v), initial pH 8.0, and incubation time 118 hours. Optimization was then carried out in a 2.5 L stirred tank bioreactor. The highest bioethanol yield (0.481 g/g) was attained at 33C, pH 7.0, and agitated at 0.4 m/s impeller tip speed. However, this result might differ if it is to be reduplicated due to heterogeneity of OPT sap and POME as well as variability in Bakers yeasts performance. Therefore, a predictability test was carried out using Monte Carlo algorithm. Results showed that consistence bioethanol yield with this study could be expected if the fluctuation of kinetic model parameters is 2.5% or below. Variability beyond 2.5% could result in high variation of bioethanol yield with relative standard deviation of higher than 5.0%. Therefore, sensitivity analysis was then carried out in order to evaluate the influence of each kinetic model parameter on bioethanol yield. It showed that bioethanol yield highly dependent on the changes of biosolid which represented the yeast growth. Therefore, in order to maximise bioethanol yield, the yeast growth must be carefully monitored. In order to improve bioethanol production, very high gravity (VHG) fermentation was then carried out using concentrated OPT sap and POME. In this study, OPT sap was concentrated using a rotary vacuum evaporator. In addition, evaporation model considering both temperature and pressure was developed and validated. During VHG fermentation, up to 131.2 mmol/(min.mg protein) and 60.5 mmol/(min.mg protein) of glycerol-3- phospatase (G3Pase) and trehalose-6-phosphate phosphatase (TPP) enzyme activity were detected, respectively. These enzymes were produced by Bakers yeast in order to sustain its growth in high osmotic stress, and high ethanol toxicity, respectively.', 'stochastic fermentation oil-palm', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering', '2015', 0),
(484, 'Ooi Zhong Xian ', 'Potential Utilization Of Modified Oil Palm Ash As Filler In Natural Rubber Vulcanizates. ', 'This work studied the possibility of utilizing oil palm ash (OPA) as filler to reinforce the natural rubber vulcanizates. The OPA loading used in this study was ranged from 0 to 9 phr. The characterization of OPA was carried out prior to compounding by using conventional laboratory-sized two roll mills. Morphological study revealed that the OPA particle was irregular with rough surface and porous structure. The two main mineralogical components in OPA were quartz and calcite which elucidated by Energy dispersive X-ray, X-Ray Fluorescence spectrometry, Fourier transform infrared and X-ray diffraction analysis. Results of the OPA-filled vulcanizates showed that the scorch time and cure time decreased with the incorporation of OPA whereas maximum torque, tensile modulus, and hardness increased. From a reinforcement points perspective, it was worthwhile to note that the tensile strength improved by 16 % when 1 phr OPA was incorporated. When compared to the commercial fillers, this OPA-filled vulcanizate showed comparable strength to the 50 phr carbon black-filled vulcanizate and even higher than silica-filled vulcanizate. Besides, the incorporation of low OPA loading has increased the elongation at break whereas silica and carbon black reduced the elongation at break of the natural rubber vulcanizates. The measurement of rubber-filler interaction and morphological studies of tensile fractured surface of OPA, silica, and carbon black-filled natural rubber vulcanizates supported the result obtained from tensile properties. The thermal stability and retention properties after thermal ageing were notably enhanced with the incorporation of OPA and improved as the OPA loading was increased. xxx Thermogravimetric analysis also denoted the thermal stability was depending on the filler loading, thus higher thermal stability was found for higher loading of filler-filled vulcanizates. Last but not least, the effectiveness of three different pre-treatment methods was carried out in order to further improve the tensile strength of the OPA-filled vulcanizates. The pre-treatment media, i.e. cetyltrimethylammonium bromide (CTAB), hydrochloric acid (HCl), and liquid epoxidized natural rubber (LENR) improved the tensile strength of natural rubber vulcanizates. However, other properties such as curing characteristics, elongation at break, hardness, tensile modulus, and swelling resistance were varied depend on the pre-treatment media utilized. Thermal properties of OPA-filled vulcanizates have been affected after CTAB and LENR modification, but the HCl pretreatment method showed no significant effect and behaves almost the same manner as raw OPA-filled vulcanizates. The CTAB, HCl, and LENR modification method also contribute the positive effect on retention properties of OPA-filled natural rubber vulcanizates after thermal ageing.', 'utilization oil-palm vulcanizates', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering', '2015', 0),
(485, 'Shohreh Raftari, ', 'A Study Of The Iranian Efl Learners\' Use Of Reading Strategies. ', 'Tujuan utama kajian ini adalah mengkaji faktor yang mempengaruhi penggunaan strategi pembacaan EFL dalam kalangan pelajar EFL Iran, dan untuk profil kekerapan penggunaan strategi pembacaan dengan melakukan suatu tinjauan. The main purpose of this study was to investigate the factors that influence the use of English as a Foreign Language (EFL) reading strategies by the Iranian EFL learners, and to profile their most and least frequently used reading strategies through conducting a survey.', 'elf learners reading', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2015', 0);
