(486, 'Toh Pey Yi', 'Magnetophoretic Separation Of Microalgae Via Iron Oxide Nanoparticle', 'Harvesting of microalgae biomass is a crucial step in obtaining the microalgae biomass as biofuel feedstock and also to avoid the secondary water pollution caused by the decomposition of microalgae biomass in the water system. Magnetophoretic separation is being recognized as a feasible method to harvest the microalgae. It is performed via attachment of iron oxide magnetic nanoparticles (IONPs) on the cell surface in order to impart the magnetic property onto the cells and hence enable the subsequent collection of cells by using a permanent magnet. The electrostatic-mediated-attachment mechanism which enables the attachment and detachment of particle-to-microalgal cell is usually done through a series of pH manipulation. However, the need of pH adjustment onto the microalgae culture medium prohibited the use of this technology in large scale application. Therefore,the surface functionalization of IONPs to form positively charged surface functionalized IONPs (SF-IONPs) is carried out in order to overcome the drawback associated with pH manipulation. This study looked into the characterization of the prepared SF-IONPs, the modeling of particle-to-microalgal cell interaction, the separation kinetic in low gradient magnetic separation (LGMS), and its feasibility on water treatment and biofuel production. The colloidally stable positively charged SFIONPs which were prepared via immobilized-on approach promote effective electrostatic attachment of SF-IONPs on the freshwater Chlorella vulgaris. The surface functionalization using poly(diallyldimethylammonium chloride) (PDDA)was chosen over chitosan since its surface charge are not pH dependent. A high cell separation efficiency of > 97 % was obtained in all range of pH tested and the oil quality from the harvested biomass was not affected. The kinetic study indicated that the cell separation is initiated via particle-to-microalgal cell aggregation during incubation followed by field-induced-aggregation under magnetic field in LGMS with B < 80 T/m. Extended Derjaguin-Landau-Vewey-Overbeek (XDLVO)analysis employed to predict the interaction between SF-IONPs and microalgal cells took into account the van der Waals (vdW), ES and Lewis acid-base (AB) interactions. The ES interaction governed the net interaction between cell and SFIONPs in freshwater media while the AB and vdW interactions play a dominant role in seawater. XDLVO predicted effective attachment of SF-IONPs onto cell surface with a secondary minimum of -3.12 kT, which is in accordance with the experimental result. This gave an insight on the strategy of particle detachment from cell for reuse. In overall, the performance of SF-IONPs is strongly depending on the particle stability, molecular weight (MW) of PDDA, particle concentration, and the microalgae species. The SF-IONPs coated by very low MW PDDA at dosage of 100 g PDDA/g IONPs formed the most colloidally stable suspension and it enabled the separation of C. vulgaris at almost 100 % efficiency with SF-IONPs concentration of  50 mg/L. The light shading effect and cell agglomeration were the main toxic effect of SF-IONPs (PDDAvl) toward the growth of C. vulgaris. This technology was proven effective and cost feasible in fishpond water treatment. A cell separation efficiency of 90 % was achieved and at water treatment cost of USD$0.15/m3 with a dosage of 0.519 g SF-IONPs/g dry biomass under the LGMS. In biofuel production, further improvement is required to meet the economic feasibility', 'magnetophoretic microalgae nanoparticle', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) > ', '2015', 0),
(487, 'Sengphet Keokangdong', 'Development Of Porous Ceramic Clay Bodies Using Four Different Types Of Bioresource Wastes', 'The main objective of this study is to ascertain the possibility of fabricating porous clay ceramic materials. The raw materials consist of a kaolinitic Laotian clay and an illitic Malaysian clay, mixed with bioresource wastes (kenaf powder, kenaf fiber, banana stem and sugarcane wastes) as the pore-forming agents (PFA). The raw powders, i.e. Laotian clay (LC), Malaysian clay (MC) and bioresource wastes were initially characterized using XRF, XRD and TGA/DSC. The clay ceramic green bodies were fabricated with different types and amounts of bioresource wastes in the clay bodies (10, 20 and 30 wt%). The granulated powder mixtures were pressed hydraulically using a round stainless steel mould 23 mm diameter, under a pressure of 50MPa. It was observed that different types of bioresource waste additions did not create any shaping problems. After drying, the ceramic green bodies were fired at different temperatures (1100, 1125, 1150 and 1175oC) for 3 hours at a heating rate of 5oC/min. The effects of adding these wastes on the properties of the porous clay ceramics were assessed by shrinkage, density, porosity, water absorption, compressive strength, scanning electron microscopy (FESEM) and computed tomography (CT) tests. XRD analyses confirmed that the mineralogical composition of the raw clays consisted of quartz and kaolinite as the major minerals in the LC clay, whilst illite and quartz were in the MC clay. Upon firing, the crystalline phases detected were only quartz and mullite. All the four bioresource wastes were successful in producing porous ceramic bodies in both clays but with varying degrees of porosity. This work had succeeded in establishing that the relative effects of the different bioresoure wastes were the same. For example, the sugarcane waste gave the highest porosity at all temperatures and percentages tested. This was followed by kenaf fibre, kenaf powder and banana stem wastes. Correspondingly, property such as density will be the lowest for the sequence of wastes mentioned. It was also established that the microstructural study using computed tomography provided useful additional information on the shape of the pores apart from the 3- dimensional image by FESEM. In conclusion, this work has successfully proven that bioresource wastes can contribute towards promoting green technology with regards to porous ceramic body production.', 'ceramic bioresource waste', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineerin', '2014', 0),
(488, 'Wafaa I. A. Alnajjar', 'A Case Study Of Attitudes And Motivations Of Students And Lecturers Toward Language-In-Education Policies In Al-Aqsa University, Palestine', 'Tujuan kajian ini adalah untuk menentukan sikap para pensyarah dan pelajar di atas dasar pendidikan Bahasa Inggeris dan peranannya di Fakulti Sains, Universiti AlAqsa. The overreaching aim of this research is to determine students` and lecturers` attitudes and motivation towards the current English education policies and the role of English in science faculties in Al-Aqsa University.', 'attitudes motivations students', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(489, 'Nur Hartini Binti Mohd Taib', 'Quantative analysis of brain white matter using diffusion tensor imaging', 'Penyelidikan ini mengenai aplikasi pengimejan tensor difusi (DTI) dalam kajian tentang leukoaraiosis dan jirim putih normal. Empat objektif utama yang telah digariskan dalam kajian ini telah tercapai. Sebuah fantom kepala telah digunakan dan sejumlah 15 subjek normal dan 51 subjek leukoaraiosis telah mengambil bahagian dalam kajian ini. Sejumlah 5128 hirisan telah dianalisis dalam kerja ini. Pengimejan otak telah dijalankan menggunakan sistem pengimejan resonan magnet (MRI) 1.5 Tesla. Keupayaan mendapatkan data DTI dan membina trektografi gentian untuk kajian leukoaraiosis telah dikaji. Hasil yang didapati menunjukkan kebolehan DTI untuk membezakan leukoaraiosis daripada jirim putih normal. Trektografi gentian telah menunjukkan perbezaan struktur yang jelas bagi gentian saraf dalam kawasan jirim putih. Dapat disimpulkan data DTI dan pembinaan trektografi gentian untuk penilaian leukoaraiosis didapati boleh dilaksanakan. This research is concerned with the application of diffusion tensor imaging (DTI) in the study of leukoaraiosis and normal white matter. Four main objectives outlined in the study have been achieved. A head phantom was used and a total of 15 normal subjects and 51 leukoaraiosis subjects participated in the study. A total of 5128 slices were analysed in this work. Brain imaging was performed using 1.5 Tesla MRI system. Feasibility of acquiring DTI data and constructing fiber tracts for leukoaraiosis study was investigated. Results obtained showed capability of DTI to distinguish leukoaraiosis from normal white matter. Fiber tractography exhibited a good structural differentiation of nerve fibers in the white matter region. Acquiring DTI data and constructing fiber tractography for assessment of leukoaraiosis was found to be feasible.', 'brain tensor imaging', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2014', 0),
(490, 'Mohamad Fadhili Bin Yahaya ', ' `High-Performing Esl Readers Response To Loading Cognitive Stress In Reading Comprehension Performance', 'Tujuan utama kajian tentang respons pembaca Bahasa Inggeris sebagai bahasa kedua (ESL) yang berprestasi tinggi terhadap beban tekanan kognitif dalam prestasi pemahaman bacaan adalah bagi mengetahui tahap sebenar pembaca yang baik. Kajian ini berasaskan teori transaksi tekanan Lazarus dan Folkman. Oleh itu, kajian ini memberi tumpuan kepada mengenalpasti pembaca ESL berprestasi tinggi, menyelidik kesan tekanan kognitif masa untuk bacaan dan kesukaran teks, serta menghuraikan strategi yang digunakan. This study on high-performing ESL readers response to loading cognitive stress in reading comprehension performance was developed on the basis of Lazarus and Folkmans transactional theory of stress, mainly to know how good, good readers are. In doing so, the study focused on identifying high-performing ESL readers, investigating the influence of loading cognitive stress of time-on-task and text difficulty, and describing the strategies employed.', 'esl readers cognitive comprehension', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(491, 'Awwalu Muhammad Inuwa', 'Parental And School Climate Factors On Student Dropouts In Junior Secondary Schools Of Sokoto Metropolis, Nigeria', 'Pendidikan dianggap sebagai suatu cara bagi melatih, memperkasa, mendidik dan memupuk sikap kemasyarakatan dalam kalangan golongan muda di Nigeria dalam memelihara norma serta nilai-nilai (moden dan tradisional) kemasyarakatan. Education in Nigeria is an avenue for training, empowering, education and socializing the young adult to preserve the norms and values of the society (traditional and modern).', 'parental school-climate dropout', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(492, 'Mohd Zulkifli Bin Mustafa ', 'In vitro and preclinical evaluation of newcastle disease virus strain V4UPM as an oncolytic virus candidate for novel human malignant glioma theraphy.', 'Virus pemusnah kanser merupakan virus aktif yang digunakan untuk menjangkiti sel kanser dan telah dikaji dengan meluas bagi tujuan rawatan kanser. Virus pemusnah kanser menjangkiti sel kanser secara spesifik kerana virus ini mampu mengeksploitasi mutasi yang merangsang pembiakan sel kanser tanpa menjejaskan sel yang normal. Kanser otak adalah malignan pembunuh didalam otak dan glioma merupakan kanser otak manusia yang bertumbuh dari sel glia dan ianya paling kerap dijumpai. Glioma tahap IV dikenali sebagai glioblastoma multiform (GBM) dimana pembiakan dan perebakan GBM ini dikaitkan dengan peningkatan ekspresi protin Rac1. Virus sampar ayam (NDV) adalah virus avian didalam keluarga paramyxovirus, dan merupakan salah satu virus pemusnah kanser yang mewarisi seleksi terpilih terhadap sel kanser. NDV dilaporkan menjadi pencetus kepada pembentukkan sel syncytia dan mengaruh bagi kematian sel didalam pelbagai jenis kanser, tetapi dilaporkan selamat untuk suntikan klinikal pada manusia. Oncolytic viruses are replicating viruses that have been used to infect neoplastic cells and are widely studied as a form of antitumor therapy. Oncolytic viruses specifically target tumorigenic cells because they are able to exploit the aberrations on the cellular level that promote tumor growth and the viruses preferentially infect cancer cells without interfering with normal cells. Brain cancer is a malignant growth within the skull and glioma is the most common human brain cancer arising from glial cells. Grade IV glioma is known as glioblastoma multiforme (GBM) where the proliferation and invasive behavior in GBM was associates with upregulation of Rac1 protein. Newcastle disease virus (NDV), an avian virus in the Paramyxovirus family, is one of the oncolytic viruses that inherit natural selectivity towards cancer. It is reported to robustly induce syncytium and apoptosis in multiple types of cancer cells but found to be safe for clinical injection into human.', 'preclinical v4upm novel-human', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2014', 0),
(493, 'Abdulelah Ahmad Salawi', 'Barriers, Attitudes, And Self-Efficacy Of People With Disabilities In Recreational Sports Activities Participation In Saudi Arabia', 'Penyertaan dalam aktiviti sukan rekreasi adalah penting sama ada orang itu berkeupayaan atau kurang upaya. Participation in recreational sports is as important to disabled people as it is to people without disabilities.', 'attitudes disabilities sports', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies', '2014', 0),
(494, 'Chang Boon Peng', 'Mechanical And Tribological Properties Of Ultra High Molecular Weight Polyethylene With Zinc Oxide Antibacterial Agent For Joint Implant', 'Total joint replacement (TJR) is a highly successful treatment for end-stage joint disease like osteoarthritis. A prominent number of TJR devices used in orthopaedic involve articulation between a metallic alloy and ultra-high molecular weight polyethylene (UHMWPE). Although this polymer has excellent properties, suitable for TJR bearing materials, the wear particulate produced due to relative motion between components still remains an issue yet to be resolved. This study presents approaches to improve the wear performance of UHMWPE in implant applications by various types of fillers reinforcement. The UHMWPE composites were fabricated by compression moulding with different filler-matrix ratios. These composites were characterized and compared in terms of their mechanical and tribological properties. The filler which delivered the best performances were selected as the filler in the UHMWPE hybrid composites. The tribological properties was investigated using pin-on-disc tester under different loads and sliding speeds. The worn surfaces and transfer films produce after wear test were studied under scanning electron microscopy (SEM). This research consists of four parts. The first part was to investigate the effect of surface treatment of ZnO on the mechanical, tribological and antibacterial properties. Two variants of untreated ZnO-reinforced UHMWPE (U-ZPE) and treated ZnO-reinforced UHMWPE (T-ZPE) with aminoproply-triethoxysilane (APTES) were used to compare the improvement of properties. The antibacterial assessments of the composites were tested against two common human body bacteria i.e. Escherichia coli (E. coli) and Staphylococcus aureus (S. aureus). Results have shown that T-ZPE possess higher mechanical and wear properties as compared to U-ZPE. Both U-ZPE and T-ZPE composites showed active inhibition against E. coli and S. aureus bacteria. T-ZPE showed higher percentage inhibition against the tested bacteria. The second part of the research was compared the performances of the micro- and nano-ZnO reinforcement in the UHMWPE composites. The wear properties of nano-ZnO/UHMWPE composites are better than micro-ZnO/UHMWPE. The nano-ZnO/UHMWPE composites impart superior antibacterial properties as compared to micro-ZnO/UHMWPE composites. The third part of the research studies the influence of silicate mineral reinforcements (zeolite and talc) on the properties of UHMWPE. In terms of mechanical properties, the zeolite/UHMWPE showed superior mechanical properties as compare to talc/UHMWPE. However, for wear resistance, talc/UHMWPE exhibited better wear behaviour as compared to zeolite/UHMWPE. There is no direct relationship of degree of crystallinity (DOC) on the tribological properties of UHMWPE composites. Finally, in the fourth part of the research, the effects of two types of filler reinforcements i.e. particulate (talc particles) and fibre (glass fibre (GF))-reinforced ZnO/UHMWPE hybrid composites on the tribological properties were carried out. The empirical models on the relationship of various variables of applied loads, sliding speeds and distances on the wear and friction of UHMWPE composites was developed using Response Surface Methodology (RSM). Optimization of the responses as function of independent variables were generated. GF/ZnO/UHMWPE exhibited better wear performance compared to talc/ZnO/UHMWPE hybrid composites.', 'mechanical molecular antibacterial', '', 'Institut Penyelidikan dan Teknologi Nano Optoelektronik (Institute of Nano Optoelectronics Research andTechnology (INOR)', '2014', 0),
(495, 'Cheah Swi Ee', 'Classroom Interactions, Instructional Activities And Learning Affordances Of An Undergraduate Technical Writing Classroom: A Sociocultural Study. ', 'Tesis ini dihasilkan menerusi satu usaha akademik untuk menerokai amalan menulis di institusi pengajian tinggi di Malaysia. This thesis is the result of an academic venture to explore writing practices in the Malaysian higher education.', 'classroom activities writing', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(496, 'Guan Teik Ee ', 'Self-Hurt Behaviours Among Malaysian Chinese Adolescents. ', 'Kajian ini menggunakan kaedah gabungan untuk meninjau pengalaman tingkah laku mencederakan diri dalam kalangan remaja. This mixed-methods study examined the experiences of adolescents who engaged in self-hurt behaviour.', 'self-hurt behaviors adolescents ', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2014', 0),
(497, 'Bati Sulaiman Humaid Al Shekaili', ' Teachers\' Beliefs And Levels Of Use In The Adoption Of The Student-Active Learning Approach In Efl Classrooms In Oman', 'Matlamat utama kajian ini adalah menyelidik kepercayaan guru dan Tahap Penggunaan (TP) kaedah Pemelajaran Aktif-Pelajar (PAP) di bilik darjah EFL di Oman. The main purpose of the study was to investigate the teachers\' Beliefs and their Levels of Use (LoU) in the adoption of the Student-Active Learning (SAL) approach in their English as a Foreign Language (EFL) classrooms in Oman.', 'teachers adoption active-learning', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(498, 'Hasmirizal Lubis', 'Faktor Mempengaruhi Tingkah Laku Merokok Dalam Kalangan Murid Sekolah Menengah Umum Di Medan.', 'Tujuan kajian ini ialah untuk mengenal pasti pengaruh tahap pengetahuan dan sikap, persepsi ketersediaan fasiliti Unit Kesihatan Sekolah (UKS), tingkah laku merokok ibu, bapa, saudara-saudara, rakan-rakan dan guru terhadap tingkah laku merokok daripada murid Sekolah Menengah Umum (SMU) di Kota Medan, Indonesia. The purpose of this study was to identify the influence of knowledge and attitude, the perception of availability of School Health Unit (UKS) facilities, the behaviour of parents, relatives, friends and teachers on smoking behaviour of pupils in Public Secondary School (SMU) in Medan, Indonesia.', 'faktor merokok murid', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies', '2014', 0),
(499, 'Vahid Rafieyan', 'The Effect Of Focus On Form Versus Focus On Forms Pragmatic Instruction On The Development Of Pragmatic Comprehension', ' Anggapan umum ialah ciri-ciri pragmatik bahasa sasaran perlu diberi perhatian terhadap pelajar bahasa melalui pengajaran pragmatik berfokuskan form. Untuk menilai tahap pemahaman pengajaran pragmatik Focus on Form dan Focus on Forms, satu kajian eksperimen telah dijalankan terhadap 45 orang siswazah yang mengambil kursus Bahasa Inggeris di Universiti Sains Malaysia. The common assumption is that target language pragmatic features need to be brought to language learners direct attention through form-focused pragmatic instruction for them to be learned. To assess language learners level of pragmatic comprehension and the effectiveness and sustainability of Focus on Form and Focus on Forms pragmatic instruction on pragmatic comprehension, an explanatory experimental study was conducted on 45 undergraduates studying English language at Universiti Sains Malaysia by random assignment of participants to three equal groups of Focus on Forms, Focus on Form, and Control and conducting a 6-session intervention based on listening tasks. Focus on Forms group received metapragmatic explanations of target language conversational implicatures, Focus on Form group received input enhancement by highlighting target language conversational implicatures of listening transcripts, and control group practiced some listening activities.', 'focus pragmatic comprehension', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2014', 0),
(500, 'Khaled Mohammad Hamadin', 'Perceived Taqwa Practices Of School Principals And Its\' Influence On Teachers Organizational Commitment And Organizational Trust As Mediator.', 'Kajian yang menggunakan kaedah campuran ini telah menyiasat pengaruh amalan Taqwa pengetua sekolah ke atas komitmen guru dan peranan pengantara amanah. This mixed method study investigated the influence of perceived Taqwa as practiced by school principals on teachers organizational commitment, and trust as the mediator variable.', 'taqwa organizational mediator', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(501, 'Majid Poor Mohammadi', 'The Effects Of Direct Teaching Of Test-Taking Strategies On Iranian Efl Students Performance In Reading Comprehension Tests', 'Penyelidikan ini mengkaji kesan pengajaran strategi menduduki ujian terhadap prestasi ujian kefahaman pelajar siswazah EFL Iran. Selain itu, kajian ini meneliti sikap pelajar terhadap pengajaran strategi tersebut dalam kelas pemahaman. This study investigates the effect of teaching test-taking strategies on Iranian EFL undergraduates reading comprehension test performance. Besides, it probes their attitudes towards the teaching of such strategies in their reading classes.', 'teaching test-taking comprehension', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(502, 'Fouzieh Sabzian', ' An Evaluation On The Effectiveness Of The Primary School Teachers\' Professional Development Programme In Iran.', 'Tujuan kajian ini ialah untuk menilai keberkesanan program pembangunan profesional guru-guru sekolah rendah (TPD) di lran. Ia memberi tumpuan kepada pandangan peserta latihan dalam perkhidmatan khusus tentang kekuatan dan kelemahan dari segi sepuluh komponen model sarang labah Akker (2003). The purpose of this study is to evaluate the effectiveness of primary school teachers professional development (TPD) programmes in Iran. It focuses on the views of in-service training participants specifically on the strengths and deficiencies or shortages according to ten components of Akkers (2003) Spider Web Model.', 'effectiveness teachers programme', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2014', 0),
(503, 'Hussam F. O. Abushawish', 'The Influence Of Transformational Leadership, Organizational Culture, And Strategic Change On Organizational Effectiveness In Palestinian Higher Education.', ' Dilaporkan bahawa universiti di Palestin sentiasa berdepan dengan cabaran persekitaran, yang menyebabkan keberkesanan mereka semakin merosot. Palestinian universities were reported to face persistent environmental challenges which detrimentally caused them to deteriorate in effectiveness.', 'leadership organizational education', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(504, 'Ummalzayn Hussain Badawi ', 'The Moderating Roles Of Institutional Variables On The Influence Of Professional Learning Community On Teaching Competency Among Educational University Faculty Members In West Coast Saudi Arabia.', 'Kajian ini bertujuan untuk mengenal pasti peranan moderator variabel institusi terhadap pengaruh komuniti pembelajaran profesional dengan kompetensi pengajaran dalam kalangan anggota fakulti universiti pendidikan di pantai barat daya Arab Saudi. This study aims to identify the moderating role of institutional variables on the influence of professional learning community on teaching competency among educational faculty members in west coast of Saudi Universities.', 'institutional teaching educational', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(505, 'Azemi Bin Shaari ', 'Kesan Kaunseling Individu Terapi Rasional Emosi Dan Tingkah Laku (Rebt), Kaunseling Sedia Ada (Ksa) Dan Kumpulan Kawalan (Kk) Terhadap Tingkah Laku Agresif Murid Sekolah Menengah', 'Kesan Kaunseing Individu Terapi Rasional Emosi Dan Tingkah laku (REBT), Kaunseling Sedia Ada (KSA) Dan Kumpulan Kawalan (KK) Terhadap Tingkah Laku Agresif Murid Sekolah Menengah. The Impact of the Rational Emotion Behavior Therapy (REBT) and Basic Counselling Skills on Secondary School Students with (Physical Aggression) Aggressive Behavior.', 'kaunseling agresif murid', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(506, 'Samsudin Anis', 'Tar Removal From Producer Gas Via Thermal And Catalytic Means In A Microwave Reactor.', 'Tar in biomass producer gas should be removed to avoid blocking of the pipe lines and to allow producer gas utilization in Internal Combustion (IC) engines and turbines for power generation. Among the available tar removal methods, thermal and catalytic (thermocatalytic) treatments of tar are more attractive with improvement of the producer gas energy content by converting tar into combustible gases. However, the commonly applied thermocatalytic treatments are costly by the use of conventional heating mechanism that consumes high electrical energy. The alternative method of microwave heating is cost effective, simple and potential for process scale up. A modified commercial microwave oven was developed and characterized for thermocatalytic treatment of tar. Tar removal was conducted initially using tar model compounds (toluene and naphthalene) followed by real tar from producer gas derived from biomass gasification. Two treatments were conducted: thermal and catalytic treatments. Tar species and gases were analyzed using Gas Chromatography-Mass Spectrometry (GC-MS) and Gas Chromatography-Thermal Conductivity Detector (GC-TCD), respectively. Whilst, coke/soot deposited on the catalysts was determined using Thermogravimetric Analyzer (TGA).', 'tar thermal microwave', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering', '2014', 0),
(507, 'Yusni Binti Abd.Rahman', 'Pembinaan Model Konsepsi Dan Amalan Pentaksiran Guru.', 'This is a survey research on Teachers Conceptions and Assessment Practices (TCoAP) involving 396 sample of teachers from 127 schools in Perak. The focus of the study was to evaluate the psychometric characteristics of TCoAP instrument through the development of the TCoAP model. The study also investigated the relationship between teachers conceptions and assessment practices. Kajian tinjauan terhadap Konsepsi dan Amalan Pentaksiran Guru (KAPG) melibatkan 396 orang guru sampel dari 127 buah sekolah di negeri Perak. Tumpuan kajian adalah untuk menilai ciri-ciri psikometrik instrumen melalui pembinaan model KAPG yang dibentuk. Kajian turut mengenal pasti hubungan di antara konsepsi dan amalan pentaksiran guru.', 'model konsepsi pentaksiran-guru', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(508, 'Ali Mohammad Hamdan Abuarra', 'Fabrication And Characterization Of Gum Arabic Bonded Rhizophora spp. Particleboard Head Phantom For Pet/Ct Applications', 'Gum Arabic was used to manufacture Rhizophora spp. particleboards with three particle sizes (149 - 210 m, 74 - 149 m, and < 74 m) at four different GA adhesive levels (0%, 5%, 10%, and 15%). The density, moisture content (MC), internal bond (IB) strength, thickness swelling (TS), water absorption (WA), CHNS (carbon, hydrogen, nitrogen, and sulfur), structural morphology and the mass attenuation coefficient measurements were used to characterize the fabricated particleboards. Gam Arab telah ditambah ke dalam papan serpai Rhizophora spp. dengan tiga saiz zarah (149 - 210 m, 74 - 149 m, dan < 74 m ). Pada empat tahap perekat GA yang berbeza (0%, 5 %, 10 %, dan 15%). Ketumpatan, kandungan lembapan (MC), kekuatan ikatan dalaman (IB), bengkak ketebalan (TS), penyerapan air (WA), CHNS (karbon, hidrogen, nitrogen, dan sulfur), morfologi struktur dan peng ukuran pekali atenuasi tisu telah digunakan untuk mencirikan papan serpai yang dihasilkan.', 'gum arabic particleboard ', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2014', 0),
(509, 'Alian Aaly F Alrasheedy', 'Generic Medicines: Knowledge, Perceptions And Practice Of Community Pharmacists, Physicians And Medicine Consumers In Riyadh, Saudi Arabia.', 'Generic medicines are essentially the same as their counterpart brand medicines. They provide the same therapeutic outcomes, but at a much cheaper price. Therefore, they are promoted in many countries to confront the problem of escalating pharmaceutical expenditures. Ubat-ubatan generik secara lazimnya adalah sama seperti ubat-ubatan berjenama asli. Ia membekalkan hasil teraupetik yang sama, pada kos yang lebih rendah. Disebabkan itu, ubat-ubatan ini dipromosikan di pelbagai negara sebagai salah satu langkah untuk mengatasi kos perbelanjaan farmaseutikal yang kian meningkat.', 'medicines community consumers', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2014', 0),
(510, ' Ayesha Ashfaq', 'The Representation Of The United States In Mainstream English Newspapers Of Pakistan: An Analysis Of Political Cartoons (1991-2013).', 'Realism has always been a driving force behind the foreign policies of the United States across the world. Therefore, the US interests in geo-strategic position of Pakistan always determine the fluctuating nature of the Pakistan-United States relations. Based on this interest specific relationship, the representation of the United States has become an interesting dimension of Pakistani political cartoonists. Realisme sentiasa menjadi daya penggerak kepada dasar-dasar Amerika Syarikat di seluruh dunia. Kecederungan Amerika Syarikat dalam kedudukan geo- strategik Pakistan telah mencorakkan turun naiknya perhubungan di antara Pakistan dan Amerika Syarikat (Pak-US). Berdasarkan kepada kecederungan perhubungan tertentu ini dalam pembinaan imej di Amerika Syarikat, ia telah menjadi dimensi tarikan kepada kartunis politik di Pakistan.', 'english newspapers political-cartoons', '', 'Pusat Pengajian Komunikasi (School of Communication)', '2014', 0),
(511, 'Zahra Zohoorian Vahid Baghban', 'The Effect Of Authentic Context On Motivation Level, Reading Motivation And Reading Achievement Among Iranian EAP Students', 'This study was carried out in response to the question of Iranian EAP students lack of motivation and low achievement for the reading skill. Among different methods proposed in the literature to enhance motivation or to promote achievement, the researcher examined the effect of authenticating the teaching/learning context to investigate its effect. Kajian ini dijalankan sebagai respon terhadap tanggapan bahawa pelajar Iran yang mengikuti program EAP (Bahasa Inggeris bagi Tujuan Akademik) kurang motivasi dan pencapaian yang rendah dalam kemahiran bacaan. Antara pelbagai kaedah yang dicadangkan,dalam literatur untuk meningkatkan motivasi atau menggalakkan pencapaian, penyelidik mengkaji kesan pengautentikan konteks pemgajaran-pembelajaran untuk mengkaji kesan tersebut.', 'authentic reading students', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2014', 0),
(512, 'Chan Boon Peng', 'Mechanical And Tribological Properties Of Ultra High Molecular Weight Polyethylene With Zinc Oxide Antibacterial Agent For Joint Implant.', 'Total joint replacement (TJR) is a highly successful treatment for end-stage joint disease like osteoarthritis. A prominent number of TJR devices used in orthopaedic involve articulation between a metallic alloy and ultra-high molecular weight polyethylene (UHMWPE). Although this polymer has excellent properties, suitable for TJR bearing materials, the wear particulate produced due to relative motion between components still remains an issue yet to be resolved. This study presents approaches to improve the wear performance of UHMWPE in implant applications by various types of fillers reinforcement. The UHMWPE composites were fabricated by compression moulding with different filler-matrix ratios. These composites were characterized and compared in terms of their mechanical and tribological properties. The filler which delivered the best performances were selected as the filler in the UHMWPE hybrid composites. The tribological properties was investigated using pin-on-disc tester under different loads and sliding speeds. The worn surfaces and transfer films produce after wear test were studied under scanning electron microscopy (SEM). This research consists of four parts. The first part was to investigate the effect of surface treatment of ZnO on the mechanical, tribological and antibacterial properties. Two variants of untreated ZnO-reinforced UHMWPE (U-ZPE) and treated ZnO-reinforced UHMWPE (T-ZPE) with aminoproply-triethoxysilane (APTES) were used to compare the improvement of properties. The antibacterial assessments of the composites were tested against two common human body bacteria i.e. Escherichia coli (E. coli) and Staphylococcus aureus (S. aureus).', 'tribological molecular joint-implant', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2014', 0),
(513, 'Fatemeh Gholami', 'Development Of Multiwalled Carbon Nanotubes Reinforced Hydroxyapatite', 'The similarity of the chemical composition of hydroxyapatite (HA) to the mineral phase of bone and their excellent biocompatibility meets the requirement of materials designed for bone repair and augmentation purposes. However, the application of HA in load bearing devices is limited by its poor mechanical properties. Persamaan komposisi kimia hidroksiapatit (HA) dengan fasa mineral tulang dan keserasian biologinya yang sangat baik memenuhi keperluan bahan reka bentuk untuk pembesaran dan pembaikan tulang. Walaubagaimanapun, aplikasi HA dalam peranti menanggung beban adalah terhad disebabkan ciri mekanikal yang lemah.\r\n\r\n', 'multiwalled nanotubes hydroxyapatite', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering', '2014', 0),
(514, 'Haslina Binti Jaafar', 'Low Voltage Rf Microelectro-Mechanical Switch Using 0.35 m MIMOS CMOS Compatible Process.', 'Low voltage RF MEMS switch that can be integrated with other circuits is required in the consumer product, industrial and telecommunication sector. Voltage actuation less than 10 V with simple fabrication process is desirable as most of applications need low power system with low fabrication cost. Suis RF MEMS bervoltan rendah dan boleh berintegrasi dengan litar lain sangat diperlukan di dalam produk pengguna, sektor industri dan telekomunikasi. Voltan penggerak kurang daripada 10 V dengan proses fabrikasi yang mudah sangat dikehendaki kerana kebanyakan aplikasi memerlukan sistem kuasa rendah dengan kos fabrikasi yang rendah.\r\n\r\n', 'voltage mechanical compatible', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2014', 0),
(515, 'Zeinab Abbas Jawad', 'Functionalized Multi-Walled Carbon Nanotube/Cellulose Acetate Mixed Matrix Membrane For CO2/N2 Separation.', 'Carbon dioxide (CO2), as one of the major atmospheric contributors to the Earth\'s greenhouse effect has been rising extensively since the industrial revolution. One promising means of lowering the emission of CO2 is to develop highly efficient and robust membranes that are capable of selective CO2. Karbon dioksida (CO2) adalah salah satu penyumbang utama kepada kesan rumah hijau kepada bumi, yang kuantitinya kian meningkat sejak revolusi industri. Salah satu cara untuk mengurangkan pelepasan CO2 adalah dengan menghasilkan membran yang cekap dan mantap yang mampu menapis mengikut kememilihan CO2.', 'multi-walled cellulose c02/n2', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2014', 0),
(516, 'Kwan Yuet Ping', 'In Vitro Cytotoxicity Activity And In Vivo Oral Toxicity Of Euphorbia hirta.', 'Euphorbia hirta is an annual plant that has been widely used in traditional medicine to treat various diseases. In vitro cytotoxicity, genotoxicity properties and in vivo toxicological evaluation of E. hirta methanol extract were investigated in this study. Various pharmacognostical parameters evaluation was carried out as per World Health Organization (WHO) guidelines procedure for the standardization of E. hirta extract. Euphorbia hirta adalah sejenis tumbuhan yang digunakan dalam perubatan tradisional secara meluas untuk mengubati pelbagai jenis penyakit. Sitotoksik, genotoksik secara in vitro dan penilaian ketoksikan secara in vivo ekstrak metanol daripada E. hirta telah diselidik dalam kajian ini.', 'cytotoxicity in-vivo euphorbia', '', 'Institut Penyelidikan Perubatan Molekul (Institute for Research in Molecular Medicine INFORMM', '2014', 0),
(517, 'Lam Sze Mun ', ' Photocatalytic Performance Of ZnO Nanorod Coupled Photocatalysts Under Fluorescent Light And Sunlight Irradiation For Phenol And 2,4-Dichlorophenoxyacetic Acid Degradation', 'Over the years, the surge of industrial activities that inevitably resulted in an increasing flux of pollutants in the environment still remains an intricate challenge for nations. Heterogeneous photocatalysis, particularly on metal oxide coupled on one dimensional (1D) ZnO nanorods (MOx/ZnO) as promising heterostructured photocatalysts were employed to treat two endocrine disrupting chemical (EDC) pollutants, namely phenol and 2,4-dichlorophenoxyacetic acid (2,4-D). Selama bertahun-tahun, aktiviti perindustrian yang pesat masih menjadi satu cabaran yang rumit bagi kebanyakan negara. Aktiviti perindustrian yang tidak dapat dielakkan ini menyebabkan peningkatan bahan pencemar ke dalam alam sekitar. Fotopemangkinan heterogen, terutamanya pada logam oksida digandingkan dengan satu dimensi (1D) ZnO berbentuk rod nano (MOx/ZnO) bertindak sebagai fotopemangkin heterostruktur yang berkesan telah digunakan untuk merawat dua bahan pencemar kimia pengganggu endokrin (EDC) iaitu fenol dan asid 2,4-diklorofenoxiasetik (2,4-D).', 'photocatalytic fluorescent 2,4-dichlorophenoxyacetic', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2014', 0),
(518, '', '', 'Lim, Chen Kim (2014) Crowd And Acoustical Modelling In Digital Cultural Heritage\r\n\r\nThe broad term of heritage refers to the study of human activity in the past and its cultural narratives and to virtualize heritage means to actualize the heritage content digitally. Istilah warisan secara meluas merujuk kepada kajian kegiatan manusia pada masa lampau dan pengkisahan budayanya dan memayakan warisan bermaksud merealisasikan kandungan warisan secara digital.\r\n\r\n', '', '', '	Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '0', 0),
(519, '', '', 'Lim, Chen Kim (2014) Crowd And Acoustical Modelling In Digital Cultural Heritage\r\n\r\nThe broad term of heritage refers to the study of human activity in the past and its cultural narratives and to virtualize heritage means to actualize the heritage content digitally. Istilah warisan secara meluas merujuk kepada kajian kegiatan manusia pada masa lampau dan pengkisahan budayanya dan memayakan warisan bermaksud merealisasikan kandungan warisan secara digital.\r\n\r\n', '', '', '	Pusat Pengajian Sains Komputer (School of Computer Sciences) ', '0', 0),
(520, 'Lim Chen Kim', 'Crowd And Acoustical Modelling In Digital Cultural Heritage', 'The broad term of heritage refers to the study of human activity in the past and its cultural narratives and to virtualize heritage means to actualize the heritage content digitally. Istilah warisan secara meluas merujuk kepada kajian kegiatan manusia pada masa lampau dan pengkisahan budayanya dan memayakan warisan bermaksud merealisasikan kandungan warisan secara digital.\r\n\r\n', 'crowd modelling digital', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2014', 0),
(521, 'Lim Wei Hong ', 'Enhanced Particle Swarm Optimization Algorithms With Robust Learning Strategy For Global Optimization.', 'Particle Swarm Optimization (PSO) is a metaheuristic search (MS) algorithm inspired by the social interactions of bird flocking or fish schooling in searching for food sources. Pengoptimuman Kawanan Zarah (PSO) merupakan satu algoritma pencarian metaheuristik (MS) yang diinspirasi oleh interaksi sosial kumpulan burung atau kawanan ikan semasa pencarian sumber makanan.', 'particle algorithms optimization', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2014', 0),
(522, 'Mohd Jaki Bin Mamat ', 'Penglibatan Masyarakat Dalam Pemuliharaan Kawasan Warisan Di Pusat Bandaraya Ipoh, Perak', 'This research focuses on the problems of abandoned heritage sites by the community, administrators, users and building owners. To overcome these problems, two main aspects are measured to evaluate the communitys acceptance level in stirring the efforts to conserve the sites. Potential and awareness are the two aspects that become as main objective in this research. The potential aspect was measured by evaluating the communitys confidence and understanding level towards the heritage sites and how it could encourage the community to conserve these sites. Penyelidikan ini memberi fokus kepada masalah pengabaian kawasan warisan di kalangan masyarakat, merangkumi pentadbir, pengguna dan pemilik bangunan. Bagi mengatasi masalah ini dua aspek utama diukur untuk menilai tahap penerimaan masyarakat dalam menggerakkan usaha pemuliharaan di kalangan mereka. Dua aspek dimaksudkan ialah potensi dan kesedaran yang menjadi objektif utama penyelidikan ini.', 'masyarakat pemuliharaan warisan', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2014', 0),
(523, 'Azam Taufik Bin Mohd.Din', 'Ordered Mesoporous Carbons And Its Alginate Composite Adsorbents: Syntheses, Characterizations And Adsorption Performances For Methylene Blue, Chloramphenicol And Riboflavin', 'Ordered mesoporous carbons (OMC) were synthesized through nanocasting method by using lab-synthesized hexagonal mesoporous silica (HMS) as a template and polyethylene glycol 400 (PEG-400) as a carbon source. One-time variable experimental approach was deployed to study the effect of selected process parameters including carbonization temperature (873-1073 K), dwelling time (15-240 min), heating rate (1-10 K.min-1) and PEG-400 (2.5-15 g) loading on the surface area properties, yields and its ability to remove methylene blue (MB). Karbon mesoliang tersusun (KMT) telah disintesis menerusi kaedah tempa nano menggunakan silika mesoliang heksagonal (SMH) sebagai templat dan polietilena glikol 400 (PEG-400) sebagai sumber karbon. Pendekatan eksperimen pemboleh ubah satu-masa telah digunakan untuk mengkaji kesan parameter proses terpilih termasuk suhu pengkarbonan (873-1073 K), masa penahanan (15-240 min), kadar pemanasan (1-10 K.min-1) dan muatan PEG-400 (2.5-15 g) ke atas sifat-sifat luas permukaan, hasil dan kebolehan untuk menyingkirkan metilena biru (MB).', 'mesoporous composite riboflavin', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering', '2014', 0),
(524, 'Farzaneh Mola', 'A Model Of Tourism Support By Local Residents In Pangkor Island, Malaysia. ', 'This study used sustainability attitude indicators, namely, environmental sustainability, long-term planning, community participation, and community-based tourism, as major predictors of local residents attitude toward tourism development in small islands. Kajian ini telah menggunakan penunjuk sifat kemampanan seperti perancangan jangka panjang, penglibatan komuniti dan pelancongan berasaskan komuniti sebagai penentu utama sikap penduduk tempatan dan sokongan mereka terhadap pembangunan pelancongan di pulau-pulau kecil.', 'tourism support local-residents', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2014', 0),
(525, 'Ooi Lu Ean ', 'Determination Of Frequency Dependent Global Dynamic Properties Of Engine Mount', 'The dynamic properties of engine mount influence the performance of the engine mounting system. The frequency-dependent properties represented the more accurate properties of the engine mount as opposed to the frequency-independent properties model. Sifat dinamik pelapik getah enjin mempengaruhi prestasi untuk pelapik getah enjin. Sifat kekakuan dan faktor kehilangan bersandarkan frekuensi menerangkan sifat pelapik enjin dengan lebih tepat berbanding model yang menggunakan sifat redaman tak bersandar frekuensi.', 'frequency dynamic engine-mount', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2014', 0),
(526, 'Azani Bin Salleh', 'Peralihan Kepada Sistem Obb Sektor Awam: Kajian Kes Di Jabatan Pengairan Dan Saliran Malaysia.', 'The purpose of this study is to determine how a new budgeting system that was first introduced by government in 2010 and to be fully used in 2013 was implemented in a government agency. The government agency selected for this case study is the Department of Irrigation and Drainage Malaysia (DID). Kajian ini bertujuan untuk melihat bagaimana penerimaan organisasi kerajaan terhadap pengenalan sistem bajet baru yang telah mula diperkenalkan pada tahun 2010 dan seterusnya dilaksanakan sepenuhnya pada tahun 2013. Agensi kerajaan yang telah dipilih untuk dijadikan kajian kes pula ialah Jabatan Pengairan dan Saliran Malaysia (JPS).', 'sistem obb jabatan-pengairan', '', 'Pusat Pengajian Pengurusan (School of Management)', '2014', 0),
(527, 'Sufian Farid Shaker', 'Thermal And Flow Analysis Of Piezoelectric Fans For Cooling LEDS Packages.', 'Computers, LED packages and portable electronic devices, such as minilaptops, tablets, and cellular phones, are rapidly emerging in lighter, slimmer, and more compact forms with high functionalities to meet consumer demands. This tremendous growth in advance electronics necessitates modern solutions to be adapted with the new challenges of thermal management. One of the recent thermal solutions is piezoelectric fans, which recently considered as a very strong candidate for cooling the next generation in general microelectronic devices. Komputer, pakej LED dan alatan elektronik mudah-alih, seperti komputer riba mini, tablet, telefon sel, meningkat dengan ketara dari segi bentuk, ringan, nipis, dan lebih padat dengan fungsi yang tinggi bagi memenuhi permintaan pelangan. Pertumbuhan yang ketara ini dalam elektronik termaju memerlukan penyelesaian moden bagi menyesuaikan dengan cabaran baru pengurusan terma. Salah satu daripada penyelesaian terma terbaru adalah kipas piezoelektrik, yang mana baru-baru ini dianggap sebagai alat yang amat sesuai bagi penyejukan generasi hadapan dalam alatan mikroelektronik umum.', 'thermal piezoelectric leds', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2014', 0),
(528, 'Yogheswaran Gopalan ', 'An Investigation Of The Neuroprotective Effects Of Palm Vitamin E Tocotrienols Using White Matter Lesions As The Human Study Model', 'A study was conducted to evaluate the neuroprotective activity of mixed tocotrienols using human volunteers with white matter lesion (WML). WMLs are regarded as manifestations of cerebral small vessel disease. Satu kajian telah dijalankan untuk menilai aktiviti neuroprotektif campuran tokotrienol menggunakan manusia yang mempunyai kecederaan zon putih otak [White matter lesion (WML)]. WMLs adalah manifestasi penyakit salur darah kecil cerebral.', 'neuroprotective vitamin e human', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2014', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(529, 'Reem A. H Yousef', 'The Influence Of Teacher Confirmation And Connected Classroom Climate On Malaysian University Preservice English Teachers Willingness To Communicate In English.', 'The purpose of this study was to determine the direct and indirect influences of exogenous factors, namely, teacher confirmation and connected classroom climate and endogenous factors, namely, motivation to learn English as a second language, communication confidence, and affective learning on willingness to communicate (WTC) in English among Malaysian pre-service English teachers. Also investigated was whether there were differences towards WTC in English by ethnic groups. Tujuan kajian ini ialah meninjau pengaruh langsung dan tidak langsung faktor-faktor eksogenus iaitu pengesahan guru dan keakraban pelajar serta faktor-faktor endogenus iaitu motivasi untuk mempelajari bahasa Inggeris sebagai bahasa kedua, keyakinan berkomunikasi, dan pembelajaran afektif terhadap kesediaan berkomunikasi dalam bahasa Inggeris dalam kalangan guru-guru pelatih bahasa Inggeris dari beberapa universiti tempatan terpilih di Malaysia. Juga dikaji ialah sama ada terdapat perbezaan yang signifikan dalam kesediaan berkomunikasi dalam bahasa Inggeris mengikut kumpulan etnik.\r\n', 'influence teacher english', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2014', 0),
(530, 'Raihaniah Binti Zakaria', 'Pemikiran Pendidikan Islam Ibn Qayyim Al-Jawziyyah : Analisis Terhadap Kitab Miftah Dar Al-SaAdah', 'Findings in the area of philosophy cannot be separated from the educational field. Specifically, findings in philosophy are the basis for the establishment of the educationalaims and objective, curriculum design, methodology in teaching and learning, methods of teaching evaluation and learning and all the elements that develop the education process. Penemuan-penemuan dalam bidang falsafah adalah tidak terpisah dari bidang pendidikan. Secara lebih spesifik, penemuan-penemuan dalam bidang falsafah menjadi rujukan kepada pembentukan tujuan-tujuan pendidikan, pembentukan kurikulum, metodologi pengajaran pembelajaran, kaedah penilaian pengajaran dan pembelajaran dan semua unsur-unsur yang membentuk proses pendidikan.', 'islam al-jawziyyah', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2014', 0),
(531, 'Zuriawati Binti Zakaria ', 'Managerial Entrenchment And Dividend Payout Policy Of Malaysian Public Listed Companies.', 'This thesis examines the influence of managerial entrenchment towards companies dividend distribution. This includes the effects of high managerial entrenchment on investment opportunities, internal governance, monitoring by external governance, CEO incentives, and different types of ownership. The thesis analyzed 327 companies listed on Bursa Malaysia from 2005 to 2010. Tesis ini meneliti pengaruh kekukuhan pengurusan terhadap pengagihan dividen syarikat. Ini termasuk kesan pengurusan berkekukuhan tinggi ke atas peluang pelaburan, tadbir urus dalaman (saiz lembaga pengarah, ahli lembaga asing, dan undi pemilik terbesar), pemantauan oleh tadbir urus luaran (kebebasan lembaga pengarah), insentif Ketua Pegawai Eksekutif (ganjaran dan opsyen saham) dan jenis pemilikan yang berlainan (pemilikan tertumpu, pemilikan kerajaan, pemilikan asing, dan pemilikan pengurusan). Tesis ini menganalisa 327 syarikat yang tersenarai di Bursa Malaysia dari tahun 2005 hingga 2010.', 'entrenchment payout-policy companies', '', 'Pusat Pengajian Pengurusan (School of Management)', '2014', 0),
(532, 'Maryam Hj Sulaiman', 'Effect Of Integrating Lesson Study Approach In The Preparation Of Preservice Chemistry Teachers', 'Tujuan utama kajian ini adalah untuk mengkaji keberkesanan model Cognitive Apprenticeship melalui pendekatan Lesson Study untuk menyedia guru praperkhidmatan memperoleh pengetahuan dan kompetensi dalam pengajaran Kimia. Penyelidikan ini telah dijalankan menggunakan rekabentuk mixed-methods dinamakan model Concurrent Embedded Experiment, yang menggabungkan kutipan data secara kuantitatif dan kualitatif. The main purpose of this study was to investigate the effect of Cognitive Apprenticeship model through Lesson Study approach to prepare preservice teachers to acquire appropriate knowledge and competencies in teaching Chemistry. This research was conducted using a mixed-method research design known as Concurrent Embedded Experimental model, which incorporated both quantitative and qualitative data collection.', 'integrating study preservice', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2013', 0),
(533, 'Shamsu Mohamad', 'Penambahbaikan Atap Singgora Dari Aspek Bahan Gunaan Dan Reka Bentuk.', 'Tesis ini mengkaji tentang atap tanah liat iaitu singgora. Sejarah awal menjelaskan bahawa teknologi pembuatan atap singgora dibawa masuk ke Songkla oleh para pedagang Cina pada abab ke-16. Selain Songkla, perusahaan atap singgora telah berkembang dengan pesat sehingga ke negeri Kelantan dan Terengganu. Atap singgora digunakan secara meluas dalam seni bina tradisi masyarakat Melayu, Thai dan Cina Peranakan. Seni bina tradisi yang dimaksudkan ialah rumah, wakaf, masjid, wat Buddha, pintu gerbang, dan makam. Perusahaan tradisi ini semakin pupus, sehingga kini masih terdapat sebuah perusahaan dari Kampung Pengkalan Baru, Bachok (KPBB) yang masih beroperasi. Pemasalahan kajian ini bertitik tolak dari kelemahan produk atap singgora yang mudah pecah apabila ditimpa oleh ranting kayu, daun kelapa dan sebagainya. Haiwan, dan angin kencang merupakan di antara punca yang menyebabkan berlaku kerosakan dan anjakan di sebabkan saiznya yang kecil dan nipis. Oleh yang demikian, matlamat utama penyelidikan ini adalah bagi mencari solusi dalam memperbaiki kelemahan atap singgora seperti yang telah maklum. Ini dapat dicapai dengan meningkatkan kekuatan tanah liat atap singgora dan cara susun atur yang lebih ekonomikal. Oleh yang demikian, penambahbaikan bukan sekadar menumpukan kepada aspek estetika semata. Metodologi penyelidikan ini menggunakan kaedah campuran iaitu penyelidikan kualitatif dan kuantitatif. Data-data kualitatif berkenaan atap singgora berkisar tentang sejarah, proses pembuatan, dan evalusi prototaip. Segala maklumat diperolehi melalui temubual, pemerhatian dan bahan bertulis. Bagi penyelidikan kuantitatif, data-data diperolehi melalui beberapa kaedah uji kaji; MOR, XRF, XRD, SEM dan uji kaji fizikal bahan tanah liat. Untuk uji kaji tekanan lentur, MOR merupakan instrumen utama yang paling banyak digunakan bagi menguji kekuatan tanah liat. Berdasarkan keputusan keseluruhan ujikaji MOR, terbukti fomurla yang menggunakan litium karbonat mencatatkan kekuatan yang paling tinggi berbanding bahan lain. Secara ringkasnya, melalui reka bentuk baru dan menambah kekuatan atap singgora. ia akan terus relevan dalam seni bina Negara pada abab 21.', 'penambahbaikan singgora gunaan', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2013', 0),
(534, 'Ali Bin Othman', 'Bandwidth Enhancement Of Pyramidal Horn Antenna Using Dielectric Resonator Feeder', 'Nowadays, satellite communications play an important role in telecommunications. As a result, high gain and broadband antennas are part of the solution to establish a concept of wide frequency usage. Pyramidal horn antenna is most widely used as feed in satellite communication and tracking due to suitability for high gain and broadband applications. Generally, pyramidal horn antennas are fed by a coaxial feed transition. However, there is a fundamental limitation on the operating bandwidth (BW) of the coaxial feed transition and is often being considered as narrowband device. This thesis describes the development and analysis of the BW enhancement feeding technique for pyramidal horn antenna using a dielectric resonator (DR) feeder. The hybrid dielectric resonator antenna (DRA) found to be in essence contributing the BW of the design feeder. The combinational effect of two radiators produces multiple resonant frequencies and provides wideband 48.15% of measured -10 dB return loss impedance BW centered at 14.23 GHz, while that of the pyramidal horn with conventional coaxial feed transition is 13.27%. The designed feeder provide an average simulated gain of 16.22 dBi with flexibility in the impedance BW and the far-field radiation characteristics appears to be satisfied within the operating BW. The pyramidal horn improved the gain of the hybrid DRA by 12.34 dBi. The effectiveness of proposed design and preliminary results of the design have shown a potential to exploit the designed feeder to be used in a parabolic antenna for tracking of satellites applications at 10 to 18 GHz. In conclusion this work offers a new, efficient and relatively simple alternative feeding technique configuration for pyramidal horn antenna.', 'bandwidth pyramidal resonator', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2013', 0),
(535, 'Maryam Farooqui', 'Use Of Complementary And Alternative Medicines Among Cancer Patients In Penang, Malaysia: A Qualitative And Quantitative Assessment Of Health Beliefs, Treatment Disclosure And Health Related Quality Of Life', 'The use of Complementary and Alternative Medicines (CAM) is widespread for general health maintenance and management of disease symptoms. In Malaysia, there is evidence that a variety of CAM is used by patients with cancer. Cancer patients tend to use CAM in an attempt to reduce cancer recurrence and to lessen the side effects due to conventional therapies. The study aimed to provide a comprehensive evaluation of health beliefs, treatment disclosure and health related quality of life of cancer patients in the context of CAM. A mixed methodological approach using both qualitative and quantitative methods was adapted. The thematic content analysis identified three major themes: patients beliefs towards cancer and its treatment, patients perceptions toward the use of CAM for cancer treatment and the disclosure of CAM use to the health care providers. Twenty patients were interviewed, twelve of them reported to use CAM while only four disclosed it to the doctors. The slow progression of CAM effectiveness and cost were given as barrier to CAM use. Patients agreed that CAM disclosure is important to avoid any interaction with the conventional medicines.', 'medicines cancer health', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(536, 'Theresa Ho Char Fei ', 'The Influence Of Intellectual Capital And Organisational Learning Capability On The Competitive Capabilities Of Manufacturing Small And Medium Enterprises (Smes) In Malaysia.', 'This research examined the relevance of intellectual capital in the context of manufacturing SMEs in Malaysia and how intellectual capital can enhance manufacturing competitive capabilities through organisational learning capability from the dynamic capability perspective. This research also investigates the relationship between manufacturing competing capabilities and business performance. In addition, it also examined how dynamic environment moderates the relationship between competitive capabilities and business performance. Data were collected from 145 manufacturing SMEs via survey questionnaire developed from related literature and interviews from practitioners. The data collected were then analysed using structural equation modeling via Smart PLS. Findings indicate that intellectual capital in terms relational and organisational capital had significant impact on organisational learning capability. Organisational learning capability mediates the relationship between intellectual capital (relational and organisational capital) and manufacturing competitive capabilities in terms of delivery dependability, flexible product innovation and quality. As for the relationship between manufacturing competitive capabilities and business performance, this study found quality have a significant impact on financial performance. This study also found that there is a significant positive relationship between non-financial performance and competitive capabilities (delivery dependability and quality). Moderating effect of dynamic environment on the relationship between competitive capabilities (delivery dependability and quality) and financial performance were found in this research. Theoretical and practical contributions of the research findings were discussed. Limitations of the research were explained and suggestions for future research were also presented.', 'organisational manufacturing enterprises', '', 'Pusat Pengajian Pengurusan (School of Management)', '2013', 0),
(537, 'Karim Hashim Kraidi Al-Saedi', ' A False Alert Reduction And An Alert Score Assessment Framework For Intrusion Alerts', 'The Alert Detection Engine (ADE) is a powerful network security system that is used to secure computer networks. ADE can detect security breaches which other forms of security measures unable to uncover. Yet, it still suffers from the problem of generating huge amounts of alerts that are mostly false positives. Each ADE generates a large number of alerts, where some are real and the others are not (i.e. false or redundant alert). Consequently, this increases the ambiguity among the decision makers as they conduct assessments of alerts. In particular, real alerts of ADE are not classified based on the magnitude of the threat they pose. Therefore, it is difficult for the security analyst to identify attacks and take remedial action against their threats, making it necessary to categorize the magnitude of each threat. For this reason, it becomes necessary to categorize the degrees of threat using data mining techniques, especially where huge data are involved. Several reduction and assessment approaches have been proposed to solve these problems; however, they unable to address many other problems related to ADE. This thesis proposes a new framework called A False Alert Reduction and an Alert Score Assessment Framework for Intrusion Alerts. The objectives of using this framework are to reduce the false alerts and to assess such alerts and examine their threat scores. This work aims to provide a full understanding of the network attacks as well as ease the process for the analysts and save their time. Framework is a standalone system that can work online and offline. It combines the following algorithms: the first algorithm is New Alert Reduction (NAR) algorithm to remove the redundancy from the alerts file and reduce the false positives.\r\n\r\n', 'reduction alert intrusion', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2013', 0),
(538, 'Mahmoud A. M. Albreem,', 'Lattice Sphere Detection Techniques In Block Data Transmission And Multiuser Wireless Systems', 'Recent years have witnessed an increase in demand for higher transmission data rates for wireless multimedia communications applications. Block Data Transmission Systems (BDTS) and Code Division Multiple Access (CDMA) are considered as efficient techniques for high data rate transmission and found in the coming generation of mobile and wireless technologies such as Long Term Evolution (LTE) systems. The Exhaustive Search (ES) detector is the optimum. Owing to its high computational load, lattice sphere detection (LSD) technique and its variants had been proposed. For the system designer, the main objective is to achieve an attractive performance-complexity tradeoff. In this research, LSD based detectors are designed for BDTS and Multi-User Detection (MUD) system. LSD searches lattice points in a sphere within a predetermined radius. In LSD, when the initial radius increases, the performance and complexity increased. This research produces exact expression for the sphere radius used in LSD technique which depends on the lattice dimension and average received power. It is well known fact that a small condition number results in a better detection performance. This research aims to reduce the condition number value to its smallest possible using the regularization methods (L1-regularization and L2-regularization), and utilizing special matrices (i.e., Hankel and Toeplitz). Sequentially, this research proposed a new detection technique which called as a near-An-LSD technique. Exact relationships between the LSD performance and condition number, and the relationship between the radius and condition number had been derived.', 'lattice data wireless', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2013', 0),
(539, 'Norizah Binti Aripin', 'Keberkesanan, Corak Rantaian Komunikasi Dan Kedinamikan Pasukan Maya Dalam Organisasi Bertaraf Koridor Raya Multimedia (Msc) Terpilih', 'These days teamwork plays an important role in the organisation due to the effects of globalisation in the world of commerce. Although communication technologies help simplify the management of work in virtual teams, there still exists many problems such as interpersonal communication and team relationships when working with other members based in different locations and time zones. Therefore, this study was undertaken to understand how virtual teams work within the constraints of distance and time. Epistemological paradigm positivist (quantitative) and interpretivist (qualitative) approaches were utilised in this study to obtain a general description of the effectiveness of virtual teams, and network communication patterns besides a better understanding of the dynamics of virtual teams. A total of 363 respondents, and three different types of virtual teams were involved in this study. This involved staff participation among those with experience in virtual team working conditions based at an MSC status organisation. Results of the study found four factors that contribute to virtual team effectiveness. They are internal dynamics of the team in terms of frequency of use of communication media (fax, e-mail and shared database systems), the internal dynamics of the team in terms of team relationships (relationship among team members, relationship and level of trust among leaders with team members), diverse work practices and team recognition.', 'komunikasi kedinamikan msc', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2013', 0),
(540, 'Muchtaridi', ' Computer-Aided Drug Design Of Potential Neuraminidase Inhibitors From Plant Extracts.', 'Neuraminidase (NA) of influenza virus is responsible for the proliferation and infections of the virus progeny, prompting several efforts to discover and optimize new neuraminidase inhibitors. The main aim of this study is to discover new potential neuraminidase inhibitor from the natural product source using computeraided (pharmacophore modelling-molecular docking) drug design method combined with bioassay-guided isolation. Two Hypogen models were selected as screening sievers (ROC AUC =0.91 and 0.80;   = 0.92 and 0.90). These models were integrated with molecular docking to screen 3000 compounds from NADI database. Virtual screening results showed that xanthone derivatives from G. mangostana (mangosteen) were the top hits, thus provide rationale to select this plant for further isolation. Seven compounds obtained from mangosteen showed inhibition more than 80 % by bioassay-guided isolation. The potency of neuraminidase (NA) (C. perfringens-NA and H1N1-NA) inhibitory effect in this study is as follows: garcinone D > -mangostin > -mangostin > garcinone C > 3-isomangostin > gartanin > 8-deoxygartanin. These seven compounds were favourably docked to the binding site of NA.', 'computer-aided neuraminidase extracts', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(541, 'Mohamad Yusri Bin Aman ', 'Water Sensitivity Of Warm Porous Asphalt Incorporating Sasobit.', 'The asphalt industry is making constant efforts to minimize energy consumption and reduce emissions by lowering asphalt production temperature. This can be achieved by incorporating warm asphalt additive named Sasobit. In this study, rheological properties of a conventional bitumen 60/70 penetration grade with and without Sasobit at different aging conditions have been investigated. The addition of Sasobit content increased penetration index and complex modulus (G*), despite reduction in phase angle (). By adding 3% Sasobit, the mixing temperature is decreased from 160C to 150C. Meanwhile, adding 1%, 2% and 3% of it increased the PG 70 base binder to PG 73, PG 74 and PG 76, respectively. There was no significant change observed in the mixing temperature from 3% to 4% of Sasobit addition. However, the reduction of mixing temperatures may prevent moisture from being completely evaporated from the aggregate and so affect the bitumen bond, making the mixture more susceptible to stripping. Two anti-stripping additives, namely hydrated lime and Pavement Modifier (PMD) were used to reduce the destructive effects of moisture. The Dynamic Asphalt Stripping Machine (DASM) that simulate rainfall event was used to enhance stripping. Upon subjected to dynamic stripping, specimens were tested for indirect tensile strength and Cantabro test showed lower strength and less resistance to disintegration due to stripped mastic as compared to immersing condition.', 'water porous sasobit', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2013', 0),
(542, 'Chee Su Yin ', 'Developmental Biology And Genetic Diversity Of Selected Neritidae In Malaysia With An Emphasis On Nerita Balteata', 'The gastropods in this study are from the genus Nerita found in the rocky and muddy intertidal zones along the coasts of Malaysia. The species diversity was analyzed, morphological descriptions were made, and barcodes of cytochrome oxidase I were generated for each of the 12 species of nerites found. The nuclear gene, ATPS-, successfully determined the phylogenetic status of each species. Twenty-one populations of the focal species of this study, N. balteata, were sequenced for 16S rRNA gene fragments to determine the population structure of nerites found in this region. Despite geographic and oceanographic barriers and habitat boundaries, the nerites managed to maintain a homogeneous structure between Peninsular Malaysia, Sarawak, and Sabah. Genetic distances between populations were low, phylogenetic trees did not exhibit distinct clades which denoted singular populations, and network diagrams produced two major haplotypes with most populations accounted for in each.', 'biology neritidae nerita-balteata', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2013', 0),
(543, 'Jasni Bin Dolah', 'Development And Effects Of An Interactive Multimedia Learning Environment (Imle) In Learning Autism Behavioral Symptoms', 'This research was focused to develop and evaluate the effectiveness of a multimedia learning environment with the purpose of increasing learners knowledge, awareness as well as perceived motivation towards learning of autism behavioral symptoms. An Interactive Multimedia Learning Environments (IMLE) was developed by integrating relevant learning theories and multimedia principles to provide learners with an interactive content experience. The objective of this research was to study the effects of IMLE as measured by Knowledge Awareness Scale (KAS) in terms of Design Strategies, Gender, Learning Styles and perceived motivation. This research employed a quasiexperimental research with purpose to investigate the effects of two presentation modes: Presentation Mode 1 (Modality Principle) and Presentation Mode 2 (Redundancy Principle). The sample of this study consists of special education pre service teacher who were taking special education courses at local public universities. The total population size of 550 was selected and based on Krejcie and Morgan (1970) table; around 225 samples was selected for the final treatment. The study used several instruments in ensuring the consistency of the outcome during the treatment. The first instrument was the Index of Learning Styles (ILS) developed by Felder and Soloman (1994) with purpose to identify the learning style preferences of the respondents. A second instrument was the Knowledge Awareness Scale (KAS) which requires respondents to self-assess the instrument before and after the presentation modes. The last instrument was the Instructional Material Motivation Scale (IMMS) developed by Keller (2006) which measure the perceived motivation after respondents have completed with KAS 2.', 'multimedia learning autism-behavior', '', 'Pusat Pengajian Seni (School of the Arts)', '2013', 0),
(544, 'Jinan Hatem Issa', 'English Teacher Education In Malaysian Tertiary Institutions: Aligning Tqm To The Determinants Of Quality.', 'Kualiti adalah matlamat utama yang berusaha dicapai oleh pengurusan sesebuah organisasi dalam prestasi mereka setiap hari. Quality is the leading goal that organisations management strives for accomplishing in its everyday performances.', 'english teacher quality', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2013', 0),
(545, 'Islam Abu Sharbain', 'A Proposed Training Program To Improve English Primary Pre-Service Teachers Competencies And Their Attitudes Towards The Teaching Profession. ', 'Kajian ini bertujuan mengkaji keberkesanan program latihan yang dibangunkan ke atas kecekapan guru Bahasa Inggeris sekolah rendah pra-perkhidmatan dan sikap mereka terhadap profesion perguruan. The study aimed at examining the effects of a developed training program on English primary pre-service teachers competencies and their attitudes towards the teaching profession in the Gaza strip.', 'proposed pre-service teachers', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2013', 0),
(546, 'Mahmoud Abdullah Hussein Al-Areefi', 'The Influence Of Drug Promotion Techniques On Prescribing Decisions Among Physicians In Sanaa City, Yemen', 'The pharmaceutical industry invests heavily in promotion, and it uses a variety of promotional strategies to influence physicians prescribing decisions. The purpose of this study is to explore those factors used to influence physicians prescribing decisions and their role in decision-making process. Specifically, this study investigates the relationships between physicians and medical representative (MRs) and to identify physicians perceptions, beliefs and attitudes toward interactions with those MRs, and to explore the potentially modifiable factors influencing those interactions; to identify the main sources of information physicians use to obtain knowledge about new drugs and to explore how they influence physicians prescribing decisions; and to investigate the relationship of physicians characteristics and practice-setting factors with previous factors. This study was conducted in a step-wise approach. In the first phase, a qualitative research method was adopted to have an in-depth understanding of the phenomenon surrounding the nature and extent of drug promotion techniques. In the second phase, a quantitative method was applied using the cross-sectional. Research was conducted in Sanaa, Yemen. Physicians in public and private hospitals were surveyed. All instruments were tested for its reliability and validity measures.', 'drug prescribing physicians', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(547, 'Shadi Khaled Abdullah Al-Badareen', 'The Use Of A Modified Strategy-Based Module In Developing Creative Thinking And Self-Concept Of Low Achievers In Jordan.', 'The purpose of this study was to find the effectiveness of a modified strategy-based module (MSBM) that based on CoRt and SCAMPER in the development of creative thinking and self-concept among a sample of low achievers in Jordan. The study sample comprised 160, sixth year female and male elementary low achievers randomly selected from 8 resource rooms at Al-mafareq governorate. The sample was divided into four groups. The experimental groups received the modified strategy-based module (MSBM) and the control groups received the currently strategy-based used module (CSBUM) for four weeks, after which a post-test was administered. The findings revealed that there is a significant difference between the post-test means of the two experimental groups against the two control groups performance. An analyses of variance based on correct responses recall for the (Piers-Harris 2 Self Concept Scale) and (Torrance Creative Thinking Test) posttests grades indicated significant differences between the experimental and control groups in their creative thinking and self-concept. In summary, the findings of this study not only support current opinion regarding the state of training low achievers creative thinking and self-concept in Jordan, but more pertinently, it highlights the fact that remedial action needs to be taken to address the inherent failure of the educationists to follow effective methods to improve low achievers creative thinking and self-concept to improve academic performance. One way of doing so would be to use the findings of this study to look into the possibility of training low achievers in the Jordanian resource rooms in a useful and integrative manner. Consequently, the study has recommended some suggestions.', 'creative-thingking self-concept low-achievers', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2013', 0),
(548, 'Alireza Jalali', 'The Moderating Effect Of Social Capital In Relation To Entrepreneurial Orientation And Firm Performance', 'The importance of entrepreneurial orientation (EO), resource-based view (RBV), network types of social capital (SC) and small and medium enterprises (SMEs) have become the main focus in the manufacturing environment. In view of the highly competitive manufacturing environment, the ability and reliability of small and medium enterprises (SMEs) is very important in order to achieve desired SMEs performance namely growthprofitability. In addition to that, literature argues that further research is required in the area of entrepreneurship and firm performance. In order to address this need, the study investigates 1. The relationship between EO and Manufacturing SMEs performance and 2. The moderating effect of intra- and extra-industry network in EO and manufacturing SMEs performance relationship. Quantitative method was done through survey. Instrumentation of data-gathering in quantitative method was done through questionnaires and its validity was measured by content validity. The population of this study was industrial SMEs in Tehran and Hamedan. Proportionate stratified random sampling was employed and out of 351 questionnaires sent out, only 150 questionnaires were returned, yielding a return rate of 25 percent. A model is hypothesized and analyzed by multiple regressions. The result implies that EO positively improved manufacturing SMEs performance.', 'social-capital entrepreneurial performance', '', 'Pusat Pengajian Pengurusan (School of Management)', '2013', 0),
(549, 'Siti Arffah Binti Kamarulzaman', 'Gene expression profile of primary fibroblasts from keloid and normal skin treated with palm oil tocotrienol rich fraction (TRF)', 'Keloid adalah penyakit kulit fibroproliferatif yang terbentuk disebabkan oleh tindak balas luka yang tidak normal pada individu tertentu. Perubahan terhadap faktor pertumbuhan dan sitokin dalam proses penyembuhan yang tidak normal membentuk keadaan yang tidak seimbang antara sintesis dan degradasi kolagen dan komponen ekstraselular matriks yang lain. Pelbagai rawatan telah dicuba untuk keloid, tetapi secara klinikal, kebanyakan terapi masih tidak memuaskan. Kepentingan saintifik tokotrienol telah meningkat kerana sifatnya sebagai antioksida dan sifat berkaitan pelindung. Walau bagaimanapun, terdapat kekurangan bukti saintifik mengenai keberkesanan tokotrienol dalam pengurusan keloid dan parut. Oleh itu, kajian ini telah dijalankan untuk menyiasat kesan-kesan berfaedah pecahan tokotrienol (TRF) minyak kelapa sawit pada fibroblas keloid. Keloids are dermal fibroproliferative disease that developed due to abnormal wound response in predisposed individuals. The alteration of growth factors and cytokines in abnormal healing process formed an imbalanced condition between collagen and other extracellular matrix components synthesis and degradation. Various treatments for keloids have been tried but most of the therapeutic approaches remain clinically unsatisfactory. Tocotrienols have gained increasing scientific interest due to their antioxidant and related protective properties. However, there is lack of scientific evidence regarding the efficacy and therapies of tocotrienol in keloid and scar management. Thus, this study was carried out to investigate the effects of palm oil tocotrienol rich fraction (TRF) on human keloid fibroblasts. Keloids and normal skin were collected as samples in this study.', 'fibroblasts keloid tocotrienol', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2013', 0),
(550, 'Ahmad O. Al Fawair', 'Identifying Training Needs And Client Satisfaction Of Vocational Rehabilitation Services For Students With Physical, Intellectual, Or Multiple Disabilities In Kuwait. ', 'Keperluan latihan dan kepuasan pelanggan adalah dua kebimbangan utama dalam pemulihan vokasional tetapi belum ditangani di Kuwait. Training needs and client satisfaction are two of the major concerns in vocational rehabilitation but has not yet been adequately addressed in Kuwait.', 'training rehabilitation disabilities', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2013', 0),
(551, 'Khaled Saleh Algariri', ' Antihyperglycemic And Toxicological Studies Of EthanolicAqueous Extracts Of Gynura Procumbens', 'Leaves of Gynura procumbens (sambung nyawa) have been used in Malay traditional medicine among others to treat diabetes. It is understood that the leaves contain many compounds and only one or a few of these compounds possess the antidiabetic activity. Therefore, the aim of this study was to extract the leaves using solvents of different polarity, mixtures of the different ratio of ethanol-water to select the extract that contains compound(s) with the strongest antidiabetic activity and to carry out acute and subchronic toxicity tests of the extract with better activity. The antidiabetic activity of the extracts was compared based on their ability to lower down the blood-glucose level of normal rats and streptozotocin-induced diabetic rats. Dried powdered leaves of the plant were extracted with 0, 25, 50, 75 and 95% ethanol and concentrated using rotary evaporator respectively. The 0, 25, 50, 75 and 95% ethanol extracts respectively significantly reduced (p<0.005) blood-glucose level of streptozotocin induced diabetic rats at 3rd and 5th hours after oral administration of 1000 mg/kg of the extracts. The 25% ethanol extract showed the strongest antidiabetic activity and similar to metformin significantly reduced (p<0.005) blood-glucose level at the 2nd, 3rd, 5th and 7th hours after administration. In the phytochemical analysis the 75% ethanolic extract contained the highest flavonoids content, while the water extract showed the lowest value. In addition, the n-butanol fraction from 25% ethanolic extract represented the highest value of flavonoids and phenolics contents.', ' antihyperglycemictoxicological ethanolic', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(552, 'Salem Ali Alsalem Bashanfer', 'Gene Expression Profile And Modulation Of Genetic Pathways In Acute Myeloid Leukaemia T(8;21)', 'Many in vivo and in vitro models have been widely used in experimental research in order to facilitate pathway analysis, gene targeting and further scientific discoveries. Cell lines, such as Kasumi-1 and SKNO-1, have been used to study the AML1/MTG8 mechanisms in acute myeloid leukaemia t(8;21). However, in some cases, results obtained from in vivo and in vitro studies are incompatible or not valid when applied on patients. Given the above, the primary aim of this study is to explore and identify the similarities and differences of gene expression profiles of AML t(8;21) patient samples and the corresponding cell lines (Kasumi-1 and SKNO-1) as compared to normal CD34 cells. The initial analysis revealed that there were 34,073 differentially expressed genes found in patient samples and the corresponding cell lines as compared to the control cells, with a Spearman Rho correlation coefficient of 0.451 between the patient samples and cell lines. However, the 6,092 overlapping differentially expressed genes (3,297 upregulated) and (2,795 downregulated) between patient samples and the corresponding cell lines had a Spearman Rho correlation coefficient of 0.826. These overlapping genes were then subjected to further analysis. The analysis comprised of hierarchical clustering, gene ontology and functional annotation clustering as well as pathway analysis using two different software packages (GeneSpring v11.5 and DAVID v6.7). The aim of the analysis was to identify the function of those genes and pathways implicated within.', 'gene modulation leukaemia', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2013', 0),
(553, 'Rayenda Khresna Brahmana', 'Psychology Biases Explanation On Malaysian Day Of The Week Anomaly.', 'The main assumption in conventional finance is rational behavior. Based on this tenet, investor is presumed cannot beat the market because each investor has same amount of information with similar quality. However, market anomalies, such as Day-of-the week anomaly, are the dossiers to show that basic tenet cannot be longer hold. Considering the importance of DOWA in investment strategy and finance theory, it is imperative to study further the determinant of that Monday irrationality from the perspective of investors behavior. Even though many researchers have proposed trading behavior as the explanation of the Monday Irrationality or Day-of-the Week anomaly, yet, it has still left without empirical evidence. This research aims to investigate empirically by gauging psychological approach whereas the affection bias (weather-induced mood, and moon-induced mood), and cognition bias (attention bias, and cognitive dissonance) are the factors. In regards of examining the relationships, this study employed two regression models, namely, interactive model and day-by-day model. Preceding this phase, the role of affection (temperature and full moon) was preliminary tested by conducting time series quasi experimental study.', 'psychology biases anomaly', '', 'Pusat Pengajian Pengurusan (School of Management)', '2013', 0),
(554, 'Chea Sam Ang ', 'Integration Of Tree Planting In Family-Based Social Forestry As An Effective Tool For The Conservation Of Endangered Timber Species For Kingdom Of Cambodia', 'Combadian has experiences deforestation and forest degradation since late 1990s due to rapid economic development and fast growing population. As a reult, timber species are now under the endangered list. The conservation of these timbers is given higher priority. In this project, Thress villages in the provience of rattanakiri were selected.', 'tree-planting conservation timber', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2013', 0),
(555, 'Irni Hamiza Binti Hamzah', 'Design, Fabrication And Characterization Of Fr4-Based Dna Label Free Sensor Integrated With Pocket-Sized Readout Circuitry.', 'Silicon, glass and ceramic are commonly base substrates used in SU8 film fabrication and DNA biosensor. All these substrates are biocompatible, expensive, hard and brittle, difficult for drilling and dicing, requires expensive equipments and complex methodology of fabrication. Microcracks are often found on SU8 film due to the large gap of thermal expansion coefficient (TEC) between silicon/glass and SU8. In addition, the use of bulky equipments and accessories that must be interfaced with hardware and software through a central processing unit (CPU) limits the portability of the whole biosensor system. Hence, the aim of this work is to investigate on the suitability of polymethylmethacrylate (PMMA) to be used as a base substrate for SU8 film fabrication and the application of a non-biocompatible material, flame retardant 4 (FR4) as a base substrate for a label free DNA biosensor. A portable and handy readout circuitry with double-sided pocket-sized of PCB for DNA detection through current measurement cyclic voltammetry (CV) method has been developed and integrated with the FR4-based fabricated sensor. The Au is fabricated throughout all conducting tracks on the FR4 and the characterization of the fabricated FR4-based sensor to perform CV reversible process is confirmed by a series of analysis. The thiol group at the 3-end of ssDNA is used to link the DNA with the Au surface and act as probe DNAs. Two types of target DNAs which consist of complementary nucleobase sequence and noncomplementary nucleobase sequence are used to investigate on the hybridization mechanism with the probe DNAs.', 'design fr4-based-dna circuitry', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering) ', '2013', 0),
(556, 'Nor Ilyani Binti Mohamed Nazar', 'Therapeutic drug monitoring in methadone maintenance therapy (MMT) : an evaluation of genetic factors influencing clinical outcomes and serum concentrations of methadone', 'Terapi Gantian Methadone (TGM) telah digunakan secara meluas dan berfungsi untuk mengelakkan berlakunya gejala penarikan dalam kalangan penyalahguna dadah jenis opiat. Ia merupakan salah satu daripada kaedah pendekatan pengurangan kemudaratan (harm reduction) bagi menurunkan kadar penularan jangkitan melalui darah dalam komuniti terutamanya HIV AIDS yang boleh membawa maut. Walau bagaimanapun, proses penentuan dos yang optimum bagi setiap pesakit adalah sukar dan mencabar kerana ia menunjukkan kepelbagaian aktiviti farmakologi yang tinggi dalam individu yang berbeza. Kajian ini menghuraikan hubungkait di antara kepekatan methadone darah (Ctrough) dengan dos harian pesakit dan keberkesanan yang dikehendaki iaitu keterukkan gejala penarikan dan ujian pengesahan air kencing bagi pengambilan dadah terlarang. Hubungan antara pelbagai haplotaip gen CYP2B6 dengan kepekatan methadone darah dan variasi polimorfisme nukleotida tunggal OPRM1 (A118G) dengan tahap keberkesanan klinikal yang diukur juga dikaji. Methadone maintenance therapy (MMT) has been widely used to prevent withdrawal symptoms among opiate use disorder patients. It is one of the harm reduction approaches in order to reduce the spread of fatally blood borne diseases in the community especially HIV AIDS. However, determining the optimal dose in patients is somehow difficult and challenging as it shows wide inter-individual variability of pharmacological activity. This study correlates the trough serum methadone concentrations (Ctrough) at steady state with the methadone dose and the clinical outcomes namely severity of withdrawal symptoms and urinalysis for other illicit drugs. The relationship between various CYP2B6 haplotypes with the Ctrough and OPRM1 (A118G) single nucleotide polymorphisms (SNPs) with the clinical outcomes measures were also studied.', 'therapeutic methadone clinical', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2013', 0),
(557, 'Noor Raha Mohd Radzuan', 'An Analysis Of Technical Oral Presentation Anxiety In English Among Engineering Students In Universiti Malaysia Pahang', 'This main aim of this study was to analyze the anxiety experienced by engineering students in delivering effective technical oral presentations (TOP) in English in the context of chemical engineering education. It also investigated the factors that may have contributed to the students\' feelings of anxiety. This study draws on the Social Cognitive Theory (Bandura, 1986), Processing Efficiency Theory (Eysenck & Calvo, 1992) and the Recursive Framework of Anxiety, Cognition and Behaviour (MacIntyre, 1995) in discussing engineering students\' technical oral presentation anxiety. In addition, the concept of Communication Apprehension (McCroskey, 1982b) was used as a basis in further understanding the anxiety experienced by the students in technical oral presentation and oral communication in English as a second language (ESL). This case study used a mixed method sequential explanatory approach proposed by Creswell (2003). Two questionnaires were used in this study: (1) an adapted version of Personal Report of Public Speaking Anxiety (PRPSA-34) (Richmond & McCroskey, 1998) questionnaire and (2) the Personal Report of Communication Apprehension (PRCA-24) (McCroskey, 1982a) questionnaire. Other instruments used were semi-structured interviews and document analysis.', 'technical anxiety engineering', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2013', 0),
(558, 'Kadhim Fathel Khalil', 'Architectural Typology Of Mesopotamian Civilization From Ancient Cultural Myth. ', 'Some facts can be easily inferred subjectively but difficult to prove objectively, thus causing the philosophers who came before Socrates to deviate from logic in interpreting the nature of the physical world around them. The dialectic between subjectivity and objectivity is the force that motivated us to restore the symbolic dimensions of Mesopotamian cultural and architectural products. The most important theoretical presentations of architecture are those that deal with the metaphysical and physical environments, which together form the contemporary cultural identity. The most important dialectics in contemporary architectural society in MesopotamiaIraq are related to the importance of formulating the basis of cultural identity by highlighting the importance of studies that focus on the Mesopotamian cultural environment. No civilization is older than Mesopotamia, and the cultural and architectural products of this society have extended spatially and temporally but are incapable of speaking for themselves, which lends difficulty to understanding the interpretations of the mental expressions that stand behind the material expressions. As a result, a kind of ambiguity exists about the nature of knowledge relative to its origin in terms of the reflection of mental expressions on architectural expressions. This study sets off from a consideration of cultural and architectural products as part of the philosophical perspective. Therefore, the intellectual exploration of the architectural prototype appears to be the abstract level that is connected to mental expressions on one hand and architectural expressions on the other. The inquiry is phenomenologically unknown; thus, a methodological inquiry was applied by based on the path of formation comprising the spirit of the age and the path of abstraction comprising the cultural species. Thus, this study first adopted the structural analysis method considering the nature of the Mesopotamian cultural core to identify the structure of its mental expressions. Such expressions are represented by myth of creation in Mesopotamia, which is based on the structure of origin, evaluation, and organization. Second, this study adopted the geometrical analysis method to determine the structure of the architectural expressions, which are represented by symbolic architecture, temples, and palaces in Mesopotamia based on the structure of the wholepart, publicprivate, and massvoid.', 'architectural mesopotamian cultural', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2013', 0);
