(559, 'Khe Cheng Seong', 'Role And Correlation Of Synthesis, Size And Morphology To The Magnetic Properties Of Cobalt And Cobalt/Gold Bimetallic Hierarchical Nanostructures.', 'Cobalt is a ferromagnetic material while cobalt-gold bimetallic particles are expected to have modulated magnetic properties. Besides, gold nanostructure is also a good plasmonic material. However, cobalt is susceptible to oxidation in aqueous environment. The oxidised layer can harm the magnetic properties. Therefore, in order to avoid oxidation of cobalt, this work was devoted to the synthesis of cobalt and cobalt-gold bimetallic hierarchical particles using polyol method cum galvanic replacement reaction. A number of synthesis conditions were experimented in order to investigate their impacts on the morphologies of the cobalt particles produced. The parameters studied including reaction time, sodium hydroxide, concentration of cobalt salt, reaction temperature, reducing agent and surfactants. Various morphologies were successfully prepared such as hierarchical microspheres, hierarchical polyhedral shape, hierarchical raspberry like, truncated hexagonal bipyramid, flower-like, elongated and quasi cubic-like particles. All of these hierarchical cobalt particles exhibited their own unique magnetic properties. Sample prepared from 1mmol cobalt chloride, 2 mmol of sodium hydroxide, 5 mmol of hydrazine hydrate and 3.0% (w/v) of sodium dodecyl sulfate has a mixture of quasi cubic and elongated particles. It has the highest coercivity of about 290 Oe. Cobaltgold bimetallic hierarchical particles were prepared by galvanic replacement reaction where cobalt acted as sacrificial template. Bimetallic particles with hollow hierarchical structure and arbitrary shapes were produced under different synthesis conditions.', 'synthesis magnetic bimetallic', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2013', 0),
(560, 'Mohamad Najmi Masri', 'The Study Of Agar Binder And Super P Additive In Porous Zinc Anode For Zinc-Air Batteries', 'A zinc-air (Zn-air) battery was fabricated using porous Zn anode, an air cathode, and 6 M KOH-sago gel electrolyte. The porous Zn anode was prepared by mixing Zn powder and agar binder at different concentrations to achieve the desired conductivity and physical properties. Agar is an abundant natural polymer that does not require tedious and costly processing or preparation. Agar is also a gel-forming environmental friendly material. Meanwhile, the presence of KOH causes the growth of ZnO needle structures to cover the Zn-active material. Zn-agar binder without KOH produced the highest discharge capacity of 505 mAhg1. By contrast, the addition of KOH reduced the discharge capacity. The introduction of Super P improved the electrochemical performance of the batteries. The advantages of using Super P in batteries include high purity, large area, and highly structured body. The use of Super P additive in porous Zn anode enhanced the Zn-air battery discharge capacity because of the efficient and better voltage stability obtained from such an anode. The specific discharge capacity and power density of Zn anode with 2 wt% Super P were 776 mAhg1 and 20 mWcm2, respectively. Morphological images and structural properties were also analyzed to support these observations. Super P acted as a bridge in the Zn powders and improved the electrochemical performance of the Zn-air batteries.', 'agar-binder additive batteries', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2013', 0),
(561, 'Fahad Saleem', 'Assessment Of A Pharmacist Initiated Health Education Programme In Improving Hypertension Patients\' Health Related Quality Of Life, Disease State Knowledge And Medication Adherence In Quetta City, Pakistan.', 'The role of pharmacists in chronic disease state management is becoming a norm especially in the developed nations. In developing countries context, the role of pharmacists in chronic disease state management such as hypertension is yet to be fully explored. Therefore the aim of this research was to assess the impact of a pharmacist led educational intervention for improving clinical and quality of life outcomes among hypertensive patients in Quetta city, Pakistan. A mix methodological approach using both qualitative and quantitative methods was used to conduct the research. For the qualitative arm of the research, sixteen hypertensive patients were interviewed and thematic content analysis identified five major themes. In order to gain an insight of self management of hypertension, a focus group discussion was conducted with 19 hypertensive patients. The study found that the self management strategies were influenced by social sources, peers or family members with little information received from healthcare professionals. Exercise of self-management was strongly linked to the comparative advantages and disadvantages of long term medication use.', 'pharmacist education hypertension', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(562, 'Yousif Abdelbagi Abdalla', 'A Qualitative Study On The Decoupling Of Environmental And Social Issues From Management Control Systems In A Petroleum Company: An Institutionalist Approach', 'The main objective of this study is to understand and explain how environmental and social issues are considered and embraced in the management control system (MCS) of an oil and gas company located in Sudan. An interpretive case study is used whereby data are collected through semi-structured interviews with relevant individuals from inside and outside the company. Document reviews, informal conversations and observations are also employed to support the data generated from the interviews. The findings of this study are informed by the New Institutional Sociology theory, which emphasizes that MCS configurations are driven not only by economic or functional factors, but also by institutional factors. From the case findings, it would appear that the governmental laws and regulations, the pressure from and concerns of NGOs, the companys goal to protect and maintain its reputation and public image, and the high expectations of local communities, are among the main factors that pushed the company to consider environmental and social issues in its operations.', 'qualitative decoupling petroleum', '', 'Pusat Pengajian Siswazah Perniagaan (Graduate School of Business)', '2013', 0),
(563, 'Thair Abed Alrahman Mohamed Habbosh', 'The Effect Of Attractiveness Factors On Mall Shoppers Satisfaction In Jordan (Abstract)', 'Kompleks membeli belah bertukar menjadi persekitaran penting bagi perniagaan dengan impak yang besar terhadap mereka yang terlibat dalam perniagaan Shopping malls have turned into be a vibrant milieu for business with a wideranging impact on traders, retailers, and shoppers', 'attractiveness shoppers satisfaction', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2013', 0),
(564, 'Abdulmunaem .S. M. Gembri', 'The Determinants Of Corporate Social Disclosure In The Annual Reports Of Malaysian Construction Companies: An Application Of Stakeholder Theory.', 'This study seeks to investigate the motivations that make the Malaysian construction publicly listed companies voluntarily provide social and environmental information in their annual reports. The first objective of this research is to examine the level of corporate social disclosures present in 2010 Malaysian construction listed companies annual reports. The second objective, is the application of Ullmanns (1985) stakeholder framework, which contains three dimensions namely stakeholder power; strategic posture; and economic performance, to determine their ability to explain why these companies disclose voluntarily social and environmental information in their annual reports. Companies without a 2010 annual reports are omitted from the construction companies listed on the Bursa Malaysia to create a sample of 107 companies. Data was collected to measure components of corporate social disclosure, and proxies for Ullmanns three-dimensional stakeholder framework were applied. This study examines the level of corporate social disclosures in relation to creditor stakeholder power represented by return on equity; investors stakeholder power represented by government shareholders and foreign shareholders and employee stakeholder power represented by employee share ownership. Evidence shows that both creditor and government shareholders (measures investor power), and employee share ownership does empower stakeholder pressure regarding the quantity and quality of corporate social disclosures. In contrast, foreign shareholders were an insignificant proxy and did not serve in explaining the level of corporate social disclosure in the companies annual report. The results also find that companies displaying a more active strategic posture towards social and environmental issues disclose higher quantity and quality of corporate social disclosure information than companies displaying a less active posture to these issues. Companies employ strong corporate governance mechanisms to, strategically, manage their relationship with their stakeholders through disclosing voluntary social and environmental information. The presence of corporate social responsibility committee in the companies board structure is also evidence of strategic posture, but only in quantity of corporate social disclosure. Companies with higher economic performance disclose a greater amount of corporate social disclosure information than, companies with lower economic performance. Economic performance represented by average return on assets. The results showed that larger companies are significantly associated with higher levels of corporate social disclosures.', 'corporate social disclosure', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2013', 0),
(565, 'Khor Chu Yee', 'Investigation Of The Fluid/Structure Interaction In Moulded Underfill Process.', 'The rapid development of portable electronic devices, such as iPad, iPhone, iPod, and laptop, propels the integrated circuit (IC) packaging technology toward miniaturization characterized by high capacity and compactness of IC package. The scaling down of IC package size has given challenges to the engineers and IC designers in maintaining package reliability. In moulded underfill (MUF) process, the interaction between fluid (EMC) and structure (silicon chip and solder bump) yields unintended deformation and stress that may cause defects and reduce package reliability. Thus, the understanding of the FSI phenomenon is essential for the engineers and IC designers to tackle these problems. Therefore, the MUF process considering FSI aspect was the focus of this research. The FSI simulation was performed by finite volume based (FLUENT) and finite element based (ABAQUS) software through the MpCCI coupling technique for the simultaneous analysis. The capability of the software in handling encapsulation problems was examined by comparing the predicted results with previous scholars works and the current scaled-up MUF encapsulation processes. The scaled-up MUF encapsulation processes were fabricated in transparent for better visualization of FSI phenomenon, flow and void formation mechanisms. In the simulation, the Castro-Macosko viscosity model was written into UDFs to describe the EMC fluid behaviour. The accurateness of the UDFs has been proven excellent in modelling the rheological fluid behaviour during the encapsulation process.', 'investigation fluid moulded', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Enginee', '2013', 0),
(566, 'Leila Shekari', 'Characterization Of Gan Nanowies Grown By Thermal Evaporation On Different Substrates And The Study Of Their Capability As A Solar Cell.', 'In this study, Gallium Nitride (GaN) nanowires (NWs) were grown on different substrates, such as Silicon (Si) (111) and (100) either with or without Gold (Au) coating, Porous Si (PS), Porous GaN (PGaN) and Porous ZnO (PZnO), using the Thermal Evaporation method. SEM images of the synthesized GaN NWs displayed an overview of apparently high density and straight well-ordered GaN NWs on the Si (111) substrate compare to GaN NWs on Si (100) substrate. The SEM images of GaN NWs on Si (100), Au-coated Si (111) and PZnO indicated that the density of NWs was apparently less than that in samples of other substrates.', 'gan-nanowies evaporation solar-cell', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2013', 0),
(567, 'Omar Saad Saleh Abrika', ' \"A Mix Methodology Study Evaluating Perceptions Among Pharmacy Stakeholders In Two States Of Libya Towards The Need For Social Pharmacy Courses In Pharmacy Curriculum\"', 'The pharmacy profession in many parts of the world had changed over the years due to the evolution of pharmacy practice from product to patient oriented services. Within this context, there is a need for the modern pharmacy practitioner to be well-equipped with appropriate social and human skills in order to better serve the population. In response to this need, in majority of developed nations, social pharmacy subjects have been formally integrated in the pharmacy curriculum in order to prepare a holistic future practitioner who will be able to understand and respond towards the socio-behavioural aspects of health and medication use among patients. Although the incorporation of social pharmacy topics into the pharmacy curriculum of developed countries has been promoted during the last two decades, the inclusion of these subjects as standard topics in many developing countries is poorly documented and similar case prevails in Libya. Understanding social pharmacy components can really help to fulfil the important mission for the provision of pharmaceutical care. It is therefore imperative to ascertain the knowledge and perceptions of pharmacy academics, practitioners and final year pharmacy students about the concepts of social pharmacy in the current Libyan pharmacy curriculum.', 'perception pharmacy courses-curriculum', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2013', 0),
(568, 'Vani Khare', 'Role Of Cyclooxygenases In Zebrafish Oogenesis And Their Transcriptional Regulation By Peroxisome Proliferator Activated Receptor Gamma. ', 'Prostaglandins are required for the successful development and functioning of the female reproductive system in vertebrates. The synthesis of prostaglandin relies on the catalytic activities of two cyclooxygenase isoforms (COX-1 and COX-2). Various reports emphasize that both COX isoforms are essential for the production of prostaglandin during various stages of oogenesis, such as oocyte growth, maturation and ovulation. In comparison to COX-2, there is a paucity of knowledge on the role of COX-1, especially in oogenesis. At the same time, while COX-2 is a well established marker in ovulation, its function in growth and maturation of oocyte requires further exploration. This study, thereby, distinguishes the role of COX-1 and COX-2 during zebrafish oocyte growth and maturation, firstly by examining the mRNA expression of both the isoforms in these oocyte stages. An increase in zebrafish follicle COX-1 mRNA expression was observed as the oocytes develop and mature.', 'cyclooxygenases peroxisome gamma', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2013', 0),
(569, 'Sani Alhaji Garba', 'The Effect Of Ict Integration In The Use Of Inquiry Method On Pre-Service Teachers Achievement In Social Studies (Citizenship) Education In Nigerian Colleges Of Education.', 'Ilham untuk kajian ini tercetus daripada kebimbangan terhadap kurangnya minat dan penggunaan ICT dalam amalan pendidikan oleh guru-guru di sekolah Nigeria. This study was inspired by a concern over the low level of interest and usage of ICT in educational practices by teachers in Nigerian schools.', 'ict pre-service-teachers education', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2013', 0),
(570, 'Huzili Bin Hussin', 'Kesan Intervensi Terapi Kelompok Tingkah Laku Kognitif Terhadap Estim Kendiri Dan Lokus Kawalan Dalam Kalangan Penagih Dadah', 'Kajian ini bertujuan untuk mengkaji kesan intervensi terapi kelompok Tingkah Laku Kognitif Standard [CBT(S)] dengan terapi kelompok Tingkah Laku Kognitif Brief [CBT(B)] terhadap skor min estim kendiri (EK) dan lokus kawalan (LK) The purpose of this study is to investigate the effects between Standard Cognitive Behavioural Therapy [CBT(S)] and Brief Cognitive Behavioural Therapy [CBT(B)] on self- esteem and locus of control mean score among drug abusers.', 'intervensi kognitif penagih-dadah', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2013', 0),
(571, 'Dadan Ramdan', 'Investigation Of Wire Sweep During Pbga Encapsulation Process Using Fluid Structure Interaction.', 'The reduction of IC chip size has a significant impact to the modern electronic industry especially on the circuit design and IC assembly process. The increasing of I/O counts in a small scale IC chip result in severe wire deformation and deformation issues during transfer moulding process. In this research, visualization of wire sweep phenomenon during the encapsulation process of plastic ball grid array (PBGA) package is studied through a three-dimensional (3D) fluid structure interaction (FSI) technique; which FV- and FE-based software are connected by using mesh-based parallel code coupling interface (MpCCI). The effect of polymer rheology, inlet pressure, arrangement of inlet gate, number of stacked die, wire diameter and size of mould cavity vents, on the melt flow behaviour, wire sweep, filling time, cavity pressure and stress distributions, are mainly studied. A 3D model of mould and wires was created by using GAMBIT, and the fluid/structure interaction was simulated by using FLUENT and ABAQUS software integrated with MpCCI for the real-time calculations. The Castro-Macosko model and Kamal model are used to incorporate the polymer rheology and the Volume of Fluid (VOF) technique is applied for melt front tracking. User-defined functions (UDFs) were incorporated to allow the curing kinetics. However, in the experimental work, the effects of FSI phenomenon in the PBGA package was studied using a scaled-up package size to mimic the encapsulation process. The effects of stacked die, inlet gate arrangement, outlet vent, and inlet pressure of mould cavity on the melt flow behaviour and wire sweep were xxxiii investigated. The constant viscosity of test fluid was utilised for experiment. The numerical results of melt front patterns and wire sweep were compared with the experimental results and it was found in good conformity. Three types of Epoxy Moulding Compound (EMC) were utilized for the study of fluid flow within the mould cavity. The melt front profiles and viscosity versus shear rate for all cases were analysed and presented. The numerical results of melt front behaviour and wire sweep were compared with the previous experimental results and found in good agreement. In the present study, the lower viscosity shows the lower air trap, lower pressure distributions and lower wire deformation. Optimised design of the PBGA gives better PBGA encapsulation process and minimises the wire sweep. The physical and process parameter (i.e., pressure inlet, wire diameter, vent height) were optimised via response surface methodology (RSM) using central composite design (CCD) to minimise the deformation of wire sweep, filling time and void in package during the PBGA encapsulation process. Fluid structure interaction (FSI) was considered in the optimisation of the PBGA encapsulation process. The optimum empirical models were tested and well confirmed with the simulation results. The optimum design of the PBGA with 12 wires for both physical and process parameters ware characterised by 5.57 MPa inlet pressure, 0.05 mm wire diameter, and 0.36 mm vent height. Therefore, the strength of MpCCI code coupling in handling FSI problems is proven to be excellent. This present work is expected to be a reference and guideline for microelectronics industry.', 'wire-sweep encapsulation interaction', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering)', '2013', 0),
(572, 'Muhammad Azwadi Bin Sulaiman', 'Effects Of Electrode Materials On Electrical Properties Of Cacu3ti4o12 At 100 Hz  1 Ghz', 'CaCu3Ti4O12 (CCTO) has attracted much interest because of its extraordinary high dieletric constant of 100,000 at room temperature and very small temperature dependence in a broad temperature range from 100 K to near 400 K. This high dielectric constant offers opportunities in miniaturization of electronic application nowadays. However, CCTO also possesses high dielectric loss which is undesirable in electronic applications. To lower the dielectric loss, it is necessary to understand the origin of polarization responds and relaxation mechanism in CCTO. Using wide frequency impedance spectroscopy (IS) from 100 Hz to 1 GHz, the origins of polarization effect can be revealed. One of the important origins is the used of different electrode materials which determine the contact condition to the bulk CCTO. A research was carried out to study the effect of electrode materials to the electrical properties of CCTO at the frequencies of 100 Hz to 1 GHz. Samples were prepared through solid state reaction methods and starting materials of CaCO3, CuO and TiO2 has been used. After the characterization, the starting materials were mixed for 1 hour and thermal analysis was done. Mixed powder was calcined at 900 to 1000C for 3 to 6 hours. Phase analyses and microstructure observation was carried out. Calcination at 1000C for 3 hours produced almost single phase of CCTO. The calcined powder was pressed into pellet forms and the sintering processes were done between 1000 to 1050C for 3 to 10 hours. X-ray diffraction (XRD) analisys indicated that sintering at 1030C and below increased the lattice parameter and long soaking time until 10 hours at 1040C has decreased the lattice parameter. Longer soaking times are also increasing the crystallite size and 6 hours of soaking time or xix more produced large grains (>100m). The IS reported the dielectric constants and dielectric loss are also increased with the sintering soaking time. Relaxation peak at 10 MHz is suggested due to the loss of grain boundaries polarization effects. High frequency curve of impedance complex was observed and modeled as domain and domain boundary contribution in equivalence circuit analyses. The current-voltage characteristic reported the non-linearity and proved the Schottkys barrier of CCTO. Sample sintered at 1040C for 4 hours have stable and high dielectric constant and low dielectric loss over the frequency range. Heat treatment study to the electrode from room temperature to 400C in argon gas revealed the increase of dielectric constant with the increasing of treatment temperature. The dielectric constant improvement was due to more Schottkys contact formation after the treatment. Treatment at 300C is the most suitable temperature to produce high dielectric constant CCTO with low dielectric loss. Schottkys effect to the contact were observed by applying different electrode material, gold, platinum, silver and aluminium and non-linear of current-voltage characteristic was revealed on Pt and Au electrode. This is due to both electrodes have higher work function than the other electrodes. Samples with Au electrode showed high dielectric constant at 1 MHz (4,398) and low dielectric loss (0.03 at 1.58 kHz). Wide frequency measurement of the electrical properties shows the responds from grain, grain boundary, domain and domain boundary through impedance complex plane curve fitting method. Their resistivities have changed with the study parameters and high frequency respond associated with domain boundary resistivities has been modelled according the equivalence circuit analysis.', 'electrode electrical cacu3ti4o12', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2013', 0),
(573, 'Mohamad Kahar Bin Abd Wahab', 'Characterization And Properties Of Thermoplastic Tapioca Starch Based High Density Polyethylene / Natural Rubber Blends.', 'Effects of thermoplastic tapioca starch (TPS) on the properties of HDPE/NR (70/30) blends were investigated. Tapioca starch was chosen to incorporate into HDPE/NR blends due to its abundance and biodegradability properties. However certain drawbacks, such as poor compatibility with the hydrophobic polymer matrix, tendency not to disperse during processing and affinity for moisture are factors which lower the potential of TPS based blends. TPS loadings were varied from 0 wt% to 30 wt% and incorporated into HDPE/NR blends using HAAKE rheomix 600 internal mixer. The melt blending was carried out at temperature of 150 C with the rotor speed of 50 rpm for 12 minutes. Mechanical properties of blends were evaluated as a function of TPS loadings and the influence of blends modification. The tensile strength showed a sharp drop on addition of TPS particle into the blends system due to the inability of TPS to support the stress transfer between phases. Few series of blends modification have been done in order to improve the mechanical properties of the blends. TPS was treated with citric acid in order to improve the plasticization and fluidity of TPS in HDPE/NR blends. TPS can be partly depolymerised to produce low viscosity product when processed with citric acid. It is also found that TPS with low molecular weight (Mw) is easy to disperse in the thermoplastic elastomer (TPE) blend and improve wettability at the inter phase of TPS-HDPE/NR as shown by scanning electron microscope (SEM). The effect of polyethylene-grafted-maleic anhydride (PE-g-MA) as a compatibilizer was also xxviii shown to be effective in improving the tensile strength. The degree of TPS adhesion and dispersion in blends were improved in the cases of PE-g-MA compatibilized blends. The improvement in compatibilized TPS-HDPE/NR interface adhesion was clearly indicated in SEM study. In the cases of dynamic vulcanization system, two series were prepared; (a) sulphur vulcanized blends and (b) N, N-m-phenylenebismaleimide (HVA-2) vulcanized HDPE/NR/TPS blends. Tensile strength, Youngs modulus and elongation at break exhibit significant improvement when HDPE/NR/TPS blends were subjected to the both crosslinkers. Moreover, SEM micrographs showed fine TPS was dispersed and well embedded in vulcanized HDPE/NR matrix. Comparison was also made based on the results of gel content, thermogravimetric analysis(TGA) and differential scanning calorymetry (DSC). Generally, the improvement observed in tensile properties, blends homogeneity and thermal stability can be correlated to the crosslink formation within the NR phase.', 'thermoplastic density rubber', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2013', 0),
(574, 'Abdul Malek Yaacob', 'Kenaf/Glass Hybrid Composites: Preparation, Characterization And Properties.', 'This research involved the use of long kenaf fiber and glass fiber fabric grade commercial aircraft and its potential to be used in composite production. Hybrid kenaf/glass fiber epoxy composites have been fabricated using untreated and treated kenaf. Kenaf treatment was done using sodium hydroxide and acetylation process to modify the surface of the kenaf fibers. In this study no modification was done on the surface of glass fibers or the matrix. This study combines glass fiber commonly used on aircraft with kenaf fiber using interply hybrids concept. The fabrication method that has been used to combine the kenaf and glass fiber to produce composite is hand lay-up and vacuum bagging method. Hybrid samples of kenaf and glass fiber produced for this study utilized the bidirectional orientation concept where one fiber layers is align in the weft direction and the second fiber layers is align in the warp direction. Characterization and study of the properties of hybrid kenaf/glass fiber composites was determined by morphological of adhesion, physical, thermal and mechanical. Inconsistent mechanical properties behavior for untreated kenaf /glass fiber composites samples was confirmed by the high void content between fiber and matrix that can reach up to 300% with comparison to treated samples. Kenaf fiber treated/glass composites showed a consistency in bending characteristics and impact strength at low percentage by weight of kenaf fiber namely at 10 wt%, 20 wt% and 30 wt% kenaf.', 'kenaf  composites properties', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2013', 0),
(575, 'Amir Hussein Ali', 'Numerical Investigation On The Effects Of Geometrical Parameters On Film Cooling Performance.', 'The aim of this study is to investigate the effect of different kinds of cooling holes and staggered arrangements on adiabatic and conjugate film cooling effectiveness for convex surface of gas turbine blade. The investigation included a new cooling hole scheme called heart-shaped to solve the vortex problem claimed to be responsible for the detrimental lift-off phenomenon in conventional simple cylinder film cooling holes. Also, the conjugate studies included a new conjugate blade technique called multi-layers to be helpful in speeding up the heat absorption from the upper blade surface. Fluent has been utilized and realizable -', 'numerical geometrical performance', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering) ', '2013', 0),
(576, 'Umar Al-Amani Bin Haji Azlan', 'The Effect Of Rare-Earth Substitution On The Properties Of Bismuth Titanate Prepared By Low Temperature Combustion Technique.', 'In this research work, the production of bismuth titanate (Bi4Ti3O12 or BIT) at low temperature using combustion method was investigated to minimize the volatilization of Bi that deteriorates the dielectric and ferroelectric properties. In order to embark upon this problem, in the first phase, two combustion methods; sol-gel auto-combustion (SGAC) and precipitation assisted low-temperature combustion (PLTC) were investigated in terms of phase formation, structural, powder and grain morphology, dielectric and ferroelectric properties. The use of SGAC had resulted in single phase BIT with high degree of crystallinity at 750oC, particle size of 120 nm, spherical in shape with the highest relative density of about 84% at 1100oC. The dielectric constant (r), dielectric loss (tan ), remanent polarization (Pr) and coercive field (Ec) of BIT by SGAC were 119, 0.008, 6.3 C/cm2 and 20 kV/cm, respectively. For PLTC, the single phase BIT with high crystallinity was formed at around 290oC without calcination, with particle size of 50 nm which is platey in shape. The highest relative density of 86% was achieved at 1000oC. The values of r, tan , Pr and Ec of BIT by PLTC were 113, 0.007, 6.8 C/cm2 and 26 kV/cm, respectively. For the second phase, rare-earth substituted-BIT was investigated and it was found that La and Nd exhibited similar characteristic, whereby both resulted in single phase regardless of La and Nd content. The presence of pyrochlore phase was detected in BSmT samples when the content Sm above 0.5. La substituted-BIT (BLaT100) exhibited high r (212) and low tan  (0.005). This is as a result of uniform grain size (1.6 m in length and 0.3 m in width) with the improved relative density (91%) of the sample. However, for ferroelectric properties, the maximum Pr (9.6 C/cm2) with low Ec (18 kV/cm) were observed at BLaT75 and BLaT100 samples, respectively. The best optimum sample for Nd substituted-BIT was BNdT100 with r and tan  values of 231 and 0.005, respectively. The average grain size was 1.3 m in length and 0.3 m in width with improved relative density of 90% were achieved in BNdT100 sample. For ferroelectric properties, the maximum Pr (9.2 C/cm2) with low Ec (34 kV/cm) were identified from BNdT75 and BNdT100 samples, respectively. In BSmT system, the improved dielectric properties were obtained from BSmT100 sample with r and tan  were 139 and 0.004, respectively. The improved dielectric results were attributed to the uniform grain size (1.9 m in length and 0.4 m in width). Nevertheless, the low ferroelectric performance in BSmT100 is due to low Pr (4.4 C/cm2) and high Ec (64.3 kV/cm).', 'rare-earth bismuth combustion', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering) ', '2013', 0),
(577, 'Amera Khalil Mohammed .A', 'Osteopromotion of mandibular distraction osteogenesis using stem cells from human deciduous teeth and in biphasic calcium phosphate scaffold in rabbit model. ', 'Osteogenesis Regangan (OR) yang digambarkan sebagai kejuruteraan tisu tulang dalaman telah menjadi semakin popular di tahun-tahun kebelakangan ini dan teknik penggunaan telah mengalih perhatian kepada rangka kraniofasial yang telah mengembangkan bilangan rawatan alternatif untuk pesakit yang tidak normal dan kekurangan maksilofasial. Ia telah digunakan pertama kali dalam pembedahan ortopedik untuk pembetulan kerencatan pertumbuhan anggota badan, dan seterusnya telah digunakan dalam rawatan microsomia kraniosfasial dan kecacatan tulang. Dalam OR, pembentukan tulang yang baru adalah didorong oleh pemisahan secara beransur-ansur segmen bertulang selepas osteotomi atau kortikotomi semasa proses biasa penyembuhan patah yang diganggu oleh penggunaan daya tarikan secara beransur-ansur terhadap kalus lembut.', 'osteopromotion osteogenesis human', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2013', 0),
(578, 'Koay Loke Kean ', 'Development And Analysis Of Linear Resonant Scanner With Torsional Mechanism.', 'Large size mirror scanners are needed in several scanning technologies such as, ultra short-throw projector, free-space optical communications and barcode scanner. Several researches on large size mirror in microelectromechanical systems (MEMS) scanner were conducted. For instance, research on micromachined polysilicon microscanners has been performed for barcode scanner. However, the curvature of the microscanners causes image distortion. Furthermore, high operation voltages of the MEMS scanner deter the usage of MEMS scanner in hand-held applications. In this research, a linear resonant scanner consisting of an electronically driven mechanically-resonant torsional spring-mirror system was developed for display applications. The scanner was designed according to the functional components such as compliant structure and actuator. The torsional spring which is the compliant structure was modeled with finite element analysis (FEA) and geometry studies were conducted. The optimized torsional spring with the lowest stress level was selected for the design. The actuator of air core coil (ACC) was used in the scanner; geometry study was used to maximize the magnetic forces of the ACC. The ACC of with minimum length, minimum inner radius and maximum outer radius was used. Besides, experimental analysis and FEA of the scanner showed that resonant frequency, angular displacement and stress level are affected by the magnet position on the suspended plate. After the scanner design, several characteristic studies were conducted. A nonlinear damping model is proven to be able to analyze and predict the free vibration response of the scanner based on experimental results. xxx The damping model is able to accommodate the frequency perturbation which happens when the scanner mounting is changed. The hysterical frequency response on the large scale torsional spring mechanism is first found in this research work. Furthermore, the relationship between scanning angle and driving frequency was employed for extra mechanical gain. The proposed resonant scanner extends the ability of the torsional mechanism scanner for large angular displacement of 87.1o with low voltage input of 5 V.', 'development linear-resonant torsional', '', 'Pusat Pengajian Kejuruteraan Mekanikal (School of Mechanical Engineering', '2013', 0),
(579, 'Warapong Krengvirat', 'Development Of Carbon And Potassium-Incorporated Titanium Dioxide Nanotube Arrays For Solar Energy Harvesting Applications.', 'TiO2 nanotube arrays have attracted great interest as the most promising candidate for solar energy harvesting applications. However, poor visible-light absorption and high recombination of charge carriers still remain as challenging issues for their practical applications. Hence, the objective of this work was to develop carbon and potassium-incorporated TiO2 nanotube arrays for solar energy harvesting applications, including photodecolorization, photoelectrochemical cell (PEC) and dye-sensitized solar cells (DSSC). Visible-light responsive TiO2 nanotube arrays were rapidly grown with a rate of ~289 nm min-1 by anodic oxidation in ethylene glycol (EG) containing 0.5 wt% ammonium fluoride (NH4F) and 1 wt% H2O. The presence of adsorbed-carbonate species and interstitial carbon in TiO2 nanotubes originated from the pyrogenation of EG resulted in the generation of localized state, and thus enabled the visible-light absorption. Anatase TiO2 nanotube arrays with high surface area (110.9 m2 g-1) were obtained by facile immersion of as-anodized nanotube arrays in hot water at ~90C. Such hot water-treated nanotube arrays exhibited efficient visible-light photodegradation of methylene blue with the decomposition rate of ~11 % h-1. This value is relatively higher than heat-treated arrays (~9 % h-1) and P25 powder (~2 % h-1). However, heat treatment at 400C for 4 h was found as essential approach to obtain better crystallinity for high PEC and DSSC properties. Heat-treated TiO2 nanotube arrays with average nanotube lengths xxxiv of 18 m, thick walls (13 nm) and large pore sizes (115 nm), with high aspect ratio (~123.6) exhibited remarkable ability to generate H2 at a rate of ~508.3 L min-1 cm-2 and photoconversion efficiency () of ~2.3%. The growth of TiO2 nanotube arrays and their electrochemical properties were further improved by simple addition of potassium hydroxide (KOH) into fluorinated-EG. The incorporation of 1 wt% of 1.0 M KOH facilitated an equilibrium growth of nanotube arrays with a rate of ~353 nm min-1. The adsorbed-potassium species further extended the light visible-light absorption to 780 nm. Furthermore, the electron donation nature of adsorbed-potassium promoted larger number of charge carriers (9.7  1021 cm-3). Carbon and potassium-incorporated TiO2 nanotube arrays with aspect ratio of 140.5 exhibited superior photoelectrochemical H2 generation with an evolution rate of ~658.3 L min-1 cm-2 and  of ~2.5%, which is 30 % higher than that of without potassium. Carbon and potassium-incorporated TiO2 nanotube arrays were assembled to back-side illumination DSSCs using N719 dye and iodide/triodide redox electrolyte. Well-aligned nanotubes with average nanotube lengths of 18 m, thick walls (13 nm), and large pore sizes (130 nm) allowed a greater penetration of excited h and ease charge carrier diffusion. Furthermore, high geometric surface area up to 755 could harvest higher dye adsorption. A maximum  of 2.78% was achieved from a 17.8 m length TiO2 nanotube arrays, with open circuit potential of 0.67V, current density of 8.95 mA cm-2, and filled factor of 46.39%.', 'potassium dioxide solar-energy', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2013', 0),
(580, 'Lee Tien Ping', 'Development Of New Analytical Methods Involving Novel Sorbents And Membranes For The Determination Of Selected Mycotoxins And Related Metabolites In Biological Fluids And Food', 'This thesis focuses on the development and validation of new sample preparation methods applied to the determination of mycotoxins and their related substances. Additionally, a high performance liquid chromatography (HPLC) method for the determination of sphinganine (Sa) and sphingosine (So) in urine samples by employing a silica based monolithic column is described. Under the optimized conditions, separation was achieved using a mixture of methanol:water (93:7, v/v), column temperature at 30C, flow rate of 1 mL min-1 and injection volume of 10 L. A marked reduction in separation time (less than 6 min) was found compared to approximately 14 min by using a conventional C18 particle column. Twenty two urine samples from the healthy donors and seven samples from the liver cancer patients were analyzed using the method. Molecularly imprinted polymers (MIPs) for citrinin (CTN) were prepared with 1-hydroxy-2-naphthoic acid (HNA) and 1- naphthol (NA) as mimic template. Hybrid MIP membrane were next prepared by embedding the NA-MIP particles into the polyethersulfone scaffold using phase inversion technique. The resultant membranes were evaluated for the extraction of CTN and were determined using HPLC with fluorescence detection.', 'novel-sorbents mycotoxins biological', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2013', 0),
(581, 'Marziana Bt Madah Marzuki', 'Earnings And Balance Sheet Conservatism In Malaysia: The Influence Of Ifrs, Corporate Governance And Institutional Culture In Malaysia', 'Recently, two important regulatory reforms initiated by the regulators in Malaysia to enhance financial reporting quality among the public listed companies which are the enforcement of IFRS in 2006 and the amendment of Malaysian Code of Corporate Governance (MCCG) in 2007. Baru-baru ini, dua pembaharuan pengawalseliaan yang penting yang dimulakan oleh pengawal selia di Malaysia untuk meningkatkan kualiti pelaporan kewangan di kalangan syarikat-syarikat senaraian awam iaitu penguatkuasaan IFRS pada tahun 2006 dan pindaan kepada Kod Tadbir Urus Korporat Malaysia (MCCG) pada tahun 2007.', 'conservatism corporate-gorvernance culture', '', 'Pusat Pengajian Pengurusan (School of Management)', '2013', 0),
(582, 'Prihadi Kususanto', 'Mediating Effect Of Locus Of Control On The Causal Relationship Between Students Perceived Teachers Expectancy And Self-Esteem', 'This mixed method study is looking at the mediation effect of Locus of control on the causal relationship between students perceived teachers expectancy and their self-esteem in the schools where Between Class Ability Grouping is practiced. The existence of correspondence bias among the teachers in such schools is also investigated. A total of 795 form two (year 8) students (446 low achievers and 349 high achievers) and 72 teachers from five secondary schools in the state of Penang were selected via purposive sampling method to participate in the quantitative part of this study. 10 teachers and 7 students from were taken from the sample in order to participate in the qualitative part of this study. Quantitatively, self-esteem was measured by the Rosenberg Self-Esteem Scale (Rosenberg, 1965), while Locus of Control was measured by using Internal Control Index (Dutweiller, 1984), and Students perceived teachers expectancy is measured by using Scales of Perceived Teachers Expectancy (Prihadi, 2009). Scale of Teachers Expectancy was developed in order to collect the data about teachers expectancy towards the students. All scales were translated into the Malay language and internal consistency reliability scores (Cronbachs alpha) were found to be above 0.6 for all scales. Open-ended interviews to the students and teachers were conducted in order to collect the qualitative data. Results showed that students from low-performers classes had their internal Locus of Control mediates the influence of their perceived teachers expectancy on their self-esteem; in other words, their self-esteem would not be influenced by their perception of teachers expectancy if they have internal Locus of Control. However, mediation effect was not shown among high-performer students. This study also discovered that correspondence bias occurred among teachers, which means that teachers developed different expectancy towards high and low achiever students without any further consideration; they expect high-achievers to be willing to improve their achievement and low-achievers are expected to be involved in disciplinary problems. Some meaningful themes emerged during the qualitative data analyses and played their roles in explaining the phenomenon even deeper. The themes are namely reciprocal envy between high and low achievers, pressure from the school managements goals, and the involvement of tuition centers.', 'mediating causal expectancy', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2012', 0),
(583, 'Noor Aziah Serri', 'Lipase Mediated Hydrolysis Of Crude Palm Oil In Enzymatic Membrane Reactor And Recovery Of Carotenes And Tocopherol.', 'Production of fatty acid and glycerol from oils are important especially in oleochemical industries. Nowadays, researchers prefer to use enzyme to conduct hydrolysis in order to reduce energy consumption and minimize thermal degradation of the products. The advantages of the enzyme hydrolysis technique include; the use of bio-route technology that only requires a mild temperature, simple operational procedure and low cost as well as energy consumption. The present investigation focuses on hydrolysis of triglyceride to produce free fatty acids and glycerol from crude palm oil (CPO) using Candida rugosa lipase in batch and enzymatic membrane reactor (EMR). At the same time, the recovery of carotenes and tocopherol was also studied. The optimization in hydrolysis of CPO for batch process was carried out using Design of Experiment that focuses on response surface methodology (RSM) to optimize the hydrolysis reaction. The process variables which were taken into account include; enzyme loading, A (0.30  0.80 g), oil loading, B (0.15  0.35 g/ml), reaction temperature, C (40oC - 50oC) and pH of buffer solution D, (6.5-7.5). The optimum conditions found for the enzymatic hydrolysis of CPO under investigation are: 0.43 grams of enzyme, 0.15 g/ml of oil with temperature of 45oC and buffer solutions at pH 7.0. The yield predicted for fatty acids produced can reach up to 90.95% and the actual value was found to be 90.67% (5.59 x 10-5 mol hr-1 g-1 enzyme)', 'lipase enzymatic carotenes', '', 'UNSPECIFIED', '2012', 0),
(584, 'Abdulwahab Yahya Mohammed Abdulqader', 'The Moderating Effect Of Perceived Organizational Culture On The Relationship Between Budget-Related Behaviour And Propensity To Create Slack For Yemeni Managers. ', 'The accounting researchers proposed that the propensity to create slack could leads to inefficient use of the resources that the organization controls. They also suggested that slack can be increased or decreased by several factors, including the budgetrelated behaviour. However, the results of prior studies examining the relationship between budget-related behaviour (such as participation, measure and monitor and evaluation by budget) and propensity to create slack is not clear and have often been found to be contradictory. As a result, many researchers have reconciled the inconsistent results by using the contingency approach. The present study aims to extend this line of research by examining another contingent variable, namely the managers perceptions of the organizational culture.', 'organizational-culture budget-related managers', '', 'Pusat Pengajian Pengurusan (School of Management)', '2012', 0),
(585, 'Olutoye Moses Aderemi ', 'Synthesis, Characterization And Activity Of Mixed Metal Oxide (Mg, Zn, Al) Catalysts For Transesterification Of Waste Cooking Palm Oil, Edible And Non-Edible Oils.', 'Biodiesel, also known as fatty acid methyl esters (FAME), is an alternative fuel that could be obtained by homogeneous or heterogeneous catalytic processes. It is renewable and its combustion is environment friendly compared to fossil (crude petroleum). This research focused on the development and synthesis of solid catalyst from combination of some metals to produce composite catalyst with KyMg1-xZn1+xAl(2-y)/3O3 (at y = 0 and 0.1 x 0.9) suitable to produce FAME from different vegetable oils-edible and non-edible sources (refined palm oil (RPO), waste cooking palm oil (WCPO), coconut oil (CCO), palm kernel oil (PKO) and crude jatropha oil (CJO)) most specifically from palm oil since Malaysia is one of the worlds largest producer and its available in commercial quantity.', 'synthesis transesterification palm-oil', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2012', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(586, 'Ahmad Fairuz Bin Omar', 'Development Of Optical Fiber Vis-Nir Spectroscopy System For Metrological Analysis On Intrinsic Qualities Of Averrhoa Carambola L', 'Optical measuring techniques are one of the methods that have shown promising results in non-destructive quality evaluation. In this research, several approach in quantifying fruits intrinsic quality have been successfully performed through absorbance, reflectance and interactance techniques via visible and near infrared spectral as well as novel application of monochromatic measurement systems. The research begins by Aquaphotomics assessment (NIR absorbance) of water-sugars (sucrose, glucose and fructose) and water-acids (citric, tartaric, malic and oxalic) solutions which are common biochemical composition in fruits.', 'optical metrological averrhoa', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2012', 0),
(587, 'Wael Abdel Muhdi Yacoup Salah', 'Modified PWM Technique For Torque Ripples Reduction In Three Phase PM BLDC Motors.', 'Permanent magnet (PM) brushless DC motors are used in many applications due to their high efficiency, high torque density, and compact sizes, which make this type of motors more popular over the other types. This research work focused on torque improvement of PM brushless DC motors by minimizing the generated torque ripples during the commutation period. The approaches and methods adopted in this project are presented thoroughly, along with the mathematical analysis and Matlab-Simulink modeling. Torque ripples in PM brushless DC motor drives usually originate from the motor design structure and from the control side in the form of current ripples.', 'modified torque pm-bldc-motors', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2012', 0),
(588, 'Behnam Koohestani ', 'Mixed Matrix Vanadium Oxide Catalytic Nanocomposite Membrane For Styrene Oxidation.', 'The oxidation of olefin compounds to equivalent epoxides or oxides using metal oxides as catalyst is an important step in the manufacturing of large quantities of fine and pharmaceutical grade chemicals. The chemical property of vanadium as metal in its oxide state is of interest particularly in application during ole e oxidation. Well-defined metal oxide nanostructures on the walls of carbon nanotubes (CNTs) are attractive as catalyst in the oxidation reaction because of their high specific surface area and formation of novel composite material with enhanced physical and catalytic properties.', 'vanadium nanocomposite styrene-oxidation', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2012', 0),
(589, 'Ghassan Abedalkarim Abdullah Samara', 'An Efficient Safety System For Vanet Using Enhanced Message Dissemination Protocols With Channel Performance Control. ', 'The rapid development of wireless communication networks in recent years has made vehicle to vehicle (V2V) and vehicle to infrastructure (V2I) communications possible in mobile ad hoc networks (MANETs). It has also led to the development of a new technology called vehicular ad hoc network (VANET), which aims to achieve road safety, infotainment, and a comfortable driving experience. It can support safety systems designed to avoid road accidents in two ways: 1) periodic transmissions (beacon) from all vehicles that inform neighbors about their current status, and 2) dissemination of emergency messages to warn other vehicles to avoid the danger.', 'vanet dissemination control', '', 'Pusat IPv6 Termaju Negara (National Advanced IPv6 Centre of Excellence NAv6) ', '2012', 0),
(590, 'Radzi Bin Ismail', 'Determining The House Buyers Requirements For Green Homes In Malaysia', 'Rumah hijau mengandungi enam elemen utama, iaitu rekabentuk dan perancangan masyarakat, keberkesanan terhadap pengunaan sumber, mengunakan sumber alternatif, sistem semulajadi, perlindungan dan keselamatan, pendekatan dalam guna semula dan kitar semula. Green homes consist of six main elements, namely community design and planning, efficient usage of resources, use of alternative resources, natural system, protection and safety, and reusing and recycling approach.', 'house-buyers green homes', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2012', 0),
(591, 'Reza Kamyab Moghadas', 'Optimization Of Double Layer Grid Structures Using FEM, SPSA And Neural Networks.', 'Optimization of square-on-square double layer grids is beneficial for design purpose. For this purpose, use of a gradient based optimization algorithm incorporating stochastic feature called static perturbation stochastic approximation (SPSA) has not investigated. A computational procedure for constrained optimization of square-onsquare double layer grids combining FEM, SPSA algorithm and neural network has been formulated. Using the formulated procedures, a total of 208 set of optimization have been carried out on square-on-square double layer grids with different combinations of span L(25m~75m) and height h (0.035L~0.095L). Of the 208 sets of data, 173 and 35 have been used in the training and testing of radial basis function(RBF) and generalized regression(GR) neural networks for prediction of optimal design and the corresponding maximum deflection of square-on-square double layer grids with different spans and heights.', 'fem spsa neural-networks', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2012', 0),
(592, 'Noraini Othman', 'Job Performance Of Public Hospital Nurses: The Role Of Personal Resources, Job Resources And Work Engagement', 'The aims of this study were to (a) examine the relationships between personal resources (psychological capital), job resources (social support, job characteristics), and job performance; and (b) investigate the effectiveness of work engagement as a mediator in the above relationships. Conservation of resources (COR) theory (Hobfoll, 1989) and Blaus (1964) social exchange theory (SET) were utilized in developing the research framework. Job performance was operationalized as comprising of two broad dimensions: task performance and contextual performance.', 'performance nurses engagement', '', 'Pusat Pengajian Pengurusan (School of Management)', '2012', 0),
(593, 'Khairunnisa', 'Development And Evaluation Of Intervention Tools To Improve Primary School Teachers Knowledge On Asthma And Its Management In Penang, Malaysia', 'Primary school children who develop asthmatic attack during school hours required assistance from their teachers or school staff. Therefore teachers knowledge on asthma and its managements are vital in order for them to provide necessary assistance to their needy students. This scenario is particularly important in Malaysia as most primary schools do not have medically trained staff to assist students who develop medical problems during school hours.', 'intervention-tools teachers asthma', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2012', 0),
(594, ' Abdalrahim F. A. Aisha', ' Anti-Cancer Studies Of Garcinia Mangostana L. And Syzygium Campanulatum Korth Towards Colorectal Carcinoma.', 'This study aims to investigate the anti-angiogenic and anti-colon cancer activity of the extracts and isolates of Syzygium campanulatum and Garcinia mangostana. And to prepare G. mangostana toluene extract in nanoparticles and -mangostin in solid dispersions in order to improve their aqueous solubility. Phytochemical analysis of S. campanulatum extracts reveals relatively high concentration of betulinic acid (BA) and polyphenols. BA fraction from S. campanulatum showed potent cytotoxicity on colon cancer cells by inducting the mitochondrial pathway of apoptosis. Extracts also showed potent inhibition of angiogenesis in several in vitro and in vivo models, by inhibiting the expression of vascular endothelial growth factor and inhibiting migration of human endothelial cells. The methanolic extract also inhibits tumor growth in xenograft tumor model with inhibition of intratumor blood vessels.', 'anti-cancer mangostana carcinoma', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(595, 'Helia Vaezian', 'Investigating The Use Of The Internet In A Translation Class At Allameh Tabataba\'i University, Iran.', 'There is no doubt that the Internet is one of the greatest inventions of the 20th century which has had a tremendous impact on our everyday lives. It not only has eased the access of information, but has also provided a new mode of communication across the globe. This valuable source of information has also a lot to offer translators. The present qualitative study aimed at elaborating on the implications and applications of the Internet as a big virtual corpus and as a resource to get texts for inclusion in DIY corpora, in the context of translation of political texts from English into Persian.', 'investigating internet translation', '', 'Pusat Pengajian Bahasa Literasi & Terjemahan (School of Languages, Literacies and Translation) ', '2011', 0),
(596, 'Daud Moalin Ishaq Aweis', 'Clinical Outcomes And Economic Burden Of Patients Having Diabetes Mellitus And Tuberculosis In Three Hospitals In Malaysia. ', 'The prevalence of diabetes mellitus (DM) in Malaysia is growing to the epidemic level. Since a long time increased susceptibility of diabetic patient to wide range infectious diseases including tuberculosis (TB) has been reported. This study was intended to assess the clinical outcomes and economic burden of combined DM-TB condition. The type of this study is prevalence based prospective cohort. Study patients were divided into three groups: patients with TB infection only; patients with DM only; patients with coexistence of DM and TB. Each group included 200 subjects.', 'clinical patients diabetes-tuberculosis', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(597, 'Choi Sy Bing ', 'Structural And Functional Prediction Of Hypothetical Proteins From Klebsiella Pneumoniae MGH78578: Molecular Modelling Studies', 'Twenty percent of the genes from Klebsiella pneumonaie MGH78578 coded for hypothetical protein. Two particular hypothetical proteins KPN00728 and KPN00729 were identified using bioinformatics approaches. Both open reading frames showed high sequence homology to succinate dehydrogenase Chain C (SdhC) and D (SdhD) from Escherichia coli KPN00729 was annotated as SdhD in May 2008. Thus, investigation on KPN00728 remained as no annotation for SdhC gene in the complete genome sequence of Klebsiella pneumoniae MGH78578. In this study, KPN00728 has a missing region with conserved residues which is important for ubiquinone (UQ) and heme group binding. Structure and function prediction of KPN00728 coupled with secondary structure analysis and transmembrane topology showed KPN00728 adopts SDH-(subunit C)-like structure.', 'prediction proteins mgh78578', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(598, 'Alfian Abdul Halin', 'Soccer Video Event Detection Via Collaborative Textual, Aural And Visual Analysis', 'Soccer event detection deals with identifying interesting segments in soccer video via audio/visual content analysis. This task enables automatic high-level index creation, which circumvents large-scale manual annotation and facilitates semantic-based retrieval. This thesis proposes two frameworks for event detection through collaborative analysis of textual, aural and visual features. The frameworks share a common initial component where both utilize an external textual resource, which is the minute-by-minute (MBM) reports from sports broadcasters, to accurately localize sections of video containing the desired events.', 'soccer detection analysis', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2011', 0),
(599, 'Liau Siow Yen ', 'Clinical, Economic And Humanistic Evaluation Of A Worksite Health Promotion Program Conducted Among Employees Of A Public University In Malaysia.', 'The burden of cardiovascular (CV) diseases is increasing in Malaysia. This has an adverse effect on the countrys health, society and economy. The general objective of this research was to develop an effective and efficient worksite health promotion program that could reduce the cardiovascular risk factors among employees at the Universiti Sains Malaysia (USM) Engineering campus. This was a quasiexperimental study conducted between 2009 and 2010. The six-month program consisted of individualized counseling and seminars targeted at five behavioral risk factors (RFs) i.e. smoking, alcohol consumption, inadequate fruit and vegetable intake, physical inactivity and overweight/obesity.', 'clinical worksite employees', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(600, 'Gamil Qasem Othman', 'Economic And Health Related Quality Of Life Evaluation Of Tuberculosis Patients In Yemen.', 'The study aims to assess the economic and the health related quality of life for tuberculosis patients in Yemen. A Cohort prospective study was carried out among pulmonary tuberculosis and extra pulmonary tuberculosis patients diagnosed and treated in a TB centers in Sanaa, the capital city of Yemen. Socio demographic, clinical and laboratory data and types of drug regimen used in treatment were collected from TB patients and medical records at the TB centers. Pharmacoeconomic methodology was applied to calculate direct and indirect costs. The patients were asked to complete DR-12 questionnaire. The patients was subjected to the questionnaire at onset of treatment, then after one month and finally repeated at the end of intensive phase of treatment.', 'economic health tuberculosis', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(601, 'Akpan Uduak George', 'Synthesis, characterization and activity of titanium dioxide based- (Ca, Ce, W)-TiO2 photocatalysts for degradation of dye and pesticide', 'Pengindustrian global berhadapan dengan berbagai cabaran. Pelepasan yang tidak diingini melibatkan produk dan bahan cemar yang karsinogen dan toksik ke dalam persekitaran oleh industri tekstil, kimia dan pemprosesan adalah berkadar langsung kepada pertumbuhan industri. Global industrialization is not without its attendant challenges. The release of unwanted by-products and pollutants which are carcinogenic and toxic into the environment by textiles, chemicals and processing industries is directly proportional to industrial growth.', 'titanium photocatalysts pesticide', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2011', 0),
(602, 'Siddig Balal Ibrahim Balal', 'Societal Marketing Orientation And Marketing Performance: The Mediating Role Of Key Market-Based Capabilities And The Moderating Effect Of Institutional Context', 'Societal issues appear to be increasingly important in todays business climate. Response to these issues by adopting societal marketing orientation is expected to enable firms to gain better competitive advantage. However, literature search reveals that there is a lack of research offering valid measurement and a systematic framework that demonstrates the underlying mechanisms and contingencies through which societal marketing orientation can help firms to achieve that end. Using a priori approach the study intended to propose a valid measure of societal marketing orientation and to investigate the extent of this orientation among large manufacturing firms in Malaysia.', 'marketing market-based context', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(603, 'Sheida Jahani', 'Developing an ict professional development model for Iranian faculty members.', 'Ahli fakulti kini menghadapi tekanan untuk memperolehi kemahiran yang bersesuaian untuk menggunakan teknologi pengkomputeran dalam pengajaran dan pembelajaran, penyelidikan dan penyediaan perkhidmatan. Berdasarkan faktor ini, ICT dianggap sebagai faktor penting dalam pembangunan dan penambahbaikan pengajian tinggi di Iran. Faculty members are now experiencing pressure to acquire the necessary skills to make effective use of computer technology in teaching and learning, research and providing service. For this reason, ICT has been considered as the key element for the development and improvement of higher education in Iran.', 'ict professional faculty-members', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2011', 0),
(604, 'Mohammed Aboud Kadhim', 'Antenna and frequency diversity improvement in mimo wimax technology.', 'Kepelbagaian ialah teknik komunikasi berpengaruh yang mengatasi kekaburan dengan memanfaatkan sifat rawak saluran tanpa wayar dan mengesan laluan isyarat bebas antara pemancar dengan penerima. Dalam lapisan fizikal WiMAX (PHY) teknik kepelbagaian seperti kepelbagaian masa, kepelbagaian frekuensi dan kepelbagaian antena digunakan untuk meningkatkan prestasi. Tujuan utama tesis ini ialah meningkatkan prestasi kepelbagaian WiMAX PHY. Diversity is an influential communication technique that combats fading by exploiting the random nature of the wireless channel and finding independent signal paths between the transmitter and the receiver. In WiMAX PHY, diversity techniques such as time diversity, frequency diversity and antenna diversity are used to improve performance. The main objectives of this thesis are to improve diversity performance in WiMAX PHY.', 'antenna improvement mimo-wimax', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering', '2011', 0),
(605, 'Maassoumeh Bemani Naeini', 'A quasi-experimental study on the role of multiple intelligences in developing motivational orientation and listening proficiency among Iranian tefl students', 'Berasaskan trend semasa dalam pendidikan yang memberi tumpuan atau pemusatan khusus terhadap pelajar, maka Teori Kecerdasan Pelbagai (Multiple Intelligences Theory, MIT) dipercayai dapat membantu para guru menilai perbezaan kognitif dan afektif bagi setiap pelajar ESL/EFL. Multiple Intelligences Theory (MIT) is believed to provide for teachers to consider ESL/EFL learners individual cognitive and affective differences. However, there is no research on cognition and affect in one single study to investigate the problem of listening.', 'multiple-intelligences listening students', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2011', 0),
(606, 'Shazia Jamshed', 'An Exploratory Sequential Mixed Method Evaluation Of General Practitioners, Pharmacists, Consumers And Pharmacy Students Knowledge, Perception And Attitude On Contemporary Issues Surrounding Generic Medicine Use In Karachi, Pakistan.', 'Developing countries are struggling with the high cost of treatment and Pakistan is not an exception to this issue. Generic medicines could be instrumental in curtailing the cost of treatment and reduce healthcare expenditures in Pakistan. Therefore, it is imperative to ascertain the knowledge, perception and attitudes of different stakeholders in this regard. The study used a sequential mixed-method research in which the qualitative and quantitative approaches were applied. The qualitative data was collected through in-depth semi-structured, face-to-face interviews with general practitioners, pharmacists, consumers, and pharmacy students. Saturation point, a peak after which no new information was sought from additional interviews, was achieved at 11 for doctors, 11 for pharmacists, 29 for consumers and 28 for pharmacy students.', 'exploratory issues generic-medicine', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(607, 'Mohammad Jawaid', 'Development and characterization of oil palm empty fruit bunch/jute fibres reinforced epoxy hybrid composites.', 'Kajian ini berkaitan dengan penghasilan komposit hibrid dan komposit hibrid teranyam menggunakan kaedah hand lay-up. Dalam kombinasi kajian yang unik ini, gentian tandan kosong kelapa sawit (TKKS) dan jut mempunyai perbezaan penting dalam sifat mekanikal dan fizikal telah digunakan sebagai penguat dalam matriks epoksi. Present work deals with the designing of hybrid and woven hybrid composites by hand lay-up method. In this work unique combination of oil palm empty fruit bunch (EFB), and jute fibres having notable differences in mechanical and physical properties have been used as reinforcement in epoxy matrix.\r\n\r\n', 'oil-palm fiber composites', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2011', 0),
(608, 'Idris Bin Long', 'The relationship between protein and mrna expression of transcription repressor dream, c-fos and prodynorphin in modulating pain responses induced by formalin in the rat spinal cord.', 'Protein Downstream Regulatory Element Antagonist Modulator (DREAM) bertindak sebagai penindas transkripsi bagi gen c-Fos dan prodynorphin yang terlibat dalam proses kesakitan. Downstream Regulatory Element Antagonist Modulator (DREAM) protein acts as a transcription repressor for c-Fos and prodynorphin gene which is involved in modulating pain processes.', 'protein c-fos-prodynorphin formalin', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2011', 0),
(609, 'Mohammed Aliyu Paiko', 'Studies On Lipid Nutrition And The Expression Of Genes For Desaturase And Elongase Enzymes In Snakehead, Channa Striata (Bloch, 1793) Fingerlings.', 'This study examined lipid nutrition in C. striata fingerlings, through a series of experimental feeding trials, including; the evaluation of lipid/protein ratio and fatty acid (FA) requirements, as well as the screening of some of its tissues for the expression of genes for fatty acyl desaturase (FAD) and fatty acyl elongase (FAE) enzymes. These preliminary studies provided some insight about lipid metabolism in the species; suggesting that snakehead fingerling requires 65/450 g kg', 'lipid genes snakehead', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2011', 0),
(610, 'Ahmad Saleh', 'Establishment of the biological control system by black ant, Dolichoderus thoracicus (Smith) (Hymenoptera: Formicidae) and mealybug, Cataenococcus hispidus (Morrison) (Homoptera: Pseudococcidae) against the cocoa pod borer, Conopomorpha cramerella (Snelle', 'Satu kajian untuk pewujudan Dolichoderus thoracicus (semut hitam) dan kutu putih (Cataenococcus hispidus) sebagai agen kawalan biologi untuk mengawal Pengorek Buah Koko (PBK) (Canopomorpha cramerella) dilakukan di ladang koko Bah Lias LONSUM di Sumatera Utara. A study on the establishment of Dolichoderus thoracicus (black ant) and Cataenococcus hispidus (mealybug) to be used as biological agents for Conopomorpha cramerella, cocoa pod borer (CPB) was carried out in LONSUM cocoa estates in Bah Lias, North Sumatera.', 'black-ant mealbug cocoa-pod-borer', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2011', 0),
(611, 'Nurul Hamiruddin Bin Salleh', 'Fire Safety And Protection Measures In Heritage Buildings With Special Consideration On Museum Buildings In Malaysia.', 'In Malaysia, a number of priceless heritage buildings were badly damaged or burnt down by fire including the People Museum, Melaka (2001), Pak Alis House, Gombak (2003) and the Sarawak Club, Kuching (2006). Indeed, fire is one of the greatest threats to heritage buildings not only to the buildings occupants but also to the buildings fabrics and contents. Heritage buildings are irreplaceable, in addition to being vulnerable to fire due to several factors: large scale buildings, flammable priceless contents, and weak existing structures to fire resistance. Unfortunately, until today, there are no sufficient legislations or guidelines on fire safety for heritage buildings in Malaysia.', 'safety-protection heritage building', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2011', 0),
(612, 'Harith Khalid Mohammed al-Qazaz', 'Assessment Of Knowledge And Adherence To Medication: A Mixed Methodology Study Among Patients With Type-2 Diabetes Mellitus In Penang.', 'The prevalence of diabetes mellitus had increased tremendously among the Malaysian population during the last decade. Furthermore, managing diabetes related morbidity is always faced with challenges by the healthcare providers. In order to provide optimal disease management, there is a need for diabetic patients to be exposed to diabetes self management approach. Although numerous measures have been taken to improve glycemic control among patients with diabetes in Malaysia, the results are still unfavorable.', 'knowledge medication type-22-diabetes', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(613, 'Salahaddin Yasin Baper Al-Shwani', 'Influence Of Modernity Versus Continuity Of Architectural Identity On House Facade In Erbil City, Iraq', 'This thesis discusses one of the most distinctive issues of architecture debates about modernity and architectural identity. It aims to measure the influence of modernity to architectural identity on house facade in Erbil City, Iraq. The objectives of this research attempt to evaluate the factors\' degree of change, develop a model for visual analysis, examine the variations in the perceptions of the respondents and investigate the correlation between house facade modernity factors and its continuity of architectural identity. Through the literature review, the study investigates a conceptual model for modernity and formulates the properties of architectural identity.\r\n\r\n', 'modernity continuity architectural', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2011', 0),
(614, 'Fareed Mohammed Al-Yagout', 'An Assessment Of Seaport Privatization In Saudi Arabia : A Case Study Utilizing Grounded Theory Approach. ', 'Saudi Arabia, one of the late adopters of the privatization as compared to other countries, has embarked on the privatization policy in late 1990s with seaports being one of the earliest sectors that the government opened up for private sector involvement. The purpose of this research is to study the seaports privatization outcome after nearly 10 years of its implementation and to evaluate whether the declared privatization objectives have been achieved and the contributory positive / negative factors, as well as to suggest curative measures to mitigate the shortcomings, if any.', 'seaport privatization theory', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(615, 'Banjuraizah Bt Johar', 'The Synthesis Of Non-Stoichiometric Cordierite Via Glass Ceramic Route Using Calcined Talc And Kaolin', 'Various non-stoichiometric cordierite compositions were synthesized via glass route. Densification and crystallization behavior of the glass were determined by dilatometry and differential thermal analysis, while phase transformation of glass to glass-ceramic by X-ray diffraction. CTE, dielectric properties, density and porosity percentages as well as the microstructure of glass-ceramic were carried out to correlate its variation with the compositions. 100 wt% -cordierite phase with the density 2.54 g/cm3, porosity 0.4% has succesfully being obtained at lower heat treatment temperature of 900oC for 2 hours using non-stoichiometric cordierite compositions synthesized from mainly calcined talc and kaolin as initial raw materials.', 'non-stoichiometric ceramic calcined-talc', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2011', 0),
(616, 'Ahmed Mohammed Kamaruddeen', 'The Influence Of Internal And External Factors In Measuring The Innovativeness Among Housing Developers In Peninsular Malaysia. ', 'The debate on the innovativeness status of the housing industry is ongoing and well documented in the literature. While some scholars opine that the housing industry is generally lagging behind other industries in terms of innovativeness, others contend that this claim does not reflect the actual condition of the industry which is innovative to a certain extent. Despite this, empirical studies in other industries have shown that certain firms internal and external factors do influence innovativeness of the firms. Coupled with the considerable attention on innovativeness in Malaysia in recent times, and the need for the Malaysian housing industry to be innovative in order to address the challenges it is facing, studies of innovativeness in the Malaysian housing industry are scarce.', 'influence innovativeness housing-developers', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2011', 0),
(617, 'Sundis Mahdi Sahib Ajam', 'Antimicrobial Activity Of Plant Extracts And Isolation And Characterization Of Alkaloids From Samanea Saman (Jacq.) Merr. Leaves', 'Due to the harmful effects on the occupants and environment, residual toxicity, and carcinogenic nature of synthetic biocides, plant-based biocides may offer safer alternatives for controlling bacterial and fungal bioaerosols that cause sick building syndromes and building deterioration. Therefore, the purpose of this study was to screen local flora for antimicrobial activity against bacteria and fungi isolated from sick enclosed buildings, fractionate and identify the compounds with the highest antimicrobial activities from the methanolic (80% MeOH) extract of Samanea saman leaves.', 'antimicrobial extracts alkaloids', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2011', 0),
(618, 'Hazman Bin Seli ', 'Modelling Of The Friction Welding Process Between Mild Steel And Alumina', 'The heat transfer, mass diffusion and thermo-mechanical mechanisms in friction welding (FW) are not fully understood. In friction welding of two dissimilar materials, two rods are welded together by holding one of them still rotated while the other under the influence of an axial load which creates frictional heat in the interface. This thesis reports a study of the thermal, thermo-mechanical and mass diffusive behaviors of friction welded aluminamild steel rods with the use of aluminum alloy sheet as interlayer.', 'welding mild steel alumina', '', 'UNSPECIFIED', '2011', 0),
(619, 'Farid Ahmad Sobhani', 'Corporate Sustainability Disclosure Practices In Bangladesh: A Comparison Of Two Banks From An Institutional Perspective', 'Sustainability is now a global concern because of the effects of climate change, social unrest, and economic depression. This has encouraged the corporate bodies to be accountable by disclosing their sustainability activities that may affect the earth and society at large. The study aims to focus on the extent of corporate sustainability disclosure (CSD) practices, and identification of the factors behind the disclosure and nondisclosure of CSD information by two selected banks in Bangladesh', 'corporate social disclosure', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(620, 'Noor Hasmini Hj Abd Ghani', 'Dealers Market Orientation And Brand Equity: The Mediating Effect Of Relationship Marketing', 'The reliance of car manufacturers on their sales dealers in a very competitive market, which have created selling pressures justified the importance of investigating brand equity from the latters perspective. Generally, the Malaysian brands including the car brands have been perceived to have low brand equity. From literature, the importance of market orientation and relationship marketing cannot be ignored. Hence, the study attempts to investigate the role of market orientation and relationship marketing in forming the brand equity.', 'dealers brand marketing', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(621, 'La Hamimu', 'Inversion Of Surface Wave Phase Velocity Using New Genetic Algorithm Technique For Geotechnical Site Investigation. ', 'The inverse procedure of surface wave phase velocity is a complicated problem for linear inversion approach because of its multi-model and highly nonlinear nature. Therefore the use of genetic algorithm (GA) optimization technique which is one of nonlinear optimization methods is an appropriate choice to solve surface wave inversion problem having high nonlinearity and multimodality. A novel inversion procedure of GA (NIPGA) suggested in this study was presented an effective technique for surface wave phase velocity inversion.', 'wave-phase algorithm geotechnical', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2011', 0),
(622, 'Mozaherul Hoque Abul Hasanat', 'Probabilistic contextual models for object class recognition in uncontrived images.', 'Konteks merupakan suatu elemen penting dalam mendapatkan penjelasan yang bererti untuk sesuatu imej bagi kedua-dua sistem visual biologi dan buatan. Tesis ini mencadangkan permodelan hubungan konteks di antara objek dunia nyata di dalam imej yang tidak dibuat-buat bagi meningkatkan prestasi pengecaman kelas objek. Dua model kebarangkalian dicadangkan iaitu Semantic Context Model (SCM) dan Spatial Context Model (SpCM) - untuk memodelkan hubungan kontekstual semantik dan ruangan peringkat tinggi. Context is a vital element in deriving meaningful explanation of an image for both biological, as well as, artificial vision systems. This thesis proposes to model contextual relation among real-world objects in uncontrived images in order to improve object class recognition performance. Two probabilistic models are proposed  Semantic Context Model (SCM), and Spatial Context Model (SpCM) to model high-level semantic and spatial contextual relations respectively.', 'probabilistic recognition images', '', 'Pusat Penyelidikan Dadah dan Ubat-ubatan (Centre for Drug Research)', '2011', 0),
(623, 'Ling Song Kai ', 'Study on municipal solid waste management in Malaysia : case study in Kuching, Miri and Sibu', 'Berjuta-juta tan sisa pepejal dijana setiap tahun. Malaysia telah membelanjakan banyak wang, masa dan ruang untuk perkhidmatan pengurusan sisa ini. Program kitar semula kurang mencapai sasaran yang diharapkan. Several million tonnes of solid wastes are generated each year. Malaysia allocates a lot of money, time and space for the waste management services. However, the recycling programmes has remained unsuccessfull in achieving the set targets.', 'municipal waste study', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering)', '2011', 0),
(624, 'Sivakumar Vaiyazhipalayam Murugaiyan', 'Synthesis Of Carbon Nanotubes Via Decomposition Of Methane Using Carbon Supported Catalysts.', 'Carbon nanotubes (CNTs) with their special properties find applications in many areas. Owing to its global demand, its synthesis at a cheaper cost is inevitable. In this study, low-cost carbon materials like carbon molecular sieves (CMS-G, CMS-IN) and activated carbon (AC) were examined as supports for three different active metals (Ni, Co and Fe) for methane chemical vapour decomposition (m-CVD) process to produce CNTs. Blank studies and active metal impregnated (5, 10 and 15 wt% loadings) catalysts activity were studied at temperatures 650, 750 and 850 oC for maximum methane (CH4) conversion and optimum CNTs growth.', 'nanotubes methane carbon', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2011', 0),
(625, 'Babak Salamatinia', 'Biodiesel Production Using Ultrasonic-Assisted Heterogeneous Catalytic Process', 'Biodiesel, a product from the transesterification of alcohol and vegetable oils or animal fats, is a greener alternative to petroleum diesel. Biodiesel production process assisted by means of ultrasonic energy has been investigated. Alkaline metal earth oxide catalysts i.e. MgO, CaO, BaO and SrO were employed to catalyze the transesterification process. Initially these catalysts were tested in conventional mixing method to find out the best catalytic activities and to serve as background data. Ultrasonic was initially introduced into the reaction as a replacement for mechanical mixing.', 'biodiesel ultrasonic-assisted process', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering) ', '2011', 0),
(626, 'Ghassan Zuhair Abdullah', 'Formulation, characterization and optimization of palm oil esters based nano-scaled emulsions for topical delivery of ibuprofen and the evaluation of their anti-inflammatory and analgesic effects.', 'tujuan utama kajian ini adalah untuk formulasi ibuprofen sebagai suatu emulsi berskala nano baru, yang terdiri daripada ester minyak sawit tersintesis baru sebagai fasa minyak. The main aim of this study stands on formulating ibuprofen as a novel nano-scaled emulsion encompassing newly synthesized palm oil esters as the oil phase.', 'palm-oil-esters nano-scaled anti-inflammatory', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(627, 'Sabiha Karim', 'Design And Evaluation Of Multiparticulate Systems Prepared Using Sieving-Spheronisation And Extrusion-spheronisation', 'Dosej berbentuk pelet boleh disediakan melalui pelbagai kaedah yang biasanya memakan masa serta memerlukan tenaga kerja yang banyak. Pelletised dosage forms can be prepared by different methods which, in general, are time consuming and labor intensive.', 'multiparticulate sieving extrusion-spheronisation', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(628, 'Yaser Mohammed Ali Al-Worafi', 'Evaluation of community acquired pneumonia treatment outcomes and cost of illness and development of mortality model.', 'Pneumonia aruhan komuniti (CAP) adalah punca mortaliti dan kematian utama di seluruh dunia termasuk Malaysia. Pengenalan perbezaaan dalam keputusan perubatan dan kos di antara hospital universiti dengan hospital umum (GH) boleh membantu perkembangan dalam rawatan pneumonia dan membantu pasukan kesihatan melakukan perkhidmatan perubatan dengan tepat and berkesan. Community acquired pneumonia (CAP) is a major cause of morbidity and mortality worldwide including Malaysia. Identification of the differences in the outcome and cost between a university hospital and a general hospital (GH) could lead to the development of pneumonia interventions and guide the health team to accurately perform and administrate health care services effectively.\r\n\r\n', 'community pneumonia treatment-cost', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(629, 'Abdassalam Abdelhafiz Alfergani', 'Solid phase extraction of biogenic amines using immobilized new hydrazone ligands', 'Dalam kajian ini, sebatian hidrazin dan hidrazid melalui tindak balas kondensasi dengan keton dan terbitan berbeza aldehid menghasilkan hidrazon sepadan yang dijangkakan. Kesemua ligan yang dipisahkan memperolehi hasil yang memuaskan (82-94 %). In this work, hydrazine and hydrazide compounds were subjected to condensation reaction with ketone and different aldehyde derivatives affording the corresponding expected hydrazones. All the ligands were isolated in satisfactory yields (82 - 94%).', 'extraction immobilized ligands', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2011', 0),
(630, 'Raja Kumar Murugesan', 'An expansionary approach for the allocation of next generation ipv6 internet addresses. ', 'Tesis ini menunjukkan bahawa penyahpusatan lanjut bagi peruntukan Pengalamat Internet IPv6 Generasi Akan Datang adalah mungkin tanpa memberi kesan terhadap kebolehskalaan (scalability) dan kestabilan sistem laluan Internet. Ia menjelaskan suatu Pendekatan Ekspansionari dan Model Implementasi yang memungkinkan penyahpusatan yang sedemikian. This thesis shows that further decentralization for the allocation of Next Generation IPv6 Internet Addresses is possible without affecting the scalability and stability of the Internet routing system. It describes an Expansionary Approach and an Implementation model that allows for such decentralization.', 'expansionary allocation ipv6', '', 'Pusat IPv6 Termaju Negara (National Advanced IPv6 Centre of Excellence NAv6) ', '2011', 0),
(631, 'Faris Ali Mustafa Mzoori', 'Impact of spatial configuration on functional efficiency of house layouts in Erbil City, Iraq from 1900 to 2010', 'Penyelidikan ini adalah untuk mengenalpasti impak konfigurasi ruang terhadap tahap susunatur dan efisiensi fungsinya dalam pelan-pelan rumah yang dibina dari tahun 1900 hingga 2010 di Bandar Erbil, Iraq. Pelan-pelan perumahan di Bandar Erbil dipilih sebagai kajian kes ini kerana ia mempunyai stail yang pelbagai dipengaruhi oleh senibina tradisional dan moden. This study is to determine the impact of spatial configuration on the level of functional efficiency of house layouts in Erbil city in Iraq, from 1900 to 2010. Erbil city in Iraqi Kurdistan region is selected as the case study because the city has mixed styles of traditional and modern architecture.', 'impact configuration house-layout', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2011', 0),
(632, 'Qais Mohammad Ahmad Al-Efan ', 'Pharmacoeconomic analysis of uncomplicated hypertension in ambulatory care clinic', 'Peningkatan ketidaknormalan tekanan darah dikaitkan dengan penyakit-penyakit kardiovaskular dan ginjal. Hipertensi merupakan masalah utama kesihatan yang dihadapi di serata dunia, berdasarkan frekuensinya yang tinggi. Di Malaysia, prevalens hipertensi di kalangan umur penduduk  15 tahun adalah 27.8%. Abnormal elevation in BP is associated with cardiovascular and renal diseases. Prevalence of hypertension in subjects aged  15 years is 27.8% in Malaysia.', 'pharmacoeconomic hypertension care-clinic', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(633, 'Mashita Binti Abdullah', 'Microscale Chemistry Experiments For Upper Secondary Schools In Malaysia. ', 'Laboratory work is essential to assist students in acquiring scientific and thinking skills and experience, as well as appreciate chemistry in real life. Students require the hands-on practical and personal laboratory experience. Chemistry practical classes in Malaysian secondary schools are conducted mostly in groups (2 or more), as demonstrations or not conducted at all. Increase in the number of students leads to increased costs of conducting laboratory experiments and also to increase in chemical wastes generated which contributes to environmental pollution.', 'chemistry experiments upper-secondary', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2011', 0),
(634, 'Rais Ahmed Al-Timimi', 'Socio-Economic Perspectives Of Language Learning Motivation: The Case Of Yemeni EFL Undergraduates At The Hadramout University Of Science & Technology', 'The concept of integrativeness in Foreign Language Learning (FLL) contexts has been theoretically reformulated recently by scholars in the field of motivational research such as Csizr and Drnyei (2005). The reformulated concept takes into consideration the notion of possible selves which refers to the desire of language learners to learn or use the Target Language (TL) to create an identity or self image that is congruous with some socio-economic/cultural traits in their closer environment.', 'socio-economic language undergraduates', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2011', 0),
(635, 'Rabail Nasir Aziz', 'Cell death mechanism induced by15-deoxy prostaglandin J2 and 17-estradiol in er-positive and er-negative breast cancer cell lines. ', 'Kanser payudara adalah kanser yang paling utama di kalangan wanita Malaysia. Peningkatan insiden penyakit ini di seluruh dunia menunjukkan kepentingan terhadap kajian untuk mengkaji dan mengenal pasti terapi yang lebih berkesan dan efektif untuk melawan kanser payudara. Breast cancer is the most common malignancy in Malaysian women. An increase in the prevalence of this disease worldwide indicates the necessity to explore and identify more potent and effective therapies against breast cancer.', 'cell-death prostaglandin breast-cancer', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2011', 0),
(636, 'Md. Amin Bin Hashim', 'Creep And Isothermal Fatigue Behaviour Of Eutectic SnPb, SnBi And SnZn Solders For Microelectronic Packaging At Mildly Elevated Temperatures', 'Interconnect materials are used to connect surface mounting components and other passive and discrete circuit components on to copper pads or lands, and in holes on the printed circuit boards. Presently, the industrial practice is using thermal cycling as a method for reliability testing of circuit boards with assembled components. Bulk specimens of 63Sn37Pn solder alloy were subjected to isothermal fatigue at three mildly elevated temperatures (30, 40 and 50oC), loading frequencies (6, 60 and 600 CPM) and at different applied peak stresses (ranging from 8.75 to 33.25 MPa).', 'isothermal eutectic microelectronic', '', 'Pusat Pengajian Kejuruteraan Bahan & Sumber Mineral (School of Material & Mineral Resource Engineering)', '2011', 0),
(637, 'Md. Jahan Boksh Moral', 'Locating The Poor: Spatial Poverty Mapping Of Household In Rajshahi City, Bangladesh.', 'The main objectives of the study are to analyze the spatial poverty mapping of household, determine spatial infrastructure and services of the poor and to find out the association between vulnerability and poverty. The study also analyzes the application of logistic regression to determine the most influential indicators of poverty. The spatial and non-spatial information are used in the study which are assembled from the published documents, database of Rajshahi Development Authority (RDA) and field investigations using a structured questionnaire.', 'locating mapping household', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) >', '2011', 0),
(638, 'Dzuljastri Bin Abdul Razak', 'Diminishing partnership as an alternative Islamic home financing in Malaysia: issues and perceptions.', 'Rumah adalah keperluan asas kepada semua manusia. Kaedah Bai Bithaman Ajil (BBA) atau jualan dengan bayaran tertanguh adalah kaedah yang paling dominan dalam pembiayaan perumahan di Malaysia sejak penubuhan sektor perbankan Islam pada tahun 1983. Home is a basic necessity for everyone. The Bai Bithaman Ajil (BBA) or Deferred Installment Sales facility is the most predominant mode of home financing in Malaysia since the establishment of Islamic banking in 1983.', 'partnership islamic financing', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(639, 'Sim Jia Huey', 'Transesterification Of Crude Palm Oil To Fatty Acid Methyl Esters (FAME) Mediated By Lipase In Batch And Continuous Systems.', 'The rapid increase in the crude oil prices due to diminishing reserves of fossil fuels and the increased rate of world energy consumption have drawn attention of the researchers towards biodiesel as an alternative energy source. The transformation of palm oil into value-added product biodiesel can help to increase its commercial value of palm oil. The green technology of enzymatic transesterification with crude palm oil (CPO) as feedstock for biodiesel production has been studied in the present research.', 'transesterification fame lipase', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2011', 0),
(640, 'Sabrina Tiun ', 'Natural Sounding Standard Malay Speech Synthesis Based On UTMK EBMT Architecture System', 'In this research work, we make natural sounding speech synthesis as the main goal. This goal was chosen following the type of demanded speech synthesis application systems by the industrial market; the limited-domain speech synthesis application systems. The limited-domain speech synthesis application system has restricted number of vocabularies (less flexible) but requires a highly natural sounding of speech synthesis. Based on the evolution of speech synthesis technique, one can conclude that using natural speech units without applying any signal processing is the technique to produce the most natural sounding of synthetic speech.', 'sounding speech utmk-ebmt', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2011', 0),
(641, 'Zar Ni Wynn', 'Factors influencing the usage of multimedia for teaching amongst health sciences lecturers in Malaysian public Universities: towards the development of a multimedia repository system', 'Penyepaduan multimedia untuk pengajaran sains perubatan dan sains kesihatan (SK) adalah terhad disebabkan faktor-faktor organisasi dan individu. Faktor-faktor organisasi yang telah dikenalpasti ialah kekurangan sokongan organisasi dalam penyediaan sumber, kemudahan, program latihan teknologi maklumat (IT) dan sokongan teknikal (TS). Faktor-faktor individu termasuklah sikap dan pengetahuan ahli akademik mengenai penyepaduan teknologi dalam pengajaran. In higher institutions worldwide, the integration of multimedia for teaching medical and health sciences (HS) has been limited owing to organizational and individual factors. Organizational factors identified were insufficient organizational support in terms of teaching resources, facilities, information technology training programmes and technical support. Individual factors include attitude and knowledge of academics on technology integration into their lectures.', 'multimedia teaching health-science', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2011', 0);
INSERT INTO `phd_abstract` (`ID`, `author`, `title`, `abstract`, `keyword`, `category`, `school`, `year_publish`, `save`) VALUES
(642, 'Ghassan Ahmed Ali', 'A new approach based on honeybee guarding system to improve intrusion detection system', 'Serangan yang semakin meningkat terhadap rangkaian dalam pelbagai cara yang canggih mendapat perhatian daripada pihak keselamatan rangkaian. Sistem pengesanan penerobohan (intrusion detection system, IDS) digunakan untuk mengenal pasti atau membezakan antara pengguna yang sah (legitimate incomer) dengan peneroboh. Increasing of network attacks with sophisticated forms has made the network security concern a significant necessity for such a network. The intrusion detection system (IDS) used to identify the legitimate incomer from an intruder.', 'honeybee system intrusion', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2011', 0),
(643, 'Saira Azhar', 'Role of pharmacists in Pakistans healthcare system: a qualitative and quantitative assessment of perspectives among healthcare professionals and general public', 'Sejak sedekad yang lalu, profesion dalam bidang farmasi mulai berubah dengan ketaranya dari segi perkhidmatan kesihatan terhadap pesakit dan penduduk secara keseluruhannya. Dalam tempoh perubahan ini, ahli farmasi, terutamanya di negaranegara maju, begitu dihormati dalam sistem penjagaan kesihatan. Sebaliknya, di negara yang sedang membangun, perkhidmatan dan kepakaran yang ditawarkan oleh ahli farmasi tidak dimanfaatkan sepenuhnya. Di samping itu, peranan mereka sebagai profesional penjagaan kesihatan tidak dianggap penting sama ada oleh komuniti atau penyedia penjagaan kesihatan lain, terutamanya doktor dan jururawat. In the last decade, pharmacy profession had transformed tremendously in terms of health and pharmaceutical service provision to both patients and general population. Within this practice transformation, pharmacists, especially those in developed countries, now occupy a respectable position within the healthcare system. In contrast, services and expertise offered by pharmacists in developing countries are still underutilized, and their role as healthcare professionals is not deemed to be important either by the community or by other healthcare providers, especially doctors and nurses.', 'pharmacist healthcare perspectives', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2011', 0),
(644, 'Amer Saleem Flayyeh Elameer', 'Designing An E-Education System In The University Of Mustansiriyah Baghdad, Iraq.', 'Designing an e-education system for UoMust (which would enhance learning opportunities for about 41000 individuals) was the main objective of this e-education research. Perekaan suatu sistem e-pendidikan untuk UoMust (yang dapat menambahbaik peluang pengajian kepada kira-kira 41000 individu) adalah objektif utama bagi penyelidikan e-pendidikan ini', 'designing e-education system', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2011', 0),
(645, 'Mustafa Omar Mohammed', 'The objectives and performance measures of Islamic Banking based on Maqasid Al-ShariAh framework.', 'Seketika pertumbuhan perbankan Islam mencapai tahap yang memberangsangkan, kajian-kajian mengenai prestasi perbankan Islam menunjukkan bahawa bank-bank Islam masih ketinggalan dibelakang perbankan konvensional. While the Islamic banking (IB) industry has achieved a remarkable growth, studies have shown that the performance of Islamic banks is trailing behind their conventional counterpart.', 'objectives islamic banking', '', 'Pusat Pengajian Pengurusan (School of Management)', '2011', 0),
(646, 'Tan Cheng Im', 'An Evaluation Of Postgraduate School-Based Teacher Education Program In Malaysia', 'PHD 2011 The primary purpose of this study was to evaluate the strengths and weaknesses of the postgraduate SBTE program as an alternative route in training teachers. The post graduate SBTE was conducted by using modules through self-directed learning and tutorials, with the collaboration of the school mentor teachers. Tujuan utama kajian ini adalah untuk menilai kekuatan dan kelemahan program LPBS lepas ijazah sebagai satu kaedah alternatif dalam melatih guru. Program LPBS lepas ijazah dilaksanakan dengan menggunakan modul-modul melalui pembelajaran arah kendiri dan tutorial, dengan kolaborasi guru pembimbing di sekolah.\r\n\r\n', 'postgraduate teacher education', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2011', 0),
(647, 'Fahrizal Zulkarnain', 'Strength And Durability Properties Of Lightweight Foamed Concrete For Housing Construction', 'Foamed concrete is either cement paste classified as lightweight concrete, where air-voids are entrapped in mortar by a suitable foaming agent. It possesses high-flow ability, low self-weight, minimal consumption of aggregate, controlled low strength, and excellent thermal insulation properties. A wide range of densities of the foam concrete between (1600-400 kg/m3), with proper control in the dosage of the foam, can be obtained for the structural, partition, insulation application and the filling grades. In this research, foam concrete uses fine aggregate passing a 5 mm or 3/16 inch sieve, and 10% of Norizal Hardener Powder Code: 4 (NHP4) based on the weight of cement, for increasing the strength and durability of lightweight foamed concrete.', 'lightweight foamed-concrete housing', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2011', 0),
(648, 'Norlida Binti Jaafar', 'Study Of Market Timing, Selectivity And Performance Of Equity Unit Trust Funds In Malaysia.', 'The main objective of this study is to re-look at the performance of the unit trust industry given that this industry has grown tremendously over the past years. Data of public and private funds from January 1991 to December 2004 was used, which were further sub divided into pre-crisis period, crisis period and post crisis period. The main focus of this study is on the contribution of market timing and selectivity strategies on the performance of unit trust funds. This study is a wider study on the subject of unit trust funds ad the evaluation focused at three aspects that is the effect of these practices over different time horizon, different benchmarks and the assessment of the funds under the same management.', 'market-timing equity funds', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2010', 0),
(649, ' Naji Arafat Bin Haji Mahat', 'Influence Of Rain, Malathion, Sunlit And Shaded Habitats On The Duration Of Development And Molecular Identification Of Chrysomya Megacephala (Fabricius) (Diptera: Calliphoridae) In Kelantan, Malaysia.', 'Chrysomya megacephala (Fabricius) is the earliest and the most prevalent necrophagous species infesting dead bodies in Malaysia and thus, may provide the best estimate of minimum postmortem interval (PMI). In Malaysia, heavy and/or incessant rain is commonplace occurrence and malathion is the most prevalent poison used for committing suicide. In this research, the independent and combined influences of rain and presence of malathion in whole rabbit carcasses decomposing in sunlit and shaded habitats on oviposition and development of Ch. megacephala were studied over a period of 1-year in Kelantan,', 'malathion habitats molecular', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2010', 0),
(650, 'Ezarina Zakaria', 'Program pertukaran jarum suntikan dan picagari di Malaysia : cabaran dalam mengkoordinasikan agensi berkepentingan sebagai satu jaringan sosial formal', 'Penglibatan agensi pelbagai sektor dalam melaksanakan Program Pertukaran Jarum Suntikan dan Picagari (NSEP) adalah penting. Walau bagaimanapun cabaran dalam mengkoordinasikan agensi-agensi ini sebagai aktor jaringan sosial masih kurang difahami. Agensi berkepentingan cenderung berbeza antara satu sama lain daripada segi pengalaman, perspektif, ideologi dan kedudukan organisasi. Kajian eksploritari ini dijalankan untuk mengenalpasti cabaran dalam mengkoordinasikan agensi-agensi berkepentingan bagi NSEP. Enam agensi telah dipilih secara bertujuan sebagai responden. Agensi-agensi ini merupakan agensi kerajaan dan badan bukan kerajaan. Setiap agensi telah memilih wakil mereka untuk ditemubual bagi pihak agensi. Kajian kualitatif ini menggunakan strategi abduktif dan kaedah temubual bersemuka dalam pengumpulan data. Hasil kajian menunjukkan agensi yang dipilih mempunyai pengetahuan yang baik tentang objektif, falsafah dan intervensi NSEP.', 'picagari mengkoordinasikan sosial', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2010', 0),
(651, 'Manjur Sayyad Badasha Kolhar', 'Real Time Conference Gateway For Heterogeneous Clients : Real Time Switching Clients And Inter-Asterisk Exchange Clients', 'Various standards organizations have considered signaling for voice and video over Internet Protocol(IP) from different approaches. The Inter-Asterisk eXchange (IAX) protocol is used as the promising VoIP protocol by the service provider because of its simplicity and NAT friendliness. Meanwhile, the Real time SWitching (RSW) has the ability to combine voice and video services. Incidentally, these two heterogeneous clients pose considerable problems for users who have to choose between two solutions offering different advantages and disadvantages. While RSW is being used in many areas, IAX is being deployed in many VoIP services. Hence, RSW interoperability and coexistence with IAX is considered very important to support new deployments that could use RSW as an alternative packet telephony signaling protocol. We proposed and implemented the conference gateway (CG), which enables the heterogeneous clients to communicate seamlessly. It has two modules, one is signaling, the other is media module. In signaling module, we have converted signaling and control messages of RSW and IAX respectively to achieve seamless signaling communication between heterogeneous clients via CG. The signaling module includes authentication of heterogeneous clients (RSW and IAX) before they start communication, conversion of Uniform Resource Indicator to reach remote clients, setup media calls and exchange media capability.', 'conference heterogeneous inter-asterisk', '', 'Institut Perubatan & Pergigian Termaju (Advanced Medical & Dental Institute (AMDI)', '2010', 0),
(652, 'Leong Kit Keng', 'The Relationship Among Safety Management System, Safety Climate And Safety Performance In Construction Sites', 'There is a lack of conceptual model seek about the relationship among safety management system, safety climate and safety performance. Safety climate is linked to safety performance and more research or model is needed to validate the relationship (Choudhry et al., 2008). Unless identified which factors have the greatest impact on health and safety, if not the safety management system compliance auditing will have little impact on organizations overall safety performance (Makin and Winder, 2008). Thus, a self-administered questionnaire by using 7 points scale that includes the safety management system, safety climate, and safety performance scales were used to collect the data in construction sites of Malaysia.', 'safety-management climate construction', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2010', 0),
(653, 'Teong Mee Mee', 'Measuring The Gaps Between The Research And Statistical Skills And The Training Needs Of Graduate Students.', 'This study was initiated by the lack of research-based study to provide reliable and valid information regarding graduate students training needs in the area of research and statistics. The primary purpose of this study was to examine the graduate students state of preparedness in conducting and evaluating research literature, their knowledge base and their training needs in the area of research and statistics. The secondary purpose was to identify the graduate students demographic and situational variables that may explain or predict the overall training needs.', 'research statistical training', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies) ', '2010', 0),
(654, 'Aydin Behnam', 'The centrifugal-centripetal continuum : towards a consummation-oriented ambivalent answerability in a Bakhtinian reading of Faulkner\'s As I Lay Dying and Radcliffe\'s The Romance of the Forest.', 'It can be argued that the most pivotal legacy of Mikhail Bakhtin is the term Dialogism. However the non-preference of centralising and de-centralising forces over each other with which Dialogism is implicated has been used by many, including the poststructuralists, to suit their own purpose of attributing chaos to dialogue. Thus the voices in the text have been left dangling so to speak and have not been tied up to any ends because the readers are often afraid to speak of finalisation when it comes to Dialogism. In addition, it is peculiar that it is hard to come across an in-depth analysis of the treatment of the notions of centrifugal and centripetal where these notions are at the core of Bakhtins discussions on finalisation. Therefore the attempt of this thesis is to come up with a way of understanding what this consummation or finishing off of voices or forces may mean and also to see what effect this consideration will have on the theoretical and practical sphere of a Bakhtinian analysis of a text.', 'centrifugal-centripetal consummation-oriented ambivalent', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities) >', '2010', 0),
(655, 'Mohammed Issam Younis Al-Khiro', ' Mipog : a parallel t-way minimization strategy for combinatorial testing', 'ombinatorial testing has been an active research area in recent years. One challenge in this area is dealing with the combinatorial explosion problem, which typically requires a very expensive computational process to find a good test set that covers all the combinations for a given interaction strength (t). Parallelization can be an effective approach to manage this computational cost, that is, by taking the recent advancement of multicore and GRID architectures. Motivated by such alluring prospects and challenges, this thesis discusses the design, implementation, and evaluation of an efficient parallelizable t-way strategy, called MIPOG (Modified IPOG) strategy based on its predecessor IPOG (In Parameter Order General) strategy, for systematic t-way test data minimization. Unlike earlier work, the MIPOG optimizes and removes the dependencies between parameter and values. In this manner, MIPOG permits the possibility for exploiting parallel computing.', 'mipog t-way combinatorial', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering) ', '2010', 0),
(656, 'Hasan Basri', 'Accounting And Accountability In Islamic Religious Organizations: A Case Study Of Pesantren In The Province Of Nanggroe Aceh Darussalam - Indonesia', 'Kajian ini meneliti persepsi Sarjana Muslim mengenai bagaimana sesebuah organisasi Islam mendemonstrasikan akauntabiliti kewangan mereka dan peranan laporan kewangan dalam meningkatkan akauntabiliti This study concerns the perceptions of Muslim scholars regarding how the Islamic religious organizations demonstrate their financial accountability and the role of financial reporting in enhancing such accountability', 'accounting islamic organizations', '', 'Pusat Pengajian Pengurusan (School of Management)', '2010', 0),
(657, 'Maher Faeq', 'Sensorless operation of permanent magnet brushless dc motor based on infinite impulse response digital filter.', ' Disertasi ini membentangkan operasi baru tanpa penderia bagi motor arus terus magnet kekal tanpa berus (BLDC) berasaskan pada penapisan digit gelombang daya gerak elektrik balik dengan menggunakan dsPIC30F6010 mikropengawal. Dari segi motor pacuan, teknik pemodulatan lebar denyut (PWM) biasanya digunakan untuk mengubah voltan yang dikenakan pada pangkalan motor supaya dapat mengendalikan kelajuan motornya. This dissertation presents a new sensorless operation for permanent magnet brushless DC motor based on digital filtering of back-EMF waveform using dsPIC30F6010 microcontroller. In motor drives, PWM technique is normally used to vary the voltage imposed on the motor terminals, and therefore controlling the speed of the motor.', 'sensorless magnet digital-filter', '', 'Pusat Pengajian Kejuruteraaan Elektrik & Elektronik (School of Electrical & Electronic Engineering)', '2010', 0),
(658, 'Mohd Fadzil B Arshad', 'Influence Of Multiple Blended Binders On Engineering Properties And Durability Of Concrete.', 'The influence of multiple blended binders in the forms of binary blended cement (BBC) and ternary blended cement (TBC) on the properties and performance of concrete is investigated. The mineral admixtures used are silica fume(SF), fly ash (FA), metakaolin (MK) and rice husk ash (RHA). They are used to partly replace the cement by direct replacement method on mass-to-mass basis. The mix proportions of the concretes are kept nominally the same with constant water/binder ratio and the same superplasticizer content for all concrete mixes, so as to isolate the effect of each binder type. Most of the mineral admixtures used are abundantly available in the country and analyses performed indicate their compliance with standard specification requirements as pozzolan. They are used to replace ordinary Portland cement (OPC) at replacement level of 0 (control mix) to 40% (TBC mix). Analyses on the binders also exhibit their compliance with standard specification requirements which are comparable to OPC. The engineering properties of the TBC concretes are generally comparable with those of OPC and better than OPC:FA BBC concrete when cured continuously in water. The durability performance of the TBC concrete exposed to air is found to be comparable to that OPC concrete. Nonetheless when exposed to sulphate and chloride environments the durability performance seems to be more effected in comparison to the OPC concrete. This could be due to the very early exposure to the aggressive environments', 'binders properties concrete', '', 'Pusat Pengajian Kejuruteraan Awam (School of Civil Engineering) ', '2010', 0),
(659, 'Sharon Fatinathan', 'Preparation, Characterisation And Adsorption Properties Of Chitosan And Chitosan Derivatives Beads For The Removal Of Copper(Ii) And Lead(Ii) Ions. ', 'In this study, a batch adsorption system was applied to study the adsorption of copper(II) and lead(II) ions onto chitosan, chitosan-glutaraldehyde (GLA) (1:1 and 1:2), chitosan-alginate and chitosan-tripolyphosphate (TPP) beads. The physicochemical properties of all five adsorbents were analysed based on infrared spectroscopy, light metal cations analysis, surface area and pore size analysis, CHN analysis and X-ray diffraction analysis. Different parameters affecting the adsorption capacity such as initial pH, agitation period, agitation rate, particle sizes, adsorbent dosage, initial concentration of metal ions and temperature were studied. Adsorption isotherm data for copper(II) and lead(II) ions onto all five adsorbents were determined and correlated with Langmuir, Freundlich, Dubinin-Radushkevich (D-R), Sips and Redlich-Peterson (R-P) isotherm models.', 'chitosan copper lead', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2010', 0),
(660, 'Mirtaghi Mirmohammadi', 'Evaluation Of Diisocyanates And Their Metabolites In Selected Iranian Polyurethane Factories', 'In this thesis the concentration of diisocyanates namely hexamethylene diisocyanate (HDI), methylene diphenyl diisocyanate (MDI) and toluene diisocyanate (TDI) in indoor air samples and their respective metabolites hexamethylene diamine (HDA), methylene dianiline (MDA) and toluene diamine (TDA) found in workers urine were measured in fifteen polyurethane factories located in the Tehran province, Karaj city and Mazandaran province in Iran. Measurement of isocyanate concentration was performed using the NIOSH 5522 method. Measurement was conducted over three daily working shifts in fifteen factories with a total of three hundred air samples. Psychrometric parameters (indoor air temperature and relative humidity), workplace dimension and altitude factors were evaluated to correlate to the diisocyanate pollution level. The association between diisocyanates and health effects and specific sensitisation was also studied. The findings of this study demonstrated that HDI, MDI and TDI were dominant in frequency of occurrence and showed the highest exposure levels when compared to NIOSH, OSHA and ACGIH standards and some other studies. The correlation between psychrometric parameters and diisocyanate concentration was determined and the results showed that, relative humidity and dry bulb temperature have positive significant relationship.', 'diisocyanates metabolites factories', '', 'Pusat Pengajian Teknologi Industri (School of Industrial Technology)', '2010', 0),
(661, 'Mardiana Saaid', 'Development Of Sample Preparation Techniques For The High Performance Liquid Chromatographic Determination Of Biogenic Amines In Foods. ', 'Biogenic amines (BA) have been extensively studied in recent years due to their potential toxicity and possible use as chemical markers for assessing food quality and in cancer research. This thesis is focused on the development of sample preparation techniques for the high performance liquid chromatographic-ultraviolet determination of BA in food. The BA tryptamine (TRP), putrescine (PUT), histamine (HIS), tyramine (TYR) and spermidine (SPD) were extracted using hydrochloric acid and trichloroacetic acid and determined in sixty-two food items commonly consumed in Malaysia. This includes the local appetizers budu and cincalok, canned fish, salt-cured fish, meat products, fruit juice, canned vegetables/fruits and soy bean products. After the extraction, the samples were derivatized with dansyl chloride. Mean levels of TRP, PUT, HIS, TYR and SPD in eight budu samples were 82.7, 38.1, 187.7, 174.7 and 5.1 mg kg1, respectively. The main BA found in cincalok were PUT, HIS and TYR where the mean values were 330.7, 126.1 and 448.8 mg kg1, respectively. With the exception of pekasam and belacan, significantly lower levels of BA were found in salt-cured fish samples. Non detectable or low levels of BA were found in meat products, fruit juice and canned vegetables/fruit samples.', 'sample chromatographic biogenic', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2010', 0),
(662, 'Marzan Ismail', 'The Potential Of Hybrid Turbine Ventilator To Improve Indoor Climatic Conditions In Hot -Humid Environment', 'Tesis ini membincangkan hasil kajian empirikal mengenai kemungkinan memperbaiki keadaan iklim dalaman bangunan di persekitaran panas-lembap melalui penggunaan pengalihudaraan turbin hibrid (HTV). This thesis presents the results of the empirical studies regarding the possibilities of improving indoor climatic conditions in the hot-humid environment with the use of hybrid turbine ventilator (HTV).', 'hybrid climatic hot-humid', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2010', 0),
(663, 'Fuad', 'The Antecedents And Outcomes Of Business Units Slack: A Prospect Theory Aproach.', 'Organizational slack has long been used to explain diverse organizational phenomena and has been regarded as one of building blocks of the behavioral theory of the firm. It has been widely accepted that a comprehensive study to observe the determinants of slack and its performance outcome is the solution for the unsolved puzzles for slack creation. However, prior researches have indeed revealed that the determinants of slack creation itself are yet still inconclusive and the results were ambiguous. The inconclusive and mixed research on the determinants of slack has been normatively prescribed due to lack vigorous, robust model and adopted the piecemeal approach to the measurements of slack creation.', 'antecedents business prospect', '', 'Pusat Pengajian Pengurusan (School of Management)', '2010', 0),
(664, 'Gary John Rangel ', 'Evidence, Determinants, And Consequences Of Asset Price Bubbles: The Case Of Malaysia And Singapore', 'Asset price bubbles have been a phenomenon that has occurred for centuries. This phenomenon can result in a negative impact on a countrys economy during the build-up and collapse phase. The issue with a bubble build-up is the misallocation of scarce economic resources in speculative activities which crowd out investment in productive activities. When the bubble collapses, its effect is even greater on society as a whole. Researchers nevertheless are still debating its existence even historically, what its causes are, and whether it will has any consequential effects on countries generally and society at large. This study seeks to provide further insight on these three questions. A multi-test approach was employed to determine the existence of bubbles. Using the financial instability hypothesis proposed by Hyman Minsky and a polynomial distributed lag approach; several salient variables were identified to have explanatory properties on the propagation of asset price bubbles in Malaysia and Singapore. In the case of stock price bubbles propagation, both real GDP growth and capital flows are consistently significant explanatory variables. As for real estate bubbles, real interest rates, real GDP growth, and the stock market bubble proxy are leading indicators. With these leading indicators in hand, both investors and government authorities can implement appropriate monitoring measures on these salient variables to ameliorate the effects of bubble build-up and its collapse.', 'asset price bubbles', '', 'Pusat Pengajian Pengurusan (School of Management)', '2010', 0),
(665, 'Md. Fahmidul Hoque', 'Representing Identity In Cinema: The Case Of Selected Independent Films Of Bangladesh', 'In the contemporary post-colonial, globalised and post-9/11 era, the question of national identity has emerged as a significant one. This explorative study tends to examine how the Bengali Muslim identity i.e. the national identity of Bangladesh, is represented in selected independent films. The key objective of the study is to examine how national identity is represented in selected independent films made by four leading independent filmmakers  Abu Sayeed, Tanvir Mokammel, Morshedul Islam and Tareque Masud. Theoretical applications of national identity by Earnest Gellner, Benedict Anderson, Arjun Appadurai, Homi K Bhabha and Stuart Hall and the notion of representation by Stuart Hall are instructive here in guiding this study. For textual analysis of selected films, film narratology derived from the theory of Narrative Discourse by Gerard Gennette has been applied. Also the idea of cultural institution is used to relate to the topic to the larger cultural, historical and societal aspects. The method of the study is qualitative and the measures of the study are in-depth interviews and analyses of film texts. The analyses find the independent filmmakers of Bangladesh try to depict Bengaliness, the ethno-linguistic identity approach, as the preferred identity approach of Bengali Muslims and portray Muslimness, the religious identity and popular religion identity approach, as the other identity. The findings also suggest that to sustain the ethnic and cultural elements of Bengaliness on the screen, directors do not hesitate to orientalise themselves to the interests of the global audience. The study finds independent cinema of Bangladesh as an influential cultural institution in portraying national identity. This study contributes to the understanding of the identity debate and diversity prevailing in the society. This, in turn, it helps resolving discussion on contesting of identity approaches and contributes to the development of society, polity and nationhood as well as generate new knowledge in Asian cinema and national cinema within the global discipline of cinema studies.', 'representing identity cinema', '', 'Pusat Pengajian Seni (School of the Arts)', '2010', 0),
(666, 'Hussein Abdelrahman Hussein Albazar', 'An Innovative System To Monitor E-Mail Systems Environments Using Active Monitoring', 'Sehingga kini, Sistem E-mail amat penting dalam memenuhi setiap keperluan dalam pelbagai bidang kehidupan seperti pendidikan, perdagangan, pemasaran, komersial and pelbagai bidang perniagaan termasuk komunikasi peribadi melalui Internet. In recent times, E-mail systems are essential in fulfilling all correspondences in various fields of our lives such as the education, trading, marketing, commerce and other businesses as well as personal communications via the Internetet.', 'innovative monitor e-mail', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2010', 0),
(667, 'Mazran Ismail ', 'The Potential Of Hybrid Turbine Ventilator To Improve Indoor Climatic Conditions In Hot-Humid Environment', 'This thesis presents the results of the empirical studies regarding the possibilities of improving indoor climatic conditions in the hot-humid environment with the use of hybrid turbine ventilator (HTV). From the literature, it is found that the fan assisted stack ventilation strategy like the HTV is one of the most potent strategies to be applied in this high solar radiation and low wind velocity region of Malaysia. Through the pilot experiment study, an optimum configuration of the HTV has been determined, which is the new configuration with inner duct and larger free upper outlet area is found to show the best performance in inducing indoor air movement. Then, a series of full-scale field measurement studies conducted in the real building and under real weather conditions confirmed the significance of the device in improving indoor climatic conditions. The study shows that the strategy of applying HTV for occupied space achieved to reduce indoor air temperature and relative humidity (RH) level significantly and succeeded to induce air movement in the occupied level of up to 0.38m/s in the windows and doors are kept opened case. However, although all the HTV application strategies succeeded to reduce the Operative Temperature (OT) and Standard Effective Temperature (SET*) level compared to the existing condition, the overall results revealed that it is still not able to ensure occupants thermal comfort level at most of the time, when the OT achieved were above the upper comfort limits of 30.0C for about 21% to 45% during the study period. One possible improvement of the device derived from the results is by applying the HTV for both attic and occupied spaces at the same time and ensure that openings are kept opened.', 'ventilator climate hot-humid', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2010', 0),
(668, 'Mohammad Ali Zinnah', 'Social Science Teachers Pedagogical Content Knowledge: A Case Study At General Secondary School Level In Bangladesh. ', 'This multiple-case study investigates Social Science teachers Pedagogical Content Knowledge (PCK), and factors that facilitate or inhibit their PCK in teaching Social Science at the general secondary level education in Bangladesh. Shulmans (1987) model of Pedagogical Reasoning and Action was used as the theoretical model in this study. Five teachers were purposeful selected from one government, three non-government and one specialized general secondary schools to participate in this the study. Multiple techniques including pre- and post-observation interviews with the teacher participants, observations of their classroom teaching, and analysis of documents were used for collecting the data. Nineteen other informants were selected to gain further data through interviewing. Data were analyzed during the period of data collection to develop deeper understanding of the phenomena under investigation, as well as to guide in seeking appropriate data from the participants. The final data were analyzed in different steps to arrive at the findings. The validity and reliability of the data and the findings were maintained. The findings have demonstrated eight components of PCK that the participants possessed and practiced, but not at equal level.', 'teacher pedagogical knowledge', '', 'Pusat Pengajian Ilmu Pendidikan (School of Educational Studies)', '2010', 0),
(669, 'Halim Bin Mad Lazim', 'Total Productive Maintenance (TPM) Practices And Manufacturing Performance: The Moderating Effect Of Types Of Production Processes', 'The importance of maintenance has become the main focus in the manufacturing environment. New technologies and advancements in the manufacturing industry have driven many companies to implement reliable maintenance program in order to avoid stoppages and disruptions of equipment from occurring in their daily operations. Total productive maintenance (TPM), a resource-emphasized approach moves the paradigm of maintenance by putting emphasis on total employee involvement in the maintenance activities.', 'tpm practice manufacturing', '', 'Pusat Pengajian Pengurusan (School of Management)', '2010', 0),
(670, 'Mohammad Farooq', 'The Private Rates Of Return To Education In Pakistan.', 'Pembangunan model insan, terumanya melalui pendidikan dan persekolahan dianggap sebagai faktor utama dalam menjana pembangunan sesebuah negara. The development of human capital especially through education and schooling is regarded as the main factor promoting the over all development of nations.', 'rates return education', '', 'Pusat Pengajian Sains Kemasyarakatan (School of Social Sciences)', '2010', 0),
(671, 'Subish Palaian', ' Pharmacovigilance Studies Involving Healthcare Professionals And Students In Nepal: Impact Assessment On Knowledge, Awareness, Adverse Drug Reactions Reporting And Drug Safety Communications. ', 'The concept of pharmacovigilance is new in Nepal. The present study analyzed the pattern and cost of pharmacotherapy of Adverse Drug Reactions (ADRs) reported to the western regional pharmacovigilance center at Nepal, and evaluated the Knowledge, Attitude and Practices (KAPs) of healthcare professionals in Manipal Teaching Hospital (MTH) towards drug safety. It also aimed at evaluating pharmacovigilance education modules for community pharmacy practitioners, medical, pharmacy and nursing students and analyzed the drug safety communications produced by the western regional pharmacovigilance center.\r\n\r\n', ' pharmacovigilance healthcare communications', '', 'Pusat Pengajian Sains Farmasi (School of Pharmacy)', '2010', 0),
(672, 'Low Siew Chun ', 'Lateral Flow Nitrocellulose Membrane For Diagnostic Kit Application: Synthesis, Characterization And Performance Evaluation', 'Lateral flow nitrocellulose (NC) membrane is one of the main requirements in the biomedical field due to its excellent binding capacity, high wetting properties and low background staining. However, there are still many challenges in the method of membrane fabrication in order to synthesise and control the membrane morphologies to fulfil the whole range of the required immunoassay applications, which is the main focus of this research. In this research, lateral flow NC membrane was successfully fabricated via dry phase inversion.', 'nitrocellulose diagnostic kit', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2010', 0),
(673, 'Mohammad Reza Zare Mirakabad', 'A Framework For Privacy Diagnosis And Preservation In Data Publishing', 'Privacy preservation in data publishing aims at the publication of data with protecting private information. Although removing direct identifier of individuals seems to protect their anonymity at first glance, private information may be revealed by joining the data to other external data. Privacy preservation addresses this privacy issue by introducing k-anonymity and l-diversity principles. Accordingly, privacy preservation techniques, namely k-anonymization and l-diversification algorithms, transform data (for example by generalization, suppression or fragmentation) to protect identity and sensitive information of individuals respectively.\r\n\r\n', 'privacy diagnosis data-publishing', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2010', 0),
(674, 'Sumathi Sethupathi ', 'Removal Of SO2 And NO From Simulated Flue Gas Using Cerium-Modified Palm Shell Activated Carbon', 'The focus of this research was to study the usage of oil palm shell made activated carbon as a sorbent to remove SO2 and NO gases simultaneously from simulated flue gas. The palm oil industry plays a major role in Malaysian economic especially in enhancing the economic welfare of the population. Despite obvious benefits of this industrial development, its activity contributes to abundant solid waste. Palm shell derived from the fruit bunch of oil palm, is one of the solid wastes.', 'so2 cerium-modified carbon', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2010', 0),
(675, 'Hasni Bin Arsad', 'Determination Of R-3-Hydroxyacylacp- Coa Transferase (Phag) Structure.', 'R-3-hydroxyacyl-ACP-CoA transferase (PhaG) catalyzes the conversion of (R)-3- hydroxyacyl-ACP to (R)-3-hydroxyacyl-CoA derivatives, which serve as the ultimate precursor for polyhydroxyalkanoate (PHA) polymerization from unrelated substrates. PHA is a family of bioplastic that has a good potential to replace fossilbased thermoplastics because it is biodegradable. The transferase enzyme PhaG of a locally isolated strain, Pseudomonas sp. USM 4-55, was recently cloned (GeneBank accession number EU305558). Currently there is no known 3D structure with high similarity to PhaG. In order to over express, the phaG gene was cloned into expression vector pQE-30 and it was successfully overexpressed by induction with 0.5 mM IPTG in the host Escherichia coli strain SG 13009.', 'determination r-3-hydroxyacylacp transferase', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2010', 0),
(676, 'Reza Devernejad', 'Phase Equilibrium Study Of -Carotene, Tocopherols And Triacylglycerols In Supercritical Fluid Extraction Process From Crude Palm Oil Using Carbon Dioxide As A Solvent. ', 'Phase equilibrium of the substances from a multi-component system such as crude palm oil in sub and supercritical carbon dioxide solvent has become increasingly important particularly in unit operation processes. In this study, two rigs have been fabricated and calibrated to study the supercritical fluid extraction of -carotene from crude palm oil and also to evaluate the phase equilibrium of the supercritical extraction of -carotene, triacylglycerols (TAGs) and tocopherols from crude palm oil using carbon dioxide as a solvent.', 'equilibrium supercritical palm-oil', '', 'Pusat Pengajian Kejuruteraan Kimia (School of Chemical Engineering)', '2010', 0),
(677, 'Sin Yew Keong ', 'Fabrication Of Two Dimensional Silicon Photonic Crystal.', 'Photonic crystals are materials with a periodicity in refractive index. When electromagnetic waves with a wide range of frequencies propagate through these materials, certain range of frequencies is prohibited. The prohibited frequencies are known as photonic bandgap. In this study, a two dimensional silicon photonic crystal is fabricated by microfabrication method. Electron beam lithography and etching process are important processes in this method. Hence, preliminary works on optimization parameters in electron beam lithography are necessary.', 'Fabrication silicon photonic-crystal', '', 'Pusat Pengajian Sains Fizik (School of Physics) ', '2010', 0),
(678, 'Eissa Hamid Al Khotaba', 'The Use Of Lexical Repetition And Patterning In Written Compositions Of Jordanian Students Majoring In English Language And Literature At Mutah University: A Case Study.', 'In an EFL (English as a Foreign Language) context, writing is a skill that EFL learners must acquire as that would certainly help them in their future career (Mirhosseini, 2009). Many researchers such as Hoey (1991), Wong (2004), Klebanov and Shamir (2006), Morris (2007) and Kai (2008) found out that EFL (English as a Foreign Language) and ESL (English as a Second Language) learners written essays are difficult to understand as they lack coherent structure and organisation. These researchers, in particular Hoey (1991), argue that lexical repetition and patterning in written texts are necessary to produce coherent and well-organised written essays.', 'lexical patterning english', '', 'Pusat Pengajian Ilmu Kemanusiaan (School of Humanities)', '2010', 0),
(679, 'Leow Ghin Yin ', 'Assessing Malaysias Manufactured Exports Competitiveness In The East Asian Region: A Shift-Share And Simulation Approach', 'Bagi kebanyakan negara Asia Timur, perdagangan antarabangsa menyumbangkan sebahagian besar daripada Keluaran Dalam Negeri Kasar (KDNK) dan kepentingannya kian meningkat. For most East Asian countries, international trade represents a significant portion of their Gross Domestic Product (GDP). Albeit on a different scope and scale, the importance of international trade is rising over the years.', 'Manufactured exports competitiveness', '', 'Pusat Pengajian Sains Komputer (School of Computer Sciences)', '2010', 0),
(680, 'Muhamad Odeh Atyeh Al-Limoun', 'Production, Purification, Characterization And Application Of Organic Solvent Tolerant Lipase From Trichoderma Sp. Bw45 In Palm Oil Hydrolysis.', 'In order to establish a successful process of enzymatic hydrolysis of palm oil, for the production of palmitic acid and oleic acid, the following objectives have been designated: Screening for potential microorganisms producing a significant amount of extracellular organic solvent tolerant lipase from indigenous soil samples, optimization of the physicochemical parameters required to achieve maximum lipase production in shake flask system, purification of the enzyme using aqueous two phase system coupled with Sephadex G-75 gel filtration, characterization of the pure enzyme properties and application of the crude lipase preparation in palm oil hydrolysis for the production of palmitic and oleic acids.', 'production organic lipase ', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2010', 0),
(681, 'Chan Yuan Eng', 'Buyer\'s Conjoint Preferences For Attributes Of Condominium Properties In Penang.', 'It is important that developers should understand their buyers preferences in relation to the condominium attributes that they are offering to their buyers. The problem is that there are not many research studies conducted to understand the buyers preferences for condominium attributes in the context of the medium price-range condominium property market in Penang. This study is the writers endeavor to address this problem and to contribute to the existing academic literature.', 'buyers preference condominium', '', 'Pusat Pengajian Perumahan, Bangunan & Perancangan (School of Housing, Building & Planning)', '2010', 0),
(682, 'Lee Chee Keong ', ' Development Of Solid State Fermentation System For Enzyme Production And Its Usage In A Pilot Scale Deinking Of Printed Waste Paper.', 'The present work deals with the development of solid state fermenter for enzymes production and the development of a pilot scale of enzymatic deinking system. The newly developed solid state fermenter, was named FERMSOSTAT, which was used for the production of cellulases and xylanase using a local isolate; Aspergillus niger USM AI 1. Kajian ini memberi tumpuan kepada pembangunan fermenter keadaan pepejal untuk penghasilan enzim dan pembangunan sistem penyahdakwatan secara enzimatik berskala rintis. Fermenter yang bam dibangunkan itu dikenali sebagai FERMSOSTAT.', 'fermentation enzyme waste-paper', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2010', 0),
(683, 'Lee Chee Keong ', ' Development Of Solid State Fermentation System For Enzyme Production And Its Usage In A Pilot Scale Deinking Of Printed Waste Paper.', 'The present work deals with the development of solid state fermenter for enzymes production and the development of a pilot scale of enzymatic deinking system. The newly developed solid state fermenter, was named FERMSOSTAT, which was used for the production of cellulases and xylanase using a local isolate; Aspergillus niger USM AI 1. Kajian ini memberi tumpuan kepada pembangunan fermenter keadaan pepejal untuk penghasilan enzim dan pembangunan sistem penyahdakwatan secara enzimatik berskala rintis. Fermenter yang bam dibangunkan itu dikenali sebagai FERMSOSTAT.', 'fermentation enzyme waste-paper', '', 'Pusat Pengajian Sains Kajihayat (School of Biological Sciences)', '2010', 0),
(684, 'Syafruddin Pohan', 'Wacana penubuhan provinsi Tapanuli dalam akhbar Indonesia: Satu kajian terhadap berita di dalam Akhbar Sinar Indonesia baru dan Waspada', 'Kajian ini menggunakan pendekatan analisis wacana kritikal untuk menjelaskan kedudukan kedua-dua akhbar Sinar Indonesia Baru (SIB) dan Waspada dalam melaporkan isu penubuhan Provinsi Tapanuli. Fokus penyelidikan ialah mengenal pasti kaedah kedua-dua akhbar membuat wacana rancangan penubuhan Provinsi Tapanuli. This research uses a critical discourse analysis approach to clarify both positions of SIB and Waspada dailies on reporting the issue formation of Tapanuli province. The focus of this research is to understand exactly how both media construct relating to discourse on the formation of Tapanuli province plan', 'wacana tapanuli berita-akhbar', '', 'Pusat Pengajian Komunikasi (School of Communication)', '2010', 0),
(685, 'Tan Gim Cheong', 'Understanding The Molecular Enteropathogenesis Of Martx Toxin Genes And Cholera Toxin Gene Mutations Of Vibrio Cholerae O139 Serogroup Towards Cholera Vaccine Development. ', 'Cholera is a lethal diarrheal disease caused by toxigenic V. cholerae of O1 and O139 serogroups. Early diagnosis and prompt treatments of the disease are needed to prevent death in these patients. Even though the spreading of the disease could be controlled with proper sanitation, the best way to prevent cholera is through vaccination. There are several cholera vaccines available for O1 serogroup V. cholerae but they do not cross-protect against O139 serogroup. The bivalent O1/O139 cholera vaccine also did not show satisfactory protective immune response against O139 serogroup in clinical trials. Hence, the objective of this study is to construct an attenuated live cholera vaccine against V. cholerae O139 serogroup. In the present study, we focused on mutational analysis of MARTX toxin and cholera toxin of V. cholerae O139 serogroup. Constructed rtxC (VCUSM9P) and rtxA/C (VCUSM10P) mutants of V. cholerae O139 serogroup showed depleted in cytotoxic properties.', 'enteropathogenesis cholera vaccine', '', 'Pusat Pengajian Sains Perubatan (School of Medical Sciences)', '2010', 0),
(686, 'Zahayu Md Yusof', 'Type I Error And Power Rates Of Robust Methods With Variable Trimmed Mean.', 'The effects of nonnormality and heteroscedasticity on the T1 and trimmed F (Ft) test statistics were investigated using two methods of trimming namely the proposed automatic trimmed mean and the typical fixed amount of trimming. These are typical problems in any test of equality of central tendency measure. For each test statistic, three automatic trimming procedures using different scale estimators MADn, Tn, and LMSn, and a fixed trimmed mean procedure were examined for their robustness via Type I error and power rates.', 'robust trimmed mean', '', 'Pusat Pengajian Pendidikan Jarak Jauh (School of Distance Education)', '2010', 0),
(687, 'Mohammed Hadi Saeed al-Douh', 'Synthesis, Characterization And Anti-Proliferation Study Of Some Benzimidazole Derivatives', 'Four different types of compounds were successfully synthesized and characterized. The syntheses of these compounds involved benzylation, addition elimination and cyclization reactions. The structures of the synthesized compounds were confirmed by melting points, FTIR, HRMS, 1D and 2D NMR spectroscopy and Xray crystallography. The first type of these compounds is 2-benzyloxy-3- methoxybenzaldehyde 75, which was synthesized by the reaction of o-vanillin with benzyl bromide in acetone as the solvent and K2CO3 as a base in the presence of tetra-n-butylammonium iodide (TBAI) as catalyst.', 'characterization anti-proliferation benzimidazole', '', 'Pusat Pengajian Sains Kimia (School of Chemistry)', '2010', 0);
